INSERT INTO `articles` VALUES (16,1,65,NULL,'ADVANCED DETECTION AND MITIGATION OF CROSS-SITE SCRIPTING ATTACKS THROUGH INTELLIGENT JAVASCRIPT CODE INJECTION ANALYSIS','<p>ABSTRACT\r\n</p><p>Cr oss-site scripti ng attack, abbreviated as XSS , has been an incessant problem for W eb applications since the early 2000s. It is a code injection attack on the client -side where an attacker injects malicious pa yload into a vulner able we b applic ation, without client’s kno wl edg e.\r\n</p><p>The attacker is often successful in executing the malicious code inadvertently in the browser of an unwary user. Attempts have been made to implement the detection of XS S attacks using Genetic Algorithm, Web Vulnerabilities Finder, F uzzy Interference Model, but they all come with drawba cks. Implementation URL of the  website  is collected through an extension and vuln erability is checked by injecting java-script code to the website. If the website is vulnerable, then display a pop -up stating “Website is vulnerable,  be  awar e”,  else  display  a  pop -up  stating “ W ebsite is not vulner able ”. It is a low cost model which is easy to implement.\r\n</p><p>Keywords- XSS , F I Model, Genetic Algorithm, Web Vulnerabilities Finder, Cyber Attack\r\n</p><p>INTRODUCTION\r\n</p><p>W eb applications and websites are  becoming more  and more widespread as a result of increased internet usage, which has also led to an increase in cyber attacks on web applications and websites. XS S  (Cross -S ite  S cripting) attacks are one of the most prevalent forms of cyber attack on web applications and websites out of all the other sorts of attacks.\r\n</p><p>Cross Site S cripting (XS S ) is vulnerability in a web application that allows a third party to execute a script in the user’s browser on behalf of the web application. Malicious scripts are injected into websites that are normally safe and reputable in Cross-Site S cripting (XS S )\r\n</p><p>attacks. XS S attacks take place when an attacker sends malicious code, typically in the form of a browser side script, to a separate end user using an online application. It allows an attacker to by-pass the origin policy that is designed to segregate different websites from each other.\r\n</p><p>An attacker who exploits this vulnerability can:\r\n</p><p>Read any d ata that the user is able to access\r\n</p><p>Capture user\'s login cred entials\r\n</p><p>Impersonate or masquerade as the victim user.\r\n</p><p>Cross-site scripting attacks enable attackers to inject client -side scripts into web pages view ed by the user. The scripts are executed automatically without user’s consent, unless manually disabled. Besides, the users don’t seem to care about configuring the browsers securely. The number of attacks on users, by exploiting the browser vulnerabilities, has risen at alarming rate.\r\n</p><p>Already existing attack detecting mechanisms have failed miserably in most  scenarios.  Additionally, people haven\' t paid much attention to configuring their browsers securely with the help of acc essible plug-ins and  extensions.\r\n</p><p>The users have to protect themselves from these vulnerabilities and hence the detection of Cross-site scripting attacks is ve ry imp ortant  .to effectively detect and defend XS S attacks are still one of the most important security  issues.  Therefore,  we  need   better solutions/ methods  for  detection  of  Cross-site  S cripting (XS S ) attacks.</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p>','no_image.jpg','Advanced_Detection_1689661215.docx',NULL,NULL,NULL,2,2,1,6,'INDJCST',2,1,1,5,NULL,NULL,'unpaid-1',0,65,65,'2023-07-18 06:18:25','2023-08-06 04:38:10'),(21,1,67,NULL,'Health Give Rise to Non-Contact Biometric Attendance System”','<p>Viruses such as COVID-19 are transferrable through touch and contact. There are WHO guidelines to clean or sanitize hands regularly to reduce the risk of infection. Attendance system is required in many different places such as offices, companies, schools, organizations and institutions, etc. There are many attendance systems to take attendance. But, every place need to have a good system. In this project we develop a Arduino based Automatic Sanitizer dispenser The controller processes the sensor data &amp; actuates the pump and solenoid valve. The sanitizer liquid dispenses through nozzle. Biometric Attendance System with help the of ultrasonic sensor, RS305 fingerprint sensor and also check person health status by checking blood oxygen level &amp; pulse heart rate of person before giving his biometric attendance with the help of multiple sensors. Parallax Data acquisition tool (PLX-DAQ) are the main components to display record in Excel.</p>','no_image.jpg','paper_1690555534.docx',NULL,NULL,NULL,1,2,1,1,'IJIRE',1,1,1,15,NULL,'<p>Published Article Link:</p><p>Journal Website:</p><p><a href=\"https://theijire.com/archives?year=2023&amp;volume=4&amp;issue=4\" target=\"_blank\">https://theijire.com/archives?year=2023&amp;volume=4&amp;issue=4</a></p><p>FDRP Website:</p><p>https://fdrpjournals.org/ijire/archives?paperid=6424158224731845940</p><p><br></p>','paid-1',1,67,1,'2023-07-28 14:45:34','2023-08-12 04:19:50'),(22,1,68,NULL,'Red Tacton-A Human Area Networking Technology','<p>In the recent days, Electronic bias come lower in size and lower in power Conditions and they’re less precious. We’ve begun to beautify our bodies with Particular Information and communication operations. Some Exemplifications includes cellular Phones, Pagers and particular digital sidekicks. Networking these kinds of bias can reduce Functional I/ O redundancies and allow new Conveniences and services. Mortal society is Entering a period of ultramodern computing, when networks are easily connected. The Perpetration of ubiquitous services requires three situations of connectivity Land Area Networks (LAN), Wide Area Networks (WAN), and Human Area Networks (HAN) for Connectivity to particular information, share data, media and communication appliances Within the important lower areas for communication. RedTacton is a technology that uses The face of the mortal body as a high speed and safe network transmission path. So we the  Pupil are explaining the new and unique functional features and eventuality of RedTacton  As a Human Area Networking Technology. Our Human body acts as a transmission medium Supporting half duplex communication at 10Mbit/s.</p>','no_image.jpg','Red_Tacton_A_Human_Area_Networking_Technology_1690954573.docx',NULL,NULL,NULL,1,2,1,1,'IJIRE',7,1,1,5,NULL,NULL,'unpaid-1',0,68,NULL,'2023-08-02 05:36:13','2023-08-06 04:38:21'),(23,1,69,NULL,'ADVANCED DETECTION AND MITIGATION OF CROSS-SITE SCRIPTING ATTACKS THROUGH INTELLIGENT JAVASCRIPT CODE INJECTION ANALYSIS','<p>ABSTRACT\r\n</p><p>Cr oss-site scripti ng attack, abbreviated as XSS , has been an incessant problem for W eb applications since the early 2000s. It is a code injection attack on the client -side where an attacker injects malicious pa yload into a vulner able we b applic ation, without client’s kno wl edg e.\r\n</p><p>The attacker is often successful in executing the malicious code inadvertently in the browser of an unwary user. Attempts have been made to implement the detection of XS S attacks using Genetic Algorithm, Web Vulnerabilities Finder, F uzzy Interference Model, but they all come with drawba cks. Implementation URL of the  website  is collected through an extension and vuln erability is checked by injecting java-script code to the website. If the website is vulnerable, then display a pop -up stating “Website is vulnerable,  be  awar e”,  else  display  a  pop -up  stating “ W ebsite is not vulner able ”. It is a low cost model which is easy to implement.\r\n</p><p>Keywords- XSS , F I Model, Genetic Algorithm, Web Vulnerabilities Finder, Cyber Attack\r\n</p><p>INTRODUCTION\r\n</p><p>W eb applications and websites are  becoming more  and more widespread as a re