we  need   better solutions/ methods  for  detection  of  Cross-site  S cripting (XS S ) attacks.\r\n</p><p>LIT ERAT UR E S URV EY\r\n</p><p>Zhonglin Liu, Yong Fang, Cheng Huang and Yijia Xu (2022) - Genetic Algorithm\r\n</p><p>Genetic algorithm starts from an initial population, through random selection, crossover and mutation.\r\n</p><p>The algorithm generates a group of individuals more suitable for the environment so that the gro up evolv es to\r\n</p><p>better ar e as in the e xplor ation spac e.\r\n</p><p>In the process of exploration, obtaining the local optimal solution is not easy.\r\n</p><p>Dra wback : Genetic algorithm is random and hence a large amount of time is consumed in detecting vulnerabilities.</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p>','no_image.jpg','Advanced_Detection_1690979792.docx',NULL,NULL,NULL,2,2,1,6,'INDJCST',1,2,1,15,'2023-08-05','<p>Journal Archive link:</p><p><a href=\"https://indjcst.com/archives?year=2023&amp;volume=2&amp;issue=2\" target=\"_blank\">https://indjcst.com/archives?year=2023&amp;volume=2&amp;issue=2</a></p><p>FDRP Archive Link:</p><p>https://fdrpjournals.org/indjcst/archives?paperid=9015397585418601467</p><p><br></p><p><br></p>','paid-1',1,69,1,'2023-08-02 12:35:02','2023-08-05 13:23:23'),(25,2,42,NULL,'sample article_09.08.2023','<p>sample_Abstract</p>','no_image.jpg','Fdrp_marketing_1691591468.docx',NULL,NULL,NULL,1,2,1,1,'IJIRE',1,1,1,5,NULL,NULL,NULL,1,42,NULL,'2023-08-09 14:31:08','2023-11-08 02:33:00'),(26,1,71,NULL,'DRIVER DROWSINESS & AICOHOL DETECTION SYSTEM','<p>\r\n</p><br> Road accidents became a matter of concern due to the huge increase in traffic. The primary cause of accidents is due to the drowsiness of drivers in the nighttime. Fatigue and drowsiness are some of the leading causes of major accidents on Highways.\r\nNow a day’s drowsiness due to drunken driving is increasing. If driver is found to be drowsiness in eyes more than 2secs, then the sensor senses <b>the eye movement of driver</b>, long with drowsiness alcohol detection is also detected by using <b>alcohol MQ3 sensor.</b> The alcohol is detected in driver’s breathe. \r\n<b>Key Word</b>: Alcohol detection system, Vehicle control, Arduino, Eye blink sensor.\r\n<br>','no_image.jpg','journal_paper_1691654689.pdf',NULL,NULL,NULL,2,2,1,2,'IJSREAT',2,1,1,15,'2023-08-11','<p>Published Article Link\'s:</p><p>Journal:</p><p><a href=\"https://ijsreat.com/archives?year=2023&amp;volume=3&amp;issue=4\" target=\"_blank\">https://ijsreat.com/archives?year=2023&amp;volume=3&amp;issue=4</a></p><p>FDRP Site:</p><p>https://fdrpjournals.org/ijsreat/archives?year=2023&amp;volume=3&amp;issue=4</p><p><br></p>','paid-2',1,71,1,'2023-08-10 08:04:49','2023-08-11 12:33:57'),(27,1,72,NULL,'Dynamic analysis of laminated composite cylindrical shells with stiffeners','<p>The domain of engineering and structural mechanics has undergone a transformative shift, courtesy of composite materials, attributing to their remarkable strength-to-weight ratio and versatile design adaptability. Amid the diverse array of composite applications, significant attention has been directed towards composite shells fortified with stiffening elements. These configurations seamlessly amalgamate the merits of composite materials with the augmented load-bearing capabilities conferred by the incorporation of stiffeners. This research undertaking aims to dissect orthotropic multilayered shells manifesting distinct stiffening configurations. The analytical exploration is carried out through the utilization of the Finite Element Analysis (FEA) software ANSYS. The ensuing analysis embraces several stiffening patterns: no stiffener, edge beam, central stringer, three equidistant stringers, central ring, and ring with stringer. The inherent diversity in the natural frequencies is reflective of the variance in these stiffening arrangements.</p>','no_image.jpg','Dynamic_analysis_of_laminated_composite_cylindrical_shells_with_stiffeners_1692170965.docx',NULL,NULL,NULL,1,2,1,2,'IJSREAT',1,1,2,15,'2023-08-17','<p>Published Article Details:</p><p>IJSREAT Journal page:</p><p><a href=\"https://ijsreat.com/archives?year=2023&amp;volume=3&amp;issue=4\" target=\"_blank\">https://ijsreat.com/archives?year=2023&amp;volume=3&amp;issue=4</a></p><p>FDRP Website:</p><p><a href=\"https://fdrpjournals.org/ijsreat/archives?paperid=46099540686060204\" target=\"_blank\">https://fdrpjournals.org/ijsreat/archives?paperid=46099540686060204</a></p><p><br></p><p><br></p>','paid-2',1,72,1,'2023-08-16 07:29:25','2023-08-17 04:16:51'),(28,9,73,NULL,'THE IMPACT OF LEADERSHIP STYLE IN EFFECTIVE MANAGEMENT OF AN ORGANIZATION: A CRITICAL REVIEW OF MICRO FINANCE BANKS IN OTA, OGUN STATE.','<p>Leadership is one of the key driving forces for improving a firm’s performance. It is assumed that the kind of leadership style employed in an organization has an impact on its overall performance. The study examined the leadership style practiced at microfinance banks in ota are of Ogun state. The study established that microfinance banks majorly use democratic leadership style in its operations. It also discovered that the democratic leadership style being practiced has had an appreciable influence on the operations and performance of the organization. The results of this study also revealed that there is strong relationship between leadership style and effective management of microfinance banks. As the strength of the organization dwells much on democratic style of leadership, it is recommended that management of the organization applies more of that and mix it with other leadership styles where necessary for the organization to wax stronger within its industry.</p>','no_image.jpg','leadership_style_9_1692268973.docx',NULL,NULL,NULL,1,2,1,1,'IJIRE',2,1,2,17,NULL,NULL,NULL,0,73,NULL,'2023-08-17 10:42:53','2023-08-21 06:27:48'),(29,1,72,NULL,'Stress analysis of U-type layered sandwich beams','<p>In this paper, the U-type symmetric sandwich beams with three layers are analyzed. Variations in the ratio of Young\'s modulus between the skin and core, as well as the curvature radius (R/H), parameters are considered for the U-type beams. The study investigates the influence of various core materials on the U-type beams. The stress analysis is conducted through numerical simulations utilizing the Finite Element Method software ANSYS.</p>','no_image.jpg','Stress_analysis_of_U_type_layered_sandwich_beams_1692438676.docx',NULL,NULL,NULL,1,2,1,2,'IJSREAT',1,1,2,15,'2023-08-21','<p>Published Article Details:</p><p>journal link:</p><p><a href=\"https://ijsreat.com/archives?year=2023&amp;volume=3&amp;issue=4\" target=\"_blank\">https://ijsreat.com/archives?year=2023&amp;volume=3&amp;issue=4</a></p><p>FDRP Link:</p><p>https://fdrpjournals.org/ijsreat/archives?paperid=2792588491631249578</p>','paid-2',1,72,1,'2023-08-19 09:51:16','2023-08-21 06:12:08'),(30,1,74,NULL,'Evaluation A Sitting Position on Public Space Based Ergonomic Approach','<p>Public spaces provide infrastructures for the community to carry out diverse activity types in any activities. Downtown of Malang City is a public space that conveys the different intensity of community activities in its place. However, the existing condition shows discrepancy to the ideal condition of a comfortable public open space. This study applies a qualitative approach with data collection gathered from physical and non-physical conditions from respondent’s intellectual understanding and continued by analysis according to related theories. The result of this study are: first; there are quality differences among sub-regions both in the physical and non-physical qualities, second; the sub-area with linear type has better quality compared to the square-type sub-area, third; from responsiveness aspect, sub-areas with mixed functions have better quality than sub-areas with a single function, and fourth; from the democratic aspect, sub-areas with shady vegetations which provide diverse functions have better quality as open public space.</p>','no_image.jpg','Evaluation_a_Sitting_Position_on_Public_Space_based_Ergonomic_Approach_03_Agustus_2020_1692580685.docx',NULL,NULL,NULL,1,2,1,1,'IJIRE',1,1,2,5,NULL,NULL,'unpaid-1',0,74,NULL,'2023-08-21 01:18:05','2023-08-29 10:27:30'),(32,4,73,NULL,'INVESTMENT BANKING DIVERSIFICATION: A STUDY OF THE MOTIVATIONS AND CHALLENGES OF EXPANDING INTO NEW PRODUCTS AND MARKETS.','<p>This study examines the drivers and barriers of investment banking diversification, which refers to the expansion of investment banks into new products and markets. The study adopts a literature review approach, synthesizing the existing theoretical and empirical evidence on the topic. The study identifies four main drivers of diversification: client demand, competitive advantage, regulatory pressure, and innovation opportunities. The study also reveals four main barriers of diversification: operational complexity, cultural resistance, reputational risk, and market uncertainty. The main findings are that investment banking diversification is motivated by several factors, such as revenue growth, risk reduction, cross-selling opportunities, economies of scale and scope, and regulatory arbitrage. However, investment banking diversification also faces several challenges, such as organizational complexity, cultural clashes, agency problems, diseconomies of diversification, and regulatory scrutiny. The study contributes to the literature on investment banking strategy by providing an in-depth understanding of the motivations and challenges of diversifying in a dynamic and competitive environment.  The study concludes that investment banking diversification is a double-edged sword that requires careful strategic management and alignment with the bank\'s core competencies and competitive advantages. The study also offers practical implications for investment bankers and regulators on how to manage the trade-offs between diversification and specialization.</p>','no_image.jpg','The_drivers_and_barriers_of_investment_banking_diversification_1692610488.docx',NULL,NULL,NULL,1,2,1,1,'IJIRE',2,1,2,5,NULL,NULL,NULL,0,73,NULL,'2023-08-21 09:34:48','2023-08-23 06:16:25'),(35,1,75,NULL,'Wear Behavior of DLC Coated HSS with Hydraulic Fluids','<p>The worldwide rotary pump market was estimated at around $5000 million in 2020 and the market is supposed to increase by 20% toward the end of 2026, seeing a compounded annual growth rate of 3% over a period from 2022-2026. The scrapping of an engineered component made from non-renewable resources at an early stage in life due to wear goes against the ethics of the conservation of natural resources as the frictional processes lead to dissipation of a part of input energy. In this context many research works focused on analyzing wear behavior using various formulated and vegetable oils but no works investigated on using hydraulic oils as lubricant for wear preventative nature. The objective of the work was to obtain diamond-like carbon coating on high-speed steel samples and test them for better wear preventative behavior with different hydraulic fluids.The HSS ball sample of 12.7 mm diameter were used as a substrate on which the dlc coating was to be developed using then RF-PECVD technique.The developed DLC coating was characterized by conducting X-Ray diffraction which suggested the coating to be of amorphous structure, Raman spectroscopy which determined the content of graphite (sp2 ) to be 47% and that of diamond (sp3 ) to be 53%.Further nanoindentation was conducted to compare the hardness of the high-speed steel sample before and after coating which was 12.22GPa and 35.56GPa respectively. The four ball test was performed to investigate the anti-wear properties of lubricating oil at specific conditions such as higher load, controlled temperature and constant rotating speed of the ball as per the ASTM D4172. The four ball results show that the coefficient of friction for samples reduces by around 36% when test oil 3 is used in uncoated samples and 48% in coated samples. Also, the wear rate for the test oil 3 for coated samples was found to be 0.7381x10-6 mm/Nm, which is the lowest wear rate among the other test oils. The outcome of the project is the reduction of coefficient of friction by 84% with respect to dry condition when test oil 3 is used. Therefore, it can be deduced that test oil 3 stands out as the most effective lubricant among the trio of test oils.\r\n</p><p>In this direction , further work can be carried out by carrying out four ball tests with lubricant oils in combination with additives to it so as to enhance the base oil property and suppress undesirable base oil properties. Fabrication and manufacturing of the vane model can be done to validate the result with the help of experimental work.</p>','no_image.jpg','Wear_Behavior_of_DLC_Coated_HSS_with_Hydraulic_Fluids_(1)_compressed_1693030396.pdf',NULL,NULL,NULL,1,2,1,1,'IJIRE',1,1,2,15,'2023-09-13','<p>Published Article Details:</p><p>FDRP Link:</p><p><a href=\"https://fdrpjournals.org/ijire/archives?paperid=5289579660065552939\" target=\"_blank\">https://fdrpjournals.org/ijire/archives?paperid=5289579660065552939</a><a href=\"https://fdrpjournals.org/ijire/archives?paperid=5289579660065552939\" target=\"_blank\"></a></p><p>IJIRE Link:</p><p>https://theijire.com/archives?paperid=5289579660065552939</p><p><br></p><p><br></p><p><br></p>','paid-2',1,75,1,'2023-08-26 06:13:16','2023-09-13 04:45:37'),(38,1,77,NULL,'AUTOMATIC WATER PUMPING AND QUALITY MONITORING SYSTEM','<b style=\"font-size: 0.875rem;\">Automatic Water Pumping and Quality Monitoring System</b><span style=\"font-size: 0.875rem;\"> is an innovative project integrating an Arduino Uno, ultrasonic sensor and pH sensor with the <b>Blynk platform</b>. This system effectively manages water levels and pH values for applications like hydroponics and irrigation. It maintains water levels within defined thresholds and ensures pH levels stay optimal. When levels deviate, it takes corrective actions. This project combines automation and real-time monitoring for efficient water management and quality control.</span><br>','no_image.jpg','Automatic_water_pumping_and_quality_monitoring_system_1693550990.pdf',NULL,NULL,NULL,1,2,1,2,'IJSREAT',1,1,1,15,'2023-09-03','<p>Published Article Link:</p><p>IJSREAT Journal link:</p><p><a href=\"https://ijsreat.com/archives?year=2023&amp;volume=3&amp;issue=5\" target=\"_blank\">https://ijsreat.com/archives?year=2023&amp;volume=3&amp;issue=5</a></p><p><span style=\"font-size: 0.875rem;\">FDRP Link:</span><br></p><p>https://fdrpjournals.org/ijsreat/archives?year=2023&amp;volume=3&amp;issue=5</p><p><br></p>','paid-2',1,77,1,'2023-09-01 06:49:50','2023-09-03 06:45:34'),(39,9,78,NULL,'AN OVERVIEW ON QR CODE AWARENESS','<p>QR (Quick Response) codes have emerged as a transformative technology in India, playing a pivotal role in digitalization and enhancing awareness across various sectors. This abstract provides a concise overview of the significance and adoption of QR codes in India, focusing on their role in promoting awareness and accessibility.\r\n</p><p>QR codes are two-dimensional barcodes that store data, enabling quick and efficient access to information or actions by scanning the code with a smartphone or QR code reader. In India, QR codes have gained substantial prominence due to several key factors:\r\n</p><p>The information Technology (IT) has revolutionized the various aspects of our lives; particularly it has provided an easy way to go for digital payments. During the demonetization period, the Government of India forced the people directly or indirectly to do all commercial transactions via digital mode. The common people started to move from traditional payment system towards digital payments system which ensured safe. Secure and convenience. With giant technological leaps in the smart phone and easy internet access has led Indian market to accept QR Code through payment system. The percentage of the QR Code through is also increasing in a significant speed. The objective of the present study in to know about the various types by using QR Code  payment transactions that are used by the common people compared to since 2016. Today, government data shows nearly 40 per cent of all payments in the once cash-only economy are digital.\r\n</p><p>This amounts to almost US$3 trillion, a number set to rise to US$10 trillion by 2026, according to a recent report by PhonePe and Boston Consulting Group. Tiny signs and QR-coded sound boxes can now be found in roadside shops across India, where vendors who sell everything from cigarettes to paan desserts and handcrafted jewellery have begun accepting digital payments.\r\n</p><p>Keywords-QR code, Digital Payments, Mobile Payment, Demonetization, Digital Revolution\r\n</p><p><br></p>','no_image.jpg','AN_OVERVIEW_ON_QR_CODE_AWARENESS___Abstract_1693561006.docx',NULL,NULL,NULL,1,2,1,3,'IJRTMR',3,1,1,15,'2023-09-16','<p>Published Article Link:</p><p>FDRP:</p><p><a href=\"https://fdrpjournals.org/ijrtmr/archives?year=2023&amp;volume=3&amp;issue=5\" target=\"_blank\">https://fdrpjournals.org/ijrtmr/archives?year=2023&amp;volume=3&amp;issue=5</a></p><p>IJRTMR:</p><p>https://ijrtmr.com/archives?year=2023&amp;volume=3&amp;issue=5</p><p><br></p><p><br></p>','paid-1',1,78,1,'2023-09-01 09:36:46','2023-09-16 06:42:49'),(40,1,79,NULL,'Hasting Algorithm - Generalization of Metropolis','<p>This paper presents Metropolis to search the space of possible configurations, by exploring possible transitions between configurations. The way the Metropolis algorithm decides about moving from the current state to a state in the neighborhood can be seen as a two-stage process.  a probability that depends upon the relative costs of the solutions associated with two conditions. The Metropolis algorithm the proposal stage will choose a neighbor uniformly at random. the Hasting Algorithm chain has the same stationary distribution as the usual Metropolis algorithm.</p>','no_image.jpg','Hasting_Algorithm_1693761775.docx',NULL,NULL,NULL,1,2,1,2,'IJSREAT',1,1,1,5,'2023-09-05',NULL,NULL,0,79,NULL,'2023-09-03 17:22:55','2023-09-04 13:44:06'),(50,4,57,NULL,'In the current work an endeavor has been made to concentrate','<p>demonstrated that on the off chance that counterfeit unpleasantness can be made on the bearing surface impeccably it can build the exhibition of a diary&nbsp;</p>','no_image.jpg','Manuscript__0983_1694093750_1694236776.docx',NULL,NULL,NULL,1,2,1,5,'INDJECE',4,2,2,5,'2023-12-06','<p><b>Published Article Details:\r\n</b></p><p>IJSREAT Journal Link: <span style=\"background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijsreat/archives?paperid=2982804930826027344\" target=\"_blank\">click here</a></span></p><p><span style=\"font-size: 0.875rem;\">FDRP Website Link:</span><span style=\"font-size: 0.875rem; background-color: rgb(255, 255, 0);\"> <a href=\"https://ijsreat.com/archives?paperid=2982804930826027344\" target=\"_blank\">Click here</a></span><br></p><p><br></p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p>',NULL,1,57,1,'2023-09-09 05:19:36','2024-04-27 06:48:54'),(52,4,81,NULL,'IMPACT OF DIVERSITY, EQUITY AND INCLUSION ON EMPLOYEE COMPETENCIES TOWARDS SUSTAINABLE ORGANIZATION IN IT SECTOR','<p>Companies are thus realizing that it goes beyond just having nice DEI policies to be on track especially if individual and business success is to be recorded. In fact, a study by McKinsey &amp; Company (2020) that examined at more than 1,000 large companies and 15 countries found a greater association between diversity on executive teams and the probability of financial outperformance. However, business returns being just an outcome should not be a sole motivator for prioritizing DEI initiatives but for the meaningful employee experience as well as employee competencies and it impacts on all aspects of the employee and organization.\r\n</p><p>The IT sector is an area that is undergoing rapid development and is changing the face of business standards in India. It is an industry that flourishes globally. In order to survive, Companies need to establish their brand in a well-developed way. DEI practices with Employee competencies on Sustainability is an idea whereby companies assume the liability of giving something great back to the general public in any form of development, which brings the culture of creating “power to be good”. It involves how their decisions impact the clients, the surrounding area, and the climate in every aspect of their operations. It is a fundamental requirement and an unavoidable idea of the contemporary association.\r\n</p><p><span style=\"font-size: 0.875rem;\">The present paper focuses on assessing the impact of diversity, equity and inclusion on employee competencies towards sustainable organization and core competencies on sustainable competitive advantage in information technology companies. The data collected from 131 employees working in various IT companies in Bangalore with structured questionnaire. The data is initially evaluated and interpreted using specific questionnaire questions. Finally, statistical approaches are used to analyse the data in order to gain a better knowledge of the variables affecting employee competencies and support long-term sustainability of organizations in the IT sector. The impact of DEI activities on enhancing employee competencies is assessed by this study. The results of the study are beneficial for IT company management in implementing DEI initiatives for sustainable organization and to gain an advantage over their competitors.</span><br></p>','no_image.jpg','IMPACT_OF_DEI_ON_EMPLOYEE_COMPETENCIES_TOWARDS_SUSTAINABLE_ORGANIZATION_IN_IT_SECTOR_1694594986.pdf',NULL,NULL,NULL,1,2,1,3,'IJRTMR',1,1,2,5,NULL,NULL,NULL,0,81,NULL,'2023-09-13 08:49:46','2023-09-13 14:28:00'),(55,4,82,NULL,'Test_article _by_Developer_durai','<p>Something.....................................</p>','no_image.jpg','TECHNICAL_MEETINGS_1694598268.pdf',NULL,NULL,NULL,1,2,2,1,'IJIRE',4,1,1,17,NULL,NULL,NULL,0,82,NULL,'2023-09-13 09:44:28','2023-11-06 05:05:20'),(58,2,87,NULL,'MACHINE LEARNING AND DEEP LEARNING APPROACHES FOR BRAIN DISEASE DIAGNOSIS','<p>Recent Recognition and division of a mind cancer, for example, glioblastoma multi shaped in attractive reverberation (MR) pictures are frequently difficult because of its characteristically heterogeneous sign qualities. A strong division strategy for cerebrum growth X-ray checks was created and tried. Techniques Basic limits and measurable strategies can\'t enough portion the different components of the GBM, like nearby difference upgrade, rot, and edema. Most voxel-based techniques can\'t accomplish agreeable outcomes in bigger informational indexes, and the strategies in view of generative or discriminative models have natural constraints during application, for example, little example set learning and move. The commitments of these two tasks were to show the complicated collaboration of mind and conduct and to comprehend and analyze cerebrum sicknesses by gathering and dissecting huge amounts of information. Chronicling, examining, and sharing the developing neuroimaging datasets presented significant difficulties. Multimodal MR pictures are sectioned into super pixels utilizing calculations to ease the inspecting issue and to further develop the example representativeness. Then, highlights were separated from the super pixels utilizing staggered Gabor wavelet channels. In view of the elements, grey level co-occurrence matrix (GLCM) model and a fondness metric model for growths were prepared to beat the impediments of past generative models</p>','no_image.jpg','ML_and_DL_1695974112.docx',NULL,NULL,NULL,1,2,1,1,'IJIRE',1,1,1,15,'2023-10-03','<p>Published Article Link\'s:</p><p>IJIRE Website:</p><p><a href=\"https://theijire.com/archives?paperid=8547505999877390468\" target=\"_blank\">https://theijire.com/archives?paperid=8547505999877390468</a></p><p>FDRP Website:</p><p>https://fdrpjournals.org/ijire/archives?paperid=8547505999877390468</p><p><br></p>','paid-2',1,87,1,'2023-09-29 07:55:12','2023-10-03 14:12:29'),(59,1,89,NULL,'ML BASED HAND GESTURE RECOGNITION','<p>The projects focus on Gesture recognition using the mediapipe hands Lite framework where the custom dataset of 10 gesture Images is trained with an inbuilt mediapipe hands model which contains 2 CNN models - A palm detection model running on  single  Shot  detection  architecture  and  a  hand  landmark generator running on regression model architecture. The dataset is successfully trained and tested with the proposed method and an accuracy of 98 percent is obtained.</p>','no_image.jpg','ML_BASED_HAND_GESTURE_RECOGNITION_1696417950.docx',NULL,NULL,NULL,1,2,1,6,'INDJCST',1,1,3,15,'2023-10-05','<p>Published Article Details:</p><p>Indjcst website link:</p><p><a href=\"https://indjcst.com/archives?paperid=8472788925136157516\" target=\"_blank\">https://indjcst.com/archives?paperid=8472788925136157516</a></p><p>FDRP Website Link:</p><p>https://fdrpjournals.org/indjcst/archives?paperid=8472788925136157516</p><p><br></p><p><br></p>','paid-2',1,89,1,'2023-10-04 11:12:30','2023-10-05 04:41:11'),(61,2,90,NULL,'Suicide Rate Analysis and Prediction','<p>Self-murder is a global public health concern with profound societal and individual impacts. This exploration paper aims to dissect self-murder rates from colorful perspectives and develop prophetic models to understand and potentially alleviate this critical issue. We employ a multidisciplinary approach, exercising data analysis, machine literacy, and socio- profitable factors to gain perceptivity into the factors impacting self-murder rates and produce prophetic models that can help in forestallment sweats. The study covers an expansive dataset gauging several times and multiple countries to give a comprehensive view of this complex problem.</p>','no_image.jpg','Suicide_Rate_Analysis_and_Prediction_ML_(1)_1696740105.docx',NULL,NULL,NULL,1,2,1,6,'INDJCST',1,1,1,2,NULL,NULL,NULL,0,90,NULL,'2023-10-08 04:41:45','2023-10-08 06:25:14'),(62,2,90,NULL,'Suicide Rate Analysis and Prediction','<p>Self-murder is a global public health concern with profound societal and individual impacts. This exploration paper aims to dissect self-murder rates from colorful perspectives and develop prophetic models to understand and potentially alleviate this critical issue. We employ a multidisciplinary approach, exercising data analysis, machine literacy, and socio- profitable factors to gain perceptivity into the factors impacting self-murder rates and produce prophetic models that can help in forestallment sweats. The study covers an expansive dataset gauging several times and multiple countries to give a comprehensive view of this complex problem.</p>','no_image.jpg','Suicide_Rate_Analysis_and_Prediction_ML_(1)_1696740186.docx',NULL,NULL,NULL,1,2,1,1,'IJIRE',1,1,1,5,NULL,NULL,NULL,0,90,NULL,'2023-10-08 04:43:06','2023-10-08 16:07:46'),(63,10,91,NULL,'The use of counselling','<p>Abstract is included in the main work uploaded.&nbsp;</p>','no_image.jpg','THE_USE_OF_COUNSELLING_AS_A_TOOL_FOR_CHOOSING_A_LIFE_PARTNER_1696755363.docx',NULL,NULL,NULL,1,2,1,3,'IJRTMR',2,1,1,5,NULL,NULL,NULL,0,91,NULL,'2023-10-08 08:56:03','2023-10-12 04:26:10'),(89,1,100,NULL,'Sequence Generation Model for Multi-Label Classification','<p>Multi-label classification is a challenging task in machine learning and natural language processing, where an input data point can belong to multiple categories simultaneously. In this paper, we propose a novel approach to multi-label classification using a Sequence Generation Model. Unlike traditional multi-label classification methods that treat each label independently, our model generates label sequences, considering the inherent dependencies and order of labels in the output.Our sequence generation model leverages the power of recurrent neural networks (RNNs) and attention mechanisms to capture the sequential relationships between labels. We introduce a unique architecture that not only predicts labels but also arranges them in a coherent and meaningful sequence. This approach improves the interpretability of multi-label classification results, which can be invaluable in various applications, such as text classification, image tagging, and recommendation systems.We evaluate our Sequence Generation Model on several benchmark datasets and compare it to state-of-the-art multi-label classification methods. Experimental results demonstrate that our approach outperforms traditional methods in terms of accuracy, especially when labels exhibit significant dependencies. Furthermore, we show that the generated label sequences provide more context and insight into the classification decision, aiding in better understanding the model\'s predictions.Our Sequence Generation Model offers a promising direction for multi-label classification tasks and opens up opportunities for improving the performance and interpretability of machine learning models in a wide range of applications.</p>','no_image.jpg','SGM__Sequence_Generation_Model_for_Multi_Label_Classification_(1)_1697385286.pdf',NULL,NULL,NULL,1,2,1,1,'IJIRE',5,1,1,5,NULL,NULL,NULL,0,100,NULL,'2023-10-15 15:54:46','2023-10-16 05:27:00'),(90,1,101,NULL,'Comparative Analysis for Prediction of Pneumonia Using Deep Learning Methods','<p>Pneumonia is basically an infection which can infect one or both the lungs of a person through their air bladders. The air sacs of such a person might get filled with pus, which in turn cause cough along with problems related to breathing and fever. Pneumonia is usually originated from various organisms such as viruses, fungi and bacteria. Pneumonia may be mild or even life threatening in some situations. It usually turns out to be very serious for newborns and very young children, also for senior citizens having age more than 65 years, especially people already having some health issues or enfeeble immune systems. This research focuses on comparing the best ways of using Machine Learning and Deep Learning for detecting Pneumonia using its different symptoms as features. For the purpose of this research, the dataset that has been used can be extracted from Kaggle website. It is a comparative study to compare which aspects of the disease should be considered for the best model. We compared various deep learning and machine learning models such as Random Forest and numerous Convolutional Neural Network architectures (VGG-16, Inception V3, 2:1 Architecture without using Batch Normalization and Dropout, 4:2 Architecture using Batch Normalization and Dropout, 5 Convolutional Blocks CNN with Batch Normalization and Maxpooling) for each and every feasible symptom to provide a holistic way of determining whether or not patient suffers from Pneumonia.</p>','no_image.jpg','Comparative_Analysis_for_Prediction_of_Pneumonia_Using_Deep_Learning_Methods_1697401922.docx',NULL,NULL,NULL,1,2,1,1,'IJIRE',1,1,1,15,'2023-10-25','<p>IJIRE Journal Link:\r\n</p><p>https://theijire.com/archives?year=2023&amp;volume=4&amp;issue=5\r\n</p><p>FDRP Link:\r\n</p><p>https://fdrpjournals.org/ijire/archives?year=2023&amp;volume=4&amp;issue=5</p><p>\r\n</p><p>\r\n</p><p>\r\n</p>','paid-2',1,101,1,'2023-10-15 20:32:02','2023-10-24 17:56:36'),(91,1,101,NULL,'Detection of Cricket Shots Using Deep Learning','<p>Classifying the different types of bat shots played in cricket has always been a challenging task in the field of cricket indexing. Identifying the type of shot a batsman played during a match is a crucial aspect that has not been thoroughly studied. This information can be used for context-based advertisements for cricket viewers, creating sensor-based commentary systems, and coaching assistants. However, manually identifying the different shots from video frames is difficult due to the similarity between them. This project presents a new approach for recognizing and categorizing different cricket shots by using state-of-the-art techniques such as saliency and optical flow to capture both static and dynamic information, and Long Short Term Memory (LSTM) for representation extraction. Additionally, a new dataset of 120 videos has been introduced to evaluate the performance of the model, with 4 classes of shots each having 30 videos. The model achieved an accuracy of 83.34% for the four classes of cricket shots.</p>','no_image.jpg','Detection_of_Cricket_Shots_Using_Deep_Learning_1697403466.docx',NULL,NULL,NULL,1,2,1,1,'IJIRE',1,1,1,15,'2023-10-25','<p>IJIRE Journal Link:</p><p><a href=\"https://theijire.com/archives?year=2023&amp;volume=4&amp;issue=5\" target=\"_blank\">https://theijire.com/archives?year=2023&amp;volume=4&amp;issue=5</a></p><p>FDRP Link:</p><p>https://fdrpjournals.org/ijire/archives?year=2023&amp;volume=4&amp;issue=5</p><p><br></p>','paid-2',1,101,1,'2023-10-15 20:57:46','2023-10-24 17:57:14'),(94,1,106,NULL,'Enhancing Cloud Computing using Green Computation','<p>The increasing need for computing services in the cloud has sparked worries about the effects on the environment and the rising expenses of data center operations. The purpose of this research study is to investigate the idea of \"ripe computation\" in relation to cloud computing, with an emphasis on the integration of sustainable practices to increase compute efficiency and lower cloud service costs. We look at different approaches, tools, and standards that can help create a cloud computing ecosystem that is both more economical and environmentally benign.</p>','no_image.jpg','Research_paper_1_1698731485.docx',NULL,NULL,NULL,1,2,2,6,'INDJCST',1,1,3,5,NULL,NULL,NULL,0,106,NULL,'2023-10-31 05:51:25','2023-11-02 14:55:06'),(95,1,107,NULL,'DEPLOYING  NAGIOS  FOR  SERVICE  MONITORING  AND REPORTING','<p>&nbsp;NAGIOS is Server Monitoring tool as an important criteria coming to a data center operation and service .Detects all type of network errors or server issues and allowed to monitor the server performance issues by using Nagios. This can be manually and physically monitoring the location of the server and mapping the network interface and network bridge server will be monitor. Count every 10 minutes once the application will be running properly or  else store application related bugs in data center. Large organizations always require fast and efficient network monitoring system which reports to the network administrator as soon as a network problem arises. This paper presents an effective and automatic network monitoring system that continuously monitor all the network switches and inform the administrator by E-MAIL or SMS when any of the network switch goes down. An efficient and automatic network monitoring is always required for large organizations like universities, companies and other business sectors where the manual network monitoring is very difficult . Since large organizations have a big network topology, the manual network monitoring causes waste of time to point out problem location.</p>','no_image.jpg','K.VIJAY__journal_paper_(1)_1698746560.docx',NULL,NULL,NULL,1,2,1,1,'IJIRE',1,1,2,15,'2023-11-08','<p>Published Article Details:</p><p>IJIRE Journal Link:</p><p><a href=\"https://theijire.com/archives?year=2023&amp;volume=4&amp;issue=5\" target=\"_blank\">https://theijire.com/archives?year=2023&amp;volume=4&amp;issue=5</a></p><p>FDRP Link:</p><p>https://fdrpjournals.org/ijire/archives?year=2023&amp;volume=4&amp;issue=5</p><p><br></p>','paid-2',1,107,1,'2023-10-31 10:02:40','2023-11-08 12:08:29'),(97,1,105,NULL,'Enhancing Cloud Computing using Green Computation','<p>The increasing need for computing services in the cloud has sparked worries about the effects on the environment and the rising expenses of data center operations. The purpose of this research study is to investigate the idea of \"ripe computation\" in relation to cloud computing, with an emphasis on the integration of sustainable practices to increase compute efficiency and lower cloud service costs. We look at different approaches, tools, and standards that can help create a cloud computing ecosystem that is both more economical and environmentally benign.</p>','no_image.jpg','Research_paper_1_1698844024.docx',NULL,NULL,NULL,1,2,1,6,'INDJCST',1,1,3,15,'2023-11-02','<p>Published Article Links:</p><p>INDJCST:</p><p><a href=\"https://indjcst.com/archives?paperid=44032128613398340\" target=\"_blank\">https://indjcst.com/archives?paperid=44032128613398340</a><a href=\"https://indjcst.com/archives?paperid=4159899355276817110\" target=\"_blank\"></a></p><p><span style=\"font-size: 0.875rem;\">FDRP Journals:</span><br></p><p>https://fdrpjournals.org/indjcst/archives?year=2023&amp;volume=2&amp;issue=3</p><p><br></p><p><br></p>','paid-1',0,105,1,'2023-11-01 13:07:04','2023-11-02 15:26:07'),(98,1,57,NULL,'test_03.11.2023','<p>Abstract _03.11.2023</p>','no_image.jpg','paper_pdf_data_(30)_1699013625.pdf',NULL,NULL,NULL,1,2,1,1,'IJIRE',1,1,1,5,NULL,NULL,'paid-1',1,57,NULL,'2023-11-03 12:13:45','2024-04-24 04:32:45'),(99,1,57,NULL,'test_06.11.2023','<p>test_ Abstract</p>','no_image.jpg','IJIRE_v3i4_08_33_37_1699256351.docx',NULL,NULL,NULL,1,2,1,1,'IJIRE',1,2,1,15,NULL,NULL,NULL,0,57,NULL,'2023-11-06 07:39:11','2023-11-08 02:35:29'),(100,5,57,NULL,'CFD Analysis of Hydrodynamic Proceedings Contacting Static Capabilities with Embossed Bearing Surface','<p>Execution of a Diary bearing relies upon two viewpoints. Initial one is the improvement of innate properties of ointment by thorough examination. Second one is the improvement of bearing execution by doing some examination on the plan parts of bearing surface. Improvement of bearing execution implies that its heap conveying limit will be expanded and simultaneously the frictional misfortune because of the shearing peculiarity between bearing surface and the ointment layer ought to be diminished.\r\n</p><p>It has been demonstrated that on the off chance that counterfeit unpleasantness can be made on the bearing surface impeccably it can build the exhibition of a diary bearing. Presently it is the question of exploration that which shape, aspects, position and direction will build the presentation of a given diary bearing most. In the current work an endeavor has been made&nbsp;</p>','no_image.jpg','K.VIJAY__journal_paper_(1)_1699427909_1699712387.docx',NULL,NULL,NULL,1,2,1,3,'IJRTMR',3,3,2,6,NULL,NULL,'paid-2',1,57,NULL,'2023-11-11 14:19:47','2024-04-24 14:37:40'),(101,1,59,NULL,'Current Trends in Cluster Computing','<p>High availability becomes a necessity for a growing number of business web applications. Clustering emerges as a natural solution to bring high availability to a large number of users. In this integration paper solutions for business web applications are updated. Achieving high availability and high capacity by using load balancing collections at the application server level and server clusters (including the RAC concept) at the website level is introduced. Collections are often used to improve performance and / or availability beyond what a single computer offers, while they are often more expensive than a single computer with high speed or availability.&nbsp;</p>','no_image.jpg','PAPER_SETTING_REMUNERATION__Dr_Sivaganesan_1700021548.docx',NULL,NULL,NULL,1,2,1,3,'IJRTMR',1,1,1,6,NULL,NULL,'paid-3',0,59,NULL,'2023-11-15 04:12:28','2024-01-30 04:22:20'),(102,1,111,NULL,'A RNN APPROACH ON COMPUTER VISION FOR SIGN LANGUAGE TRANSLATION','<p style=\"text-align: justify; \">Sign language serves as a non-verbal means of transferring thoughts and emotions, primarily utilized by individuals who are hearing impaired, mute, or speech-impaired. Unfortunately, the linguistic nuances of sign language often go unnoticed by the general public. To bridge this communication gap, there is a need to develop a Sign Language translation system based on the Indian Sign Language (ISL) Dataset. In this endeavor, the Recurrent Neural Network (RNN) algorithm is employed to recognize and interpret static hand signals representing letters of the Indian Sign Language, ultimately converting them into written text. This technical solution leverages the power of RNNs to capture temporal dependencies in the sign language gestures, facilitating accurate translation and fostering better communication between the hearing impaired and the wider community.\r\n\r\n</p><p style=\"text-align: justify; \"><br></p><p>\r\n</p>','no_image.jpg','A_RNN_APPROACH_ON_COMPUTER_VISION_FOR_SIGN_LANGUAGE_TRANSLATION_1700110054.docx',NULL,NULL,NULL,1,2,1,6,'INDJCST',1,1,1,5,NULL,NULL,NULL,0,111,NULL,'2023-11-16 04:47:34','2023-11-16 08:59:36'),(103,8,58,NULL,'JAWAHARLAL NEHRU TECHNOLOGICAL','<p>Assistant Professor \r\n</p><p>Department 		:	Electrical &amp; Electronics Engineering \r\n</p><p>Scale of Pay		:	15600-39100+ AGP 6000\r\n</p><p><br></p>','no_image.jpg','INDJCST_0000102_1700119151.docx',NULL,NULL,NULL,1,2,1,2,'IJSREAT',6,1,3,6,NULL,NULL,NULL,0,58,NULL,'2023-11-16 07:19:11','2024-01-13 14:26:12'),(104,1,57,NULL,'test_20.11.2023','<p>test_ Abstract&nbsp;</p>','no_image.jpg','Open_Access_Peer_1700452998.docx',NULL,NULL,NULL,1,2,1,6,'INDJCST',1,1,1,15,NULL,NULL,NULL,0,57,NULL,'2023-11-20 04:03:18','2023-12-12 13:55:07'),(105,1,116,NULL,'Analysing The Performance Of A Manufacturing Firm Using Hierarchical  Approach','<p>There is a growing demand for manufacturers from within and outside the company to embrace stakeholder-satisfying production techniques. As a result, companies undertake a wide range of assessments as part of their strategic planning and performance monitoring processes. The Strengths, Weaknesses, Opportunities, and Threats (SWOT) analysis is used in strategic planning that help businesses evaluate their current standing. In addition, through the Analytic Hierarchy Process (AHP), a pairwise comparison may be made between elements or criteria to prioritise them, making the SWOT analysis and multicriteria decision making method more effective. The purpose of the combined approach is to raise the effectiveness of strategic planning inside a business. This paper does a SWOT analysis of a process industry, outlining its strengths, weaknesses, opportunities, and threats. First, the company\'s strengths, weaknesses, opportunities, and threats (SWOT) are determined via an internal poll. Then, the AHP (analytic hierarchy process) compares alternatives by contrasting them head-to-head. The results of the company-wide poll of experts landed on seventeen distinct elements. With this information, the manufacturing firm can decide how best to boost its operations.</p>','no_image.jpg','SWOT.DEC_1700553256.doc',NULL,NULL,NULL,1,2,2,3,'IJRTMR',1,1,1,5,NULL,NULL,NULL,0,116,NULL,'2023-11-21 07:54:16','2023-11-22 09:58:22'),(106,3,110,NULL,'sdfsdfsdfsdfsdf','<p>sdfsdfsdf<br></p>','no_image.jpg','sociology_paper_examination_2020_question_paper_1_(1)_1700631978.pdf',NULL,NULL,NULL,1,2,2,3,'IJRTMR',2,1,1,17,NULL,NULL,NULL,0,110,NULL,'2023-11-22 05:46:18','2023-11-22 05:55:56'),(107,8,118,NULL,'ENVIRONMENTAL SUSTAINABILITY AND WASTE MANAGEMENT PRACTICES','<p>\r\n</p><br>ABSTRACT\r\nBackground: The study aims to explore environmental sustainability and medical waste management practices in Ghanaian private hospitals in the Greater Accra Region. It also sought to determine if there is any form of collaboration between private hospitals and district assemblies in managing medical wastes.\r\nMethods:  A qualitative research approach with a cross-sectional study design was used to collect data from employees of the three private hospitals and the district assemblies. A structured interview guide was employed to gather data from 13 purposively selected participants.\r\nResults: The findings of the study indicated that there is a collaboration between private hospitals and district assemblies with regard to medical wastes management activities.\r\nConclusions: It is recommended that policies on medical waste management are enforced to ensure sustainable healthcare waste management.\r\nKeywords: Environmental sustainability, collaboration, medical waste, private hospitals, district assemblies\r\n<br><br>','no_image.jpg','RESEARCH_PAPER__new_1700740261.doc',NULL,NULL,NULL,1,2,1,3,'IJRTMR',1,1,3,15,'2023-11-28','<p>Published Article Details:</p><p>IJRTMR Journal LInk:</p><p><a href=\"https://ijrtmr.com/archives?year=2023&amp;volume=3&amp;issue=6\" target=\"_blank\">https://ijrtmr.com/archives?year=2023&amp;volume=3&amp;issue=6</a></p><p>FDRP Site Link:</p><p>https://fdrpjournals.org/ijrtmr/archives?paperid=8432859227733606399</p><p><br></p>','paid-3',1,118,1,'2023-11-23 11:51:01','2023-11-29 02:24:10'),(108,1,119,NULL,'Feasibility Study on ATM/ITM Demand for Production with KPI Metrics in Ethiopia','<p>Automatic Teller Machines (ATM) is an innovative service delivery mode that offers diversified financial services. These are operated by the information and communication applications as a result in today’s business environment internet has major influences for all financial, banking and commercial transactions. ATMs allow bank customers to withdraw cash properly anytime, anywhere and at all hours without going to actual bank by online automation of banking transaction services. The customers also acquire different real-time service. As a result the cashless payment system adoption and innovation greatly helped the market growth forecasts of Automatic Teller Machine (ATM). This new technology is testing and demanding different finance institutions to be highly competitive in every aspect of economy. There are different types, designs and configuration of ATM/ITM machines. Their software and hardware must be confidential to support the banking services. CBE is the pioneer in introducing ATM payment system in Ethiopia and then after it got a Visa membership. Actually banking industry in Ethiopia hasn’t developed well and need to be modernized by introducing new E-banking technologies in the banking system therefore all banks operating in Ethiopia should recognize the need for introducing electronic banking system to satisfy their customers. These help them to fulfill the requirements of rapidly expanding domestic and international trades, and increasing international banking services. There is an increase in banks, bank branches and ATM usage by banks. The ATM demand is showing increment but there are no known companies that provide SKD/CKD assembling services. They are only imported as CKD and assembled for service by exporter representatives. For promotion of the E-banking in general and ATM in particular companies need to have their own assembling, service and maintenance factory due to the positive developments in financial, banking and commercial transactions</p>','no_image.jpg',NULL,NULL,NULL,NULL,1,2,1,3,'IJRTMR',1,1,1,15,'2024-01-03','<p><b style=\"background-color: rgb(255, 255, 0); color: rgb(0, 0, 255);\">Published Article Details:\r\n</b></p><p>IJRTMR Journal Link: <span style=\"background-color: rgb(255, 255, 0);\"><a href=\"https://ijrtmr.com/archives?year=2023&amp;volume=3&amp;issue=6\" target=\"_blank\">Click Here</a>\r\n</span></p><p>FDRP Website Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijrtmr/archives?paperid=7428966592810405780\" target=\"_blank\">Click Here</a>\r\n</span></p><p>Crossref (DOI) Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/?from_ui=&amp;q=10.59256%2Fijrtmr.20230306004\" target=\"_blank\">Click Here </a></span>(Please check after 48hrs)\r\n</p><p><br></p>',NULL,0,119,1,'2023-11-29 11:59:06','2024-01-04 05:44:46'),(109,2,123,NULL,'Research into the world of Cloud-Virtual Reality','<p>Virtual Reality technology has not been able to penetrate the mainstream consumer market due to restrictions on hardware and content. With the advancement of cloud computing technologies, Virtual Reality hardware and technology applications may now be supported strongly. The metaverse, cloud VR gaming, and cloud VR stimulator are just a few of the real-world applications that are now employing cloud computing in Virtual Reality. We can lower the cost of Virtual Reality technology which would begin a new era of many users to apply cloud-based technologies. With the aid of technology, it will be possible to operate from anywhere without having to transport a lot of equipment. The performance, usability, and compatibility of Virtual Reality software and hardware can be improved by cloud computing on the level of hardware and content.\r\n</p><p>The VR dataset is made available for public collaboration through the Internet using a VR-Cloud server. The digital asset that represents the layout of our pedestrian bridge comprises images of all the streets, buildings, trees, and other urban amenities. In the virtual environment of the metropolitan area, where they run and stroll according to predetermined behaviour scenarios, the cars and people are created and entered. By employing cloud communication software to analyse simulations of vehicles and pedestrian crowds and to debate design ideas, users share the VR reality by connecting to the VR Cloud servers from remote devices.\r\n</p><p>This research demonstrates how VR-cloud may be combined with Neuralink and NFT in the virtual world for future enhancement. This paper is a research note on cloud computing and its application using the Virtual Reality (VR) platform for the modern world with futuristic innovations.</p>','no_image.jpg','Cloud_Computing_Using_Virtual_Reality_Final_1701585482.docx',NULL,NULL,NULL,1,2,1,6,'INDJCST',1,1,2,15,'2023-12-22','<p><b style=\"color: rgb(0, 0, 255);\">Published Article Details:\r\n</b></p><p>INDJCST Journal Link: <span style=\"background-color: rgb(255, 255, 0);\"><a href=\"https://indjcst.com/archives?year=2023&amp;volume=2&amp;issue=3\" target=\"_blank\">Click Here</a>\r\n</span></p><p>FDRP Website Link: <span style=\"background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/indjcst/archives?year=2023&amp;volume=2&amp;issue=3\" target=\"_blank\">Click Here</a></span></p><p>DOI Link:&nbsp; <span style=\"background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/?from_ui=&amp;q=10.59256%2Findjcst.20230203002\" target=\"_blank\">Click Here</a></span><span style=\"background-color: rgb(239, 239, 239);\"><a href=\"https://search.crossref.org/?from_ui=&amp;q=10.59256%2Findjcst.20230203002\" target=\"_blank\"> </a>(please check after 48 hours)</span></p><p>\r\n</p><p>\r\n</p>','paid-2',1,123,1,'2023-12-03 06:38:02','2023-12-22 15:44:09'),(110,1,57,NULL,'ML BASED HAND GESTURE RECOGNITION','<p>Abstract—The projects focus on Gesture recognition using the mediapipe hands Lite framework where the custom dataset of 10 gesture Images is trained with an inbuilt mediapipe hands model which contains 2 CNN models - A palm detection model running on  single  Shot  detection  architecture  and  a  hand  landmark generator running on regression model architecture. The dataset is successfully trained and tested with the proposed method and an accuracy of 98 percent is obtained.\r\n</p><p>Index   Terms—Gesture   Recognition,   Mediapipe,   Hands   De-\r\n</p><p>tection,  CNN,  Regression  Model,  Hand  Landmark  Detection, Machine Learning, Image Processing.\r\n</p><p><br></p>','no_image.jpg','INDJCST_0000109_1701613092.docx',NULL,NULL,NULL,1,2,1,1,'IJIRE',1,2,1,17,NULL,NULL,'paid-3',0,57,NULL,'2023-12-03 14:18:12','2024-04-24 05:13:56'),(111,1,124,NULL,'Non Invesive Diabetes Detection and Kidney Health Diagnosis','<p>The small application is designed to provide a non-invasive method for monitoring blood glucose levels and kidney health. It utilizes acetone sensors to measure the concentration of acetone in exhaled breath, which can be correlated with blood glucose levels. Additionally, a sparsified methane sensor is used to detect methane levels in exhaled breath, indicating kidney health. The application also incorporates the measurement of light absorption rate to check blood flow. This application aims to improve the lives of individuals with diabetes and kidney disease by offering a convenient and accurate way to monitor their health without invasive procedures.</p><p><br></p>','no_image.jpg','final_pepar_(1)_(1)_(1)_(2)_1701626540.doc',NULL,NULL,NULL,1,2,2,5,'INDJECE',4,1,2,3,NULL,NULL,NULL,0,124,NULL,'2023-12-03 18:02:20','2023-12-12 04:59:15'),(112,2,125,NULL,'BIRD SPECIES IDENTIFICATION USING AUDIO PROCESSING EMBEDDED WITH TRANSLATOR','<p>With their variety of vocalizations, birds contribute significantly to the acoustic fabric of our natural surroundings. Their songs and calls offer important clues into the health of ecosystems and biodiversity. Contributions from the project include the creation of effective and trustworthy systems for classifying bird species, which may find use in ecological studies, biodiversity monitoring, and ornithology. A system like this could be useful for monitoring migratory patterns, evaluating changes in bird populations, and supporting conservation initiatives. The domains of artificial intelligence and ornithology are connected by this research.</p>','no_image.jpg','BIRD_SPECIES_IDENTIFICATION_USING_AUDIO_PROCESSING_EMBEDDED_WITH_TRANSLATOR_1701755511.docx',NULL,NULL,NULL,1,2,1,2,'IJSREAT',2,1,1,15,'2023-12-06','<p><b>Published Article Details:</b></p><p>IJSREAT Journal Link: <span style=\"background-color: rgb(255, 255, 0);\"><a href=\"https://ijsreat.com/archives?paperid=2982804930826027344\" target=\"_blank\">Click Here</a></span></p><p><span style=\"font-size: 0.875rem;\">FDRP Website Link: </span><span style=\"font-size: 0.875rem; background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijsreat/archives?paperid=2982804930826027344\" target=\"_blank\">Click Here</a></span><br></p><p><br></p><p><br></p>','paid-2',1,125,1,'2023-12-05 05:51:51','2023-12-06 14:13:57'),(113,1,126,NULL,'Indian Vehicle License Plate Extraction and Recognition Using Morphological Operations and Deep Learning','<p>License Plate Extraction and Recognition (LPER) play a vital role in various applications within intelligent transport systems (ITS), including surveillance, traffic flow monitoring, stolen vehicle tracking, and parking lot management. This paper presents a comprehensive system design for implementing LPER specifically tailored to Indian License Plates. The LPER process encompasses three essential stages: License Plate Extraction, segmentation, and classification. Each stage necessitates specialized techniques adapted to real-world scenarios, each characterized by distinct attributes.\r\n</p><p>The license plate extraction techniques are utilized to accurately locate the license plate region, which is succeeded by segmentation algorithms that effectively isolate individual characters. Subsequently, a classification step is employed to recognize these segmented characters. The overall efficacy of the process hinges upon the precision achieved at each sequential step. To significantly enhance the classification step\'s performance, we propose an innovative amalgamated approach that integrates segmentation and classification into a cohesive single-stage process. This integration harnesses the power of deep learning methodologies, incorporating Morphological and Enhanced sliding contract window (ESCW)-based number plate detection alongside the employment of the AlexNet neural network.\r\n</p><p>Our experimental findings underscore the efficacy of this proposed approach, showcasing an outstanding accuracy of 97.2% in accurately recognizing characters on vehicle license plates. This achievement notably surpasses the accomplishments of prior endeavors in this field, signifying a significant advancement in LPER technology.\r\n</p><p><br></p>','no_image.jpg','RPS_Paper_23_1701776818.docx',NULL,NULL,NULL,1,2,1,4,'INDJEEE',1,1,1,2,NULL,NULL,NULL,0,126,NULL,'2023-12-05 11:46:58','2023-12-12 04:24:49'),(114,1,127,NULL,'Virtual Air Canvas using OpenCV and MediaPipe','<p>Recent development in artificial intelligence enables a digital environment to be navigated through human gestures. Particularly relevant in computer language instruction, gestures serve as nonverbal cues. The Virtual Canvas application transforms hand and finger gestures captured via webcam into a drawing tool. Leveraging OpenCV for robust image and video analysis and MediaPipe for streamlined perceptual computing, the project simplifies the development of applications involving tasks like hand tracking and face detection. Python, chosen for its ease of use and broad compatibility, serves as the project\'s language. By monitoring hand landmarks and finger IDs in real-time, the project enables dynamic modes such as selection, drawing, and canvas clearing. This research showcases the practical application of computer vision and gesture-based interactions, enhancing the user experience.</p>','no_image.jpg','Virtual_Air_Canvas_J_1702009167.docx',NULL,NULL,NULL,1,2,1,1,'IJIRE',1,1,1,15,'2023-12-12','<p><b style=\"color: rgb(0, 0, 255);\">Published Article Details:\r\n</b></p><p>IJIRE Journal Link:<a href=\"https://theijire.com/archives?year=2023&amp;volume=4&amp;issue=6\" target=\"_blank\"> </a><span style=\"background-color: rgb(255, 255, 0);\"><a href=\"https://theijire.com/archives?year=2023&amp;volume=4&amp;issue=6\" target=\"_blank\">Click Here</a>\r\n</span></p><p>FDRP Website Link<a href=\"https://fdrpjournals.org/ijire/archives?year=2023&amp;volume=4&amp;issue=6\" target=\"_blank\">:</a><span style=\"background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijire/archives?year=2023&amp;volume=4&amp;issue=6\" target=\"_blank\"> Click Here</a></span></p><p>\r\n</p><p>\r\n</p>','paid-1',1,127,1,'2023-12-08 04:19:27','2023-12-12 06:57:46'),(117,1,129,NULL,'Mathematical Modeling of Gait for Lower Limb Exoskeleton','<p>This study presents the mathematical Modeling of gait. This model is for the lower limb exoskeleton. The exoskeleton has wide scope in hospitals, physical training, and army. The comfortable gait with exoskeleton requires a good mathematical model of gait. This Modeling of this study starts with a C3D file which is taken from a hospital. This Modeling uses MLSviewer, MOKKA, AnyBody, and Matlab software. The basic information of the C3D file read with the MLSviewer software. This software tells the type of force plate, name of maker points, the number of force plate and marker points use in the gait analysis. The motion of marker points visualizes in MOKKA software. These visuals in MOKKA software give the position of all marker points. The MOKKA software also gives information about the starting frame number and last frame number for the gait on the force plates. The information collected from the MLSviewer and MOKKA software uses for modification of AnyScript of the inbuilt model of AnyBody software. The kinematic and inverse dynamic analysis of C3D file data performs in AnyBody software after proper changes in AnyScript of the model. The linear position and velocity data obtained from kinematic analysis use in Matlab Modeling. Matlab Modeling has two-step: curve fitting and curve plotting. The sum of sine equation fits on this linear position and velocity data using the curve fitting app of Matlab. Another velocity equation is evaluated by the differentiation of the position equation. These equations of linear position and velocity simulate using Matlab software. The plot of kinematic analysis data and plot of modeled equations compare in the Matlab software. The goodness of the results of all these equations is decided based on root mean square error (RMSE)</p>','no_image.jpg',NULL,NULL,NULL,NULL,1,2,1,2,'IJSREAT',1,1,3,15,'2023-12-11','<p><b>Published Article Details:\r\n</b></p><p>IJSREAT Journal Link: <span style=\"background-color: rgb(255, 255, 0);\"><a href=\"https://ijsreat.com/archives?year=2023&amp;volume=3&amp;issue=6\" target=\"_blank\">Click Here</a>\r\n</span></p><p>FDRP Website Link: <span style=\"background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijsreat/archives?year=2023&amp;volume=3&amp;issue=6\" target=\"_blank\">Click Here</a></span></p><p>\r\n</p><p>\r\n</p>','paid-2',1,129,1,'2023-12-10 06:48:16','2023-12-11 05:38:30'),(118,1,132,NULL,'Review on energy storage system for small scale microgrid','<p>Small scale microgrids are increasingly being used for localized energy generation, distribution, and consumption. They offer benefits such as increased reliability, resilience, and the integration of energy sources. Common applications include powering remote communities, industrial facilities, or even individual homes with a mix of solar panels, wind turbines, and energy storage system.  This microgrid can operate independently or connect to main grid, providing flexibility and optimizing energy use in specific areas. This paper presents into the advancements and challenges in energy storage systems (ESS), offering a comprehensive analysis of diverse technologies, including batteries, capacitors, and emerging alternatives. It surveys the application landscape, emphasizing ESS contributions to renewable energy integration, grid stability, and peak load management. This review paper critically evaluates efficiency, cost-effectiveness, and environmental implications, exploring innovative solutions and emerging technologies. By synthesizing current research, this review provides valuable insights into optimizing ESS for a sustainable and resilient energy future.</p>','no_image.jpg','REVIEW_PAPER_ON_RESEARCH_METHODOLOGY_1702295457.docx',NULL,NULL,NULL,1,2,1,4,'INDJEEE',2,1,2,3,NULL,NULL,NULL,0,132,NULL,'2023-12-11 11:50:57','2023-12-11 14:36:34'),(119,1,132,NULL,'Review on energy storage system for small scale microgrid','<p>Small scale microgrids are increasingly being used for localized energy generation, distribution, and consumption. They offer benefits such as increased reliability, resilience, and the integration of energy sources. Common applications include powering remote communities, industrial facilities, or even individual homes with a mix of solar panels, wind turbines, and energy storage system.  This microgrid can operate independently or connect to main grid, providing flexibility and optimizing energy use in specific areas. This paper presents into the advancements and challenges in energy storage systems (ESS), offering a comprehensive analysis of diverse technologies, including batteries, capacitors, and emerging alternatives. It surveys the application landscape, emphasizing ESS contributions to renewable energy integration, grid stability, and peak load management. This review paper critically evaluates efficiency, cost-effectiveness, and environmental implications, exploring innovative solutions and emerging technologies. By synthesizing current research, this review provides valuable insights into optimizing ESS for a sustainable and resilient energy future.</p>','no_image.jpg','REVIEW_PAPER_ON_RESEARCH_METHODOLOGY_1702295469.docx',NULL,NULL,NULL,1,2,1,4,'INDJEEE',2,1,2,15,'2024-01-09','<p><b style=\"color: rgb(0, 0, 255);\">Published Article Details:\r\n</b></p><p>INDJEEE Journal Link: <span style=\"background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/indjeee/archives?year=2024&amp;volume=1&amp;issue=1\" target=\"_blank\">Click Here</a></span></p><p>\r\n</p>',NULL,0,132,1,'2023-12-11 11:51:09','2024-01-09 05:50:43'),(120,1,133,NULL,'Review on Resolution of Issues Related to Permanent Magnet Usage in Synchronous Machines','<p style=\"text-align: justify; \"><span style=\"font-size: 14px;\">This paper presents a brief overview on&nbsp;</span><span style=\"font-size: 14px;\">recent technological developments related to&nbsp;</span><span style=\"font-size: 14px;\">resolving the issues due to usage of permanent&nbsp;</span><span style=\"font-size: 14px;\">magnets in synchronous machines. This paper&nbsp;</span><span style=\"font-size: 14px;\">sheds some light on the latest technological&nbsp;</span><span style=\"font-size: 14px;\">developments, which have emerged in recent&nbsp;</span><span style=\"font-size: 14px;\">years, such as wound rotor synchronous&nbsp;</span><span style=\"font-size: 14px;\">machines, brushless WRSMs, and many others.&nbsp;</span><span style=\"font-size: 14px;\">Their aim is to address some of the issues with the&nbsp;</span><span style=\"font-size: 14px;\">conventional permanent magnet (PM) machines,&nbsp;</span><span style=\"font-size: 14px;\">such as recent unavailability, high cost, and&nbsp;</span><span style=\"font-size: 14px;\">demagnetization issues. The idea is to develop a&nbsp;</span><span style=\"font-size: 14px;\">brushless and wound-rotor type motors for dual&nbsp;</span><span style=\"font-size: 14px;\">speed applications, such as in washing machines,&nbsp;</span><span style=\"font-size: 14px;\">machines with high starting torque, and few&nbsp;</span><span style=\"font-size: 14px;\">other applications such as hybrid electric vehicles&nbsp;</span><span style=\"font-size: 14px;\">(HEVs). The main idea here is to minimize the use&nbsp;</span><span style=\"font-size: 14px;\">of permanent magnets (PM) by developing&nbsp;</span><span style=\"font-size: 14px;\">alternate methods.</span></p>','no_image.jpg','Review_Paper_on_Synchronous_Machine_RMIPR_1702348192.docx',NULL,NULL,NULL,1,2,1,4,'INDJEEE',2,1,1,2,NULL,'<p>Dear Author.</p><p>Please reduce plagiarism to less than 30%. and then resubmit. You can download the report from the <b>File</b> tab.</p>',NULL,0,133,1,'2023-12-12 02:29:52','2023-12-19 04:23:12'),(124,7,136,NULL,'Green and Clean Energy-Waste to Energy: A Review','<p>The fast depleting fossil fuels and their ever-increasing demand further reinforce the importance of energy from alternate sources. Prominent among  problems of developing nations are access to affordable and reliable energy as well as clean and  lovable environment.  Adopting waste-to-energy system could leverage on the possibility of reducing the adverse environmental impact occasioned by waste generation and ensuring production of renewable and sustainable energy while achieving circular economy. Solid waste management becomes a major challenge in a country with increasing population and simultaneously striving for economic development.  Many studies indicate that solid waste generation rate is influenced to a large extent by the level of industrialization, habits of public and climatic conditions.</p>','no_image.jpg','Green_and_clean_1702627480.docx',NULL,NULL,NULL,1,2,1,3,'IJRTMR',2,1,1,5,NULL,NULL,NULL,0,136,NULL,'2023-12-15 08:04:40','2023-12-16 03:52:45'),(125,1,137,NULL,'Software Testing  ( An Enrichment towards Quality )','<p><br><br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Software Testing&nbsp; ( An Enrichment towards Quality ) <br><br><br>Contents :-<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Definition <br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Need <br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Testing techniques<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Software testing techniques <br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Software testing terms <br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Role of software testing <br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Software testing technique&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Advantages <br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Conclusion <br><br><br><br><br><br>Definition :<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; It is a process to check whether&nbsp; deliverable product( S/W ) matches expected requirements with assurance that deliverable product ( S/W ) is defect free.<br><br>&nbsp;<br>Need :<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; A study conducted by NIST ( National Institute of Standards &amp; Technology ) states that overall&nbsp; 1/3 of budget is wasted due to software bugs therefore software testing is necessary .<br>&nbsp;&nbsp; It is important to check the severity of the error &amp; its adverse effect.<br><br><br>&nbsp;Testing technique <br><br>&nbsp;&nbsp;&nbsp;&nbsp; It is usally 5 dimension system&nbsp; for any kind of testing &amp; they are as follows :<br><br>i)&nbsp; Tester <br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; It is a human element which performs testing.<br>ii) Coverage<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; It is talk about components&nbsp; to be getting covered.<br>Iii)&nbsp; Threats ( Potential problems ) <br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; It is source of problem <br>Iv) Activity <br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; It is plan for testing (way to &amp;&nbsp; how to test )<br><br>v) Evaluation<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; It is all about comparing results if testing is successful or anti of it. <br><br><br><br><br><br><br><br><br><br>&nbsp;Software Testing Technique ( Method ) <br><br>It all depends upon requirements of software&nbsp; to choose a suitable software technique , there are several types of testing technique available but we focus on :<br><br>I) Black Box&nbsp; Testing<br>II) White Box Testing<br><br>I) Black Box Testing<br><br>i) It is one of software testing technique ( method ) where , the tester analysis the functionality without&nbsp; knowing its internal design .<br>ii) It is&nbsp; also called as specification testing&nbsp; technique.<br>Iii) Example : <br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Equivalence partition <br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Boundary value analysis <br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Error Guessing &nbsp;<br><br>II) White box Testing<br><br>i) It is one of another software testing technique ( method ) where ,&nbsp; the&nbsp; tester should be knowledgeable of internal design &amp; analyzes during testing .<br>ii) It is also called as structural testing technique<br>iii) Example :<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Statement coverage <br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Branch coverage <br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Path coverage <br>&nbsp;<br>Software Testing Terms <br><br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; The following terms are commonly used in software testing :<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 1) Debugging<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2) Testing<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 3) Review<br><br>1) Debugging<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; i) It&nbsp; is a part of the development process that identifies , analyzes and removes an&nbsp; error .<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ii)&nbsp; It is conducted by developers.<br>2) Testing<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; i)&nbsp; It is process of the activity of identifying defects .<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ii) It is performed by tester.<br>3) Review<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; i) It can be performed on deliverables such as documents , code and test cases .<br>ii)&nbsp; It is also known as a static testing technique where one should not required executing the code.<br><br><br><br><br><br><br><br><br><br>&nbsp;Role of software testing <br><br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Every software testing bonded by following <br><br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 1) Identify defects <br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2) meet users requirement <br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 3) increase quality <br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 4) Reduce failures <br><br><br><br><br><br>Advantages <br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; It is a process rather than a activity which has following advantages :-<br><br>i) Customer satisfaction :<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; The main aim of software testing is to give best user experience for deliverable product. This can be achieved&nbsp; through software testing.<br><br>ii) Quality definiteness :<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; The software testing will ensures a quality deliverable product is given to customers.<br>&nbsp; <br>iii) Minimize security vulnerabilities :<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Insecure&nbsp; software can leave vulnerabilities that can cause the source for delivering the malicious&nbsp; code , which can be prevented with proper software testing.<br><br>iv) Early stage defect identification :<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Software testing is imperative process which identifies defects&nbsp; in the deliverable product&nbsp; so it can be fixed before it is delivered.<br><br>&nbsp;v)cost effective <br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; It is cost effective i.e. many times find in &amp; fixing bug in software development process&nbsp; may results into another defect , if these defect identified&nbsp; in early defect identification stage then&nbsp; testing cost may be at lower side.<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;<br><br>&nbsp; Conclusion :<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; As we know any user who uses the software product do except it as an error free or&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; defect – free,&nbsp; With the help software testing it will ensure that quality assurance factor will improved .<br><br><br><br><br><br></p>','no_image.jpg','Software_Testing_1703066137.doc',NULL,NULL,NULL,1,2,1,1,'IJIRE',2,1,1,5,NULL,NULL,NULL,0,137,NULL,'2023-12-20 09:55:37','2023-12-21 10:18:01'),(126,1,139,NULL,'REVIEW ON DETECTION AND RECTIFICATION OF DISTORTED FINGERPRINT','<p>Elastic distortion of fingerprints is one of the major causes for false non-match. While this problem affects all fingerprint recognition applications, it is especially dangerous in negative recognition applications, such as watch list and duplication applications. In such applications, malicious users may purposely distort their fingerprints to evade identification. In this paper, we proposed novel algorithms to detect and rectify skin distortion based on a single fingerprint image. Distortion detection is viewed as a two-class classification problem, for which the registered ridge orientation map and period map of a fingerprint are used as the feature vector and a SVM classifier is trained to perform the classification task. Distortion rectification (or equivalently distortion field estimation) is viewed as a regression problem, where the input is a distorted fingerprint and the output is the distortion field. To solve this problem, a database (called reference database) of various distorted reference fingerprints and corresponding distortion fields is built in the offline stage, and then in the online stage, the nearest neighbor of the input fingerprint is found in the reference database and the corresponding distortion field is used to transform the input fingerprint into a normal one.</p>','no_image.jpg','REVIEW_PAPER_ON_RESEARCH_METHODOLOGY_Jinsha_(1)_(1)_1703257763.docx',NULL,NULL,NULL,1,2,1,6,'INDJCST',2,1,1,15,'2024-01-19','<p><b>Published Article Details:\r\n</b></p><p>INDJCST Journal Link: <span style=\"background-color: rgb(255, 255, 0);\"><a href=\"https://indjcst.com/archives?year=2024&amp;volume=3&amp;issue=1\" target=\"_blank\">Click Here</a>\r\n</span></p><p>FDRP Website Link: <span style=\"background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/indjcst/archives?year=2024&amp;volume=3&amp;issue=1\" target=\"_blank\">Click Here</a></span></p><p><b>\r\n</b></p><p><b>\r\n</b></p>',NULL,1,139,1,'2023-12-22 15:09:23','2024-01-19 06:22:06'),(127,15,140,NULL,'Effect of District Institute of Education and Training on development of teacher\'s competency at elementary level','<p>Teachers are the front -line providers of quality education . They constitute the single largest input of the endeavor for improving the quality and relevance of the education system . Quality of education , in its broadest sense , depends to a considerable extent, on the quality of teaching workforce . Teacher \'s competency and commitment are functions of teacher education programme , its pre -service and in- service components . The best of curriculum , textbooks and infrastructure support system are of little significance without the alchemy of teacher \'s reflective thinking and pedagogical skills . Teacher preparation and teacher development are the critical components of a sound system of teacher education . Teacher Education Institution plays a vital role in creating or preparing teachers of future generation . Teacher Education Institutions like College of Teacher Education (C .T .Es ), Institute of Advanced Studies in Education (I.A .S.Es ), District Institute of Education and Training (D.I.E.Ts), Elementary Teacher Education Institution (E.T.E.Is) and Block Institute of Education and Training (B .I.E .TS ) have important role in capacity building of teachers . Teacher Education institutions serve as key change agents in transforming education and society . DIET plays an important role in developing teacher\'s competency at elementary level .</p>','no_image.jpg','EFFECT_OF_TEACHER_EDUCATION_INSTITUTIONS_IN_CAPACITY_BUILDING_OF_TEACHERS_5_1703277418.docx',NULL,NULL,NULL,1,2,1,3,'IJRTMR',2,1,2,15,'2023-12-25','<p><b style=\"color: rgb(0, 0, 255); background-color: rgb(239, 239, 239);\">Published Article Details:\r\n</b></p><p>IJRTMR Journal Link: <span style=\"background-color: rgb(255, 255, 0);\"><a href=\"https://ijrtmr.com/archives?paperid=1509153130052799739\" target=\"_blank\">Click Here</a>\r\n</span></p><p>FDRP Website Link: <span style=\"background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijrtmr/archives?paperid=1509153130052799739\" target=\"_blank\">Click Here</a>\r\n</span></p><p>Crossref Link: <span style=\"background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/?from_ui=&amp;q=10.59256%2Fijrtmr.20230306002\" target=\"_blank\">Click Here&nbsp;</a></span> (Please check after 48hrs)\r\n</p><p><br></p>','paid-2',1,140,1,'2023-12-22 20:36:58','2023-12-25 05:00:18'),(130,1,141,NULL,'Behavioral Analysis of the Audible Sound with Remedial Action of the Common Acoustical Defects','<p style=\"text-align: justify; \">When the acoustics are applied to any of the buildings, it produces optimum contingencies for producing and listening to vocals, any instrumental sound or recorded song in any cinema. The planning of acoustical design and construction of the building mainly provides to eradicate the noise level below the permissible level. And due to a regular use of these various instruments like frequency modulations, sci-fi movies, heavy machineries, and vehicles that produces noise, it is essential for contemporary era to improve the acoustical conditions of the building by removing the acoustical defects. This paper will explore the typologies of noise and on the other hand it will showcase the behavior of audible sound, factors that affect the same and common acoustical defects with its remedial actions.\r\n</p><p style=\"text-align: justify; \">A good architectural acoustic design requires an appropriate combination of absorptive, reflective, and diffusive surfaces. Hence, for the better acoustical upshot the construction and implication of sound osmotic and sound reflective materials should be carefully selected and placed. This will lead us to providing a better quality of audio-visual sensations to the viewers and listeners. Optimum planning for acoustics can reduce or completely pulling up by the root defects related to sound which is then so called as acoustical defects.\r\n</p><p style=\"text-align: justify; \">Key Word: Acoustics, Acoustical Defects, Remedial Actions, Acoustical Materials.\r\n</p><p style=\"text-align: justify; \"><br></p>','no_image.jpg','IJRTMR_Manuscript_Behavioral_Analysis_of_the_Audible_Sound_with_Remedial_Action_of_the_Common_Acoustical_Defects_1703318429.docx',NULL,NULL,NULL,1,2,1,3,'IJRTMR',2,1,2,15,'2023-12-26','<p><b style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 255);\">Published Article Details:\r\n</b></p><p>IJRTMR Journal Link: <span style=\"background-color: rgb(255, 255, 0);\"><a href=\"https://ijrtmr.com/archives?paperid=7752793213493885965\" target=\"_blank\">Click Here</a>\r\n</span></p><p>FDRP Website Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijrtmr/archives?paperid=7752793213493885965\" target=\"_blank\">Click Here</a>\r\n</span></p><p>Crossref Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/?from_ui=&amp;q=10.59256%2Fijrtmr.20230306003\" target=\"_blank\">Click Here</a></span>  (Please check after 48hrs)\r\n</p><p><br></p>','paid-2',1,141,1,'2023-12-23 08:00:29','2023-12-26 07:30:39'),(131,2,142,NULL,'Review on RSA cryptography, steganography and compression techniques','<p>One of the earliest public key cryptosystems still in use for safe data transfer is called RSA (Rivest–Shamir–Adleman). Information hiding is a component of steganography. Since compressed data is easier to handle and more secure, data compression is a crucial component of information security. Efficient, safe, and readily connectable data is produced via effective data compression technology. Compression algorithm approaches come in two flavours: lossy and lossless. These methods are applicable to any type of data format, including audio, video, text, and image files. This study\'s primary goal was to decrease the amount of physical space on different storage devices and the amount of time it takes to transport data over the Internet while completely guaranteeing that the data would be encrypted and hidden from prying eyes. In this paper, the secret massage is encrypted using RSA cryptography and compressed using Huffman coding. A cover image is compressed using Discrete Wavelet Transform (DWT). The compressed encrypted message is embedded into an image using Least Significant Bit (LSB).</p>','no_image.jpg','Review_paper_CSE_Thaslima_1703332127.pdf',NULL,NULL,NULL,1,2,2,6,'INDJCST',2,1,1,16,NULL,NULL,NULL,1,142,NULL,'2023-12-23 11:48:47','2024-02-01 16:10:29'),(132,7,148,NULL,'Analytical Method Verification -A Titrimetric Case Study','<p>A verification procedure for titration method is illustrated which helps the testing laboratories.This is in compliance with ISO 17025 standard&nbsp;</p>','no_image.jpg','Analytical_Method_Verification_1703899133.docx',NULL,NULL,NULL,1,2,1,1,'IJIRE',4,1,2,5,NULL,NULL,NULL,0,148,NULL,'2023-12-30 01:18:53','2024-01-02 07:53:37'),(133,1,153,NULL,'EMBEDDING ARTIFICIAL INTELLIGENCE FOR PERSONAL VOICE ASSISTANT USING NLP','<p style=\"text-align: justify; \">&nbsp;&nbsp;&nbsp;&nbsp;The voice assistance is an software which is able to provide a detailed response as a voice based output according to an instruction in a prompt. To seamless integration of quick responses to queries and up-to-date weather information enhances daily routines, promoting efficiency and convenience. To achieve these capabilities, technologies like NLTK, pyttsx3, and speech recognition libraries play a pivotal role. To summarize, the convergence of these tools is gradually transforming the futuristic concept of an indispensable personal assistant into an attainable reality. AI technologies have revolutionized digital assistant interactions, but as they integrate into daily life, addressing bias, ambiguity, and ethics becomes crucial.</p>','no_image.jpg','IJIRE_Manuscript_Template_new_1704447432.docx',NULL,NULL,NULL,1,2,1,1,'IJIRE',1,1,1,15,'2024-01-07','<p><b>Published Article Details:\r\n</b></p><p>IJIRE Journal Link: <a href=\"https://theijire.com/archives?year=2024&amp;volume=5&amp;issue=1\" target=\"_blank\">Click Here</a><span style=\"background-color: rgb(255, 255, 0);\"></span></p><p>FDRP Website Link: <span style=\"background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijire/archives?paperid=1345359337585067241\" target=\"_blank\">Click Here</a>\r\n</span></p><p>Crossref Link: <span style=\"background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/?from_ui=&amp;q=10.59256%2Fijire.20240501001\" target=\"_blank\">Click Here</a></span> (Please check <a href=\"https://search.crossref.org/?from_ui=&amp;q=10.59256%2Fijire.20240501001\" target=\"_blank\">after 48hr</a>s)</p><p>\r\n</p><p>\r\n</p><p>\r\n</p>','paid-2',1,153,1,'2024-01-05 09:37:12','2024-01-06 14:51:21'),(134,11,154,NULL,'Social Distance and Notification Alerting System using IoT','<p style=\"text-align: justify; \"><i>Coronavirus (COVID-19) a deadly disease originated in China has spread exponentially across the world since it started, affecting people\'s lives, social economies, and medical systems greatly. So far, incredibly little information about this infection is being considered and extraordinary efforts are being made by foundations of government and clinical examination to discover immunizations and solutions to prevent further spread of this disease among individuals, thus reducing the amount of passages due to this disease. The doctors and researchers have suggested that in the absence of therapeutic drugs the only possible and effective way to reduce the disease from further spreading is to maintain social distancing among people. To relieve the blend of vulnerable and irresistible people and the danger of airborne particles coming down with the infection, it is encouraged to keep up at any rate 6 feet of gap between the individuals in open regions. Therefore, keeping this in mind this project mainly focuses on developing a social distance surveillance system using ultrasonic sensor  and deep techniques that focus on monitoring the distance maintained by people in public areas like supermarkets and other workplaces. This automated system, when incorporated into the local area, identifies people in the Iot technology and monitors providing alerts about distance violation. In case of excessive violations, it sends an SMS alert notification to the assigned person for further measures to be taken regarding the situation. Through this system, the spread of COVID-19 could be reduced to a greater extent.</i></p>','no_image.jpg','Social_Distance_and_Notification_Alerting_System_using_Iot_1704531384.docx',NULL,NULL,NULL,1,2,1,2,'IJSREAT',2,1,1,5,NULL,NULL,NULL,0,154,NULL,'2024-01-06 08:56:24','2024-01-07 04:04:52'),(136,8,156,NULL,'Stabilization of Expansive Soil with Micro Silica, Lime and Fly Ash for Pavement','<p style=\"text-align: justify; \">Geotechnical Engineering properties of soft clayey soil deposits such as black cotton soil may need to be improved by stabilization to make such soils suitable for construction of road pavements. Stabilization of such soils has been traditionally relied on treatment with lime, cement and waste materials such as fly ash. Micro silica is waste material obtained from electric arc furnaces. This paper presents the results of stabilization of local black cotton soil with lime, fly ash and micro silica. Series of laboratory tests have been conducted with varying percentage of these stabilizers, added individually and in combinations, to determine their optimum percentages. From the results, it is observed that CBR value, for both soaked and unsoaked conditions, increases substantially by addition of 5% micro silica along with 3% fly ash and 3% lime. The pavement designed with these improved values of CBR indicated a marked reduction in its thickness leading to economy in the construction of road pavements on or using soft clayey soils .</p>','no_image.jpg',NULL,NULL,NULL,NULL,1,2,2,3,'IJRTMR',5,1,2,3,NULL,NULL,NULL,0,156,NULL,'2024-01-08 10:31:38','2024-02-04 05:05:52'),(137,1,159,NULL,'Smart baby cradle using sensor technology','<p>&nbsp;A cradle is a device designed to help babies fall\r\n</p><p>asleep, employing a gentle side-to-side rocking motion. However, it\r\n</p><p>demands considerable physical effort from parents to manually\r\n</p><p>generate this swinging motion. Additionally, constant supervision is\r\n</p><p>required to monitor the baby\'s activities when they are placed inside\r\n</p><p>the cradle. In the contemporary age of technological advancement,\r\n</p><p>parents frequently grapple with a myriad of challenges in balancing\r\n</p><p>their professional responsibilities with the nurturing needs of their\r\n</p><p>children.\r\n</p><p>Our paper aims to address the prevalent issues faced by parents by\r\n</p><p>introducing an innovative IoT-based Smart Cradle Monitoring\r\n</p><p>System. The key objective is to alleviate the parenting challenges by\r\n</p><p>creating a solution that aids in the seamless monitoring of infants.\r\n</p><p>The Smart Cradle features an automated swinging mechanism\r\n</p><p>triggered by the detection of a baby\'s crying sound. Additionally, it\r\n</p><p>incorporates a built-in camera to provide continuous surveillance,\r\n</p><p>empowering parents with an enhanced ability to keep a vigilant eye\r\n</p><p>on their child. To achieve this functionality, we have seamlessly\r\n</p><p>integrated components such as Arduino, sound sensors, wetness\r\n</p><p>sensors, and the swinging mechanism, among other electronic\r\n</p><p>elements, into the traditional cradle design. This upgraded solution\r\n</p><p>not only offers heightened efficiency and reliability but also surpasses\r\n</p><p>the capabilities of conventional cradles, providing parents with a\r\n</p><p>more effective means of caring for their infants</p>','no_image.jpg','MB0075_RESEARCH_PAPER_1_annu_1_1704881761.docx',NULL,NULL,NULL,1,2,2,5,'INDJECE',1,1,2,2,NULL,'<p><b style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 255);\">Note:</b></p><p>Dear Author. Please decrease plagiarism to less than 5%. re-submit .&nbsp; need plagiarism report; please click files tab &amp; download&nbsp;</p>',NULL,0,159,1,'2024-01-10 10:16:01','2024-02-01 15:53:21'),(138,1,157,NULL,'Analysis of Pedestrian Steel Bridge subjected the Seismic Load and Wind Load using Damper at different Span.','<p>A Pedestrian steel truss bridge model was created by using structural analysis by software. With the similar loading and support condition the 3D model was analyzed for different span like 20m, 25m,30m the basic significance has been given decreases the response of structure member by providing damper at different span I section Girder, steel plate thickness. Steel girder and M40 grade of concrete is used for column section in Etab software. The dynamic loading caused by moving pedestrian and earthquake and wind load.\r\n</p><p>Excessive vibration in footbridges usually occurs when they are subjected to rhythmic dynamic loads caused by human activities like walking and running. In order to mitigate the human induced vibrations in footbridges, an increase in the damping ratio is often suggested as the most economical approach. Tuned mass dampers have been widely used for this purpose; however, their installation and maintenance costs are high. This has encouraged researchers to examine the efficiency of the other types of dampers. Viscoelastic dampers have been successfully employed for vibration mitigation of structures against wind and earthquake loads. \r\n</p><p><br></p>','no_image.jpg','IJRTMR_Manuscript_Template_1704907062.docx',NULL,NULL,NULL,1,2,1,1,'IJIRE',2,1,2,15,'2024-01-12','<p><b style=\"color: rgb(0, 0, 255);\">Published Article Details:\r\n</b></p><p>IJIRE Journal Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://theijire.com/archives?year=2024&amp;volume=5&amp;issue=1\" target=\"_blank\">Click Here</a>\r\n</span></p><p>FDRP Website Link:<a href=\"https://fdrpjournals.org/ijire/archives?year=2024&amp;volume=5&amp;issue=1\" target=\"_blank\"> </a><span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijire/archives?year=2024&amp;volume=5&amp;issue=1\" target=\"_blank\">Click Here</a></span></p><p>\r\n</p><p>\r\n</p>','paid-1',1,157,1,'2024-01-10 17:17:42','2024-01-12 05:45:44'),(139,1,156,NULL,'Stabilization of Expansive Soil with Micro Silica, Lime and Fly Ash for Pavement','<p style=\"text-align: justify; \">Geotechnical Engineering properties of soft clayey soil deposits such as black cotton soil may need to be improved by stabilization to make such soils suitable for construction of road pavements. Stabilization of such soils has been traditionally relied on treatment with lime, cement and waste materials such as fly ash. Micro silica is waste material obtained from electric arc furnaces. This paper presents the results of stabilization of local black cotton soil with lime, fly ash and micro silica. Series of laboratory tests have been conducted with varying percentage of these stabilizers, added individually and in combinations, to determine their optimum percentages. From the results, it is observed that CBR value, for both soaked and unsoaked conditions, increases substantially by addition of 5% micro silica along with 3% fly ash and 3% lime. The pavement designed with these improved values of CBR indicated a marked reduction in its thickness leading to economy in the construction of road pavements on or using soft clayey soils.</p>','no_image.jpg','Priti_Rana__paper_1705040550.docx',NULL,NULL,NULL,1,2,1,3,'IJRTMR',1,1,1,5,NULL,'<p><br></p><p><br></p>',NULL,0,156,1,'2024-01-12 06:22:30','2024-01-25 15:34:11'),(143,1,161,NULL,'Designing a conventional water treatment plant on Orontes River with Around the End Flocculation and horizontal sedimentation basin','<p>In this Research designing the units of a conventional drinking water purification plant facility on Orontes River were made to serve Al-Quser area in Homs city.\r\n</p><p>The treated water is from a surface water supply with accepted pH, conductivity, temperature and hardness levels according to Syrian Standards No 25 and a mediate total suspended solids continent of 330 mg/L, turbidity between 20 and 200 NTU, and color of 50 º, so the water needed a chemical treatment with coagulants The designing flow was about 0 6 m3/h \r\n</p><p>The facilities was suggested based on the water characteristics like the following; First, a mechanical flash mixer; Aluminum sulfate was used as a coagulant based on jar test experiments, Round – to – end flocculating basin, and horizontal sedimentation basin, followed with rapid sand filters The last stage was dieselization of the water using chlorine A detailed calculation is described in this work.\r\n</p><p><br></p>','no_image.jpg','1111111111_1711607679.docx',NULL,NULL,NULL,2,2,1,2,'IJSREAT',4,1,1,5,NULL,NULL,'unpaid-3',0,161,161,'2024-01-14 10:28:25','2024-03-28 06:34:39'),(144,1,164,NULL,'Deep Learning-Based Fruit Quality Classification for Customer Service','<p>Consumers always select and buy good quality fruits and vegetable. Selection criteria depend upon the freshness, shape, appearance, color, aroma and sturdiness at the first go. The taste and the shelf life come after that. As fruits play main role in day to day life, the grading of fruits is necessary in evaluating agricultural produce. The present existing technology are also used for fruit quality managing purpose but they are not more effective. There are some disadvantages like less reliability, less efficiency and less accuracy. In this paper, we would like to present a design and integration fruit quality classification solution for customer service. The purpose of this integration is to develop a service to classify the quality of fruits for customer in applications in agriculture, market or logistic.</p>','no_image.jpg','Deep_Learning_Based_Fruit_Quality_Classification_for_Customer_Service_1705472033.docx',NULL,NULL,NULL,1,2,1,3,'IJRTMR',1,1,1,5,NULL,NULL,'unpaid-3',0,164,NULL,'2024-01-17 06:13:53','2024-02-04 05:04:42'),(145,1,168,NULL,'CUSTOM VOICE CLONER','<p style=\"text-align: justify; \">The CUSTOM VOICE CLONER is based on voice signal speech synthesizer. It is a technology that converts text into audible speech, simulating human speech characteristics like pitch and tone. It finds applications in virtual assistants, navigation systems, and accessibility tools. Building one in Python typically involves Text-to-Speech (TTS) libraries such as gTTS, pyttsx3, or platform-specific options for Windows and macOS, offering easy text-to-speech conversion.However, TTS libraries might lack customization and voice quality needed for advanced projects. For more sophisticated applications, custom voice synthesizers can be built using deep learning techniques like Tacotron and WaveNet. These models learn speech nuances for more natural output.Creating a custom voice synthesizer is challenging, requiring high-quality training data, machine learning expertise, and substantial computational resources. It goes beyond generating speech to convey emotions and nuances in pronunciation for natural and expressive voices.</p>','no_image.jpg','CVC_1705554872.docx',NULL,NULL,NULL,1,2,1,1,'IJIRE',1,1,1,15,'2024-01-19','<p><b style=\"color: rgb(0, 0, 255);\">Published Article Details:\r\n</b></p><p>IJIRE Journal Link: <span style=\"background-color: rgb(255, 255, 0);\"><a href=\"https://theijire.com/archives?year=2024&amp;volume=5&amp;issue=1\" target=\"_blank\">Click Here</a>\r\n</span></p><p>FDRP Website Link: <span style=\"background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijire/archives?year=2024&amp;volume=5&amp;issue=1\" target=\"_blank\">Click Here</a>\r\n</span></p><p>Crossref Link: <span style=\"background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/?from_ui=&amp;q=10.59256%2Fijire.20240501002\" target=\"_blank\">Click Here</a></span> (Please check after 48hrs)</p><p>\r\n</p><p>\r\n</p><p>\r\n</p>','paid-2',1,168,1,'2024-01-18 05:14:32','2024-01-19 07:04:21'),(146,1,172,NULL,'Review Paper on Comparison of Asymmetric and Symmetric RCC Building with Soil Structure Interaction by Dynamic Loading.','<p>Multi story building are very much common in the urban area nowadays due to scarcity of land and increase in the cost of land. Most of the structure are not in regular either in shape and mass distribution. But the performance of structure will not be good as regular symmetric type structure. A plan asymmetric having L shaped normally exhibits a complex response under dynamic loads. In this research work, effect of change of height and change of number of bays are studied separately with soil structure interaction. In recent years, due to demand in aesthetical view and architectural design, people want unique in building so the building are designed with irregularities. Using software is used for modelling and studying the various parameter such as story drift, displacement, time period and story shear \r\n</p><p><br></p><p>\r\n</p>','no_image.jpg','MAHESHWARI_MANUSCRIPT_1705741406.docx',NULL,NULL,NULL,1,2,1,1,'IJIRE',2,1,2,15,'2024-01-21','<p><b style=\"color: rgb(0, 0, 255);\">Published Article Details:\r\n</b></p><p>IJIRE Journal Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://theijire.com/archives?year=2024&amp;volume=5&amp;issue=1\" target=\"_blank\">Click Here</a>\r\n</span></p><p>FDRP Website Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijire/archives?year=2024&amp;volume=5&amp;issue=1\" target=\"_blank\">Click Here</a></span></p><p>\r\n</p><p>\r\n</p>','paid-1',1,172,1,'2024-01-20 09:03:26','2024-01-20 17:06:34'),(147,8,176,NULL,'Green synthesis of Silver nanoparticles by using fruit peel waste: Banana ( Musa paradisiaca) and Mosambi ( Citrus limetta)','<p>This study reveals an eco-friendly and sustainable strategy for the synthesis of silver nanoparticles (AgNPs) using fruit peel waste derived from banana (Musa Paradisiaca) and mosambi (Citrus limetta) sweet lime. Without resorting to hazardous chemicals, this method capitalizes on the reducing and capping capabilities of the bioactive substances present in fruit peel extracts. These extracts were collected, cleaned, dried, and aqueous extracts were prepared for the synthesis process. UV-Vis spectroscopy was utilized to monitor the formation of AgNPs, with absorption peaks at 190–900 nm, confirming the successful synthesis. FTIR spectroscopy was employed to elucidate the functional groups responsible for the reduction and stabilization of AgNPs, revealing prominent peaks corresponding to biomolecules present in fruit peel extracts. These findings suggest the active participation of bioactive compounds in the reduction of silver ions and stabilization of the resulting nanoparticles.</p><p>The combined results of UV and FTIR spectroscopy validated the green synthesis of AgNPs using Banana and Mosambi Sweet Lime peel wastes. The functional groups identified in fruit peel extracts play a crucial role in the synthesis and stabilization processes, offering a sustainable and cost-effective approach for nanoparticle production. This environment-friendly method has promising applications, including antimicrobial agents and biomedical applications, and contributes to the advancement of green nanotechnology.            The keywords for this study were fruit peel waste, mosambi, green synthesis, and silver nanoparticles.</p>','no_image.jpg',NULL,NULL,NULL,NULL,1,2,2,3,'IJRTMR',1,1,1,3,NULL,NULL,NULL,0,176,NULL,'2024-01-21 12:09:56','2024-01-22 15:10:43'),(148,4,178,NULL,'Omnichannel retailing : evolutionary journey from 1980 to 2023','<p>Abstract:  \r\n</p><p>&nbsp;The purpose of this article comprehensively evaluates the transformation of the retail channel through 1980 to 2023, identifying key milestones and trends that have shaped the Omni channel landscape. Over the past few decades, the retail industry has undergone significant transformation due to advances in technology and changing consumer preferences. Omni channel retailing is a retail strategy that seeks to provide customers with a seamless shopping experience across all channels, including physical stores, online stores, mobile apps and social media. The goal of Omni channel retailing is to make it easy for customers to shop how they want, when they want, and from wherever they want. The objective is to comprehensively evaluate how retail channels have changed over this period, highlighting the significant turning points and patterns that have informed the Omni channel landscape. Throughout a historical analysis and review of relevant literature, it examines the crucial developments, challenges, and unborn directions of this transformative retail approach. This article argues that Omni channel retailing has evolved a continuous process of adaption and innovation, shaped by technological advances, changing consumer preferences and competitive pressures. The end result will be a comprehensive understanding of the Omni channel phenomenon covering its historical development, driving forces, key challenges and strategies for successful implementation. In its conclusion, it highlights the critical factors for success in an Omni channel environment and emphasizes the need to continuously adapt and evolve in the face of a dynamic retail industry. The ultimate objective of this study is to provide retailers with useful information to help them effectively deal with the ever-changing retail industry and maximize their Omni channel experience.\r\n</p><p><br></p>','no_image.jpg','Omnichannel_retailing_evolutionary_journey_from_1980_to_2023_1705943973.docx',NULL,NULL,NULL,1,2,1,3,'IJRTMR',2,1,3,5,NULL,NULL,'unpaid-3',0,178,NULL,'2024-01-22 17:19:33','2024-01-24 04:07:53'),(149,1,180,NULL,'BLYNK RFID AND RETINAL LOCK ACCESS SYSTEM','<p>The BLYNK RFID AND RETINAL LOCKACCESS SYSTEM describes a digital door lock system that uses an ESP32-CAM module, which is a budget friendly development board with a very small size camera and a micro-SD card slot. The system uses retinal recognition technology to detect the retinal of the person who wants to access the door. The AI-Thinker ESP32-CAM module takes pictures of the person and sends them to the owner via the Blynk application installed on their mobile phone. The owner can then grant permission to access the door based on the person’s identity.When deploying your Blynk RFID and retinal scanner project, it\'s important to consider scalability and maintenance. As your user base and access requirements may change over time, plan for future expansion and updates. Regularly review and update your system\'s firmware, libraries, and security measures to stay ahead of potential vulnerabilities and evolving best practices in access control.Monitoring and auditing your system\'s usage is crucial. The Blynk platform can help you gather data on access attempts and system performance, allowing you to analyze the data for any anomalies and potential security breaches. This data can be valuable for compliance, troubleshooting, and performance optimization.</p>','no_image.jpg','RFID_1706004592.docx',NULL,NULL,NULL,1,2,1,1,'IJIRE',1,1,1,15,'2024-01-24','<p><b style=\"color: rgb(0, 0, 255);\">Published Article Details:\r\n</b></p><p>IJIRE Journal Link: <span style=\"background-color: rgb(255, 255, 0);\"><a href=\"https://theijire.com/archives?year=2024&amp;volume=5&amp;issue=1\" target=\"_blank\">Click Here</a>\r\n</span></p><p>FDRP Website Link:<span style=\"background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijire/archives?year=2024&amp;volume=5&amp;issue=1\" target=\"_blank\"> Click Here</a>\r\n</span></p><p>Crossref Link: <span style=\"background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/?from_ui=&amp;q=10.59256%2Fijire.20240501003\" target=\"_blank\">Click Here</a></span> (Please check <a href=\"https://search.crossref.org/?from_ui=&amp;q=10.59256%2Fijire.20240501003\" target=\"_blank\">after 24 h</a>rs.)</p><p>\r\n</p><p>\r\n</p><p>\r\n</p>','paid-2',1,180,1,'2024-01-23 10:09:52','2024-01-24 14:40:02'),(150,1,183,NULL,'ML-Driven Facial Synthesis From Spoken Words Using Conditional GANs.','<p>&nbsp;A Human Brain may translate a person\'s voice to its corresponding face image even if never seen before. Training adeep learning network to do the same can be used in detecting human faces based on their voice, which may be used in findinga criminal that we only have a voice recording for. The goal in this paper is to build a Conditional Generative Adversarial Network that produces face images from human speeches which can then be recognized by a face recognition model to identifythe owner of the speech. The model was trained, and the face recognition model gave an accuracy of 80.08% in training and 56.2% in testing. Compared to the basic GAN model, this model has improved the results by about 30%.</p><p><span style=\"font-size: 0.875rem;\">&nbsp; Key Word: Face image synthesis, Generative adversarial network, Face Recognition</span></p><p><br></p>','no_image.jpg','Review_Paper_work_1706112635.docx',NULL,NULL,NULL,1,2,1,1,'IJIRE',2,1,2,15,'2024-01-26','<p><b style=\"color: rgb(0, 0, 255);\">Published Article Details:\r\n</b></p><p>IJIRE Journal Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://theijire.com/archives?year=2024&amp;volume=5&amp;issue=1\" target=\"_blank\">Click Here</a>\r\n</span></p><p>FDRP Website Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijire/archives?year=2024&amp;volume=5&amp;issue=1\" target=\"_blank\">Click Here</a>\r\n</span></p><p>Crossref Link(DOI): <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/?from_ui=&amp;q=10.59256%2Fijire.20240501004\" target=\"_blank\">Click Here</a></span><a href=\"https://search.crossref.org/?from_ui=&amp;q=10.59256%2Fijire.20240501004\" target=\"_blank\"> </a>(Please check after 24 hrs.)</p><p>\r\n</p><p>\r\n</p><p>\r\n</p>','paid-2',1,183,1,'2024-01-24 16:10:35','2024-01-25 12:16:30'),(151,3,184,NULL,'Phytoconstituents developed nanoparticles for the treatment of cancer','One of the main sourses of death in the world is cancer. There are numerous medication classes available to treat various cancer kinds. At the moment, scientists are focusing a lot of effort on developing medications at the nanoscale level in order to lower their concentrations and improve target specificity. Nanostructures, nanomaterials, and nanoparticles are just a few of the many subdisciplines that make up the exciting and rapidly expanding science of nanotechnology. Because of these materials\' size, shape, and possible effectiveness, they have become more well-known in science. As a result of the greater efficacy and fewer side effects of nanodrugs when compared to other commercial cancer drugs, the field of nanomedicine—which involves the use of various types of nanoparticles to treat cancer and cancerous cells—has gained significant traction. In this review, various medicinal plants and their active compounds are discussed in relation to their anticancer activities. Severe concerns about current chemotherapeutics are driving researchers to develop alternative therapeutics with better efficacy and safety<br>','no_image.jpg','Phytoconstituents_Developed_Nanoparticles_for_the_Treatment_of_Cancer_m.pharm_1706113462.docx',NULL,NULL,NULL,1,2,1,3,'IJRTMR',2,1,1,5,NULL,NULL,NULL,0,184,NULL,'2024-01-24 16:24:22','2024-01-25 09:56:14'),(152,1,158,NULL,'SMART BABY CRADLE USING SENSOR TECHNOLOGY','<p>In the contemporary age of technological advancement, parents frequently grapple with a myriad of challenges in balancing their professional responsibilities with the nurturing needs of their children. Our project aims to address the prevalent issues faced by parents by introducing an innovative IoT-based Smart Cradle Monitoring System. The key objective is to alleviate the parenting challenges by creating a solution that aids in the seamless monitoring of infants.\r\n</p><p>The Smart Cradle features an automated swinging mechanism triggered by the detection of a baby\'s crying sound. Additionally, it incorporates a built-in camera to provide continuous surveillance, empowering parents with an enhanced ability to keep a vigilant eye on their child. To achieve this functionality, we have seamlessly integrated components such as Arduino, sound sensors, wetness sensors, and the swinging mechanism, among other electronic elements, into the traditional cradle design. This upgraded solution not only offers heightened efficiency and reliability but also surpasses the capabilities of conventional cradles, providing parents with a more effective means of caring for their infants.\r\n</p><p><br></p><p>\r\n</p>','no_image.jpg','RESEARCH_PAPER_1706265432.docx',NULL,NULL,NULL,1,2,1,1,'IJIRE',1,1,2,15,'2024-01-28','<p><b style=\"color: rgb(0, 0, 255);\">Published Article Details:\r\n</b></p><p>IJIRE Journal Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://theijire.com/archives?year=2024&amp;volume=5&amp;issue=1\" target=\"_blank\">Click Here</a>\r\n</span></p><p>FDRP Website Link:<a href=\"https://fdrpjournals.org/ijire/archives?year=2024&amp;volume=5&amp;issue=1\" target=\"_blank\"> </a><span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijire/archives?year=2024&amp;volume=5&amp;issue=1\" target=\"_blank\">Click Here</a>\r\n</span></p><p>Crossref Link(DOI): <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/?from_ui=&amp;q=10.59256%2Fijire.20240501005\" target=\"_blank\">Click Here</a></span> (Please check after 24 hrs.)</p><p>\r\n</p><p>\r\n</p><p>\r\n</p>','paid-2',1,158,1,'2024-01-26 10:37:12','2024-01-28 13:09:26'),(153,1,187,NULL,'Revolutionizing User Interfaces: Exploring the Latest Trends in Front-End Development','<p>This scientific article serves as an exploration into the dynamic landscape of front-end development, honing in on the contemporary trends and advancements that seek to redefine user interfaces (UIs). The focal point is the profound impact innovative UIs can have on elevating user experience and engagement. Through an in-depth examination of cutting-edge technologies and the emergence of novel design principles, this article aims to furnish valuable insights into the trajectory of front-end development, with potential implications spanning diverse industries.</p><p><br></p><p>The narrative unfolds with a recognition of the pivotal role played by UIs in shaping digital interactions. It emphasizes the imperative for continuous innovation to meet the ever-evolving expectations of users in the modern digital milieu. The objectives of this article are delineated, providing readers with a roadmap for the ensuing exploration of trends in front-end development.</p><p><br></p><p>The historical evolution of user interfaces is scrutinized, tracing their journey from rudimentary command-line interfaces to the sophisticated graphic-based interfaces prevalent today. This historical contextualization sets the stage for comprehending the challenges and breakthroughs that have punctuated the development of UIs over time.</p><p><br></p><p>Current challenges faced by front-end developers take center stage in the third section, elucidating intricacies such as cross-device compatibility, performance optimization, and the critical consideration of accessibility. Acknowledging these challenges serves as a prelude to discussions on how emerging trends can potentially mitigate or overcome these obstacles.</p><p><br></p><p>The advent of artificial intelligence (AI) unfolds in the subsequent section, illuminating how machine learning and natural language processing contribute to the evolution of UI design. Practical examples, including AI-driven chatbots and virtual assistants, underscore the transformative role AI plays in personalizing user interactions and simplifying complex tasks within UIs.</p><p><br></p><p>The exploration then extends to the immersive realms of virtual reality (VR), unraveling how VR and augmented reality redefine UIs by providing captivating and engaging experiences. Real-world applications showcase the potential integration of VR into web and mobile interfaces, offering a glimpse into the future possibilities of UI design.</p><p><br></p><p>Each subsequent section of the article builds upon this foundation, diving into responsive design principles, accessibility considerations, challenges, ethical dimensions, and future directions. The overarching aim is to equip developers, designers, and researchers with the knowledge to navigate the intricate landscape of front-end development and embrace transformative possibilities is§n UI design.</p>','no_image.jpg','Title__Revolutionizing_User_Interfaces__Exploring_the_Latest_Trends_in_Front_End_Development_1706265882.docx',NULL,NULL,NULL,1,2,1,6,'INDJCST',1,1,1,15,'2024-01-31','<p><b style=\"color: rgb(0, 0, 255);\">Published Article Details:\r\n</b></p><p>INDJCST Journal Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://indjcst.com/archives?year=2024&amp;volume=3&amp;issue=1\" target=\"_blank\">Click Here</a>\r\n</span></p><p>FDRP Website Link:<a href=\"https://fdrpjournals.org/indjcst/archives?year=2024&amp;volume=3&amp;issue=1\" target=\"_blank\"> </a><span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/indjcst/archives?year=2024&amp;volume=3&amp;issue=1\" target=\"_blank\">Click Here</a></span></p><p>\r\n</p><p>\r\n</p>','paid-1',0,187,1,'2024-01-26 10:44:42','2024-01-31 06:56:55'),(155,4,188,NULL,'THE EVOLUTION OF SUSTAINABLE FASHION DESIGNING','<p>The fashion industry, a global industry, is driven by innovative architecture, design, and a desire\r\n</p><p>for a symbolic lifestyle. Sustainable fashion design aims to create clothes with minimal\r\n</p><p>environmental impact while maintaining style and quality. This study investigates the evolution of\r\n</p><p>sustainability within the fashion sector, covering 1970-2023. The process of converting fiber into\r\n</p><p>yarn, yarn into fabric, and fabric into garments has been influenced by historical examples of\r\n</p><p>insufficient consideration for sustainable practices. However, the fashion and textile sectors have\r\n</p><p>taken steps to provide sustainable solutions in their manufacturing processes due to growing global\r\n</p><p>interest and consumer awareness. Strategies include fiber creation, garment fabrication, and supply\r\n</p><p>chain management. Sustainable production methods can improve the environment, society, and\r\n</p><p>economy, paving the way for a greener planet. This review presents information from relevant\r\n</p><p>reviews and research articles on sustainable fashion and textile production. It examines current\r\n</p><p>developments in eco-friendly textile and fashion manufacturing, highlighting the responsibilities\r\n</p><p>of producers, retailers, and customers in developing sustainable fashion and textiles.\r\n</p><p>Keywords: sustainability; fashion design; zero-waste; recycling; design management,\r\n</p><p>cradle-to-cradle, slow fashion, Circular economy</p>','no_image.jpg','THE_EVOLUTION_OF_SUSTAINABLE_FASHION_DESIGNING_1706278952.docx',NULL,NULL,NULL,1,2,1,3,'IJRTMR',2,1,1,5,NULL,NULL,'unpaid-3',0,188,NULL,'2024-01-26 14:22:32','2024-02-01 15:46:56'),(156,4,189,NULL,'Tracking the evolution of branding literature','<p>The purpose of this article is to outline the evolution of brand management literature from origin point to today.  It analyzed the changes approaches in brand management literature over the time past. The information attribute changes points are brands as co-created with others, brand as communities, developing an experiencing brands, developing a complex brand, focusing on positive brand outcomes and managing negative brand outcomes, appreciating human-like brand characteristics, introducing new methodological approaches to collect data, using brands for all different natures, and branding in digital era. Changes points and each topic are marked by research literature and brands are become part of everyday vocabulary at the same time branding has been embraced by all the companies and people. Research on branding may open up exiting opportunities with the technology and future developments.&nbsp;&nbsp;</p>','no_image.jpg','225440_1706279194.',NULL,NULL,NULL,1,2,2,3,'IJRTMR',2,3,1,1,NULL,NULL,NULL,0,189,NULL,'2024-01-26 14:26:34','2024-01-27 12:29:53'),(157,4,189,NULL,'Tracking the evolution of branding literature','<p>The purpose of this article is to outline the evolution of brand management literature from origin point to today.  It analyzed the changes approaches in brand management literature over the time past. The information attribute changes points are brands as co-created with others, brand as communities, developing an experiencing brands, developing a complex brand, focusing on positive brand outcomes and managing negative brand outcomes, appreciating human-like brand characteristics, introducing new methodological approaches to collect data, using brands for all different natures, and branding in digital era. Changes points and each topic are marked by research literature and brands are become part of everyday vocabulary at the same time branding has been embraced by all the companies and people. Research on branding may open up exiting opportunities with the technology and future developments.&nbsp;&nbsp;</p>','no_image.jpg','225440_1706279311.',NULL,NULL,NULL,1,2,1,3,'IJRTMR',2,3,1,1,NULL,NULL,NULL,0,189,NULL,'2024-01-26 14:28:31','2024-01-26 14:28:31'),(158,4,189,NULL,'Tracking the evolution of branding literature','<p>The purpose of this article is to outline the evolution of brand management literature from origin point to today.  It analyzed the changes approaches in brand management literature over the time past. The information attribute changes points are brands as co-created with others, brand as communities, developing an experiencing brands, developing a complex brand, focusing on positive brand outcomes and managing negative brand outcomes, appreciating human-like brand characteristics, introducing new methodological approaches to collect data, using brands for all different natures, and branding in digital era. Changes points and each topic are marked by research literature and brands are become part of everyday vocabulary at the same time branding has been embraced by all the companies and people. Research on branding may open up exiting opportunities with the technology and future developments.&nbsp;&nbsp;</p>','no_image.jpg','225440_1706279345.',NULL,NULL,NULL,1,2,2,3,'IJRTMR',2,3,1,1,NULL,NULL,NULL,0,189,NULL,'2024-01-26 14:29:05','2024-01-27 12:31:43'),(159,4,190,NULL,'Digital Marketing in the Health Sciences: Enhancing Patient Empowerment and Engagement','<p>This paper explores the transformative impact of digital marketing in health sciences, reshaping patient-provider dynamics. Technology has revolutionized healthcare communication, granting patients easy access to reliable, personalized information. Leveraging websites, social media, search engines, and email, digital marketing targets specific demographics, fostering personalized interactions and increasing patient engagement. Online communities enable active patient participation, building support networks and facilitating informed decision-making. Healthcare professionals utilize digital channels for timely updates on treatments, advancements, and events, promoting preventive care. Data-driven strategies, employing web analytics and social media metrics, optimize content for patient needs. Despite advantages, challenges include varying accuracy of online health information, emphasizing the need for evidence-based content. Privacy concerns necessitate robust security measures. In conclusion, digital marketing empowers patients, improves healthcare outcomes, and enhances overall experiences in the health sciences.</p>','no_image.jpg','Digital_Marketing_in_the_Health_Sciences__Enhancing_Patient_Empowerment_and_Engagement_1706280773.docx',NULL,NULL,NULL,1,2,1,3,'IJRTMR',1,1,1,15,'2024-01-31','<p><b style=\"color: rgb(0, 0, 255);\">Published Article Details:\r\n</b></p><p>IJRTMR Journal Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://ijrtmr.com/archives?year=2024&amp;volume=4&amp;issue=1\" target=\"_blank\">Click Here</a>\r\n</span></p><p>FDRP Website Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijrtmr/archives?year=2024&amp;volume=4&amp;issue=1\" target=\"_blank\">Click Here</a></span></p><p>\r\n</p><p>\r\n</p>','paid-1',0,190,1,'2024-01-26 14:52:53','2024-01-31 06:59:06'),(160,4,191,NULL,'TRACKING THE EVOLUTION OF BRANDING LITERATURE','<p>The purpose of this article is to outline the evolution of brand management literature from\r\n</p><p>origin point to today. It analyzed the changes approaches in brand management literature\r\n</p><p>over the time past. The information attribute changes points are brands as co-created with\r\n</p><p>others, brand as communities, developing an experiencing brands, developing a complex\r\n</p><p>brand, focusing on positive brand outcomes and managing negative brand outcomes,\r\n</p><p>appreciating human-like brand characteristics, introducing new methodological approaches to\r\n</p><p>collect data, using brands for all different natures, and branding in digital era. Changes points\r\n</p><p>and each topic are marked by research literature and brands are become part of everyday\r\n</p><p>vocabulary at the same time branding has been embraced by all the companies and people.\r\n</p><p>Research on branding may open up exiting opportunities with the technology and future\r\n</p><p>developments.</p>','no_image.jpg','TRACKING_THE_EVOLUTION_OF_BRANDING_LITERATURE_1706282045.docx',NULL,NULL,NULL,1,2,1,3,'IJRTMR',2,1,1,5,NULL,NULL,NULL,0,191,NULL,'2024-01-26 15:14:05','2024-01-31 07:06:04'),(161,4,190,NULL,'The Role of Artificial Intelligence in Revolutionizing Digital Marketing','<p>This exploration delves into the transformative impact of Artificial Intelligence (AI) on digital marketing, showcasing its evolution from automation to personalized, data-driven campaigns. The synergy of AI algorithms with digital strategies reshapes customer connections, transcending immediate engagement to predictive prowess. Efficiency, not merely in speed but in amplifying human creativity, becomes paramount. The narrative unfolds through the lenses of personalization, predictive analytics, AI-driven chatbots, dynamic content optimization, automated email marketing, and AI\'s role in visual and voice search optimization. This comprehensive overview emphasizes the indispensability of AI in navigating the complexities of the digital landscape.</p><p><br></p>','no_image.jpg','The_Role_of_Artificial_Intelligence_in_Revolutionizing_Digital_Marketing_1706282314.docx',NULL,NULL,NULL,1,2,1,3,'IJRTMR',1,1,1,5,NULL,NULL,NULL,0,190,NULL,'2024-01-26 15:18:34','2024-02-01 15:37:50'),(162,15,193,NULL,'The South China Sea Dispute: Balancing National Interests and International','<p><br></p><p>Abstract</p><p>The South China Sea dispute presents a multifaceted geopolitical challenge, characterized by competing national interests and the imperative for international cooperation. This research paper offers a comprehensive analysis of the intricacies surrounding this contentious issue.</p><p>The dispute involves a complex web of territorial claims by China, Taiwan, Vietnam, the Philippines, Malaysia, and Brunei, each driven by distinct national interests. These interests encompass access to valuable resources, including fisheries and hydrocarbons, territorial sovereignty, and strategic advantages in controlling vital trade routes. Historical narratives, domestic pressures, and nationalist sentiments further fuel the competition among these nations, making compromise elusive.</p><p>International cooperation efforts, anchored in the United Nations Convention on the Law of the Sea (UNCLOS) and spearheaded by regional organizations such as the Association of Southeast Asian Nations (ASEAN), have sought to facilitate dialogue among claimant states. External powers, notably the United States, also play a significant role in balancing their interests while advocating for peaceful resolutions.</p><p>However, the equilibrium between national interests and international cooperation remains fragile exacerbated by the involvement of major powers and the ongoing militarization of disputed features. This research paper explores the historical roots of the dispute, analyzes the economic, political, and strategic motivations driving each stakeholder, and assesses the effectiveness of international cooperation initiatives.</p><p>By shedding light on the intricate dance between asserting national interests and nurturing international cooperation, this research contributes to a deeper understanding of one of the most significant geopolitical challenges of our time. It underscores the necessity of continued diplomatic efforts, adherence to established laws, and prioritizing dialogue over unilateral actions in the pursuit of a peaceful and sustainable resolution to the South China Sea dispute.</p><p>Key Word- South China Sea Dispute, National Interests, International Cooperation, Territorial Claims, UNCLOS (United Nations Convention on the Law of the Sea), ASEAN (Association of Southeast Asian Nations), Diplomacy, Regional Security, Maritime Dispute, Geopolitics, Sovereignty, Conflict Resolution, Historical Context, Track-Two Diplomacy, People-to-People Initiatives, Geopolitical Tensions, Regional Stability, Arbitration, Code of Conduct (CoC), Multilateral Negotiations</p>','no_image.jpg','south_china_(2)_1706332293.pdf',NULL,NULL,NULL,1,2,1,3,'IJRTMR',4,1,3,5,NULL,NULL,NULL,0,193,NULL,'2024-01-27 05:11:33','2024-01-28 07:03:04'),(163,1,177,NULL,'\"Advancements in Machine Learning: A Comprehensive Exploration of Methods, Applications, and Future Perspectives\"','<p>Abstract:\r\n</p><p>Machine learning, a specialized subset of artificial intelligence, imparts the ability to machines to learn, while artificial intelligence (AI) encompasses the broader field dedicated to emulating human capabilities. Within AI, machine learning employs computational techniques to instruct computers on learning from their historical experiences. Unlike models based on predetermined equations, machine learning algorithms derive insights directly from data, progressively improving their performance as the volume of learning examples grows. This paper presents a comprehensive overview of the domain, exploring diverse machine learning methodologies such as supervised, unsupervised, and reinforcement learning, along with an examination of various programming languages employed in machine learning applications.\r\n</p><p>Keywords: Machine learning, Artificial intelligence, Computational techniques, Historical experiences, Learning examples, Supervised learning, Unsupervised learning, Reinforcement learning, Programming languages, Machine learning applications</p>','no_image.jpg','1._Advancements_in_Machine_Learning_1706337746.docx',NULL,NULL,NULL,1,2,1,2,'IJSREAT',1,1,2,15,'2024-02-02','<p><span style=\"color: rgb(0, 0, 255);\"><b>Published Article Details:</b></span><br><br>IJSREAT Journal Link: <span style=\"background-color: rgb(255, 255, 0);\"><a href=\"https://ijsreat.com/archives?year=2024&amp;volume=4&amp;issue=1\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link: <span style=\"background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijsreat/archives?year=2024&amp;volume=4&amp;issue=1\" target=\"_blank\">Click Here</a></span><br><br>Crossref Link(DOI): <span style=\"background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/?from_ui=&amp;q=10.59256%2Fijsreat.20240401001\" target=\"_blank\">Click Here</a> </span>(Please check after 24 hrs.)<br></p>','paid-2',1,177,1,'2024-01-27 06:42:26','2024-02-02 07:41:24'),(164,1,177,NULL,'Optimizing the Future: Unveiling the Significance of MLOps in Streamlining the Machine Learning Lifecycle','<p>Abstract: </p><p>As we stand on the precipice of 2024, the technological landscape is abuzz with the convergence of two revolutionary forces: MLOps (Machine Learning Operations) and Generative AI. This potent cocktail promises to reshape the very fabric of artificial intelligence (AI), ushering in a new era of streamlined workflows, boundless innovation, and redefined value delivery. MLOps, a paradigm shift inspired by DevOps principles, emerges as the knight in shining armor, poised to vanquish the challenges plaguing the machine learning lifecycle. By fostering seamless collaboration, agile deployment, vigilant monitoring, and efficient management of models, MLOps lays the groundwork for robust organizational AI strategies. In this paper, we delve deep into the intricate world of MLOps, exploring its genesis, its potential to revolutionize business operations, and its pivotal role in shaping the future of AI.\r\n</p><p>Keywords: MLOps, Machine Learning, Artificial Intelligence, DevOps, Automation, Collaboration, Deployment, Monitoring, Management, Generative AI, Innovation, Value Delivery, Business Optimization.\r\n</p><p><br></p>','no_image.jpg','2._Optimizing_the_Future_1706338344.docx',NULL,NULL,NULL,1,2,1,2,'IJSREAT',1,1,2,15,'2024-02-02','<p><b>Published Article Details:</b><br><br>IJSREAT Journal Link:<a href=\"https://ijsreat.com/archives?year=2024&amp;volume=4&amp;issue=1\" target=\"_blank\"> </a><span style=\"background-color: rgb(255, 255, 0);\"><a href=\"https://ijsreat.com/archives?year=2024&amp;volume=4&amp;issue=1\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link:<span style=\"background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijsreat/archives?year=2024&amp;volume=4&amp;issue=1\" target=\"_blank\"> Click Here</a></span><br><br>Crossref Link(DOI): <span style=\"background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/search/works?q=10.59256%2Fijsreat.20240401002&amp;from_ui=yes\" target=\"_blank\">Click Here</a></span> (Please check after 24 hrs.)<br></p>','paid-2',1,177,1,'2024-01-27 06:52:24','2024-02-02 07:44:11'),(165,1,177,NULL,'A Comparative Study on Loan Status: Utilizing Machine Learning Algorithms for Predictive Analysis','<p>Abstract:\r\n</p><p>This research delves into a comprehensive comparative study focused on predicting loan status through the application of various machine learning (ML) algorithms. The objective is to assess and compare the effectiveness of Decision Trees, Random Forest, Support Vector Machines (SVM), and Gradient Boosting models in determining the likelihood of loan approval or denial. Leveraging a dataset comprising historical loan application data, including applicant demographics, financial history, and loan characteristics, the study conducts rigorous analysis and interpretation of the models\' performance. The results provide valuable insights into the strengths and weaknesses of each algorithm, offering a nuanced understanding of their predictive capabilities in the context of loan status determination. This research contributes to the growing body of knowledge in the application of ML algorithms in the financial sector, presenting practical implications for institutions seeking to enhance their loan approval processes.\r\n</p><p>Key words: Predictive Analysis, Machine Learning Algorithms, Loan Status, Comparative Study, Utilization\r\n</p><p><br></p>','no_image.jpg','3._A_Comparative_Study_on_Loan_Status_1706338702.docx',NULL,NULL,NULL,1,2,1,2,'IJSREAT',1,1,2,15,'2024-02-02','<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span><br><br></b>IJSREAT Journal Link:<a href=\"https://ijsreat.com/archives?year=2024&amp;volume=4&amp;issue=1\" target=\"_blank\"> </a><span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://ijsreat.com/archives?year=2024&amp;volume=4&amp;issue=1\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijsreat/archives?year=2024&amp;volume=4&amp;issue=1\" target=\"_blank\">Click Here</a></span><br><br>Crossref Link(DOI): <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/search/works?q=10.59256%2Fijsreat.20240401003&amp;from_ui=yes\" target=\"_blank\">Click Here </a></span>(Please check after 24 hrs.)<br></p>','paid-2',1,177,1,'2024-01-27 06:58:22','2024-02-02 07:45:47'),(166,1,177,NULL,'Financial Technology (Fintech) and Banking Industry Transformation: A Symbiotic Evolution into the Digital Era','<p>Abstract: \r\n</p><p>This study navigates the dynamic landscape of Financial Technology (Fintech) and its transformative impact on the banking industry, elucidating the symbiotic evolution that characterizes this intersection. Fintech, as the fusion of cutting-edge technologies with financial services, signifies a revolutionary leap, fundamentally reshaping the financial landscape. From ubiquitous mobile banking applications to the advent of blockchain, AI-driven analytics, and cryptocurrencies, Fintech embodies a spectrum of innovations redefining traditional banking norms.\r\n</p><p>The symbiosis between Fintech and banking drives a profound transformation, compelling traditional institutions to embrace digital strategies for competitiveness. Open Banking initiatives foster collaboration, blurring the lines between established banks and nimble Fintech startups. This exploration delves into the intricate layers of this relationship, unraveling the evolution, challenges, and future trends shaping the financial ecosystem.\r\n</p><p>Keywords: Fintech Integration, Banking Transformation, Digital Financial Services, Open Banking Initiatives, Symbiotic Evolution\r\n</p><p><br></p><p>\r\n</p>','no_image.jpg','4.Financial_Technology_1706340172.docx',NULL,NULL,NULL,1,2,1,2,'IJSREAT',1,1,1,15,'2024-02-02','<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJSREAT Journal Link:<span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://ijsreat.com/archives?year=2024&amp;volume=4&amp;issue=1\" target=\"_blank\"> Click Here</a></span><br><br>FDRP Website Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijsreat/archives?year=2024&amp;volume=4&amp;issue=1\" target=\"_blank\">Click Here</a></span><br><br>Crossref Link(DOI): <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/search/works?q=10.59256%2Fijsreat.20240401004&amp;from_ui=yes\" target=\"_blank\">Click Here</a> </span>(Please check after 24 hrs.)<br></p>','paid-2',1,177,1,'2024-01-27 07:22:52','2024-02-02 07:47:42'),(167,5,194,NULL,'Matrix Representation of Graph Theory in Hydrocarbons','<p>Graph theory is one of the best-known research head subjects having many applications. Graph theory serves as a mathematical model to represent any system which has a binary relation. chemical graph theory is branch of graph theory that is concerned with analysis of all consequences of connectivity in a chemical graph. An organic molecule can be represented by a graph, which can be converted to several matrices by using various graph characteristic, connecting of atoms through bonds lead to adjacency, incidence, cut-set, circuit and distance matrices. The object of this paper is to adopt graph theory matrix approach in hydrocarbons.</p>','no_image.jpg','Matrix_Representation_Of_Graph_Theory_in__Hydrocarbons_(1)_1706342525.docx',NULL,NULL,NULL,1,2,1,3,'IJRTMR',1,1,1,15,'2024-01-30','<p><b style=\"color: rgb(0, 0, 255);\">Published Article Details:\r\n</b></p><p>IJRTMR Journal Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://ijrtmr.com/archives?year=2024&amp;volume=4&amp;issue=1\" target=\"_blank\">Click Here</a>\r\n</span></p><p>FDRP Website Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijrtmr/archives?year=2024&amp;volume=4&amp;issue=1\" target=\"_blank\">Click Here</a>\r\n</span></p><p>Crossref Link(DOI): <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/?from_ui=&amp;q=10.59256%2Fijrtmr.20240401001\" target=\"_blank\">Click Here </a></span>(Please check after 24 hrs.)</p><p>\r\n</p><p>\r\n</p><p>\r\n</p>','paid-2',1,194,1,'2024-01-27 08:02:05','2024-01-30 15:06:04'),(168,1,195,NULL,'Lungs tumor classification using CNN','<p>The Lung disease tumor is common throughout the world. These include chronic obstructivepulmonary disease, pneumonia, asthma, tuberculosis, fibrosis, etc. Timely diagnosis of lungdisease is essential. Many image processing and machine learning models have been developedfor this purpose. Since the arrival of the novel Cancer Diseases (IQ-OTH/NCCD) lung cancerdataset was collected, several types of researches have been initiated for its accurate predictionacross the world. The earlier lung disease pneumonia is closely related to Cancer Diseases (IQOTH/NCCD) lung cancer dataset was collected, as several patients died due to high chestcongestion (pneumonic condition). It is challenging to differentiate Cancer Diseases (IQOTH/NCCD) lung cancer dataset was collected and pneumonia lung diseases for medicalexperts. The TUMOR STAGE DETECTION MRI-Scan imaging is the most reliable methodfor lung disease prediction.. Deep learning is an extremely powerful tool for learning complex,cognitive problems, and the frequency of their use and evaluation in different problems isincreasing.</p>','no_image.jpg','lung_conferences_final_5_1706365179.docx',NULL,NULL,NULL,1,2,1,1,'IJIRE',7,1,2,1,NULL,NULL,NULL,0,195,NULL,'2024-01-27 14:19:39','2024-01-27 14:19:39'),(169,1,195,NULL,'Lungs tumor classification using CNN','<p>The Lung disease tumor is common throughout the world. These include chronic obstructivepulmonary disease, pneumonia, asthma, tuberculosis, fibrosis, etc. Timely diagnosis of lungdisease is essential. Many image processing and machine learning models have been developedfor this purpose. Since the arrival of the novel Cancer Diseases (IQ-OTH/NCCD) lung cancerdataset was collected, several types of researches have been initiated for its accurate predictionacross the world. The earlier lung disease pneumonia is closely related to Cancer Diseases (IQOTH/NCCD) lung cancer dataset was collected, as several patients died due to high chestcongestion (pneumonic condition). It is challenging to differentiate Cancer Diseases (IQOTH/NCCD) lung cancer dataset was collected and pneumonia lung diseases for medicalexperts. The TUMOR STAGE DETECTION MRI-Scan imaging is the most reliable methodfor lung disease prediction.. Deep learning is an extremely powerful tool for learning complex,cognitive problems, and the frequency of their use and evaluation in different problems isincreasing.</p>','no_image.jpg','lung_conferences_final_5_1706365214.docx',NULL,NULL,NULL,1,2,1,1,'IJIRE',1,1,2,5,NULL,NULL,NULL,0,195,NULL,'2024-01-27 14:20:14','2024-01-28 06:25:39'),(170,12,196,NULL,'Blood Gas Analysis in SARS-COV-2 Infected Patients Admitted to SMHS Hospital: a TERTIARY CARE Hospital in Kashmir','<p>Blood gases are a measurement of how much oxygen and carbon dioxide is in blood. These determine the acidity of blood. The blood gas testing is generally used for detecting and monitoring lung and kidney problems. The blood gas testing measures partial pressure of oxygen(o2),partial pressure of carbon dioxide(CO2),oxygen saturation(O2Sat),bicarbonate(HCO3)concentration  Here in study Patients aged more than 18 years confirmed Covid 19 positive by reverse transcription ,PCR (RT-PCR) .Patients suffering from moderate  to severe Covid 19 as per WHO diagnostic guidelines and underwent at least one ABG were included in the analysis. The ABG test was done on ABG analyzer in department of Biochemistry,SMHS hospital.All the data which was related to study was gathered and recorded in case record forms using files as well as reports of patients from medical record section and we concluded, Patients with COVID19 frequently experience an acidbase imbalance. Although respiratory alkalosis predominated, the study also found respiratory acidosis with mixed metabolic acidosis and alkalosis. The study discovered a strong relationship between pH and PaCO2 as well as PaCO2 and HCO3. Regular ABG monitoring can aid in the early detection of silent hypoxia, and respiratory injury. With early management start-up, many lives can be spared with early diagnosis</p>','no_image.jpg','final_manuscript_3_1706374963.docx',NULL,NULL,NULL,1,2,1,3,'IJRTMR',1,1,1,3,NULL,NULL,NULL,0,196,NULL,'2024-01-27 17:02:43','2024-01-27 17:28:15'),(176,3,197,NULL,'Review on Development of  Chemical Sensors','<p>A comprehensive summary of the most recent research concentrating on chemical sensors utilizing nanotubes, Nano rods, Nano belts, and nanowires is given in this article. The experimental principle, sensor device design, sensor mechanism, and multiple significant conclusions receive the vast majority of our attention. The following four sections provide additional information on the creation of chemical sensors based on nanostructured materials: nanotube sensors, Nano rod sensors, Nano belt sensors and Nano wire sensors.\r\n</p><p>We conclude this review with personal perspectives on the directions towards which future research on nanostructured sensors might be directed.\r\n</p><p>At ambient temperature, the nanotube sensors show a far faster response time and a significantly higher sensitivity than the current solid-state sensors. Reversibility of the sensor can be obtained by heating it to a high temperature or by slowly recovering under ambient conditions. Over the past decade, synthesized nanomaterial’s, such as carbon nanotube, nanoparticle, quantum dot, and nanowire, have already made breakthroughs in various fields, including biomedical sensors. Enormous surface area-to-volume ratio of the Nano materials increases sensitivity dramatically compared with macro-sized material. Herein we present a comprehensive review about the working principle and fabrication process of nanowire sensors. The nanotube sensors exhibit a fast response and a substantially higher sensitivity than that of existing solid-state sensors at room temperature. Sensor reversibility is achieved by slow recovery under ambient conditions or by heating to high temperatures.\r\n</p><p>Synthesized Nano materials, including carbon nanotubes, nanoparticles, quantum dots, and nanowires, have already achieved significant advances in a number of sectors, including biological sensors, during the last ten years. When compared to macro-sized material, the nanoparticles\' enormous surface area-to-volume ratio significantly boosts sensitivity. We provide a thorough overview of the fabrication process and operating principle of the nanowire sensor here. Recent advances including self-powering, reusability, sensitivity in high ionic strength solvent, and long-term stability are surveyed and highlighted as well. Nanowire is expected to lead significant improvement of biomedical sensor in the near future.\r\n</p><p>Advantages and disadvantages of the sensors are provided along with brief descriptions. An electrical device that monitors changes in a quantity, such as voltage, temperature, pressure, or humidity, is called a sensor. As a result, classification is done according to the attribute that a sensor measures. A temperature sensor detects even the smallest variations in its environment or shifts in temperature, such as hot or cold weather.\r\n</p><p>Microelectronic manufacturing techniques have been used to manufacture chemical and electrochemical sensors. The development of chemical sensors has been spurred forward by the recent advances in micromaching technology. Chemical sensor research has advanced thanks to micromachining methods like sacrificial layers, plasma etching, and chemical anisotropic etching. These methods enable the creation of low mass, low power driven devices as well as controlled working conditions and temperature.\r\n</p><p>Researchers became interested in these carefully chosen in vitro nanostructures when they were combined with nanomaterials because the improved properties of these nanostructures led to advances in the analytical performance of chemical and biosensors. This study covers the latest advancements in recognition elements that are integrated into chemical sensors and biosensors used in the food, medical, and environmental domains. These elements include both traditional ones like enzymes and antibodies as well as more modern ones like aptomers and phages.\r\n</p><p>Cyclic voltammetry and electron microscopy are frequently used in the characterization of chemically modified sensors and biosensors because they enable the confirmation of electrode mechanisms and surface morphologies. X-ray photoelectron spectroscopy (XPS), among other methods, is a special tool for obtaining information on the sensor surface that is qualitative, quantitative/semi-quantitative, and speciation-related. However, XPS is still not widely applied in this industry. The purpose of this work is to review a few selected studies that demonstrate how well XPS performs when characterizing the top surface layers of biosensors and chemically\r\n</p><p>Modified sensors. The reader is provided with the necessary background information in a brief introduction to X-ray photoelectron spectroscopy. The use of XPS to characterize sensors appropriate for environmental and food analysis is highlighted.\r\n</p><p><br></p><p>\r\n</p>','no_image.jpg','1._mamatha_1706520351.docx',NULL,NULL,NULL,1,2,1,3,'IJRTMR',2,1,1,15,'2024-02-03','<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJRTMR Journal Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://ijrtmr.com/archives?year=2024&amp;volume=4&amp;issue=1\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijrtmr/archives?year=2024&amp;volume=4&amp;issue=1\" target=\"_blank\">Click Here</a></span><br><br>Crossref Link(DOI): <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/?from_ui=&amp;q=10.59256%2Fijrtmr.20240401002\" target=\"_blank\">Click Here</a></span> (Please check after 24 hrs.)<br></p>','paid-2',1,197,1,'2024-01-29 09:25:51','2024-02-02 17:26:44'),(177,2,198,NULL,'Unprejudiced Strategic Suppliers Selection and Inspection: An Automated Industrial Approach','<p>The world is changing rapidly to global automated market places. As the result, environment is forcing the companies to take accurate decision and consideration at the same time. The relationship between the supplier and the company has been developed for a long time, so the selection of the supplier is a very significant task. In this research ventilated one of the major concerns in the field of Industrial engineering as well as Quality management in the automated selection and inspection domain. Determination the unprejudiced selection accuracy and defect rate for present &amp; future inspection respectively in supplier evaluation of industry. Analyze the decision about future inspection 100% or not, on the basis of inspection cost during the examination and decision making activity. After selection process of supplier, next step is to checking the efficiency of this supplier, so inspection is implemented. Two model are deal with this paper, one is automated selection and second is implementation of inspection.</p>','no_image.jpg','Manuscript_final_1706535713.docx',NULL,NULL,NULL,1,2,2,6,'INDJCST',1,1,2,3,NULL,NULL,NULL,0,198,NULL,'2024-01-29 13:41:53','2024-02-01 09:18:35'),(179,4,199,NULL,'Landscape of Service Marketing','<p>From its early focus on intangibility and service quality to a holistic customer experience approach, \r\n</p><p>service marketing has seen an amazing development. This survey of the literature charts the \r\n</p><p>development of service marketing over time, emphasizing significant turning points and \r\n</p><p>conceptual models that influenced the field\'s current configuration.\r\n</p><p>From Berry and Gronroos\' seminal work to the revolution in customer experience, the overview \r\n</p><p>explores how the field\'s priorities and approaches have evolved. It also discusses new \r\n</p><p>developments in the fields of artificial intelligence (AI), servitization, experience economies, and \r\n</p><p>well-being, providing insights into the future of service marketing. This paper offers a thorough \r\n</p><p>history of the development of service marketing, giving scholars and practitioners a better \r\n</p><p>knowledge of the field\'s past as well as a peek of its fascinating future.\r\n</p><p><br></p>','no_image.jpg','Landcape_of_service_marketing_1706619843.docx',NULL,NULL,NULL,1,2,1,3,'IJRTMR',2,1,1,1,NULL,NULL,NULL,0,199,NULL,'2024-01-30 13:04:03','2024-01-30 13:04:03'),(180,4,199,NULL,'Landscape of Service Marketing','<p>From its early focus on intangibility and service quality to a holistic customer experience approach, \r\n</p><p>service marketing has seen an amazing development. This survey of the literature charts the \r\n</p><p>development of service marketing over time, emphasizing significant turning points and \r\n</p><p>conceptual models that influenced the field\'s current configuration.\r\n</p><p>From Berry and Gronroos\' seminal work to the revolution in customer experience, the overview \r\n</p><p>explores how the field\'s priorities and approaches have evolved. It also discusses new \r\n</p><p>developments in the fields of artificial intelligence (AI), servitization, experience economies, and \r\n</p><p>well-being, providing insights into the future of service marketing. This paper offers a thorough \r\n</p><p>history of the development of service marketing, giving scholars and practitioners a better \r\n</p><p>knowledge of the field\'s past as well as a peek of its fascinating future.\r\n</p><p><br></p>','no_image.jpg','Landscape_of_service_marketing_1706620036.docx',NULL,NULL,NULL,1,2,1,3,'IJRTMR',2,1,1,1,NULL,NULL,NULL,0,199,NULL,'2024-01-30 13:07:16','2024-01-30 13:07:16'),(181,4,199,NULL,'Landscape of Service Marketing','<p>From its early focus on intangibility and service quality to a holistic customer experience approach, \r\n</p><p>service marketing has seen an amazing development. This survey of the literature charts the \r\n</p><p>development of service marketing over time, emphasizing significant turning points and \r\n</p><p>conceptual models that influenced the field\'s current configuration.\r\n</p><p>From Berry and Gronroos\' seminal work to the revolution in customer experience, the overview \r\n</p><p>explores how the field\'s priorities and approaches have evolved. It also discusses new \r\n</p><p>developments in the fields of artificial intelligence (AI), servitization, experience economies, and \r\n</p><p>well-being, providing insights into the future of service marketing. This paper offers a thorough \r\n</p><p>history of the development of service marketing, giving scholars and practitioners a better \r\n</p><p>knowledge of the field\'s past as well as a peek of its fascinating future.\r\n</p><p><br></p>','no_image.jpg','Landscape_of_service_marketing_1706620090.docx',NULL,NULL,NULL,1,2,1,3,'IJRTMR',2,1,1,5,NULL,NULL,NULL,0,199,NULL,'2024-01-30 13:08:10','2024-02-01 15:34:37'),(182,1,187,NULL,'Website Development in Computer Science: Unveiling the Digital World.','<p>Website development is at the heart of the digital age, deeply ingrained in computer science. This article delves into the evolution and significance of website development, highlighting the key technologies and concepts that underpin it. From the basics of HTML, CSS, and JavaScript to advanced frameworks, backend technologies, and security measures, the journey of website development is unraveled. Emphasizing the critical role web developers play in shaping the digital landscape, this article showcases the dynamic nature of web development and the necessity of staying updated with emerging trends. Website development is not just about coding; it\'s about revolutionizing how we interact with the digital realm.</p><p><br></p>','no_image.jpg','_Title__Website_Development_in_Computer_Science__Unveiling_the_Digital_World_1706629374.docx',NULL,NULL,NULL,1,2,1,6,'INDJCST',1,1,1,15,'2024-02-01','<p><b style=\"color: rgb(0, 0, 255);\">Published Article Details:\r\n</b></p><p>IndjCST Journal Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://indjcst.com/archives?year=2024&amp;volume=3&amp;issue=1\" target=\"_blank\">Click Here</a>\r\n</span></p><p>FDRP Website Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/indjcst/archives?year=2024&amp;volume=3&amp;issue=1\" target=\"_blank\">Click Here</a></span></p><p>\r\n</p><p>\r\n</p>','paid-1',0,187,1,'2024-01-30 15:42:54','2024-02-01 09:11:14'),(183,2,142,NULL,'Review on RSA cryptography, steganography and compression techniques for data security','<p>ABSTRACT: One of the earliest public key cryptosystems still in use for safe data transfer is called RSA (Rivest–Shamir–Adleman). Information hiding is a component of steganography. Since compressed data is easier to handle and more secure, data compression is a crucial component of information security. Efficient, safe, and readily connectable data is produced via effective data compression technology. Compression algorithm approaches come in two flavours: lossy and lossless. These methods are applicable to any type of data format, including audio, video, text, and image files. This study\'s primary goal was to decrease the amount of physical space on different storage devices and the amount of time it takes to transport data over the Internet while completely guaranteeing that the data would be encrypted and hidden from prying eyes. In this paper, the secret massage is encrypted using RSA cryptography and compressed using Huffman coding. A cover image is compressed using Discrete Wavelet Transform (DWT). The compressed encrypted message is embedded into an image using Least Significant Bit (LSB).</p>','no_image.jpg','RM_Review_paper_Thaslima_1706802977.docx',NULL,NULL,NULL,1,2,1,6,'INDJCST',2,1,1,15,'2024-02-09','<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IndJcst Journal Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://indjcst.com/archives?year=2024&amp;volume=3&amp;issue=1\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/indjcst/archives?year=2024&amp;volume=3&amp;issue=1\" target=\"_blank\">Click Here</a></span><br></p>',NULL,1,142,1,'2024-02-01 15:56:17','2024-02-09 06:26:57'),(184,1,104,NULL,'MACHINE LEARNING FOR WEB VULNERABILITY DETECTION: THE CASE OF CROSS-SITE REQUEST FORGERY','<p>Cross-site request forgery (CSRF) vulnerabilities pose a significant threat to web application security, enabling attackers to execute unauthorized actions on behalf of authenticated users. Conventional CSRF detection methods, such as manual code review and static analysis, are often time-consuming, error-prone, and inefficient. Proposes Mitch, a novel machine learning (ML)-based solution for the black-box detection of CSRF vulnerabilities. Mitch employs supervised learning, trained on a comprehensive dataset of HTTP requests and responses, to effectively identify security-sensitive HTTP requests and uncover CSRF vulnerabilities within them. Rigorous evaluations on a diverse set of real-world web applications demonstrate Mitch\'s remarkable ability to detect CSRF vulnerabilities with high accuracy, outperforming traditional methods. Mitch\'s automated nature eliminates the need for manual code review and static analysis, saving time and effort while reducing the risk of human error. Additionally, Mitch\'s scalability allows seamless integration into continuous integration and continuous delivery (CI/CD) pipelines, enabling continuous security monitoring and vulnerability detection. Mitch\'s efficacy extends beyond detecting known CSRF vulnerabilities. Its ability to identify patterns and relationships enables it to uncover obscure CSRF vulnerabilities that may have been overlooked by traditional methods, including zero-day vulnerabilities. In conclusion, Mitch emerges as a powerful tool for enhancing web application security, offering a comprehensive and automated solution for detecting CSRF vulnerabilities. Its ability to handle complex web applications, uncover hidden CSRF vulnerabilities, and integrate into CI/CD pipelines makes it an indispensable tool for web security professionals. Mitch\'s adoption has the potential to significantly reduce the risk of CSRF attacks and safeguard sensitive user data. We propose a methodology to leverage machine learning (ML) for the detection of web application vulnerabilities. We use it in the design of Mitch, the first ML solution for the black-box detection of cross-site request forgery vulnerabilities. Finally, we show the effectiveness of Mitch on real software. In this project, we propose a methodology to leverage Machine Learning (ML) for the detection of web application vulnerabilities. Web applications are particularly challenging to analyses, due to their diversity and the widespread adoption of custom programming practices. ML is thus very helpful for web application security it can take advantage of manually labeled data to bring the human understanding of the web application semantics into automated analysis toolsMitch allowed us to identify 35 new CSRFs on 20 major websites and 3 new CSRFs on production software.</p>','no_image.jpg','B_12_IEEE_Paper_1706882860.docx',NULL,NULL,NULL,1,2,1,2,'IJSREAT',1,1,2,15,'2024-02-05','<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJSREAT Journal Link:<span style=\"background-color: rgb(255, 255, 0);\"> <a href=\"https://ijsreat.com/archives?year=2024&amp;volume=4&amp;issue=1\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link: <span style=\"background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijsreat/archives?year=2024&amp;volume=4&amp;issue=1\" target=\"_blank\">Click Here</a></span><br><br>Crossref Link(DOI): <span style=\"background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/?from_ui=&amp;q=10.59256%2Fijsreat.20240401005\" target=\"_blank\">Click Here</a></span> (Please check after 24 hrs.)<br></p>','paid-1',0,104,1,'2024-02-02 14:07:40','2024-02-05 18:36:22'),(185,1,171,NULL,'MULTIMODAL BIOMETRIC LOGIN SYSTEM USING FACE AND SIGNATURE','<p>Biometrics has developed to be one of the most relevant technologies used in Information Technology (IT) security. Uni-modal biometric systems have a variety of problems which decreases the performance and accuracy of these systems. One way to overcome the limitations of the Unimodal biometric systems is through fusion to form a multimodal biometric system. Hence this process is developed based on Multimodal Biometric system based on Face, Finger print, Signature etc. Multimodal biometric system employing Convolutional Neural Networks (CNNs) for effective feature extraction and classification. The system combines facial and signature biometrics, harnessing the unique advantages of each modality to create a more resilient and accurate authentication framework. Multimodal biometric system with CNN integration holds promise for applications in secure access control, financial transactions, and other domains where reliable authentication is crucial. Its adaptability and scalability make it a viable solution for addressing the evolving challenges in biometric security systems.</p>','no_image.jpg','Multimodal_Journal_1706946038.doc',NULL,NULL,NULL,1,2,1,1,'IJIRE',1,1,1,15,'2024-02-05','<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJIRE Journal Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://theijire.com/archives?year=2024&amp;volume=5&amp;issue=1\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link:<span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijire/archives?year=2024&amp;volume=5&amp;issue=1\" target=\"_blank\"> Click Here</a></span><br><br>Crossref Link(DOI): <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/search/works?q=10.59256%2Fijire.20240501006&amp;from_ui=yes\" target=\"_blank\">Click Here</a></span> (Please check after 24 hrs.)<br></p>','paid-2',1,171,1,'2024-02-03 07:40:38','2024-02-05 09:10:56'),(186,1,104,NULL,'TOWARDS DETECTION AND ATTRIBUTION OF CYBER  ATTACKS IN  IOT ENABLED CYBER-PHYSICAL SYSTEMS','<p>Internet of Things (IoT) enabled cyber physical systems such as Industrial equipment’s and operational IT to send and receive data over internet. This equipment’s will have sensors to sense equipment condition and report to centralized server using internet connection. Sometime some malicious users may attack or hack such sensors and then alter their data and this false data will be report to centralized server and false action will be taken. Due to false data many countries equipment and production system got failed and many algorithms was developed to detect attack, but all these algorithms suffer from data imbalance (one class my contains huge records (for example NORMAL records and other class like attack may contains few records which lead to imbalance problem and detection algorithms may failed to predict accurately). To deal with data imbalance, existing algorithms were using OVER and UNDER sampling which will generate new records for FEWER class only. Securing Internet of Things (IoT)-enabled cyberphysical systems (CPS) can be challenging, as security solutions developed for general information / operational technology (IT / OT) systems may not be as effective in a CPS setting. Thus, this paper presents a two-level ensemble attack detection and attribution framework designed for CPS, and more specifically in an industrial control system (ICS). At the first level, a decision tree combined with a novel ensemble deep representation learning model is developed for detecting attacks imbalanced ICS environments. At the second level, an ensemble deep neural network is designed for attack attribution.The connection between ICS or IIoT-based systems with public networks, however, increases their attack surfaces and risks of being targeted by cyber criminals.\r\n</p><p>To overcome from this issue, we are introducing novel technique without using any under or oversampling algorithms. The proposed technique consists of 2 parts.\r\n</p><p>Auto encoder: It will get trained on imbalanced dataset and then extract features from it and these extracted features will get trained with DECISION TREE algorithm to predict label for known or unknown attacks. Decision tree get trained on reduced number of features obtained from PCA (principal component analysis) algorithm.\r\n</p><p>Deep Neural Network (DNN): In this level, DNN algorithm get trained on known and unknown attacks.\r\n</p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Keywords- Cyber Physical Systems (CPS), Industrial Control System (ICS).\r\n</p><p><br></p>','no_image.jpg','B2_IEEE_paper_1706969580.docx',NULL,NULL,NULL,1,2,1,3,'IJRTMR',1,1,2,15,'2024-02-05','<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJRTMR Journal Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://ijrtmr.com/archives?year=2024&amp;volume=4&amp;issue=1\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijrtmr/archives?year=2024&amp;volume=4&amp;issue=1\" target=\"_blank\">Click Here</a></span><br><br>Crossref Link(DOI): <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/search/works?q=10.59256%2Fijrtmr.20240401003&amp;from_ui=yes\" target=\"_blank\">Click Here</a></span><a href=\"https://search.crossref.org/search/works?q=10.59256%2Fijrtmr.20240401003&amp;from_ui=yes\" target=\"_blank\"> </a>(Please check after 24 hrs.)<br></p>','paid-2',0,104,1,'2024-02-03 14:13:00','2024-02-07 14:02:47'),(187,1,104,NULL,'IMPLEMENTATION OF WASTE MANAGEMENT SYSTEM','<p>In the present days, many times we see that the garbage bins or dust bins are placed at public placesin the urban cities, that which are overflowing due to the increase in the waste every day. Itcreatesanunhygienic condition for the people and creates bad smell around the surroundings. In the recentscenario, due to the rapid growth of population disorganization of city government a lack of publicawareness and limited fund for a program of waste management garbage disposal became a causeof concern in the world. This leads to spreading some deadly diseases &amp;amp; human illness. Most of theviruses and the bacteria infection developed in the unclean and unhygienic environment. Tomaintain a strategic distance from such circumstances we have proposed wireless wastemanagement system. Which allows multiple corporations to monitor the status of dust beansremotely over a server, and keeps cities clean and hygiene very efficiently by optimizing cost andtime required for it.Waste management from its inception to its disposal is one of the importantchallenges for municipal corporations all over the world. When this was not in existence thegarbage was overflowing and people were getting all the diseases. In urban areas, people should beaware of this condition of overflowing garbage.With this overflowing of garbage on roadstransportation problem occurs. The people who work in municipal corporations will hesitate to pickall the overflowing garbage this is also a cause for developing unhygienic atmosphere. To overcomethis problem, we can use sensors and detect where the dustbin is overflowing. By this sensor, thehigher authority will get to know about this garbage overflow and then the information can bepassed and action could be taken on the municipal corporation.\r\n</p><p>Keywords—wireless waste management system, challenges in waste management system, Health and Environmental impacts, sensor technology in waste management, Municipal Corporation and waste management,Hygiene and cleanliness, Preventing transportation issues, Community Awareness.\r\n</p><p><br></p>','no_image.jpg','WASTE_MANAGEMENT_SYSTEM_1707127878.docx',NULL,NULL,NULL,1,2,1,3,'IJRTMR',1,1,2,15,'2024-02-06','<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJRTMR Journal Link:<a href=\"https://ijrtmr.com/archives?year=2024&amp;volume=4&amp;issue=1\" target=\"_blank\"> </a><span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://ijrtmr.com/archives?year=2024&amp;volume=4&amp;issue=1\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijrtmr/archives?year=2024&amp;volume=4&amp;issue=1\" target=\"_blank\">Click Here</a></span><br><br>Crossref Link(DOI): <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/?from_ui=yes&amp;q=10.59256%2Fijrtmr.20240401004\" target=\"_blank\">Click Here</a></span> (Please check after 24 hrs.)<br></p>','paid-2',0,104,1,'2024-02-05 10:11:18','2024-02-07 14:03:28'),(188,1,104,NULL,'PNEUMONIA DETECTION IN CHEST X-RAYS USING NEURAL NETWORKS','<p>Deep learning techniques are widely used to design robust classification models in several areas such as medical diagnosis tasks in which it achieves good performance. In this paper, we have proposed the CNN model (Convolutional Neural Network) for the classification of Chest X-ray images for Radiological Society of North America Pneumonia (RSNA) datasets. The study also tries to achieve the same RSNA benchmark results using the limited computational resources by trying out various approaches to the methodologies that have been implemented in recent years. The proposed method is based on a noncomplex CNN and the use of transfer learning algorithms like Xception, InceptionV3/V4, EfficientNetB7. Along with this, the study also tries to achieve the same RSNA benchmark results using the limited computational resources by trying out various approaches to the methodologies that have been implemented in recent years. The RSNA benchmark MAP score is 0.25 but using the Mask RCNN model (Region Convolutional Neural Network) on a stratified sample of 3017 along with image augmentation gave a MAP (Mean Average Precision) score of 0.15. Meanwhile, the YoloV3 without any hyperparameter tuning gave the MAP score of 0.32 but still, the loss keeps decreasing. Running the model for a greater number of iterations can give better results. Pneumonia is one of the major causes of cancer-related deaths due to its aggressive nature and delayed detections at advanced stages. Early detection of Pneumonia is very important for the survival of an individual, and is a significant challenging problem. Generally, chest radiographs (Xray) and computed tomography (CT) scans are used initially for the diagnosis of the malignant nodules; however, the possible existence of benign nodules leads to erroneous decisions. At early stages, the benign and the malignant nodules show very close resemblance to each other. In this paper, a novel deep learning-based model with multiple strategies is proposed for the precise diagnosis of the malignant nodules. Due to the recent achievements of deep convolutional neural networks (CNN) in image analysis, we have used two deep three-dimensional (3D) customized mixed link network (CMixNet) architectures for lung nodule detection and classification, respectively.\r\n</p><p>Keywords—X-Rays, Deep learning techniques, CNN model, RSNA.\r\n</p><p><br></p>','no_image.jpg','PNEUMONIA_DETECTION_IN_CHEST_X_RAYS_(1)_1707127956.docx',NULL,NULL,NULL,1,2,1,2,'IJSREAT',1,1,2,15,'2024-02-06','<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJSREAT Journal Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://ijsreat.com/archives?year=2024&amp;volume=4&amp;issue=1\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijsreat/archives?year=2024&amp;volume=4&amp;issue=1\" target=\"_blank\">Click Here</a></span><br><br>Crossref Link(DOI):<a href=\"https://search.crossref.org/search/works?q=10.59256%2Fijsreat.20240401006&amp;from_ui=yes\" target=\"_blank\"> </a><span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/search/works?q=10.59256%2Fijsreat.20240401006&amp;from_ui=yes\" target=\"_blank\">Click Here</a></span><a href=\"https://search.crossref.org/search/works?q=10.59256%2Fijsreat.20240401006&amp;from_ui=yes\" target=\"_blank\"> </a>(Please check after 24 hrs.)<br></p>','paid-2',0,104,1,'2024-02-05 10:12:36','2024-02-07 14:00:41'),(189,15,204,NULL,'Sustainable Transportation in the Gurugram-Manesar Urban Complex','<p>In today\'s world, more than half of the global population resides in urban areas, a significant shift from the past. In 1950, only 30% lived in cities, but by 2050, its projected to reach 66%. Despite rapid urbanization in India, one standout is the cyber town of Gurugram in Haryana, which has embraced sustainable urban growth. Maruti Industry was established with assistance from Suzuki Company of Japan, heralding a period of significant growth. This urban complex, often lauded as India\'s only city with a rapid metro network, modern commercial hubs, towering cyber parks, stands as a beacon of sustainable urbanization. The nomenclature of this complex was proposed in the district development plan. The establishment of the Maruti Industry in 1972 marked the onset of Gurugram\'s substantial development. Renowned for its quick metro network, modern malls, and cyber parks, Gurugram- Manesar Urban Complex stands as a model of sustainable urban development. Serving as Haryana\'s financial and industrial hub, Gurugram has witnessed the third-largest increase in per capita income in India, contributing significantly to the state\'s revenue. Its strategic location along National Highway Number 48 and proximity to Indira Gandhi International Airport have fueled its rapid expansion. This paper examines its transport system and connections to nearby towns and the national capital, Delhi.</p>','no_image.jpg','KAVITA_PAPER_1_1707294923.docx',NULL,NULL,NULL,1,2,1,3,'IJRTMR',2,1,1,5,NULL,NULL,NULL,0,204,NULL,'2024-02-07 08:35:23','2024-02-07 16:20:22'),(190,2,209,NULL,'Evaluation of anti-urolithiatic activity of seed extract of Cuminum cyminum','<p>Urolithiasis or kidney stone disease is a urologic ailment that has a high prevalence rate worldwide and medicinal \r\n</p><p>plants have been widely used for alternative therapy. A wide range of medicinal plants have been used conservatively \r\n</p><p>for urolithiasis due to their fewer side effects and because they contain copious phytochemicals that show \r\n</p><p>advantageous effects in urolithiasis. Cuminum cyminum traditionally used in the treatment of urolithiasis. \r\n</p><p>Hyperoxaluria and hypercalciuria are among the major risk factors in pathogenesis of urinary stone formation. \r\n</p><p>Evaluation of various medicinal plants are done mainly against calcium oxalate. In this present study, the \r\n</p><p>antiurolithiatic potential in Cuminum cyminum was investigated through invitro assay. The work was performed by \r\n</p><p>using invitro Anti-urolithiatic model for calculating percentage in comparison with standard drug cystone. The antiurolithiatic properties were evaluated by titrimetric and turbidity assay. The result shows that for C. cyminum folds \r\n</p><p>(55%) and for standard drug cystone (82%) for titrimetric assay. For turbidity assay. C. cyminum has significant \r\n</p><p>properties (47.9±19%). The findings of the nucleation assay indicate that phytoconstituents inhibited the \r\n</p><p>crystallization of CaOx in solution. The size and the number of calcium oxalate crystals decreased with increasing \r\n</p><p>concentration upto 400µg of the phytoconstituents. The study concludes that the seed extracts of Cuminum cyminum\r\n</p><p>have inhibitory effect on calcium oxalate for crystal nucleation. It also showed great efficacy in the dissolution of \r\n</p><p>calcium oxalate crystals. Thus, this extract may be valuable resources for treatment of urolithiasis</p>','no_image.jpg','JV_project_1707557113.pdf',NULL,NULL,NULL,1,2,2,6,'INDJCST',1,1,1,3,NULL,NULL,NULL,0,209,NULL,'2024-02-10 09:25:13','2024-02-10 09:46:31'),(193,15,211,NULL,'भारतीय आदिवासी आणि ‍नक्षलवाद','<p>आफ्रिका खंडानंतर भारतामध्ये सर्वात जास्त आदीवासी लोकसंख्या आहे. अनुसूचित जमाती मध्ये येणारी आदिवासी जमात डोंगराळ व जंगली प्रदेशात असलेल्या वेगळ्या भागांवर कब्जा करतात. या अनुसूचित जमातींमध्ये बाहेरील लोकांच्या घुसखोरीला आणि विशेषतः परकीय बाहेरच्या लोकांच्या त्यांच्या भागात घुसखोरीचा जोरदार प्रतिकार करण्याची परंपरा आहे. परकीय आक्रमणकर्ते आणि आदिवासी यांच्यात झालेल्या प्रदीर्घ संघर्षाचा पुरावा इतिहास देतो जेव्हा पूर्वीच्या लोकांनी त्यांच्या भागात घुसण्याचा प्रयत्न केला. तेव्हा वेळोवेळी त्यांनी त्यासाठी संघर्ष केला. वर्तमान संशोधन लेखाचा उद्देश भारतातील नक्षलवाद आणि आदीवासी जमातींशी संबंधित विश्लेषणात्मक माहितीवर प्रकाश टाकणे आहे. यात नक्षलवाद, त्याची उत्पत्ती, नक्षल चळवळीच्या \'कृती आराखड्या\' ची ठळक वैशिष्ठ्ये यांचा आढावा इत्यादी बाबत माहिती सादर करण्यात आली आहे. \"माओवादी\" आणि आदिवासी भागातील नक्षलवाद आणि त्याची कारणे यावर देखील माहीती सादर करण्यात येत आहे. नक्षलवादाशी संबंधित उपाय आणि सर्वसाधारणपणे आदिवासी परिस्थिती यावर देखील चर्चा करण्यात आली आहे. निष्कर्ष म्हणून,  असा युक्तिवाद करण्यात येईल की “नक्षलवाद” ही कायदा आणि सुव्यवस्थेची समस्या नाही तर जमीन, जंगल आणि खनिज संसाधनांवर विशेष लक्ष केंद्रित करून सामाजिक आणि आर्थिक न्यायाच्या वितरणातील असमतोलाशी संबंधित आहे.</p>','no_image.jpg','T._Y._Gaydhane_Naxal_1707647379.docx',NULL,NULL,NULL,1,2,2,3,'IJRTMR',2,1,2,17,NULL,NULL,NULL,0,211,NULL,'2024-02-11 10:29:39','2024-02-13 07:10:19'),(194,15,212,NULL,'To Study the Role of Forest based industries in promoting Trade','<p>Abstract –\r\n</p><p>Since the prevailing business model is based on capturing comparative advantages at the right cost, the forest products industry has made strong efforts to open up to global trade. In many emerging countries, forests are valued, processing industries seek more employment, and raw materials seek additional value (Lash, J., &amp; Wellington, F. (2007)). In the forest products industry, international investors are willing allies; however, they wish to ensure the macroeconomic climate is predictable, transparent fiscal incentives are in place, and there is an abundance of labor - and preferably a sustainable wood supply from the beginning. The domestic market should be dynamic in order to attract foreign investments since many emerging economies have bustling urban markets that lack high-quality forest products.\r\n</p><p>A number of emerging countries have experienced economic growth and poverty eradication due to increases in forest product trade. It has proven difficult for some countries to trade their way out of poverty, leading to further marginalization and misconduct. In order to ensure that trade is legal, sustainable and based on fair labor conditions and a fair distribution of benefits, adequate safeguards must be put in place (Pearce, J. M. et. al. (2014)). The establishment of sustainable policies and regulations requires effective governance.\r\n</p><p>Increasingly, environmental issues are influencing trade, both directly and indirectly. As a result, environmental policies and international agendas on trade have been recognized as a common international concern partially because the regulations impact the competitiveness of the environment. Consequently, imports and exports are influenced. Environmental concerns are underlying concerns. Trade can also affect quality and deplete resources. However, natural resource management cycles occur. Trade policies, environmental concerns, and political reforms of macroeconomic policies will likely continue to dominate public debate (International Resource Panel, United Nations Environment Programme. Sustainable Consumption, &amp; Production Branch. (2011)). Developed countries have increased exports, which have led to environmental groups focusing on commodities. Multilateral agreements on the impacts of such policies on natural resources do not constitute a trade policy under environmental standards. \r\n</p><p>There is evidence that these impacts are negative, but they have not been thoroughly assessed. Consequently, the World Trade Organization (WTO) has established a working program on trade and policy, probably the most complex sector from the perspective of land use, since the General Agreement on Tariffs and Trade (GATT) has become more important in recent years. The environment contains a significant amount of forest resources. A large part of NAFTA\'s land area is the environment, and their survival is vital if the agreement is to succeed. (Segura, O. et. al. (1994)). \r\n</p><p>A number of factors contribute to improper harvesting practices. Forests are increasing in importance regionally and are essential in maintaining biological systems. Multilaterally, this can be attributed to recent reductions in forest cover, but this role is only fully appreciated once traditional barriers to imports have been removed. Once these forest exports are gone, this effect is no longer apparent. In part because the deforestation problems that arise outside the sector itself are the origins of the exposure of national economies to competition, attention has shifted more sharply to inter-sectoral coordination in policies. The forest provides habitat for the majority of world\'s environmental standards that influence biodiversity, including cost-raising domestic policies. The forest contributes significantly to international competition among businesses. \r\n</p><p><br></p>','no_image.jpg','To_Study_the_Role_of_Forest_based_industries_(_Research_paper_)_1707657755.docx',NULL,NULL,NULL,1,2,1,3,'IJRTMR',1,2,2,15,'2024-02-12','<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJRTMR Journal Link: <span style=\"background-color: rgb(255, 255, 0);\"><a href=\"https://ijrtmr.com/archives?year=2024&amp;volume=4&amp;issue=1\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link:<a href=\"https://fdrpjournals.org/ijrtmr/archives?year=2024&amp;volume=4&amp;issue=1\" target=\"_blank\"> </a><span style=\"background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijrtmr/archives?year=2024&amp;volume=4&amp;issue=1\" target=\"_blank\">Click Here</a></span><br><br>Crossref Link(DOI): <span style=\"background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/?from_ui=&amp;q=10.59256%2Fijrtmr.20240401005\" target=\"_blank\">Click Here</a></span> (Please check after 24 hrs.)<br></p>','paid-2',0,212,1,'2024-02-11 13:22:35','2024-02-12 13:43:38'),(196,1,207,NULL,'E-Ticketing for Public buses','<p>By replacing the antiquated manual, cash-based ticketing procedures with a state-of-the-art digital system, this initiative seeks to modernise public bus transportation in India. Long wait times, operational challenges, and inefficiencies are common outcomes of the current system. The goal of the suggested solution is to completely transform the public transportation experience by putting in place a cutting-edge, digital ticketing system that improves security, convenience, and efficiency for both administrators and users.&nbsp;</p><p>This project\'s main goals are to eliminate manual cash transactions, shorten wait times, and fix operational inefficiencies. With the use of digital technology, the suggested system would expedite the ticketing procedure and provide passengers with an easy-to-use interface for smooth ticket purchases.&nbsp;</p><p>This invention increases transaction security while also making the public bus transportation system more efficient overall. Passengers will have a more flexible and easy method to utilise public transport services thanks to the digital ticketing system, which will also significantly reduce wait times and traffic. Real-time data analytics will help administrators by facilitating improved resource allocation and decision-making. The introduction of this digital ticketing solution has the potential to revolutionise India\'s public transport sector by promoting a more sophisticated and user-friendly framework.</p><p><i><b>Key Word: </b>Management, Tracking, QR Code, Location, Ticket Confirmation, E-Ticket, Online Payment</i></p>','no_image.jpg','E_Ticketing_for_Public_buses_1707734854.docx',NULL,NULL,NULL,1,2,1,3,'IJRTMR',1,1,1,15,'2024-02-14','<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJRTMR Journal Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://ijrtmr.com/archives?year=2024&amp;volume=4&amp;issue=1\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijrtmr/archives?year=2024&amp;volume=4&amp;issue=1\" target=\"_blank\">Click Here</a></span><br><br>Crossref Link(DOI): <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/?from_ui=&amp;q=10.59256%2Fijrtmr.20240401006\" target=\"_blank\">Click Here</a></span> (Please check after 24 hrs.)<br></p>','paid-2',1,207,1,'2024-02-12 10:47:34','2024-02-14 12:35:28'),(197,1,217,NULL,'A Critique of Hybrid Electric Vehicles','<p>Cleaning operations will likely result from a sign<span style=\"font-size: 0.875rem;\">ificant contribution from HEVs in lowering greenhouse gas</span><span style=\"font-size: 0.875rem;\">e missions. Reduced fossil fuel reserves are a defining&nbsp;</span>feature&nbsp;<span style=\"font-size: 0.875rem;\">&nbsp;of the current state of affairs. Because of the high cost off uel, the transportation industry, which depends significantly o</span><span style=\"font-size: 0.875rem;\">n cars, is in dire straits. Further escalation of this issue is&nbsp;</span><span style=\"font-size: 0.875rem;\">anticipated. Problems like air pollution, global warming, and the d</span><span style=\"font-size: 0.875rem;\">epletion of fossil resources are all consequences of the growing f</span><span style=\"font-size: 0.875rem;\">uel consumption, and they all have a negative impact on the e</span><span style=\"font-size: 0.875rem;\">nvironment. The modern technology employed in hybrid electric v</span><span style=\"font-size: 0.875rem;\">ehicles and the technical characteristics of the various HEV k</span><span style=\"font-size: 0.875rem;\">inds are the main topics of this study. Environmental effects of t</span><span style=\"font-size: 0.875rem;\">hese cars are also covered in the study.</span></p>','no_image.jpg','ehv_assignment_(3)_(1)_1707799528.docx',NULL,NULL,NULL,1,2,1,4,'INDJEEE',2,1,1,15,NULL,'<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>INdJEEE Journal Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/indjeee/archives?year=2024&amp;volume=1&amp;issue=1\" target=\"_blank\">Click Here</a></span><br></p>',NULL,1,217,1,'2024-02-13 04:45:28','2024-04-21 06:41:00'),(198,1,218,NULL,'A Comparative Analysis of Fuel Cell Hybrid Vehicles and Internal Combustion Engine Vehicles: A Case Study','<p>This publication presents a comprehensive comparative analysis between fuel cell hybrid vehicles (FCHVs) and internal combustion engine (ICE) vehicles, focusing on key aspects such as fuel efficiency, emissions, range, refueling infrastructure,cost, and performance. Drawing upon a case study conducted in [region or application], this research provides insights intot he relative advantages and disadvantages of each vehicle type,considering factors such as total cost of ownership, environmental impact, and driving experience</p>','no_image.jpg','IEEE_Conference_Template__2__(1)_1707799762.docx',NULL,NULL,NULL,1,2,1,4,'INDJEEE',4,1,1,15,NULL,'<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>INdJEEE Journal Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/indjeee/archives?year=2024&amp;volume=1&amp;issue=1\" target=\"_blank\">Click Here</a></span><br></p>',NULL,1,218,1,'2024-02-13 04:49:22','2024-04-21 06:38:28'),(199,1,220,NULL,'A Complete Assessment of Electric car impact on the Energy Industry, policy, technological Heaps, and power systems','<p>As eco-friendly electric vehicles (EVs) gain momen￾tum, research is crucial to understand their impact on power\r\n</p><p>systems. This study dives into this very issue, evaluating how\r\n</p><p>EVs affect energy distribution networks and specifically focusing\r\n</p><p>on the need for flexible charging station capacity. It cleverly\r\n</p><p>isolates the impact of EV charging from distributed generators\r\n</p><p>using data filtering techniques. Interestingly, the study goes\r\n</p><p>beyond traditional deterministic approaches by considering the\r\n</p><p>randomness associated with both travel distances of EVs and\r\n</p><p>their charging start times. This allows for a more realistic\r\n</p><p>assessment of how these factors influence grid demand and,\r\n</p><p>ultimately, the necessary capacity of distributed generators.\r\n</p><p>By comparing deterministic and random variable approaches,\r\n</p><p>the study highlights the importance of using more realistic\r\n</p><p>modeling techniques to effectively plan for the integration of\r\n</p><p>EVs into our power grids. This research holds valuable insights\r\n</p><p>for both policymakers and grid operators as they navigate the\r\n</p><p>increasing adoption of EVs and ensure a sustainable future for\r\n</p><p>our transportation and energy systems.</p>','no_image.jpg','IEEE_Conference_Template__1__1_1707800373.docx',NULL,NULL,NULL,1,2,1,4,'INDJEEE',5,1,1,15,'2024-04-23','<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>FDRP Website Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/indjeee/archives?year=2024&amp;volume=1&amp;issue=1\" target=\"_blank\">Click Here</a></span><br></p>',NULL,1,220,1,'2024-02-13 04:59:33','2024-04-23 04:50:21'),(200,1,222,NULL,'Fuel Cell and Battery Hybrid Systems for Electric Vehicles: A Comprehensive Feasibility Analysis','<p>Electric vehicles (EVs) are gaining popularity as a sustainable and efficient alternative to conventional vehicles. Nevertheless, EVs have drawbacks like a short driving range, a lengthy charging time, and expensive batteries. Fuel cell and battery hybrid systems (FBHS) are promising solutions that can overcome these challenges by combining the advantages of fuel cells and batteries. Fuel cells can provide high energy density, low emissions, and fast refueling, while batteries can provide high power density, fast response, and regenerative braking. However, FBHS require effective power management strategies (PMS) to optimally distribute the power between the fuel cell and the battery according to the load demand and the state of charge. This thesis proposes a novel PMS for FBHS for EVs, based on fuzzy logic and state machine control, and evaluates its effectiveness using standardized driving cycles. The proposed PMS consists of two levels: the first level uses a fuzzy logic controller (FLC) to determine the optimal power split ratio between the fuel cell and the battery, based on the power demand, the battery state of charge, and the fuel cell efficiency; the second level uses a state machine to regulate the power flow of the battery, based on the battery state of charge and the driving cycle. The proposed PMS aims to reduce the stress on the battery, extend the driving range, and enhance the fuel economy of the EV. The performance of the proposed PMS is compared with other existing PMS using different standardized driving cycles, such as the urban dynamometer driving schedule (UDDS), the highway fuel economy driving schedule (HWFET), and the new European driving cycle (NEDC). The results show that the proposed PMS can achieve better performance in terms of battery state of charge, fuel cell efficiency, and hydrogen consumption than the other PMS. The thesis contributes to the feasibility analysis of FBHS for EVs and provides a novel and effective PMS for such systems.</p>','no_image.jpg','Fuel_Cell_and_Battery_Hybrid_Systems_for_Electric_Vehicles__A_Comprehensive_Feasibility_Analysis_1707802601.pdf',NULL,NULL,NULL,1,2,1,4,'INDJEEE',2,1,1,2,NULL,NULL,NULL,0,222,NULL,'2024-02-13 05:36:41','2024-02-13 07:02:07'),(201,4,223,NULL,'FORECASTING BANKRUPTCY OF SELECTED CEMENT SECTOR  COMPANIES BY APPLYING ALTMAN’S Z-SCORE APPROACH','<p>This research paper presents an in-depth analysis of selected companies within the Indian cement sector, namely Ultratech Cement, Ambuja Cement, Shree Cement, ACC Cement, J.K. Cement, and Ramco Cement, utilizing Edward Altman\'s Z-score model to forecast their financial health and bankruptcy risks. Against the backdrop of India\'s burgeoning construction industry and the cement sector\'s pivotal role in infrastructure development, this study aims to provide valuable insights into the financial stability of these prominent players. By applying Altman\'s Z-score approach, which assesses liquidity, solvency, profitability, efficiency, and market valuation, this research categorizes the companies into safe, grey, or distress zones based on their calculated Z-scores. Through meticulous examination of financial statements and performance indicators, the findings reveal the relative financial robustness of each company, shedding light on their potential resilience or vulnerability in the face of economic challenges. This study contributes to the existing body of knowledge on financial forecasting and risk management within the Indian cement industry, offering actionable insights for investors, industry stakeholders, and policymakers. The outcomes of this analysis provide a nuanced understanding of the financial landscape within the sector, empowering stakeholders to make informed decisions and strategize effectively for sustainable growth and profitability.</p>','no_image.jpg','Amin_K.__Research_Paper_1707803236.docx',NULL,NULL,NULL,1,2,1,3,'IJRTMR',1,1,3,4,NULL,NULL,NULL,0,223,NULL,'2024-02-13 05:47:16','2024-02-13 09:03:41'),(203,1,224,NULL,'BALANCING BATTERY AND ENGINE: A REVIEW OF HYBRID ELECTRIC VEHICLES AND THEIR POTENTIAL PITFALLS','<p>&nbsp;an effort to replenish the world’s dwindling\r\n</p><p>petroleum reserves, researchers are exploring a range of alter-\r\n</p><p>native energy sources that might power hybrid vehicles. Because\r\n</p><p>of the damage it does to the environment, using fossil fuels in\r\n</p><p>vehicles is a major cause for concern. Various sources are being\r\n</p><p>studied for potential use in automobiles, including batteries, fuel\r\n</p><p>cells, super capacitors, and solar cells. Hybrid electric vehicles\r\n</p><p>(HEVs) powered by renewable energy sources could be the way of\r\n</p><p>the future when it comes to transportation. Power conditioning,\r\n</p><p>energy management systems (EMS), and propulsion systems\r\n</p><p>are just a few of the numerous components and techniques\r\n</p><p>covered in this article that pertain to HEVs. Various other\r\n</p><p>domains associated with HEVs are also discussed, including as\r\n</p><p>automotive systems and DC machinery. A variety of models and\r\n</p><p>techniques derived from experimental and simulation data are\r\n</p><p>detailed. With the help of relevant references, the table provides\r\n</p><p>a concise overview of the performance of various HEV system\r\n</p><p>combinations. A number of scholars have compiled an exhaustive\r\n</p><p>evaluation of HEVs, including all aspects such as EMS, source\r\n</p><p>combinations, and models. While hybrid electric vehicles (HEVs)\r\n</p><p>can be partially powered by present technology, more sophisti-\r\n</p><p>cated systems and increased dependability are still required. This\r\n</p><p>study has emphasised a number of problems, difficulties, and\r\n</p><p>characteristics pertinent to the upcoming generation of hybrid\r\n</p><p>vehicles.</p>','no_image.jpg','alex_conference_(2)_(2)_(1)_1707803482.docx',NULL,NULL,NULL,1,2,1,4,'INDJEEE',2,1,1,2,NULL,NULL,NULL,0,224,NULL,'2024-02-13 05:51:22','2024-02-13 07:03:16'),(204,1,225,NULL,'Electric and Hybrid Vehicles: An Overview','<p>The rise of electric vehicles (EVs) promises a new era of clean, efficient transportation, gradually phasing out tra- ditional gas-powered engines. Driven by environmental concerns and the desire to ditch expensive oil, EVs surpassed two million on the road worldwide by 2016. Several factors fuel their growth: advancements in battery technology and affordability, expanding public charging infrastructure, and government support. Battery electric vehicles (BEVs) and plug-in hybrids (PHEVs) are the leading contenders, each offering unique advantages and chal- lenges. To truly understand their potential, a deeper dive is needed. Quantify the environmental and economic benefits, delve into cutting-edge technologies, and analyze battery performance and affordability. Explore the details of government incentives and compare BEVs and PHEVs head-to-head. Don’t forget to address roadblocks like charging limitations, range anxiety, and recycling concerns. Finally, offer your own perspective: what does the future hold for EVs, and what can accelerate their widespread adoption? By painting a more detailed picture, you’ll illuminate the true potential of EVs to revolutionize transportation.</p>','no_image.jpg','Hybrid_Vehicles_1707804964.docx',NULL,NULL,NULL,1,2,1,4,'INDJEEE',2,1,1,2,NULL,NULL,NULL,0,225,NULL,'2024-02-13 06:16:04','2024-02-13 07:09:08'),(205,3,197,NULL,'EVALUATION OF ANTHELMINTIC ACTIVITY OF CAESALPINIA PULCHERRIMA LEAF EXTRACT BY IN-SILICO AND IN-VITRO STUDIES','<p>Abstract:\r\n</p><p>The Greek term for \"helminthes\" means \"worm.\" Human-infecting parasites fall into one of two categories: keepsakes or heirlooms. Heirlooms are parasites that have been passed down from African ancestors, while souvenirs are parasites that humans have picked up from animals through migration, evolution, and agricultural activities. These helminthic infections are the most prevalent human infectious agents in poor nations. The helminthic parasite affects around 2 billion people worldwide, or more than 25% of the total population. It is a big problem in developing nations, particularly for young people. Therefore, the goal of the current study was to extract the plant\'s active ingredients and test the crude extract\'s anti-helminthic properties. In this study, we worked on the ceasalpenia pulcherima plant with a focus on natural remedies for the treatment of helmintiasis. The chief scientist of Sri Konda Laxman Telangana State Horticulture University, Floriculture Research Station, Rajndranagar, authenticated the true nature of the plant. Water and ethanol were utilized in the extraction procedure. To find out what chemicals are in the alcoholic extract, a screening test is performed on it. The flavonoid test on the extract came out positive. Using Albendazole as the prescribed medication, the anthelmintic action was carried out on Indian earthworms. In Indian earth worms, we found that alcoholic extract exhibits good antihelmintic action. By Insilco studies we found the interaction of flavanoids with antihelmentic proteins.\r\n</p><p>Key words: Helminthes, ceasalpenia pulcherima, flavonoids, extractioin, in silico study.\r\n</p><p><br></p>','no_image.jpg','sadana_article_docx_1707810570.docx',NULL,NULL,NULL,1,2,1,3,'IJRTMR',1,1,1,15,'2024-02-15','<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJRTMR Journal Link: <span style=\"background-color: rgb(255, 255, 0);\"><a href=\"https://ijrtmr.com/archives?year=2024&amp;volume=4&amp;issue=1\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link: <span style=\"background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijrtmr/archives?year=2024&amp;volume=4&amp;issue=1\" target=\"_blank\">Click Here</a></span><br><br>Crossref Link(DOI): <span style=\"background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/search/works?q=10.59256%2Fijrtmr.20240401007&amp;from_ui=yes\" target=\"_blank\">Click Here</a> </span>(Please check after 24 hrs.)<br></p>','paid-2',1,197,1,'2024-02-13 07:49:30','2024-02-15 15:11:10'),(206,3,197,NULL,'REVIEW ON SILVER NANO PARTICLES','<p>The aspect of human life, making nanotechnology an exciting field for biomedical applications. Over the years, metal nanoparticles, such as silver, have attracted a lot of attention because of their extraordinary optical, electrical, and antibacterial qualities. Unfortunately, those nanoparticles\' aggregation and toxicity have restricted their employment in more advantageous applications. Choosing therapeutically active bimolecular judiciously to functionalize the surface of these particles would undoubtedly improve their biological applicability and biocompatibility. In addition to providing an overview of the current approaches being used to biofunctionalize silver nanoparticles for certain purposes, the current review the distinct size-dependent properties of nanoscale materials have had a significant impact on every aims to highlight the application areas of these particles. Nanotechnology is a promising subject for biomedical applications because of the distinctive size-dependent features of materials at the nanoscale that have greatly touched all aspects of human life. Because of their exceptional optical, electrical, and antibacterial qualities, metal nanoparticles—like silver—have attracted a lot of attention over time. However, their employment in highly optimized applications has been limited due to their poisonous nature and tendency to aggregate. The biocompatibility and biological applicability of these particles are certain to be improved by the logical selection of therapeutically active bimolecular to functionalize their surface. The present review endeavors to emphasize the various application areas of silver nanoparticles while providing an overview of the    current approaches entailed in biofunctionalizing these particles for particular uses.</p>','no_image.jpg','REVIEW_ON_SILVER_NANO_PARTICLES____DHARANI_1___Copy_1707813264.docx',NULL,NULL,NULL,1,2,1,3,'IJRTMR',2,1,1,15,'2024-02-15','<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJRTMR Journal Link: <span style=\"background-color: rgb(255, 255, 0);\"><a href=\"https://ijrtmr.com/archives?year=2024&amp;volume=4&amp;issue=1\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link: <span style=\"background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijrtmr/archives?year=2024&amp;volume=4&amp;issue=1\" target=\"_blank\">Click Here</a></span><br><br>Crossref Link(DOI):<a href=\"https://search.crossref.org/search/works?q=10.59256%2Fijrtmr.20240401008&amp;from_ui=yes\" target=\"_blank\"> </a><span style=\"background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/search/works?q=10.59256%2Fijrtmr.20240401008&amp;from_ui=yes\" target=\"_blank\">Click Here</a></span> (Please check after 24 hrs.)<br></p>','paid-2',1,197,1,'2024-02-13 08:34:24','2024-02-15 15:12:55'),(207,1,219,NULL,'OPTIMIZATION OF GEOMETRICAL CHARACTERSTICS OF BUILDING BY USING DIAGRID SYSTEM AGAINST LAERAL FORCES','<p>In this present era of population growth and scarcity of available land, engineers and architects are bound to construct high-rise buildings. Lateral loads are considered as most dominant factor in the construction of high-rise buildings. To improve the efficiency of high-rise buildings, new structural systems like diagrid and hexa-grid are introduced. A Diagrid structural system resists lateral load by presence of inclined columns in the periphery of the building. In this study, various diagrid models with different diagrid angles were analyzed through pushover analysis by using FEMA 356 &amp; ATC 40 and the results were compared with a conventional frame building of same dimension. Pushover analysis is a good way of accessing the sequence of failure by indicating hinges. The method can be used where the structure needs to be fine-tuned or it needs to be retrofitted. In this study it was found that diagrid performs well against lateral forces in comparison to conventional frame building. The hinge results of test beam showed that the 1-story diagrid module gave around 70% lower values of moment at plastic stage in comparison to simple frame structure. The performance point of all the diagrids were also better than simple frame with around 70% plus values. The story displacement value for all the diagrid modules was efficient in relation to simple frame structure with almost 70% lower displacement values. This study suggests that the usage of diagrids in building helps in improving performance of tall structures and also helps in reducing the overall cost of the structure.</p>','no_image.jpg','IJIRE_Manuscript_VAISH_1707822323.docx',NULL,NULL,NULL,1,2,1,1,'IJIRE',2,1,1,15,'2024-02-14','<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJIRE Journal Link: <span style=\"background-color: rgb(255, 255, 0);\"><a href=\"https://theijire.com/archives?year=2024&amp;volume=5&amp;issue=1\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link: <span style=\"background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijire/archives?year=2024&amp;volume=5&amp;issue=1\" target=\"_blank\">Click Here</a></span><br></p>','paid-1',1,219,1,'2024-02-13 11:05:23','2024-02-15 16:27:48'),(208,1,221,NULL,'A Comparative Study of Lithium-ion and Sodium-ion Batteries for Hybrid Electric Vehicle','<p>Lithium-ion batteries (LIBs) and sodium-ion batteries (SIBs) are two promising candidates for hybrid electric vehicles (HEVs), which require high-performance and low-cost energy storage systems. There are trade-offs between the advantages and disadvantages of these two types of batteries, such as energy density, power density, cost, safety, and environmental impact. In this paper, we review the current state-of-the-art of LIBs and SIBs for HEVs and compare their performance, challenges, and opportunities. We also discuss the potential of hybrid battery packs that combine LIBs and SIBs to achieve synergistic benefits and overcome their respective limitations.  SIBs are not yet ready to replace LIBs in HEVs, but they may complement them in some applications, especially in moderate-range and low-temperature scenarios. It recommends further research and innovation to improve the electrochemical properties, materials, and engineering of SIBs, as well as to optimize the design and management of hybrid battery packs.</p>','no_image.jpg','IEEE_Conference_Template__1__(1)_1707836148.docx',NULL,NULL,NULL,1,2,1,4,'INDJEEE',2,1,1,2,NULL,NULL,NULL,0,221,NULL,'2024-02-13 14:55:48','2024-02-13 14:59:02'),(209,1,216,NULL,'HYBRID ELECTRIC VEHICLES- A REVIEW','<p>Unexpectedly, the notion of a hybrid electric vehicle has roots nearly as ancient as the inception \r\n</p><p>of automobiles. Initially, the primary objective wasn\'t focused on reducing fuel consumption \r\n</p><p>but rather on bolstering the performance of internal combustion engines (ICE). In the nascent \r\n</p><p>stages, ICE engineering appeared more conventional compared to the burgeoning field of \r\n</p><p>electric motor engineering. The debut of hybrid vehicles occurred at the prestigious Paris Salon \r\n</p><p>of 1899, where manufacturers such as Pieper from Liège, Belgium, and Vendovelli and Priestly \r\n</p><p>Electric Carriage Company of France showcased their innovations.\r\n</p><p>These early hybrid vehicles marked a pivotal moment in automotive history, demonstrating the \r\n</p><p>potential synergy between combustion engines and electric propulsion. While the primary aim \r\n</p><p>wasn\'t explicitly aimed at fuel efficiency, the concept laid the groundwork for future \r\n</p><p>advancements in hybrid technology. The integration of electric motors alongside ICE not only \r\n</p><p>offered performance enhancements but also hinted at the prospect of reducing environmental \r\n</p><p>impact, albeit in a rudimentary form compared to modern standards.\r\n</p><p>As the automotive industry progressed, the focus on fuel efficiency gradually became more \r\n</p><p>pronounced. Hybrid technology evolved to prioritize the optimization of energy consumption, \r\n</p><p>with advancements in battery technology and electric motor efficiency playing significant \r\n</p><p>roles. The early 20th century saw sporadic developments in hybrid vehicles, but it wasn\'t until \r\n</p><p>the latter half of the century that significant strides were made in mainstream adoption.\r\n</p><p>The oil crisis of the 1970s spurred renewed interest in alternative propulsion technologies, \r\n</p><p>including hybrids. Automakers began exploring various hybrid architectures and refining their \r\n</p><p>designs to strike a balance between performance, efficiency, and cost-effectiveness. However, \r\n</p><p>it wasn\'t until the turn of the 21st century that hybrid vehicles truly gained traction in the \r\n</p><p>market, driven by advancements in battery technology, stricter emissions regulations, and \r\n</p><p>growing environmental awareness among consumers.\r\n</p><p>Today, hybrid electric vehicles have become commonplace, with a wide range of models \r\n</p><p>available across various automotive segments. From compact hatchbacks to luxury SUVs, \r\n</p><p>hybrid technology has permeated every corner of the market, offering consumers an eco-\r\n</p><p>friendly alternative without compromising on performance or convenience. Moreover, the \r\n</p><p>continued evolution of hybrid systems, coupled with the rise of plug-in hybrids and electric \r\n</p><p>vehicles, signals a promising future for sustainable mobility. In conclusion, while the concept of hybrid electric vehicles may have originated over a century \r\n</p><p>ago, its significance continues to resonate in the contemporary automotive landscape. What \r\n</p><p>began as a modest attempt to augment ICE performance has blossomed into a transformative \r\n</p><p>force driving the transition towards greener transportation solutions. As we look ahead, the \r\n</p><p>legacy of those pioneering hybrid vehicles serves as a testament to the enduring quest for \r\n</p><p>innovation and sustainability in the automotive industry.</p>','no_image.jpg','HYBRID_ELECTRIC_VEHICLES_1707878746.pdf',NULL,NULL,NULL,1,2,1,1,'IJIRE',2,1,1,5,NULL,NULL,NULL,1,216,NULL,'2024-02-14 02:45:46','2024-04-22 09:45:10'),(210,1,231,NULL,'Enhancing energy efficiency in electric vehicles: Innovation and barriers','<p>The transition to electric vehicles (EVs) represents&nbsp;<span style=\"font-size: 0.875rem;\">a pivotal shift in the automotive landscape, driven by a collective c</span><span style=\"font-size: 0.875rem;\">ommitment to mitigate environmental impacts and reduce de-</span><span style=\"font-size: 0.875rem;\">pendence on fossil fuels. This paper delves into the critical theme o</span><span style=\"font-size: 0.875rem;\">f enhancing energy efficiency in electric vehicles, exploring both&nbsp;</span><span style=\"font-size: 0.875rem;\">innovations and persistent barriers hindering widespread adopt</span><span style=\"font-size: 0.875rem;\">ion. As the demand for sustainable transportation intensifies, the&nbsp;</span><span style=\"font-size: 0.875rem;\">focus on maximizing energy efficiency becomes paramount.&nbsp;</span>The&nbsp;<span style=\"font-size: 0.875rem;\">abstract encapsulates a comprehensive examination of cutting&nbsp;</span><span style=\"font-size: 0.875rem;\">edge innovations in battery technologies, electric motor designs,</span><span style=\"font-size: 0.875rem;\">and vehicle architectures, each contributing to the overall goal&nbsp;</span><span style=\"font-size: 0.875rem;\">of minimizing energy consumption. Simultaneously, the paper&nbsp;</span><span style=\"font-size: 0.875rem;\">dissects barriers that impede the seamless integration of these&nbsp;</span><span style=\"font-size: 0.875rem;\">innovations, including cost implications, charging infrastructure&nbsp;</span><span style=\"font-size: 0.875rem;\">challenges, and consumer perceptions. Through insightful case&nbsp;</span><span style=\"font-size: 0.875rem;\">studies and a forward-looking exploration of future directions,</span><span style=\"font-size: 0.875rem;\">this paper aims to provide a nuanced understanding of the&nbsp;</span><span style=\"font-size: 0.875rem;\">dynamic landscape of energy efficiency in electric vehicles.</span><span style=\"font-size: 0.875rem;\">By navigating the delicate balance between advancements and&nbsp;</span><span style=\"font-size: 0.875rem;\">barriers, this study contributes to the ongoing discourse on&nbsp;</span><span style=\"font-size: 0.875rem;\">sustainable mobility and informs future developments in the&nbsp;</span><span style=\"font-size: 0.875rem;\">realm of electric transportation.</span></p>','no_image.jpg','IEEE_Conference_Template_(13)_1707882838.docx',NULL,NULL,NULL,1,2,1,4,'INDJEEE',2,1,1,2,NULL,NULL,NULL,0,231,NULL,'2024-02-14 03:53:58','2024-02-14 04:26:14'),(211,1,232,NULL,'A comprehensive review of hybrid electric vehicles,techngical advancement and overcoming challenges','<p>Hybrid Electric Vehicles have emerged as a promising solution to address the pressing issues of environmental</p><p>sustainability and energy efficiency in the automotive industry.</p><p>This paper presents a comprehensive review of the latest advancements in HEV technology, focusing on key innovations and</p><p>breakthroughs that have shaped the landscape of sustainable</p><p>transportation. Beginning with an overview of the fundamental</p><p>principles of HEVs, including powertrain architectures and</p><p>energy management systems, the paper explores recent developments in battery technology, electric motor design, and control</p><p>strategies. Furthermore, this review highlights the challenges and</p><p>barriers hindering the widespread adoption of HEVs, such as</p><p>cost, infrastructure, and consumer acceptance. Additionally, the</p><p>paper examines emerging trends in HEV design, such as plug-in</p><p>hybrid systems and vehicle-to-grid integration, which have the</p><p>potential to further enhance the efficiency and environmental</p><p>impact of HEVs</p>','no_image.jpg','conference_paper_(2)_1707887809.pdf',NULL,NULL,NULL,1,2,1,4,'INDJEEE',2,3,1,3,NULL,NULL,NULL,0,232,NULL,'2024-02-14 05:16:49','2024-02-14 14:59:50'),(215,1,229,NULL,'Driving Towards Tomorrow: Exploring the Evolution and Challenges of Hybrid Electric Vehicles','<p>Hybrid electric vehicles (HEVs) represent a piv-\r\n</p><p>otal advancement in automotive technology, blending internal\r\n</p><p>combustion engines with electric propulsion systems to redefine\r\n</p><p>the future of transportation. This review paper comprehen-\r\n</p><p>sively explores the intricate components, diverse types, versatile\r\n</p><p>operation modes, compelling advantages, persistent difficulties,\r\n</p><p>and groundbreaking innovations within the realm of HEVs.\r\n</p><p>HEVs encompass various types, including full hybrids, plug-\r\n</p><p>in hybrids, and mild hybrids, each offering distinct benefits in\r\n</p><p>terms of efficiency, range, and environmental impact. Innovative\r\n</p><p>powertrain architectures, next-generation batteries, regenerative\r\n</p><p>braking systems, predictive energy management, electrification\r\n</p><p>of auxiliary systems, vehicle-to-grid integration, and advanced\r\n</p><p>driver assistance systems are among the cutting-edge innovations\r\n</p><p>shaping the evolution of HEV technology. However, challenges\r\n</p><p>such as cost barriers, battery degradation concerns, weight con-\r\n</p><p>straints, maintenance requirements, infrastructure limitations,\r\n</p><p>and consumer adoption hurdles persist, underscoring the need\r\n</p><p>for collaborative efforts to overcome obstacles and accelerate the\r\n</p><p>transition to a sustainable transportation paradigm. Through an\r\n</p><p>in-depth analysis of HEV components, types, operation modes,\r\n</p><p>advantages, innovations, and difficulties, this review paper pro-\r\n</p><p>vides valuable insights into the current state and future prospects\r\n</p><p>of hybrid electric vehicles in the automotive industry.</p>','no_image.jpg','ppjjjamm_(1)_1707889701.docx',NULL,NULL,NULL,1,2,1,4,'INDJEEE',2,1,1,2,NULL,NULL,NULL,0,229,NULL,'2024-02-14 05:48:21','2024-02-14 15:03:15'),(220,2,235,NULL,'Evaluation of anti-urolithiatic activity of seed extract of Cuminum cyminum','<p>Urolithiasis or kidney stone disease is a urologic ailment that has a high prevalence rate worldwide and medicinal \r\n</p><p>plants have been widely used for alternative therapy. A wide range of medicinal plants have been used conservatively \r\n</p><p>for urolithiasis due to their fewer side effects and because they contain copious phytochemicals that show \r\n</p><p>advantageous effects in urolithiasis. Cuminum cyminum traditionally used in the treatment of urolithiasis. \r\n</p><p>Hyperoxaluria and hypercalciuria are among the major risk factors in pathogenesis of urinary stone formation. \r\n</p><p>Evaluation of various medicinal plants are done mainly against calcium oxalate. In this present study, the \r\n</p><p>antiurolithiatic potential in Cuminum cyminum was investigated through invitro assay. The work was performed by \r\n</p><p>using invitro Anti-urolithiatic model for calculating percentage in comparison with standard drug cystone. The antiurolithiatic properties were evaluated by titrimetric and turbidity assay. The result shows that for C. cyminum folds \r\n</p><p>(55%) and for standard drug cystone (82%) for titrimetric assay. For turbidity assay. C. cyminum has significant \r\n</p><p>properties (47.9±19%). The findings of the nucleation assay indicate that phytoconstituents inhibited the \r\n</p><p>crystallization of CaOx in solution. The size and the number of calcium oxalate crystals decreased with increasing \r\n</p><p>concentration upto 400µg of the phytoconstituents. The study concludes that the seed extracts of Cuminum cyminum\r\n</p><p>have inhibitory effect on calcium oxalate for crystal nucleation. It also showed great efficacy in the dissolution of \r\n</p><p>calcium oxalate crystals. Thus, this extract may be valuable resources for treatment of urolithiasis.</p>','no_image.jpg',NULL,NULL,NULL,NULL,1,2,1,2,'IJSREAT',1,1,1,3,NULL,NULL,NULL,0,235,NULL,'2024-02-14 15:29:10','2024-02-14 15:36:40'),(221,1,227,NULL,'Case Study of Analysis of Wind Load on U and V Shape  High Rise Building: A Review','<p>Conclusively, this case study provides an exhaustive and methodical investigation of wind load analysis on U and V-shaped high-rise structures, amalgamating conclusions from diverse scholars in the domain. The comprehensive examination and juxtaposition of current research techniques highlight the complex character of wind load assessment, utilizing a range of methods including wind tunnel testing, empirical observations, and Computational Fluid Dynamics (CFD) simulations. The research makes a substantial contribution to our comprehension of the complex relationships that exist between wind forces and the unique architectural arrangements of U and V shapes. By assimilating insights from numerous studies, the research successfully unveils commonalities, identifies divergences, and highlights emerging trends in the analysis of wind-induced effects on these high-rise structures. Professionals in high-rise building design, and architects and engineers. The goal of the research is to make a substantial contribution to the ongoing development of wind load analysis techniques. Understanding the building\'s response to wind rotation at different incident angles is a specific focus of this study. Validation against experimental data ensures the accuracy of CFD simulations, often involving model refinement based on real-world observations. Overall, this research contributes to a comprehensive understanding of building aerodynamics, offering insights into the intricate interplay between structures and wind forces.</p>','no_image.jpg','New_review_paper_update_1707996503.docx',NULL,NULL,NULL,1,2,1,2,'IJSREAT',2,1,1,15,'2024-02-17','<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJSREAT Journal Link: <span style=\"background-color: rgb(255, 255, 0);\"><a href=\"https://ijsreat.com/archives?year=2024&amp;volume=4&amp;issue=1\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link:<span style=\"background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijsreat/archives?year=2024&amp;volume=4&amp;issue=1\" target=\"_blank\"> Click Here</a></span><br><br>Crossref Link(DOI): <span style=\"background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/?from_ui=&amp;q=10.59256%2Fijsreat.20240401007\" target=\"_blank\">Click Here</a></span> (Please check after 24 hrs.)<br></p>','paid-2',1,227,1,'2024-02-15 11:28:23','2024-02-17 07:27:08'),(222,1,239,NULL,'Stock Price Prediction Using LSTM','<p style=\"text-align: justify;\"><b><i>Abstract: </i></b>Wealth management tools manage and assign families, individuals, enterprises, and institutions to achieve the&nbsp;<span style=\"font-size: 0.875rem;\">purpose of increasing and maintaining value to accelerate asset growth. Among them, in investment and financial&nbsp;</span><span style=\"font-size: 0.875rem;\">management, favourite product of people for investment often stocks, because the stock market has great advantages and&nbsp;</span><span style=\"font-size: 0.875rem;\">charm, especially compared with other investment methods. Designing robust and accurate predictive models for stock&nbsp;</span><span style=\"font-size: 0.875rem;\">price prediction has been an active area of research over a long time. Developing an accurate stock prediction method can&nbsp;</span><span style=\"font-size: 0.875rem;\">help investors in making profitable decisions by reducing the investment risks. Our proposition includes a regression model&nbsp;</span><span style=\"font-size: 0.875rem;\">built on long-and-short-term memory (LSTM) network-based predictive models. These spatial features are then fed into&nbsp;</span><span style=\"font-size: 0.875rem;\">LSTM layers, which capture temporal dependencies and long-range correlations in the time series data. The combination&nbsp;</span><span style=\"font-size: 0.875rem;\">of these two architectures enhances the model\'s ability to capture both short-term fluctuations and long-term trends in stock&nbsp;</span><span style=\"font-size: 0.875rem;\">prices. This system will provide accurate outcomes in comparison to currently available stock price predictor algorithms.&nbsp;</span><span style=\"font-size: 0.875rem;\">The network is trained and evaluated with various sizes of input data to urge the graphical outcomes. This system will&nbsp;</span><span style=\"font-size: 0.875rem;\">provide accurate outcomes in comparison to currently available stock price predictor algorithms.</span></p><p style=\"text-align: justify;\"><i><b>Key Word: </b>Long and Short-Term Memory, Time-Series Data, Recurrent Neural Network.</i></p>','no_image.jpg','Survey__Paper_1708102074.docx',NULL,NULL,NULL,1,2,1,6,'INDJCST',1,1,1,15,'2024-02-19','<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IndjCST Journal Link:<a href=\"https://indjcst.com/archives?year=2024&amp;volume=3&amp;issue=1\" target=\"_blank\"> </a><span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://indjcst.com/archives?year=2024&amp;volume=3&amp;issue=1\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/indjcst/archives?year=2024&amp;volume=3&amp;issue=1\" target=\"_blank\">Click Here</a></span><br><br>Crossref Link(DOI): <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/?from_ui=&amp;q=10.59256%2Findjcst.20240301001\" target=\"_blank\">Click Here</a></span> (Please check after 24 hrs.)<br></p>','paid-2',1,239,1,'2024-02-16 16:47:54','2024-02-19 05:27:14'),(223,3,240,NULL,'Investigation, Synthesis And Evaluation of Herbal Antifungal Spray of Psidium guajava leaves extract','<p>This research aims to explore the preparation and evaluation of an antifungal spray derived from Psidium guajava&nbsp;<span style=\"font-size: 0.875rem;\">(guava). The study focuses on harnessing the potential antifungal properties of Psidium guajava extracts to develop an effective and&nbsp;</span><span style=\"font-size: 0.875rem;\">environmentally friendly spray. The methodology involves extraction of bioactive compounds from guava, formulation of the antifungal spray, and subsequent evaluation of its efficacy against common&nbsp;</span><span style=\"font-size: 0.875rem;\">fungal pathogens. The observations provide insights into the spray\'s inhibitory effects on fungal growth. Results indicate promising&nbsp;</span><span style=\"font-size: 0.875rem;\">antifungal activity, showcasing the potential of Psidium guajava as a natural source for antifungal agents. The conclusion highlights the significance of this research in developing sustainable and eco-</span><span style=\"font-size: 0.875rem;\">friendly alternatives in the field of antifungal solutions.</span></p><p>\r\n</p>','no_image.jpg','Research_Spray_1708138278.docx',NULL,NULL,NULL,1,2,1,3,'IJRTMR',1,1,1,5,NULL,NULL,NULL,0,240,NULL,'2024-02-17 02:51:18','2024-02-18 04:38:49'),(224,1,237,NULL,'PDF-Chat SaaS Platform Using MERN Stack','<p>With the rise of PDF-Driven Question Answering Software as a Service (SaaS) platforms in recent years, the field of \r\n</p><p>document processing technology has experienced a paradigm shift. Examining these systems difficulties in detail, this review \r\n</p><p>article concentrates on how they include Next.js, React, Prisma, TRPC, and Tailwind CSS into the MERN (MongoDB, Express.js, \r\n</p><p>React, Node.js) stack. With a careful analysis of the architecture, functions, and ramifications, this study seeks to offer a thorough \r\n</p><p>grasp of the technological developments behind this groundbreaking methodology. The research holds significance due to its \r\n</p><p>intersectionality, as it seamlessly integrates document processing, user interaction, and data administration. The foundation of \r\n</p><p>these systems is the use of Prisma for effective database administration, Next.js and React for creating dynamic and responsive \r\n</p><p>user interfaces, TRPC for reliable API connectivity, and Tailwind CSS for contemporary and beautiful styling. A comprehensive\r\n</p><p>strategy like this tackles the difficulties in processing PDF documents for user identification, question-answering, and \r\n</p><p>facilitating seamless communication between front-end and back-end components. The research attempts to significantly \r\n</p><p>advance our understanding of PDF-driven question-answering SaaS systems by doing this thorough review. Giving insights into \r\n</p><p>the opportunities and complexities of technology, it is a useful tool for practitioners, academics, and developers. These results\r\n</p><p>highlight how important MERN stack technologies are for developing reliable, scalable, and user-focused solutions for the \r\n</p><p>changing document-centric application market.\r\n</p>','no_image.jpg','PDF_Chat_SaaS_Platform_1708183191.docx',NULL,NULL,NULL,1,2,1,1,'IJIRE',2,1,1,15,'2024-02-19','<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJIRE Journal Link: <span style=\"background-color: rgb(255, 255, 0);\">Click Here</span><br><br>FDRP Website Link: <span style=\"background-color: rgb(255, 255, 0);\">Click Here</span><br><br>Crossref Link(DOI): <span style=\"background-color: rgb(255, 255, 0);\">Click Here </span>(Please check after 24 hrs.)<br></p>','paid-2',1,237,1,'2024-02-17 15:19:51','2024-02-19 05:55:25'),(225,1,242,NULL,'Social Media App For Connecting Similar Interest People Using Flutter','<p>Understanding interest similarity in Online Social Networks (OSNs) is crucial for various applications. This study addresses the challenge of determining interest similarity on platforms like Facebook, where users may not explicitly disclose their interests. Utilizing a substantial dataset of 479,048 users and 5,263,351 user-generated interests, the research focuses on movies, music, and TV shows. Findings reveal homophily in interest similarity, demonstrating that individuals tend to share more similar tastes when they have comparable demographic information or are connected as friends.\r\n</p><p>A practical prediction model is proposed, facilitating the selection of users with high-interest similarities and enhancing decision-making for OSN applications. Additionally, the paper introduces a novel method using a tag network to connect users with similar interests, outperforming traditional methods by providing a more efficient means of connecting like-minded individuals in social networks.</p>','no_image.jpg','Social_Media_App_for_Connecting_Similar_Interests_People_Using_flutter_1708188624.docx',NULL,NULL,NULL,1,2,1,1,'IJIRE',2,1,1,15,'2024-02-19','<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJIRE Journal Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://theijire.com/archives?year=2024&amp;volume=5&amp;issue=1\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link:<span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijire/archives?year=2024&amp;volume=5&amp;issue=1\" target=\"_blank\"> Click Here</a></span><br><br>Crossref Link(DOI): <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/search/works?q=10.59256%2Fijire.20240501008&amp;from_ui=yes\" target=\"_blank\">Click Here </a></span>(Please check after 24 hrs.)<br></p>','paid-2',1,242,1,'2024-02-17 16:50:24','2024-02-19 05:54:53'),(226,6,203,NULL,'Imploding Detonation Waves in Self-gravitating Ideal Gas','<p>In the present paper, the propagation of strong spherical imploding detonation waves in a reacting ideal gas under the effect of self-gravitation of the non-homogeneous medium has been investigated, by the help of Chester-Chisnell-Whitham (CCW) theory. It is considered that detonation wave is initially Chapman-Jouguet. Initial taking the density distribution law as power decreasing with distance, the analytical expressions for the detonation velocity just behind the front along with other flow variables are derived. Neglecting the effect of overtaking disturbances the variation of  non-dimensional detonation velocity, the pressure and density with the propagation distance have been calculated numerically. The effect of change in density parameter at different Alfven Mach number on the convergence of detonation front have been discussed though graphs in details. Finally, it is found that density parameter, and Alfven Mach number of gas have significant role on propagation of strong spherical detonation front in reacting ideal gas with gravitation effect on all the post-flow variables. The software MATLAB have been used for computation of the problem.&nbsp;</p>','no_image.jpg','IJSREAT_Manuscript_gangwar_gravi_detonation_1708255231.docx',NULL,NULL,NULL,1,2,1,2,'IJSREAT',1,1,1,15,'2024-02-20','<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJSREAT Journal Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://ijsreat.com/archives?year=2024&amp;volume=4&amp;issue=1\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijsreat/archives?year=2024&amp;volume=4&amp;issue=1\" target=\"_blank\">Click Here</a></span><br><br>Crossref Link(DOI): <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/?from_ui=&amp;q=10.59256%2Fijsreat.20240401008\" target=\"_blank\">Click Here</a></span> (Please check after 24 hrs.)<br></p>','paid-2',1,203,1,'2024-02-18 11:20:31','2024-02-19 08:57:00'),(227,1,245,NULL,'A GENETIC ALGORITHM BASED HYBRID ROUTING TECHNIQUE FOR  IoT SYSTEMS','<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Internet is gaining new heights in the today’s technological environment. Internet of things (IoT) is a new class of Internet based heterogeneous networked application systems which uses various types of sensor/detectors and devices for the exchange and collection of data. Devices need to be in the radio range and must remain continuously connected to the internet. IoT can sense and control the objects remotely across existing networked architecture and builds chances for direct combination among the physical world and computer-based systems. It is believed that, in future many of the household application will be based on IoT. Due to their applications in situations such as building home automation, emergencies, crisis management, energy management and healthcare, message security becomes of top importance in IoT. An optimized routing scheme using the intelligent mathematical techniques, which includes Genetic Algorithms(GA) and Analytical Hierarchy Process(AHP), is proposed here and an optimized route can be encrypted using cryptanalytic techniques. Simulation results of GA and AHP are also presented here for the proposed network. It has been found that overall efficiency of the IoT system can be greatly improved with the proposed model. A comparison is also provided in discussion section which demonstrates that hybrid algorithms developed for IoT systems performs much better than traditional routing algorithms.\r\n</p><p><br></p><p>\r\n</p>','no_image.jpg','Research_paper__Rakesh_Kumar_1708406746.docx',NULL,NULL,NULL,1,2,1,2,'IJSREAT',1,1,1,15,'2024-02-22','<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJSREAT Journal Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://ijsreat.com/archives?year=2024&amp;volume=4&amp;issue=1\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijsreat/archives?year=2024&amp;volume=4&amp;issue=1\" target=\"_blank\">Click Here</a></span><br><br>Crossref Link(DOI): <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/?from_ui=&amp;q=10.59256%2Fijsreat.20240401009\" target=\"_blank\">Click Here</a></span> (Please check after 24 hrs.)<br></p>','paid-2',1,245,1,'2024-02-20 05:25:46','2024-02-21 14:42:09'),(228,7,248,NULL,'Effect of Excess Fluoride in Ground Water on Human Health and Fluorosis','<p>Fluoride is one of the most important geo-environmental issues in the coming days. The excessive ingestion of fluoride causes the disease, is called fluorosis. Present work deals with study of fluoride content in groundwater and its impact on human health.</p>','no_image.jpg','paper@shalini_1708447998.doc',NULL,NULL,NULL,1,2,1,3,'IJRTMR',1,1,1,15,'2024-02-24','<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJRTMR Journal Link: <span style=\"background-color: rgb(255, 255, 0);\"><a href=\"https://ijrtmr.com/archives?year=2024&amp;volume=4&amp;issue=1\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link:<a href=\"https://fdrpjournals.org/ijrtmr/archives?year=2024&amp;volume=4&amp;issue=1\" target=\"_blank\"> </a><span style=\"background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijrtmr/archives?year=2024&amp;volume=4&amp;issue=1\" target=\"_blank\">Click Here</a></span><br><br>Crossref Link(DOI): <span style=\"background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/?from_ui=&amp;q=10.59256%2Fijrtmr.20240401010\" target=\"_blank\">Click Here</a></span> (Please check after 24 hrs.)<br></p>','paid-2',1,248,1,'2024-02-20 16:53:18','2024-02-24 06:44:26'),(230,1,250,NULL,'File Packer Unpacker','<p>The File Packer/Unpacker Application is a software designed to streamline the process of compressing and decompressing files and folders. In the digital age, the need for efficient data storage and transfer is paramount. This Application aims to address this need by providing a versatile and user-friendly tool for packing multiple files and directories into a single compressed archive, as well as extracting them when required.&nbsp;<span style=\"font-size: 0.875rem;\">The application features a robust user interface that allows users to select files and folders for packing and specify compression settings. It supports various compression algorithms, such as ZIP, GZIP, and RAR, offering flexibility to accommodate different user preferences and requirements. Additionally, the application provides options for password protection and encryption to enhance data security.&nbsp;</span><span style=\"font-size: 0.875rem;\">In a world where data management and security are of paramount importance, Our File Packer/Unpacker Application aims to simplify and enhance the process of file compression and decompression. This Application offers a versatile and secure solution for individuals and organizations seeking to optimize their data storage and transfer operations.</span></p><p><br></p>','no_image.jpg','Research_Paper___File_Packer_Unpacker_1708523647.docx',NULL,NULL,NULL,1,2,1,3,'IJRTMR',5,1,1,15,'2024-02-23','<b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJRTMR Journal Link: <span style=\"background-color: rgb(255, 255, 0);\"><a href=\"https://ijrtmr.com/archives?year=2024&amp;volume=4&amp;issue=1\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link: <span style=\"background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijrtmr/archives?year=2024&amp;volume=4&amp;issue=1\" target=\"_blank\">Click Here</a></span><br><br>Crossref Link(DOI): <span style=\"background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/?from_ui=&amp;q=10.59256%2Fijrtmr.20240401009\" target=\"_blank\">Click Here</a></span> (Please check after 24 hrs.)<br>','paid-2',1,250,1,'2024-02-21 13:54:07','2024-02-22 13:34:04'),(231,1,252,NULL,'A Review on Smart Aqua Metrics: Water Quality-Based Billing System','<p>Water quality-based billing systems have attracted a lot of attention among the novel technologies that have emerged in response to the growing demand for effective management of water resources. The study explores the incorporation of sensor networks and Internet of Things (IoT) devices in water quality monitoring, clarifying their function in gathering the data. In addition, the study includes the challenges and possibilities related to the implementation of water quality-driven billing system, taking into factors like accuracy, reliability, and flexibility. In this paper a detailed review of latest works that were implemented in the arena of Water quality-based billing system is presented. The paper briefs about the different sensors used, use of recent technologies, its working and future work.&nbsp;</p>','no_image.jpg','Review_paper__1708677908.doc',NULL,NULL,NULL,1,2,1,5,'INDJECE',2,1,2,5,NULL,'<p><br></p>',NULL,0,252,1,'2024-02-23 08:45:08','2024-03-05 15:10:21'),(232,1,252,NULL,'A Review on Smart Aqua Metrics: Water Quality-Based Billing System','<p>Water quality-based billing systems have attracted a lot of attention among the novel technologies that have emerged in response to the growing demand for effective management of water resources. The study explores the incorporation of sensor networks and Internet of Things (IoT) devices in water quality monitoring, clarifying their function in gathering the data. In addition, the study includes the challenges and possibilities related to the implementation of water quality-driven billing system, taking into factors like accuracy, reliability, and flexibility. In this paper a detailed review of latest works that were implemented in the arena of Water quality-based billing system is presented. The paper briefs about the different sensors used, use of recent technologies, its working and future work.&nbsp;</p>','no_image.jpg','Review_paper__1708677992.doc',NULL,NULL,NULL,1,2,1,1,'IJIRE',2,1,3,5,NULL,'<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJIRE Journal Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\">Click Here</span><br><br>FDRP Website Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\">Click Here</span><br><br>Crossref Link(DOI): <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\">Click Here</span> (Please check after 24 hrs.)<br></p>',NULL,0,252,1,'2024-02-23 08:46:32','2024-02-23 14:04:24'),(233,1,244,NULL,'Electric Power Generation From Road Humps','<p>Energy serves as the fundamental element crucial for the survival of all life forms across the vastness of the universe. It acts as the cohesive force directing various processes shaping our environment. However, this delicate equilibrium is endangered by the depletion of traditional energy sources, worsened by the ever-growing global population. This dilemma leads to an imminent energy crisis expected to arise in the next five years due to excessive consumption. To navigate this challenging situation, there\'s a need for a significant shift in approach, urging the adoption of methods to maximize the use of existing energy sources. In our research, there\'s a promising opportunity to tap into kinetic energy, particularly from vehicles traversing over speed bumps. The proposal suggests converting these ordinary road features into dynamic generators, seamlessly transforming kinetic energy into electricity for the grid. This process involves sophisticated mechanisms like rack and pinion systems to efficiently convert kinetic energy into mechanical power, eventually generating electricity for storage and later use. This innovative solution not only addresses energy conservation but also promises economic benefits, utilizing stored energy to power street lights during the night, and enhancing urban landscapes with efficient illumination.</p>','no_image.jpg','Electric_Power_Generation_From_Road_Humps_1708741054.docx',NULL,NULL,NULL,1,2,1,1,'IJIRE',1,1,1,15,'2024-02-26','<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJIRE Journal Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://theijire.com/archives?year=2024&amp;volume=5&amp;issue=1\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijire/archives?year=2024&amp;volume=5&amp;issue=1\" target=\"_blank\">Click Here</a></span><br><br>Crossref Link(DOI): <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/?from_ui=&amp;q=10.59256%2Fijire.20240501009\" target=\"_blank\">Click Here</a></span><a href=\"https://search.crossref.org/?from_ui=&amp;q=10.59256%2Fijire.20240501009\" target=\"_blank\"> </a>(Please check after 24 hrs.)<br></p>','paid-2',1,244,1,'2024-02-24 02:17:34','2024-02-26 08:53:27'),(235,1,257,NULL,'Smart Distribution Board with Microcontroller-based safety device','<p>The Smart Safety Device for Distribution Boards is an innovative IoT-based solution to enhance electrical safety and efficiency in residential and commercial settings. An inventive Internet of Things (IoT) solution to improve electrical safety and efficiency in home and business settings is the Smart Safety Device for Distribution Boards. This system offers real-time insights and proactive management of electrical systems by integrating problem detection, remote control, and sensor-based monitoring. One of this device\'s primary functions is sensor-based monitoring, which makes use of voltage and current sensors to continually monitor electrical factors like temperature, voltage levels, and current consumption. Furthermore, sophisticated algorithms examine sensor data to identify possible problems including overcurrent, ground faults, and temperature anomalies. These defects are then instantly alerted to users through visual and auditory cues. Moreover, the system allows for remote access via a mobile application and real-time monitoring of energy usage, which is shown on an LCD screen and helps users optimize energy use. To protect electrical components and maintain safety, the system automatically shuts down in case of serious defects or when energy usage is above predetermined levels. Additionally, by integrating the gadget with the Blynk platform, customers can use a smartphone or tablet to operate electrical devices, receive notifications, and remotely monitor sensor data. All things considered, the distribution boards\' Smart Safety Device offers a complete solution to improve electrical safety, maximize energy economy, and facilitate remote control of electrical systems. It gives consumers more access and control over their electrical infrastructure by utilizing IoT technologies, thereby improving safety, dependability, and affordability.</p>','no_image.jpg',NULL,NULL,NULL,NULL,1,2,1,2,'IJSREAT',1,1,1,15,'2024-02-29','<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJSREAT Journal Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://ijsreat.com/archives?year=2024&amp;volume=4&amp;issue=1\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijsreat/archives?year=2024&amp;volume=4&amp;issue=1\" target=\"_blank\">Click Here</a></span><br><br>Crossref Link(DOI): <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/?from_ui=&amp;q=10.59256%2Fijsreat.20240401010\" target=\"_blank\">Click Here</a></span> (Please check after 24 hrs.)<br></p>','paid-2',1,257,1,'2024-02-24 19:50:04','2024-02-29 05:21:26'),(236,1,255,NULL,'Pothole Sensing System for Vehicles','<p>Abstract: Potholes are a serious hazard to motorcyclists and often lead to accidents and injuries. To solve this problem, the proposed system is designed to proactively identify potholes on the road surface and provide the driver with an early warning, allowing them to safely navigate and avoid potential hazards. This system aims to develop a robust pothole detection system for vehicles using advanced sensing technology, including ultrasonic sensors, gyroscope sensors and Global Positioning System. The system uses state-of-the-art sensor technology mounted on the vehicle, strategically placed to sense the road ahead. Whether using ultrasonic sensors, radar systems or microwaves, each technology offers unique advantages in terms of range, accuracy and environmental resistance. By continuously monitoring the road surface, the sensors can detect deviations indicating potholes regardless of lighting conditions. Upon detecting a pothole, the system activates the alarms integrated into the motorcycle interface and alerts the rider via visual or audio signals. These warnings prompt the rider to adjust their speed or maneuver, minimizing the risk of accidents or bike damage. In addition, the system can be extended with a data logging capability to record the location and characteristics of potholes, facilitating proactive road maintenance and infrastructure improvements. In conclusion, the proposed pothole detection system provides a proactive solution to reduce the risks associated with the occurrence of potholes in driving. Utilizing advanced sensor technology and intuitive warning mechanisms, the system allows riders to navigate confidently and safely, contributing to a safer and more enjoyable riding experience.</p>','no_image.jpg','Pothole_sensing_system_for_vehicles_1708804256.docx',NULL,NULL,NULL,1,2,1,3,'IJRTMR',1,1,1,15,'2024-02-27','<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJRTMR Journal Link: <span style=\"background-color: rgb(255, 255, 0);\"><a href=\"https://ijrtmr.com/archives?year=2024&amp;volume=4&amp;issue=1\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link:<span style=\"background-color: rgb(255, 255, 0);\"> <a href=\"https://fdrpjournals.org/ijrtmr/archives?year=2024&amp;volume=4&amp;issue=1\" target=\"_blank\">Click Here</a></span><br><br>Crossref Link(DOI): <span style=\"background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/?from_ui=&amp;q=10.59256%2Fijrtmr.20240401011\" target=\"_blank\">Click Here </a></span>(Please check after 24 hrs.)<br></p>','paid-2',1,255,1,'2024-02-24 19:50:56','2024-02-27 07:59:08'),(237,1,254,NULL,'Advancing Motorcycle Safety Through Helmet Detection and Accident Avoidance','<p>This paper addresses the pervasive issue of road accidents in contemporary society, attributing them to factors such as rash and drunken driving, as well as non-compliance with traffic regulations. Proposing an innovative solution, we introduce a newly developed system designed to enhance rider safety. This system operates as a cost-effective and user-friendly protection mechanism, ensuring that the rider can only operate their two-wheeler when both sober and wearing the helmet. In the event of a severe accident, the system autonomously notifies emergency contacts, expediting the delivery of critical aid and medical care. The primary goal of this system is to significantly reduce injuries sustained by two-wheeler riders in road accidents. This system also incorporates a password based unlock and ignition system which enhances the security of the vehicle. This comprehensive approach addresses not only the prevention of accidents but also emphasizes the swift response and care necessary to mitigate the adverse consequences of such incidents.&nbsp;</p>','no_image.jpg','Review_Paper_IJIRE_1708830816.doc',NULL,NULL,NULL,1,2,1,1,'IJIRE',2,1,3,5,NULL,NULL,NULL,0,254,NULL,'2024-02-25 03:13:36','2024-02-26 04:29:54'),(238,6,258,NULL,'The truth of the sky.','<p>The truth of the sky.\r\n</p><p>&nbsp;What is the Michelson-Morley experiment?  This is where the big mistake of modern science begins.\r\n</p><p><br></p><p>\r\n</p>','no_image.jpg','kishor_the_sky_0_1708849714.docx',NULL,NULL,NULL,1,2,1,2,'IJSREAT',2,2,2,5,NULL,NULL,NULL,0,258,NULL,'2024-02-25 08:28:34','2024-02-26 15:44:15'),(239,1,259,NULL,'Student\'s onLine eXchange','<p>Student\'s onLine eXchange (SLX) is a pioneering initiative designed to meet the unique needs of students by fostering a culture of mutual assistance and resource sharing. Addressing financial constraints and daily challenges, SLX provides a specialized platform where students can seamlessly exchange resources with the spirit of helping one another. Unlike traditional sharing models, SLX emphasizes the transformative power of mutual assistance over charity, promoting a community-driven approach. This synopsis offers insights into SLX\'s distinctive features, objectives, and societal impact, bridging existing gaps in the literature and presenting a novel resource-sharing paradigm. Through SLX, students collaboratively share academic materials and daily necessities, establishing a supportive environment for their educational journey. SLX endeavours to reshape the community narrative, making helping an integral part of student life.</p>','no_image.jpg','Review_Paper__SLX_1708886434.docx',NULL,NULL,NULL,1,2,1,1,'IJIRE',2,1,1,15,'2024-02-28','<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span><br></b><br>IJIRE Journal Link:<span style=\"background-color: rgb(255, 255, 0);\"> <a href=\"https://theijire.com/archives?year=2024&amp;volume=5&amp;issue=1\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link: <span style=\"background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijire/archives?year=2024&amp;volume=5&amp;issue=1\" target=\"_blank\">Click Here</a></span><br><br>Crossref Link(DOI):<span style=\"background-color: rgb(255, 255, 0);\"> <a href=\"https://search.crossref.org/?from_ui=&amp;q=10.59256%2Fijire.20240501010\" target=\"_blank\">Click Here</a> </span>(Please check after 24 hrs.)<br></p>','paid-2',1,259,1,'2024-02-25 18:40:34','2024-02-28 03:59:38'),(240,4,262,NULL,'The impact of personality traits on consumer buying behaviour','<p>Consumer behavior has been a complex and interesting subject of interest for marketers, researchers, and scholars. An individual\'s personality traits are recognized as a significant factor influencing consumer behavior, as they define an individual\'s behavior, attitudes, and preferences. These traits can greatly shape an individual\'s buying behavior, affecting how they perceive and respond to marketing efforts.</p><p>The purpose of our research is to investigate the impact of personality traits on consumer buying behavior at Sukkur IBA University Kandhkot Campus.  Our study will involve a comprehensive review of existing literature on personality traits and consumer behavior.&nbsp;</p><p>A thorough comprehension of the impact of personality traits on consumer buying behavior is crucial for marketers, as it enables them to develop effective marketing strategies that effectively connect with their target audience. By recognizing the most influential personality traits in shaping consumer behavior, marketers can craft persuasive marketing messages that are better suited to resonate with their intended audience.</p><p>&nbsp;Studies conducted in this field have pinpointed several personality traits that impact consumer behavior, such as openness, conscientiousness, extraversion, agreeableness, and neuroticism. For instance, individuals who score high in openness may exhibit a greater tendency to try new products and engage in risk-taking behavior, whereas those who score high in conscientiousness may be more inclined to conduct thorough product research before making a purchase decision</p>','no_image.jpg','consumer_behavior_1709037927.docx',NULL,NULL,NULL,1,2,1,3,'IJRTMR',1,1,1,5,NULL,NULL,NULL,0,262,NULL,'2024-02-27 12:45:27','2024-02-29 00:44:24'),(241,1,261,NULL,'Harmonic mitigation for enhancing grid-integrated photovoltaic system power quality: a review','<p>With the growing integration of renewable energy sources, such solar energy systems into electrical grids, power quality issues emerge from possible harmonic distortions. This study analyzes the effectiveness of grid-integrated photovoltaic systems and discusses harmonic mitigation to improve electricity quality. Power quality can be negatively impacted by harmonic distortion due to voltage swings, higher losses, and interference with delicate equipment. As a result, efficient and dependable PV system functioning inside the grid depends on the implementation of effective mitigation techniques. We examine a range of mitigation strategies, such as hybrid solutions, active filters, and passive filters, each with unique benefits and drawbacks in terms of expense, intricacy, and efficiency. The effects of integrating PV systems on grid stability, voltage regulation, and frequency management are also covered in the article, emphasizing the significance of thorough performance analysis. The effectiveness of various harmonic mitigation techniques is assessed by modeling studies and experimental validation, taking into account variables including system efficiency, dependability, and compliance with international power quality standards. The study also looks at how grid circumstances, PV system layout, and size affect harmonic generation and mitigation needs. The research yields valuable insights that aid in the formulation of strategies aimed at improving power quality and maximizing grid-integrated photovoltaic systems\' performance under various operating situations.</p>','no_image.jpg','Manuscript_1709115936.docx',NULL,NULL,NULL,1,2,2,4,'INDJEEE',2,1,1,16,'2024-03-11','<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>FDRP Website Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/indjeee/archives?paperid=5950693831180991688\" target=\"_blank\">Click Here</a></span><br><br><br></p>',NULL,1,261,1,'2024-02-28 10:25:36','2024-03-12 04:17:12'),(247,2,265,NULL,'QR based attendance system','<b>QR based attendance system&nbsp;</b>','no_image.jpg','QR_Code_Based_Smart_Attendance_System_(1)_1709128671.docx',NULL,NULL,NULL,1,2,2,6,'INDJCST',5,1,1,3,NULL,NULL,NULL,0,265,NULL,'2024-02-28 13:57:51','2024-02-29 04:04:17'),(248,1,265,NULL,'QR attendance system','<p><span style=\"background-color: rgb(255, 255, 0);\"><b>QR attendance system&nbsp;</b></span></p>','no_image.jpg','QR_attendance_system_(1)_1709135112.docx',NULL,NULL,NULL,1,2,1,1,'IJIRE',2,1,1,5,NULL,NULL,NULL,0,265,NULL,'2024-02-28 15:45:12','2024-02-29 00:41:15'),(249,1,267,NULL,'Effect of varying stiffness of top foil on the performance of Air foil thrust bearing (AFTB)','<p>Air foil thrust bearings (AFTB) are essential components in various rotating machinery, such&nbsp;<span style=\"font-size: 0.875rem;\">as gas turbines and turbochargers, designed to support higher loads while minimizing friction&nbsp;</span><span style=\"font-size: 0.875rem;\">and wear. The project aims to investigate the effect of varying stiffness of the top foil on the&nbsp;</span><span style=\"font-size: 0.875rem;\">performance of air foil thrust bearings. The stiffness of the top foil is a critical parameter that&nbsp;</span><span style=\"font-size: 0.875rem;\">influences the bearing\'s load-carrying capacity, stability, and overall efficiency. The&nbsp;</span><span style=\"font-size: 0.875rem;\">geometric parameters like foil geometry, sector angle of top foil, initial angle of top foil and&nbsp;</span><span style=\"font-size: 0.875rem;\">thickness of top foil and operating parameters like runner speed, gap between top foil and&nbsp;</span><span style=\"font-size: 0.875rem;\">runner, will affect the load carrying capacity of the thrust bearing.</span></p><p>The study involves both static analysis and dynamic analysis to comprehensively evaluate&nbsp;<span style=\"font-size: 0.875rem;\">how changes in top foil stiffness affect the bearing\'s operational characteristics. The&nbsp;</span><span style=\"font-size: 0.875rem;\">geometric parameters like foil geometry, sector angle of top foil, initial angle of top foil and&nbsp;</span><span style=\"font-size: 0.875rem;\">thickness of top foil are considered for the study.&nbsp;</span><span style=\"font-size: 0.875rem;\">The results of these analyses will be used to validate how the varying geometrical parameters&nbsp;</span><span style=\"font-size: 0.875rem;\">impact the stiffness of the Air foil thrust bearing. This will provide practical insights into the&nbsp;</span><span style=\"font-size: 0.875rem;\">real-world performance of air foil thrust bearings with varying top foil stiffness.</span></p><p>The findings of this research will have significant implications for the design and&nbsp;<span style=\"font-size: 0.875rem;\">optimization of air foil thrust bearings in various industrial applications. By understanding&nbsp;</span><span style=\"font-size: 0.875rem;\">how changes in top foil stiffness affect the bearing\'s performance, engineers and researchers&nbsp;</span><span style=\"font-size: 0.875rem;\">can enhance the efficiency and reliability of rotating machinery, ultimately contributing to&nbsp;</span><span style=\"font-size: 0.875rem;\">improved energy efficiency and reduced maintenance costs.</span></p>','no_image.jpg','Journal_Paper_1709197996.docx',NULL,NULL,NULL,1,2,1,2,'IJSREAT',1,1,3,15,NULL,'<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJSREAT Journal Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://ijsreat.com/archives?year=2024&amp;volume=4&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijsreat/archives?year=2024&amp;volume=4&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>Crossref Link(DOI): <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/?from_ui=&amp;q=10.59256%2Fijsreat.20240402001\" target=\"_blank\">Click Here</a></span> (Please check after 24 hrs.)<br></p>','paid-2',1,267,1,'2024-02-29 09:13:16','2024-03-01 06:51:21'),(250,1,269,NULL,'Navigating E-Commerce Frontiers: AI and Machine Learning in Women\'s Empowerment','<p>This research examines the transformative role that Artificial Intelligence (AI) plays in advancing women\'s empowerment, with a particular focus on the e-commerce industry. The study\'s focus is on the integration process of cutting-edge machine learning algorithms and assessing their impact through the System Usability Scale (SUS). This approach ensures not only the technical efficacy of the AI solutions but also their user-centered design, focusing on actual user satisfaction. The beta version of the proposed system has been rigorously tested in real-life scenarios, achieving a favorable SUS score. This outcome validates the system\'s usability and its potential effectiveness in real-world applications.\r\n</p><p>Ultimately, this project aims to have a global impact by using AI not only as a technological tool but also as a catalyst for creating new business opportunities, providing online support, and elevating the discourse around women\'s empowerment in the digital world. By doing so, it seeks to offer a scalable and impactful solution to empower women, leveraging the vast potential of AI in the e-commerce sector.\r\n</p><p><br></p>','no_image.jpg','Women_Empowerment_1709244119.pdf',NULL,NULL,NULL,1,2,1,6,'INDJCST',1,1,3,5,NULL,NULL,NULL,0,269,NULL,'2024-02-29 22:01:59','2024-03-05 16:31:43'),(251,1,270,NULL,'Image captioning the art of discription','<p>—The past few years have seen a significant increase in interest in the integration of computer vision and natural language processing due to the advancements in deep learning. One example of this field is image captioning, which teaches a computer to comprehend an image’s visual information by using one or more phrases. The insightful explanation In order to generate high-level image semantics, one must be able to analyze the state, properties, and relationships between objects in addition to being able to recognize objects and scenes. Even though image captioning is a challenging and complex endeavor, several academics have made great progress in this area. In this paper, we primarily present three deep neural network-based picture captioning techniques: three different bases: CNN-RNN, CNN-CNN, and reinforcementWith the advancement of deep learning, the combination of computer vision framework. Then, we present the best work from each of these three approaches, explain the criteria for evaluation, and list the main advantages and difficulties.</p>','no_image.jpg','Emailing_image_captioning_(4)_1709271076.pdf',NULL,NULL,NULL,1,2,1,6,'INDJCST',1,1,1,5,NULL,NULL,NULL,0,270,NULL,'2024-03-01 05:31:16','2024-03-02 05:11:06'),(253,15,273,NULL,'From Exile to Empowerment: A Comparative Study of Madeline Miller\'s Circe and Chitra Banerjee Divakaruni\'s The Forest of Enchantments','<p><br></p>','no_image.jpg','From_Exile_to_Empowerment_Article_1709462445.docx',NULL,NULL,NULL,1,2,1,3,'IJRTMR',1,1,3,15,'2024-03-05','<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJRTMR Journal Link:<span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://ijrtmr.com/archives?year=2024&amp;volume=4&amp;issue=2\" target=\"_blank\"> Click Here</a></span><br><br>FDRP Website Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijrtmr/archives?year=2024&amp;volume=4&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br></p>','paid-1',1,273,1,'2024-03-03 10:40:45','2024-03-04 14:55:34'),(254,1,274,NULL,'bVote: BLOCKCHAIN BASED VOTING SYSTEM','<p>Abstract: The current electoral system faces various challenges such as vote rigging, hacking of electronic voting machines, and election manipulation, leading to a lack of faith in the system among citizens. The adoption of an electronic voting system based on blockchain technology could potentially address these issues. This paper proposes a model of e-voting based on popular blockchain frameworks that provide blockchain as a service, which maintains participant confidentiality while still being open to public scrutiny. The paper presents a comprehensive analysis of the theme, demonstrating the usefulness of blockchain technology in the design of a secure and transparent e-voting system. Distributed ledger technology is a powerful tool in the world of information technology, with the potential to revolutionize various applications. Blockchain offers advantages such as cryptological underpinnings and transparency, making it a disruptive technology in modern times. The proposed e-voting system based on blockchain technology offers the potential to improve the resilience of e-voting systems, and ensure the integrity of the election results. Overall, this paper provides insights into the potential of blockchain technology to tackle the challenges facing the current electoral system and improve the transparency and security of e-voting systems.\r\n</p><p>Key Word: Iblockchain, confidentiality, Distributed ledger, transparency, security, metamask, solidity, Ethereum, Decentralization, testnet, Hardhat, Dapp, Consensus, immutability, blocks.</p>','no_image.jpg','bVote___BLOCKCHAIN_BASED_VOTING_SYSTEM_1709476581.docx',NULL,NULL,NULL,1,2,1,1,'IJIRE',1,1,1,15,'2024-03-05','<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJIRE Journal Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://theijire.com/archives?year=2024&amp;volume=5&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijire/archives?year=2024&amp;volume=5&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>Crossref Link(DOI): <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/?from_ui=&amp;q=10.59256%2Fijire.20240502001\" target=\"_blank\">Click Here</a></span><a href=\"https://search.crossref.org/?from_ui=&amp;q=10.59256%2Fijire.20240502001\" target=\"_blank\"> </a>(Please check after 24 hrs.)<br></p>','paid-2',1,274,1,'2024-03-03 14:36:21','2024-03-04 12:59:54'),(255,2,275,NULL,'A Convolution Neural Network Approach for Predicting the Age of Mango Trees','<p>Predicting the age of specific plant categories holds a major task in agriculture because it is useful for many things like agri-business, healthcare of the plants etc. Nowadays, Google lens is used to identify plants, text, animals that is also a computer vision tool. Predicting the age of specific trees and plants has emerged as a challenging and time-consuming task, prompting the need for innovative approaches to tackle this issue. To address this, the research is currently conducting experiments using a dataset focused on mango trees. \r\n</p><p>The aim is to develop methodologies or models that can accurately estimate the age of these trees based on various factors such as growth patterns and their size. By delving into this dataset and employing techniques from deep learning, the goal is to create a predictive framework that could streamline and enhance the accuracy of determining the age of mango trees. Convolutional Neural Network, which is a deep learning algorithm primarily used for analyzing visual imagery. With an impressive accuracy of 97.33%, a CNN Sequential model outperformed other deep learning architectures for plant recognition. There are many different mango tree species worldwide; this research is experimented on particularly Kesar Mango tree saplings, which gets sell in plant nurseries. The dataset exclusively originates from a plant nursery, aligning with the research\'s emphasis on agricultural practices beneficial to both farmers and plant nurseries.\r\n</p><p><br></p>','no_image.jpg','FinalCNN_1709531800.docx',NULL,NULL,NULL,1,2,2,2,'IJSREAT',1,1,1,16,NULL,NULL,NULL,0,275,NULL,'2024-03-04 05:56:40','2024-03-13 14:01:43'),(256,8,276,NULL,'Evaluation of anti-urolithiatic activity of seed extract of Cuminum cyminum','<p>Urolithiasis or kidney stone disease is a urologic ailment that has a high prevalence rate worldwide and medicinal \r\n</p><p>plants have been widely used for alternative therapy. A wide range of medicinal plants have been used conservatively \r\n</p><p>for urolithiasis due to their fewer side effects and because they contain copious phytochemicals that show \r\n</p><p>advantageous effects in urolithiasis. Cuminum cyminum traditionally used in the treatment of urolithiasis. \r\n</p><p>Hyperoxaluria and hypercalciuria are among the major risk factors in pathogenesis of urinary stone formation. \r\n</p><p>Evaluation of various medicinal plants are done mainly against calcium oxalate. In this present study, the \r\n</p><p>antiurolithiatic potential in Cuminum cyminum was investigated through invitro assay. The work was performed by \r\n</p><p>using invitro Anti-urolithiatic model for calculating percentage in comparison with standard drug cystone. The antiurolithiatic properties were evaluated by titrimetric and turbidity assay. The result shows that for C. cyminum folds \r\n</p><p>(55%) and for standard drug cystone (82%) for titrimetric assay. For turbidity assay. C. cyminum has significant \r\n</p><p>properties (47.9±19%). The findings of the nucleation assay indicate that phytoconstituents inhibited the \r\n</p><p>crystallization of CaOx in solution. The size and the number of calcium oxalate crystals decreased with increasing \r\n</p><p>concentration upto 400µg of the phytoconstituents. The study concludes that the seed extracts of Cuminum cyminum\r\n</p><p>have inhibitory effect on calcium oxalate for crystal nucleation. It also showed great efficacy in the dissolution of \r\n</p><p>calcium oxalate crystals. Thus, this extract may be valuable resources for treatment of urolithiasis</p>','no_image.jpg','Evaluation_of_anti_urolithiatic_activity_of_seed_extract_of_cuminum_cyminum_1709551102.docx',NULL,NULL,NULL,1,2,2,6,'INDJCST',1,1,1,17,NULL,NULL,NULL,0,276,NULL,'2024-03-04 11:18:22','2024-03-04 15:44:23'),(257,2,275,NULL,'Personality Prediction With HandWriting using Convolution Neural Network','<p>The study of personality traits through handwriting analysis has garnered significant interest due to its potential applications in psychology, hiring, and personal growth. This research investigates the feasibility of predicting specific personality traits—agreeableness, extroversion, conscientiousness, openness, and neuroticism—through handwriting patterns. The project involves data collection of diverse handwriting samples with corresponding personality trait labels, followed by preprocessing, feature extraction, model training, and validation. Key steps include standardizing handwriting samples, extracting relevant features like stroke patterns and spacing, and utilizing machine learning techniques for model training. The dataset sourced from Kaggle provides a robust foundation, which is cleansed and standardized for analysis. Our hypothesis posits that handwriting patterns encode personality traits, and by leveraging machine learning, we can accurately predict these traits. Python libraries such as sklearn, Pandas, TensorFlow, and OpenCV are employed for analysis and visualization. The research aims to contribute to the burgeoning field of handwriting analysis and provide a reliable method for predicting personality traits with practical implications in various domains.</p>','no_image.jpg','Research_Draft_1709602927.docx',NULL,NULL,NULL,1,2,1,2,'IJSREAT',1,1,1,15,'2024-03-07','<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJSREAT Journal Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://ijsreat.com/archives?year=2024&amp;volume=4&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijsreat/archives?year=2024&amp;volume=4&amp;issue=2\" target=\"_blank\">Click Here</a></span><br></p>','paid-1',1,275,1,'2024-03-05 01:42:07','2024-03-11 16:46:51'),(260,2,277,NULL,'Aug matrix','<p>Augmatrix is a project that utilizes augmented reality technology to create a very immersive virtual environment for enhanced learning and education. Beyond the traditional education system this an take on modernizing the learning into simpler and innovative. It helps the users to understand reality through virtuality.</p>','no_image.jpg','Augmatrix_Project_paper_1709629278.pdf',NULL,NULL,NULL,1,2,2,6,'INDJCST',1,1,1,5,NULL,NULL,NULL,0,277,NULL,'2024-03-05 09:01:18','2024-03-16 14:25:08'),(262,1,278,NULL,'Virtual health assistant','<h6><img src=\"data:image/png;base64,\" style=\"width: 743px;\" data-filename=\"Screenshot_20240305_185823.png\"><br></h6>','no_image.jpg','VIRTUAL_HEALTH_ASSISTANT_1709645346.docx',NULL,NULL,NULL,1,2,1,6,'INDJCST',1,1,3,5,NULL,NULL,NULL,0,278,NULL,'2024-03-05 13:29:06','2024-03-06 04:04:09'),(263,1,280,NULL,'Streamlined Workforce Management System Using AI','<p>\r\n</p><br>&nbsp;In today\'s digital landscape, face recognition technology has emerged as a versatile and non-invasive tool used across sectors, despite its lower accuracy compared to iris or fingerprint recognition. Its applications range from security and authentication to optimizing attendance systems in educational institutions and workplaces. This paper introduces an innovative class attendance system employing face recognition technology, replacing manual processes prone to inaccuracies like proxy attendance. The system involves database creation from student images, utilizing Haar-Cascade classifiers for face detection, and Local Binary Pattern Histogram algorithms for live recognition from classroom video streams. It automates attendance data distribution to faculty members, enhancing efficiency and precision. Simultaneously, the security industry necessitates alert and vigilant security personnel to prevent breaches. A sophisticated hybrid system, leveraging machine learning techniques like OpenCV and EAR/MAR algorithms alongside UHD cameras, detects guard drowsiness and alerts them promptly using sound cues and preventive measures, ensuring continual vigilance. This innovative hybrid system fortifies security guard surveillance, mitigating potential vulnerabilities due to lapses in attentiveness.\r\nKey Word:  Face Recognition Technology, Biometrics, Attendance Management, Security, Authentication, Surveillance, Machine Learning, OpenCV, Security Guard Monitoring, Vigilance, Drowsiness Detection.\r\n<br>\r\n','no_image.jpg','Streamlined_Workforce_Management_System_Using_AI_researach_paper_1709719887.docx',NULL,NULL,NULL,1,2,1,3,'IJRTMR',1,1,1,15,'2024-03-08','<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJRTMR Journal Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://ijrtmr.com/archives?year=2024&amp;volume=4&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijrtmr/archives?year=2024&amp;volume=4&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>Crossref Link(DOI): <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/?from_ui=&amp;q=10.59256%2Fijrtmr.20240402001\" target=\"_blank\">Click Here</a></span> (Please check after 24 hrs.)<br></p>','paid-2',1,280,1,'2024-03-06 10:11:27','2024-03-07 09:44:17'),(265,1,283,NULL,'INVESTIGATION OF SUSTAINABLE NANO ADDED SOLID PROPELLANTS USING PROSOPSIS JULIFLORA AND PLASTIC WASTE OIL','<p>This study investigates the creative use of leftover cooking oil and the invasive plant species Prosopis Juliflora as a sustainable and renewable resource. In many areas, Prosopis Juliflora has created ecological and economic problems that frequently result in land degradation. Additionally, disposing of used cooking oil raises environmental concerns. In order to create a unique biofuel, our study looks into the process of turning Prosopis Juliflora biomass into charcoal, which is then combined with leftover cooking oil. We examine the fuel characteristics, combustion efficiency, and emissions of this biofuel blend via a battery of tests in an effort to offer a sustainable and financially feasible solution for the management of waste oil as well as the problem of invasive plants. The objectives of this initiative are to enhance rural livelihoods, promote energy sustainability, and protect the environment.</p>','no_image.jpg','Prosopsis_Powder_Propellants_1709783799.docx',NULL,NULL,NULL,1,2,1,1,'IJIRE',1,1,2,5,NULL,NULL,NULL,0,283,NULL,'2024-03-07 03:56:39','2024-03-28 04:21:13'),(266,2,275,NULL,'Emotion Recognition Using Convolution Neural Networks: Analysis on FER2013 Dataset','<p>This research explores emotion recognition using Convolutional Neural Networks (CNNs) with a focus on analyzing the FER2013 dataset. A detailed examination of the model’s architecture, training process, and performance evaluation is presented. The study aims to contribute to the field of emotion recognition and provide insights into the effectiveness of CNNs in this domain. This research delves into the realm of emotion recognition, employing Convolutional Neural Networks (CNNs) with a primary focus on analyzing the FER2013 dataset. Our study introduces a novel CNN architecture designed for accurate classification of seven distinct emotions: Angry, Disgust, Fear, Happy, Sad, Surprise, and Neutral. The research embarks on an in-depth exploration of the model’s intricacies, training methodologies, and performance evaluation metrics. \r\n</p><p><br></p><p>\r\n</p>','no_image.jpg','Emotion_Recognition_using_Convolutional_Neural_Networks_1709789656.docx',NULL,NULL,NULL,1,2,1,2,'IJSREAT',1,1,1,15,'2024-03-13','<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJSREAT Journal Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://ijsreat.com/archives?year=2024&amp;volume=4&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link:<a href=\"https://fdrpjournals.org/ijsreat/archives?year=2024&amp;volume=4&amp;issue=2\" target=\"_blank\"> </a><span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijsreat/archives?year=2024&amp;volume=4&amp;issue=2\" target=\"_blank\">Click Here</a></span><br></p>','paid-1',1,275,1,'2024-03-07 05:34:16','2024-03-12 11:42:48'),(267,1,284,NULL,'A comprehensive study to facilitate Student Space platform with collaborative learning','<p>The Student Space Virtual Study Groups Platform is a groundbreaking solution designed to transform collaborative learning for students, addressing challenges in forming and sustaining study groups. This online platform integrates advanced technology to create a user-friendly environment, featuring an intuitive interface, dynamic group formation with smart algorithms, real-time collaboration through video conferencing and document editing, centralized resource sharing, and smart scheduling tools. Student Space aims to overcome the limitations of traditional study groups, offering an inclusive and adaptable virtual space for students to connect, collaborate, and excel academically. Anticipated impacts include improved academic performance and the creation of a vibrant academic community. Ongoing enhancements, such as integration with Learning Management Systems, a mobile app for on-the-go collaboration, and improved AI-driven matching algorithms, are planned for the future.</p>','no_image.jpg','Paper_Group_A_1709874365.docx',NULL,NULL,NULL,2,2,1,3,'IJRTMR',1,1,3,15,'2024-04-10','<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJRTMR Journal Link: <span style=\"background-color: rgb(255, 255, 0);\"><a href=\"https://ijrtmr.com/archives?year=2024&amp;volume=4&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link: <span style=\"background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijrtmr/archives?year=2024&amp;volume=4&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>Crossref Link(DOI): <span style=\"background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/?from_ui=&amp;q=10.59256%2Fijrtmr.20240402011\" target=\"_blank\">Click Here</a></span> (Please check after 24 hrs.)<br></p>','paid-1',0,284,1,'2024-03-08 05:02:00','2024-04-09 18:21:16'),(268,1,284,NULL,'FitHubster: Comprehensive Fitness Hub WebApp for Easy Navigation','<p>FitHubster, a cutting-edge fitness application developed on a foundation of HTML, CSS, Javascript, React, and Material UI, stands out for its technical robustness and scalability. Operationally, FitHubster ensures easy navigation and low maintenance, contributing to a seamless user experience.\r\n</p><p>The app\'s potential revenue streams further bolster its financial viability, making it a promising venture in the competitive fitness technology landscape. Legal compliance mechanisms are in place to safeguard user privacy and uphold content licensing standards, demonstrating a commitment to ethical practices.\r\n</p><p>Socially, FitHubster fosters user engagement and feedback, creating a vibrant community around fitness enthusiasts. The app\'s emphasis on interactive features enhances its appeal and feasibility as a comprehensive fitness solution. In conclusion, FitHubster emerges as a robust, scalable, and socially engaging fitness application with the potential to meet the demands of a diverse user base while ensuring operational efficiency and legal integrity.\r\n</p><p><br></p>','no_image.jpg','Paper_Group_B_1709875223.docx',NULL,NULL,NULL,1,2,1,3,'IJRTMR',1,1,3,15,'2024-04-10','<p><span style=\"color: rgb(0, 0, 255);\"><b>Published Article Details:</b></span><br><br>IJRTMR Journal Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://ijrtmr.com/archives?year=2024&amp;volume=4&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link:<a href=\"https://fdrpjournals.org/ijrtmr/archives?year=2024&amp;volume=4&amp;issue=2\" target=\"_blank\"> </a><span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijrtmr/archives?year=2024&amp;volume=4&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>Crossref Link(DOI): <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/search/works?q=10.59256%2Fijrtmr.20240402012&amp;from_ui=yes\" target=\"_blank\">Click Here</a> </span>(Please check after 24 hrs.)<br></p>','paid-1',0,284,1,'2024-03-08 05:20:23','2024-04-09 18:21:42'),(269,1,284,NULL,'A Comprehensive Study to Build Immersive Virtual Reality-Powered Language Learning','<p>In the rapidly evolving landscape of education technology, this project explores the integration of Immersive Virtual Reality (IVR) to revolutionize language learning experiences. Leveraging the power of virtual reality, this innovative approach aims to provide a dynamic and immersive language acquisition platform that transcends traditional methods.\r\n</p><p>The project focuses on creating a virtual environment where language learners can engage with authentic scenarios, fostering practical language application and cultural understanding. Users will navigate through lifelike settings, interact with virtual native speakers, and participate in real-world conversations, thus enhancing their linguistic proficiency in a contextualized manner.\r\n</p><p>Key features include personalized learning paths, adaptive challenges, and gamified elements to sustain user motivation and accommodate diverse learning styles. The incorporation of artificial intelligence ensures tailored feedback, tracking individual progress, and dynamically adjusting the learning curriculum to suit each user\'s proficiency level.\r\n</p><p>The virtual reality language learning experience is designed to be accessible and user-friendly, catering to a broad demographic. Emphasis is placed on creating a sense of presence and cultural immersion, allowing learners to develop language skills in an environment that mirrors real-life scenarios.\r\n</p><p>Through a combination of cutting-edge virtual reality technology, linguistic expertise, and pedagogical principles, this project aspires to redefine language education. The research and development aim to assess the efficacy of this immersive approach, comparing learning outcomes with traditional methods, with a vision to contribute to the ongoing discourse on the future of education technology and language acquisition.\r\n</p><p><br></p>','no_image.jpg','Paper_Group_C_1709875804.docx',NULL,NULL,NULL,1,2,1,3,'IJRTMR',1,1,3,15,'2024-04-10','<p><span style=\"color: rgb(0, 0, 255);\"><b>Published Article Details:</b></span><br><br>IJRTMR Journal Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://ijrtmr.com/archives?year=2024&amp;volume=4&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijrtmr/archives?year=2024&amp;volume=4&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>Crossref Link(DOI): <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/search/works?q=10.59256%2Fijrtmr.20240402013&amp;from_ui=yes\" target=\"_blank\">Click Here</a></span> (Please check after 24 hrs.)<br></p>','paid-1',0,284,1,'2024-03-08 05:30:04','2024-04-09 18:22:02'),(270,1,284,NULL,'PREDICTIVE HR ANALYTICS TO OPTIMIZE DECISION-MAKING PROCESSES AND ENHANCE WORKFORCE PERFORMANCE','<p>This paper explores the application of predictive analytics in Human Resource Management (HRM) to optimize decision-making processes and enhance workforce performance. The primary objective is to develop a predictive model that identifies key factors influencing employee retention within our organization. Utilizing historical HR data, machine learning algorithms are employed to analyze patterns and forecast potential attrition risks. \r\n</p><p>The methodology involves data preprocessing, feature selection, and model training using a comprehensive dataset spanning employee demographics, performance metrics, and engagement indicators. The model\'s predictive accuracy is assessed through cross-validation, and the final model is validated using a separate test dataset. \r\n</p><p>Results indicate a significant improvement in the accuracy of attrition predictions compared to traditional methods. Identified risk factors include job satisfaction, career development opportunities, and team dynamics. The project concludes with actionable insights for HR practitioners to proactively address potential retention challenges. \r\n</p><p>This paper demonstrates the transformative potential of data-driven decision-making in HRM. By leveraging predictive analytics, organizations can strategically allocate resources, implement targeted interventions, and foster a more engaged and satisfied workforce. \r\n</p><p><br></p>','no_image.jpg','Paper_Group_D_1709876038.docx',NULL,NULL,NULL,1,2,1,3,'IJRTMR',1,1,3,15,'2024-04-10','<p><span style=\"color: rgb(0, 0, 255);\"><b>Published Article Details:</b></span><br><br>IJRTMR Journal Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://ijrtmr.com/archives?year=2024&amp;volume=4&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link:<a href=\"https://fdrpjournals.org/ijrtmr/archives?year=2024&amp;volume=4&amp;issue=2\" target=\"_blank\"> </a><span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijrtmr/archives?year=2024&amp;volume=4&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>Crossref Link(DOI): <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/search/works?q=10.59256%2Fijrtmr.20240402014&amp;from_ui=yes\" target=\"_blank\">Click Here </a></span>(Please check after 24 hrs.)<br></p>','paid-1',0,284,1,'2024-03-08 05:33:58','2024-04-09 18:22:51'),(271,1,284,NULL,'Comparative study on classification techniques through IRIS Data Analysis','<p>Many classification techniques are implemented on different datasets in Machine Learning. This paper gives an idea on different classification techniques implementation and comparison with example an Iris Species Dataset. First dataset is preprocessed and categorized into two parts training set and test set then techniques like Decision Tree, Gaussian NB, Logistic Regression and Random Forest are used. Finally, accuracy of different techniques is compared</p>','no_image.jpg','Paper_Group_E_1709876139.docx',NULL,NULL,NULL,1,2,1,3,'IJRTMR',1,1,3,15,'2024-04-10','<p><span style=\"color: rgb(0, 0, 255);\"><b>Published Article Details:</b></span><br><br>IJRTMR Journal Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://ijrtmr.com/archives?year=2024&amp;volume=4&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijrtmr/archives?year=2024&amp;volume=4&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>Crossref Link(DOI):<a href=\"https://search.crossref.org/search/works?q=10.59256%2Fijrtmr.20240402015&amp;from_ui=yes\" target=\"_blank\"> </a><span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/search/works?q=10.59256%2Fijrtmr.20240402015&amp;from_ui=yes\" target=\"_blank\">Click Here </a></span>(Please check after 24 hrs.)<br></p>','paid-1',0,284,1,'2024-03-08 05:35:39','2024-04-09 18:23:36'),(272,1,284,NULL,'BLOCKCHAIN ENABLED ONLINE ELECTORAL SYSTEM TO ADDRESS SECURITY CHALLENGES AND TRANSPARENCY','<p>The right to vote is a foundational privilege for citizens in any democratic nation, empowering them to select future leaders and express their views on community matters. Voting fosters an understanding of the significance of citizenship and individual participation. Modern online voting systems, software platforms facilitating secure voting, have emerged as a digital alternative to traditional paper-based methods. These systems eliminate the need for physical presence, offering the convenience of voting from anywhere with an internet connection. Importantly, online voting platforms enhance the security and integrity of the voting process, employing measures such as encryption to prevent issues like voter fraud. Additionally, they address concerns by ensuring voters cannot cast multiple ballots, thus upholding the fairness of elections. While online voting presents advantages, it also poses challenges related to cybersecurity and privacy, necessitating a careful balance between accessibility and security considerations. It\'s crucial to stay updated on the latest developments in the field of online voting.</p>','no_image.jpg','Paper_Group_F_1709876868.docx',NULL,NULL,NULL,1,2,1,1,'IJIRE',1,1,3,15,'2024-04-10','<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJIRE Journal Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://theijire.com/archives?year=2024&amp;volume=5&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link:<a href=\"https://fdrpjournals.org/ijire/archives?year=2024&amp;volume=5&amp;issue=2\" target=\"_blank\"> </a><span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijire/archives?year=2024&amp;volume=5&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>Crossref Link(DOI): <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/search/works?q=10.59256%2Fijire.20240502020&amp;from_ui=yes\" target=\"_blank\">Click Here</a></span> (Please check after 24 hrs.)<br></p>','paid-1',0,284,1,'2024-03-08 05:47:48','2024-04-09 18:24:26'),(273,1,284,NULL,'SWASTHYA : A COMPREHENSIVE SYSTEM TO MANAGE HOSPITALS','<p>Swasthya : A Comprehensive System To Manage Hospitals designed to better and expedite healthcare facilities\' operational efficacy facilities to get benefits on Health and Services. This integrates various aspects of hospital operations, administration, and patient care. This is built upon a robust database architecture, allowing healthcare professionals to manage patient information securely and efficiently. It encompasses modules that cater to different departments within a hospital.&nbsp; &nbsp;</p>','no_image.jpg','Paper_Group_G_1709877260.docx',NULL,NULL,NULL,1,2,1,1,'IJIRE',1,1,3,15,'2024-04-10','<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJIRE Journal Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://theijire.com/archives?year=2024&amp;volume=5&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link: <a href=\"https://fdrpjournals.org/ijire/archives?paperid=4418570526537726270\" target=\"_blank\">C</a><span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijire/archives?paperid=4418570526537726270\" target=\"_blank\">lick Here</a></span><br><br>Crossref Link(DOI):<a href=\"https://search.crossref.org/search/works?q=10.59256%2Fijire.20240502021&amp;from_ui=yes\" target=\"_blank\"> </a><span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/search/works?q=10.59256%2Fijire.20240502021&amp;from_ui=yes\" target=\"_blank\">Click Here</a></span> (Please check after 24 hrs.)<br></p>','paid-1',0,284,1,'2024-03-08 05:54:20','2024-04-09 18:25:32'),(274,1,284,NULL,'A COMPREHENSIVE APPROACH TO SAFEGUARD CREDIT CARD TRANSACTIONS AND FRAUD PREVENTION','<p>The escalating prevalence of financial fraud within the financial sector poses profound challenges. Detecting credit card fraud in online transactions necessitates data mining due to inherent complexities. Addressing two key issues—evolving patterns in legitimate and fraudulent behaviors and highly skewed datasets of credit card frauds—renders the task challenging. This paper scrutinizes the performance of naive Bayes, KNN, and logistic regression on significantly imbalanced credit card fraud data comprising 284,807 transactions from European cardholders. The dataset\'s skewness is addressed through a hybrid under-sampling and oversampling approach. The three techniques are applied to both unprocessed and preprocessed data.\r\n</p><p>Fraud detection, defined as a set of activities thwarting illicit acquisition of assets or funds through deceptive means, varies across industries and methods. Credit card fraud, particularly susceptible due to its ease and prevalence in e-commerce and online platforms, prompted the adoption of diverse machine learning strategies to combat rising fraud rates. This paper employs machine learning algorithms for credit card fraud detection, utilizing a publicly available credit card dataset for model evaluation. While acknowledging that achieving 100% accuracy in fraud detection is elusive, the paper emphasizes the real-world applicability of its findings through the analysis of credit card data from a financial institution.\r\n</p><p>In addition to assessing model efficacy, the study introduces noise into the data samples to evaluate algorithm robustness. Experimental outcomes underscore the effectiveness of the majority voting method, achieving commendable accuracy rates in detecting credit card fraud cases. The study sheds light on the pressing issue of credit card fraud, emphasizing the importance of deploying robust machine learning approaches for timely and accurate detection in real-world scenarios.\r\n</p><p><br></p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p>','no_image.jpg','Paper_Group_I_1709877529.docx',NULL,NULL,NULL,1,2,1,1,'IJIRE',1,1,3,15,'2024-04-10','<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJIRE Journal Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://theijire.com/archives?year=2024&amp;volume=5&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link:<a href=\"https://fdrpjournals.org/ijire/archives?year=2024&amp;volume=5&amp;issue=2\" target=\"_blank\"> </a><span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijire/archives?year=2024&amp;volume=5&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>Crossref Link(DOI):<span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/search/works?q=10.59256%2Fijire.20240502022&amp;from_ui=yes\" target=\"_blank\"> Click Here</a></span> (Please check after 24 hrs.)<br></p>','paid-1',0,284,1,'2024-03-08 05:58:49','2024-04-10 07:54:31'),(275,1,284,NULL,'goatQ: A distributed message broker','<p>- goatQ, a distributed message broker explores the design and implementation of a robust message broker system. Utilizing advanced distributed concepts of network and synchronization the project aims to enhance efficiency and reliability of message delivery which fits in an event driven system. It also ensures fault tolerance and scalability. It also considers the integration with containerization and on premise and cloud deployment models to use goatQ as a message broker solution in production. \r\n</p><p>The project seeks to unravel the intricate design of message brokers, illuminating the functionality of publishers, subscribers, and message queues. A key focus lies in a rigorous performance analysis, evaluating metrics such as throughput, latency, and resource use across wide variety message broker implementations. Scalability and fault tolerance, critical considerations in the realm of distributed systems, are addressed through an exploration of how message brokers adapt to dynamic scaling requirements and recover from failures.\r\n</p><p>By synthesizing findings from diverse dimensions of message broker technology, this research project aims to equip technology professionals with valuable insights, aiding informed decision-making in the selection, optimization, and integration of message brokers within their ecosystems.\r\n</p><p><br></p><p>\r\n</p><p>\r\n</p>','no_image.jpg','Paper_Group_J_1709877745.docx',NULL,NULL,NULL,1,2,1,1,'IJIRE',1,1,3,15,'2024-04-10','<p><span style=\"color: rgb(0, 0, 255);\"><b>Published Article Details:</b></span><br><br>IJIRE Journal Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://theijire.com/archives?year=2024&amp;volume=5&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link<span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\">:<a href=\"https://fdrpjournals.org/ijire/archives?year=2024&amp;volume=5&amp;issue=2\" target=\"_blank\"> Click Here</a></span><br><br>Crossref Link(DOI):<a href=\"https://search.crossref.org/search/works?q=10.59256%2Fijire.20240502023&amp;from_ui=yes\" target=\"_blank\"> </a><span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/search/works?q=10.59256%2Fijire.20240502023&amp;from_ui=yes\" target=\"_blank\">Click Here</a></span> (Please check after 24 hrs.)<br></p>','paid-1',0,284,1,'2024-03-08 06:02:25','2024-04-10 08:36:41'),(276,1,284,NULL,'Wanderlust Chronicles- The Road Explorer Tourism Platform','<p>This platform is a dynamic and immersive tourism portal designed exclusively for foreigners seeking to explore the rich and diverse tapestry of India. With a primary focus on showcasing the vibrant Indian culture, offering updated news, and highlighting must-visit destinations, this platform aims to provide an authentic and comprehensive experience to travelers. The website will serve as a digital gateway, offering an extensive exploration of India\'s cultural heritage, including its traditions, festivals, art, music, and cuisine. Engaging multimedia content such as videos and captivating images will be strategically incorporated to offer a visually stimulating and informative experience for visitors.&nbsp; &nbsp;</p>','no_image.jpg','Paper_Group_K_1709878172.docx',NULL,NULL,NULL,1,2,1,1,'IJIRE',1,1,3,15,'2024-04-10','<p><span style=\"color: rgb(0, 0, 255);\"><b>Published Article Details:</b></span><br><br>IJIRE Journal Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://theijire.com/archives?year=2024&amp;volume=5&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link:<a href=\"https://fdrpjournals.org/ijire/archives?year=2024&amp;volume=5&amp;issue=2\" target=\"_blank\"> </a><span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijire/archives?year=2024&amp;volume=5&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>Crossref Link(DOI): <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/search/works?q=10.59256%2Fijire.20240502024&amp;from_ui=yes\" target=\"_blank\">Click Here</a></span><a href=\"https://search.crossref.org/search/works?q=10.59256%2Fijire.20240502024&amp;from_ui=yes\" target=\"_blank\"> </a>(Please check after 24 hrs.)<br></p>','paid-1',0,284,1,'2024-03-08 06:09:32','2024-04-10 08:39:39'),(277,1,284,NULL,'Enhancing User Experience in Music Streaming: A React.js and Context API Approach for Spotify Clone','<p>The evolution of web technologies has revolutionized the way music streaming platforms operate. This research paper delves into the development and implementation of a Spotify clone using React.js and Context API. The study aims to explore the efficacy of these technologies in replicating the core functionalities of the renowned music streaming service while evaluating their advantages and limitations in the context of a clone project. The research methodology involves an in-depth examination of React.js and its application in building user interfaces, along with an analysis of the Context API for state management within the Spotify clone. The paper outlines the step-by-step process of creating the clone, highlighting key architectural decisions, data handling strategies, and user experience design considerations. Additionally, this paper investigates the performance metrics, scalability, and maintenance aspects of the React.js and Context API-based Spotify clone in comparison to the original platform. The study incorporates user feedback and usability testing to evaluate the similarity in functionality and user experience between the clone and the original application. The findings of this research contribute to the understanding of leveraging React.js and Context API in replicating complex applications like Spotify. Moreover, the paper discusses the potential implications and future directions for utilizing these technologies in developing similar web-based projects.</p>','no_image.jpg','Paper_Group_L_1709879899.docx',NULL,NULL,NULL,1,2,1,2,'IJSREAT',1,1,3,15,'2024-04-10','<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJSREAT Journal Link<span style=\"background-color: rgb(255, 255, 0);\"><a href=\"https://ijsreat.com/archives?year=2024&amp;volume=4&amp;issue=2\" target=\"_blank\">: Click Here</a></span><br><br>FDRP Website Link:<span style=\"background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijsreat/archives?year=2024&amp;volume=4&amp;issue=2\" target=\"_blank\"> Click Here</a></span><br><br>Crossref Link(DOI): <span style=\"background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/search/works?q=10.59256%2Fijsreat.20240402015&amp;from_ui=yes\" target=\"_blank\">Click Here</a></span> (Please check after 24 hrs.)<br></p>','paid-1',0,284,1,'2024-03-08 06:38:19','2024-04-09 18:26:59'),(278,1,284,NULL,'HydroSight: Groundwater Prospector','<p>Access to groundwater is crucial for the sustenance of communities, particularly in key regions of West Bengal such as Midnapore, Birbhum, Purulia, and other areas. A significant portion of the population relies heavily on groundwater for various essential needs, including drinking water and daily chores. HydroSight is a project aimed at revolutionizing groundwater prospecting using data analysis techniques. Our initiative leverages data provided by the State Water Investigation Directorate (SWID), Government of West Bengal. Using machine learning techniques, we will generate compelling visual representations of data. HydroSight isn\'t just about technology; it\'s about working together to solve a real-time problem.</p>','no_image.jpg','Paper_Group_M_1709880040.docx',NULL,NULL,NULL,1,2,1,2,'IJSREAT',1,1,3,15,'2024-04-10','<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJSREAT Journal Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://ijsreat.com/archives?year=2024&amp;volume=4&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijsreat/archives?year=2024&amp;volume=4&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>Crossref Link(DOI): <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/search/works?q=10.59256%2Fijsreat.20240402016&amp;from_ui=yes\" target=\"_blank\">Click Here</a></span><a href=\"https://search.crossref.org/search/works?q=10.59256%2Fijsreat.20240402016&amp;from_ui=yes\" target=\"_blank\"> </a>(Please check after 24 hrs.)<br></p>','paid-1',0,284,1,'2024-03-08 06:40:40','2024-04-09 18:27:35'),(279,1,284,NULL,'Technological Advancements in PAN Card Security: A Robust Tampering Detection Framework','<p>This research uses cutting-edge machine learning techniques to combat the rising problem of PAN card tampering. Our technology examines the PAN card picture and looks for any irregularities or evidence of possible manipulation. With the use of cutting-edge techniques like machine learning, identifying any questionable document may be done quickly. The present study is highly committed to the establishment of a safe digital financial environment. It allays consumers\' worries about interacting with real people.</p>','no_image.jpg','Paper_Group_N_1709880172.docx',NULL,NULL,NULL,1,2,1,2,'IJSREAT',1,1,3,15,'2024-04-10','<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJSREAT Journal Link:<a href=\"https://ijsreat.com/archives?year=2024&amp;volume=4&amp;issue=2\" target=\"_blank\"> </a><span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://ijsreat.com/archives?year=2024&amp;volume=4&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link:<a href=\"https://fdrpjournals.org/ijsreat/archives?year=2024&amp;volume=4&amp;issue=2\" target=\"_blank\"> </a><span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijsreat/archives?year=2024&amp;volume=4&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>Crossref Link(DOI):<span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/search/works?q=10.59256%2Fijsreat.20240402017&amp;from_ui=yes\" target=\"_blank\"> Click Here</a></span><a href=\"https://search.crossref.org/search/works?q=10.59256%2Fijsreat.20240402017&amp;from_ui=yes\" target=\"_blank\"> </a>(Please check after 24 hrs.)<br></p>','paid-1',0,284,1,'2024-03-08 06:42:52','2024-04-09 18:28:27'),(280,1,284,NULL,'WindChat: Robust & Dynamic Flutter Messaging Application','<p>\"WindChat\" is an Android messaging application developed using Flutter and Google Firebase. It enables users to sign in with their Gmail accounts, send friend requests, and engage in real-time messaging. It is a robust messaging application developed using cutting-edge technologies - Flutter and Google Firebase. Flutter, an open-source UI software development toolkit, allows for the creation of natively compiled applications for mobile, web, and desktop from a single codebase. Its expressive and flexible framework ensures a seamless user experience across various platforms.\r\n</p><p>Complementing Flutter, Google Firebase serves as the backend infrastructure, providing a suite of powerful tools for authentication, real-time database management, and cloud storage. Firebase Authentication ensures secure user sign-ins through various methods, while Firebase Realtime Database facilitates dynamic and synchronized data updates in real-time. Additionally, Firebase Cloud Storage caters to the reliable storage of multimedia content, a pivotal aspect of WindChat\'s functionality. This integration ensures secure and efficient user authentication and authorization, while also enabling dynamic and responsive data handling, critical for a real-time messaging application like WindChat.\r\n</p><p>The combination of Flutter and Firebase empowers \"WindChat\" with a compelling and dynamic user interface, ensuring fluid navigation and an intuitive messaging experience. This fusion of innovative technologies underpins WindChat\'s ability to deliver a feature-rich and user-centric platform for seamless communication.\r\n</p><p><br></p>','no_image.jpg','Paper_Group_O_1709880253.docx',NULL,NULL,NULL,1,2,1,2,'IJSREAT',1,1,3,15,'2024-04-10','<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJSREAT Journal Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://ijsreat.com/archives?year=2024&amp;volume=4&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link:<span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"> <a href=\"https://fdrpjournals.org/ijsreat/archives?year=2024&amp;volume=4&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>Crossref Link(DOI): <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/?from_ui=&amp;q=10.59256%2Fijsreat.20240402018\" target=\"_blank\">Click Here</a></span> (Please check after 48 hrs.)<br></p>','paid-1',0,284,1,'2024-03-08 06:44:13','2024-04-10 05:45:27'),(281,1,284,NULL,'I Dustbin: A Revolutionary Waste Management Solution','<p>As urban populations continue to rise, the efficient management of municipal waste becomes increasingly imperative. Traditional waste collection systems often face challenges in optimizing resources and addressing environmental concerns. This work presents the I Dustbin, an innovative solution designed to enhance waste management processes through the integration of sensor technologies and automated features. The I Dustbin incorporates two key sensors: a garbage sensor and a level sensor. The garbage sensor detects the presence of waste within the bin, while the level sensor provides real-time monitoring of the garbage level. These sensors are seamlessly connected to a microcontroller, which processes the data and controls the system\'s functionalities. To improve user experience and facilitate waste disposal, the I Dustbin is equipped with a motorized lid. The lid automatically opens and closes, allowing for hands-free waste disposal. Additionally, an LED indicator is integrated to visually communicate the garbage level, providing users with clear and intuitive feedback. The LED indicator employs different colours or patterns to signify whether the dustbin is empty, at medium capacity, or full.</p>','no_image.jpg','Paper_Group_P_1709880350.docx',NULL,NULL,NULL,1,2,1,2,'IJSREAT',1,1,3,15,'2024-04-10','<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJSREAT Journal Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://ijsreat.com/archives?year=2024&amp;volume=4&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link<a href=\"https://fdrpjournals.org/ijsreat/archives?year=2024&amp;volume=4&amp;issue=2\" target=\"_blank\">:</a><span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijsreat/archives?year=2024&amp;volume=4&amp;issue=2\" target=\"_blank\"> Click Here</a></span><br><br>Crossref Link(DOI): <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/?from_ui=&amp;q=10.59256%2Fijsreat.20240402019\" target=\"_blank\">Click Here</a></span><a href=\"https://search.crossref.org/?from_ui=&amp;q=10.59256%2Fijsreat.20240402019\" target=\"_blank\"> </a>(Please check after 48 hrs.)<br></p>','paid-1',0,284,1,'2024-03-08 06:45:50','2024-04-10 07:46:38'),(282,3,285,NULL,'Immunopharmacology: Modulation of the Immune System for Therapeutic Interventions','<p>In recent years, there has been a tremendous development of biotechnological, pharmacological, and medical techniques which can be implemented in the functional modulation of the immune system components. Immunomodulation has attracted much attention because it offers direct applications in both basic research and clinical therapy. Modulation of a non-adequate, amplified immune response enables to attenuate the clinical course of a disease and restore homeostasis. The potential targets to modulate immunity are as multiple as the components of the immune system, thus creating various possibilities for intervention. However, immunomodulation faces new challenges to design safer and more efficacious therapeutic compounds. This review offers a cross-sectional picture of the currently used and newest pharmacological interventions, genomic editing, and tools for regenerative medicine involving immunomodulation. We reviewed currently available experimental and clinical evidence to prove the efficiency, safety, and feasibility of immunomodulation in vitro and in vivo. We also reviewed the advantages and limitations of the described techniques. Despite its limitations, immunomodulation is considered as therapy itself or as an adjunct with promising results and developing potential.\r\n</p><p>The development and progression of the inflammatory process is tightly connected with the innate immune system action. The main initial features of inflammation include vasodilation and increased blood flow. This leads to erythema and an increase in the temperature of the inflammation-affected area. Increased vascular permeability allows the inflammatory cells to infiltrate from the blood flow to the tissue, causing tissue edema and swelling. Inflammatory mediators such as bradykinins and prostaglandins increase pain sensitivity and cause hyperalgesia. Cleaning up of the infected area is possible because of the chemotaxis ability of neutrophils triggered by a gradient of chemokines released by the damaged tissue.\r\n</p><p><br></p>','no_image.jpg','Document_1709900442.docx',NULL,NULL,NULL,1,2,2,3,'IJRTMR',2,1,1,17,NULL,'<p>Dear Author. </p><p>please reduce your article plagiarism less than 30%. &amp; resubmit</p><p>thank you for your interest out international journal <br></p>',NULL,0,285,1,'2024-03-08 12:20:42','2024-03-08 15:34:52'),(283,1,288,NULL,'IoT based Landslide Monitoring System','<p>Every year, our world is shaken by the destructive force of landslides, a menacing natural disaster that disrupts social life and leaves a trail of devastation in its wake. Picture a massive Pile of stones and fragments hurtling plummet a steep incline, causing havoc and destruction in its path. It\'s a sight that exemplifies the immense power of nature .Out of all the continents, Asia has suffered the most, bearing the brunt of 75% of all landslides worldwide. This vast and diverse continent has been marked by numerous incidents that have claimed lives and caused immeasurable damage. It\'s a somber reminder of the precariousness of our existence in the face of such natural phenomenon. India, a country blessed with breathtaking landscapes and rich biodiversity, has not been spared from the wrath of landslides .in kerala, throughout the monsoon period last year, the southern state of India, tragedy struck as landslides took a toll on human lives. The loss and devastation serve as a stark reminder of the importance of early detection and proactive measures to safeguard communities.</p><p><b>Key words:</b> Transmitted, detect, indicative</p>','no_image.jpg','CONFERENCE_1710048541.docx',NULL,NULL,NULL,1,2,1,1,'IJIRE',1,1,1,5,NULL,NULL,NULL,0,288,NULL,'2024-03-10 05:29:01','2024-03-14 14:54:36'),(284,1,261,NULL,'Soft computing technique for Harmonic Mitigation of Enhancing Grid-Integrated Photovoltaic (PV) System Power Quality','<p>This abstract explores the use of soft computing techniques for harmonic mitigation in renewable energy integration, particularly for photovoltaic (PV) systems in power grids. Traditional methods often fail to effectively mitigate harmonics, leading to system performance compromise and grid instability. Soft computing\'s adaptability and ability to handle complex systems offer promising solutions. The study explores the use of soft computing techniques like artificial neural networks, fuzzy logic, and genetic algorithms to mitigate harmonics in PV systems. ANNs learn complex patterns, fuzzy logic handles uncertain data, and genetic algorithms optimize mitigation strategies for varying grid conditions and system dynamics. The study demonstrates the effectiveness of soft computing-based harmonic mitigation techniques in improving power quality indices like total harmonic distortion and voltage stability. It emphasizes the importance of integrating advanced computational approaches in PV systems for seamless grid integration and promoting sustainable renewable energy integration.</p>','no_image.jpg','manuscript_1710064450.docx',NULL,NULL,NULL,1,2,1,1,'IJIRE',2,1,3,15,NULL,'<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJIRE Journal Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://theijire.com/archives?year=2024&amp;volume=5&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijire/archives?year=2024&amp;volume=5&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>Crossref Link(DOI): <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/?from_ui=&amp;q=10.59256%2Fijire.20240502003\" target=\"_blank\">Click Here</a></span> (Please check after 24 hrs.)<br></p>','paid-2',1,261,1,'2024-03-10 09:54:10','2024-03-12 09:08:35'),(285,3,289,NULL,'Post Menopausal Osteoporosis','<p>A significant portion of the Indian female population belongs to the perimenopausal and postmenopausal age groups. One of the complications associated with aging in women is weakening of bones and a decrease in bone mineral density (BMD). This has serious, debilitating consequences on a woman\'s life, leading to a reduced quality of life and an increased incidence of fractures. If the fracture involves the hip or vertebrae, it can be debilitating and have devastating consequences. Postmenopausal osteoporosis is associated with estrogen deficiency, which occurs when ovarian function declines with age. The role of estrogen in bone remodeling is very well understood after many years of research; Estrogen plays a role in both bone formation and preventing bone resorption. The diagnosis can be made using dual-energy x-ray absorptiometry (DEXA). The main goal of osteoporosis diagnostics is to elucidate the causes of the disease, elucidate the functions of biomarkers and their dynamic changes in response to therapy, and develop a new diagnostic strategy in combination with modern methods. Conventional treatments, including bisphosphonates, denosumab, estrogen replacement therapy, and teriparatide, have long been used in the treatment of osteoporosis. Some serious side effects led to discontinuation of therapy. However, the frequency of side effects is quite low. Developing new treatments for osteoporosis using mesenchymal stem cells or Chinese herbal therapies is of growing interest to researchers as they improve safety, effectiveness and cost- effectiveness. Improvements in both diagnostic and therapeutic strategies may facilitate personalized treatment of osteoporosis.\r\n</p><p><br></p>','no_image.jpg','Saloni_(Review_Article)_1710084975.docx',NULL,NULL,NULL,1,2,1,3,'IJRTMR',2,1,1,15,NULL,'<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJRTMR Journal Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://ijrtmr.com/archives?paperid=3232745500521873662\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijrtmr/archives?year=2024&amp;volume=4&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br><br></p>','paid-1',1,289,1,'2024-03-10 15:36:15','2024-04-25 12:23:41'),(286,1,290,NULL,'Simulation and FPGA based Implementation of PI and FUZZY Controllers for Cascaded Asymmetric Multilevel Inverter','<p>respected sir&nbsp;</p><p>here i submitted the paper</p>','no_image.jpg','PAPER_1_1710086157.docx',NULL,NULL,NULL,1,2,1,1,'IJIRE',1,1,3,15,NULL,'<p><b><span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 25