p>','paid-1',1,290,1,'2024-03-10 15:57:42','2024-03-11 13:42:33'),(288,1,291,NULL,'Novel Control of PV-Battery Powered Standalone Power Supply System with Neuro-Fuzzy Controller','<p>Photovoltaic (PV) powered standalone electrical power supply systems are becoming more precious networks nowadays worldwide. Many challenging tasks are existed in PV based standalone systems due to random changes in solar irradiances, load and it is absent during nighttime. Innovative controllers are necessary to uphold power quality in these systems. A battery pack is required in this standalone system since solar irradiance is unpredictable and in order to provide continuous stable power to electrical loads during no irradiance. Therefore, a battery bank is connected to a standalone unit via a DC to DC bidirectional circuit. The maximum power point tracking converter, in conjunction with the perturbed and observe algorithm, is employed to optimize the operation of the PV system and enhance the overall efficiency of the system. Neuro-Fuzzy controller based novel controller is designed for both inverter as well as bidirectional circuit to supply quality power to both single and three phase loads. Comprehensive findings have been showcased and accessed via hardware-in-loop testing on the OPAL-RT platform to optimize the suggested controller for a 1MW standalone system in various scenarios.</p>','no_image.jpg','my_paper_1710089283.docx',NULL,NULL,NULL,1,2,1,2,'IJSREAT',1,2,2,15,'2024-03-13','<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJSREAT Journal Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://ijsreat.com/archives?year=2024&amp;volume=4&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijsreat/archives?year=2024&amp;volume=4&amp;issue=2\" target=\"_bla