s a process that involves converting waste materials into electricity by burning them in a combustion chamber. This process is a sustainable solution for waste management as it reduces the volume of waste sent to landfills while producing renewable energy. The methodology for electricity generation by burning waste materials typically involves waste collection, handling, and preparation, incineration, energy recovery, and ash management. The generated electricity can be used for local communities or industries or fed back into the national grid. The process of electricity generation by burning waste materials provides a reliable source of electricity while reducing greenhouse gas emissions by avoiding the release of methane gas from landfills. Overall, electricity generation by burning waste materials is a promising solution for waste management and renewable energy production. However, it is important to carefully consider the potential benefits and drawbacks of this method and to ensure that appropriate regulations and technologies are in place to minimize any negative environmental impacts.\r\n</p><p><br></p><p>\r\n</p>','no_image.jpg','Electrical_power_generation_from_waste_products_1710148737.docx',NULL,NULL,NULL,1,2,1,1,'IJIRE',2,1,1,15,NULL,'<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJIRE Journal Link:<a href=\"https://theijire.com/archives?year=2024&amp;volume=5&amp;issue=2\" target=\"_blank\"> </a><span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://theijire.com/archives?year=2024&amp;volume=5&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijire/archives?year=2024&amp;volume=5&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>Crossref Link(DOI): <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/?from_ui=yes&amp;q=10.59256%2Fijire.20240502007\" target=\"_blank\">Click Here</a></span><a href=\"https://search.crossref.org/?from_ui=yes&amp;q=10.59256%2Fijire.20240502007\" target=\"_blank\"> </a>(Please check after 48 hrs.)<br></p>',NULL,0,296,1,'2024-03-11 09:18:57','2024-03-15 05:12:34'),(291,1,296,NULL,'AN INNOVATIVE APPROACH TO IOT BASED PREPAID ENERGY METER','<p>AN INNOVATIVE APPROACH TO IOT BASED PREPAID ENERGY METER</p><p>Abstract— The main problem of the conventional metering system is that person from utility has go to area by area and read the energy meter of every house and handover the bills. According to that reading consumer pays the bill. Then, when the customer failed to pay bills for a long period of time one person from utility has go to area by area and remove the fuse to disconnect the consumer premises from the distribution feeder. This process can be replaced by using prepaid energy meter. Many times errors like extra billing or notification from utility are given frequently even bills are paid regularly. In this paper, Microcontroller based prepaid measuring system to calculate the power consumption and GSM circuit  for Short Messaging Service to the user is used \r\n</p><p>Keywords-GSM, Prepaid energy meter, smart monitoring and control, Theft detection, arduino\r\n</p><p><br></p>','no_image.jpg','AN_INNOVATIVE_APPROACH_TO_IOT_BASED_PREPAID_ENERGY_METER_1710227231.doc',NULL,NULL,NULL,1,2,1,1,'IJIRE',2,1,2,15,'2024-03-15','<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJIRE Journal Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://theijire.com/archives?year=2024&amp;volume=5&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijire/archives?year=2024&amp;volume=5&amp;issue=2