14.docx',NULL,NULL,NULL,1,2,1,2,'IJSREAT',1,1,3,15,NULL,'<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJSREAT Journal Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://ijsreat.com/archives?year=2024&amp;volume=4&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijsreat/archives?year=2024&amp;volume=4&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>Crossref Link(DOI): <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/?from_ui=&amp;q=10.59256%2Fijsreat.20240402005\" target=\"_blank\">Click Here</a></span> (Please check after 24 hrs.)<br></p>','paid-2',0,295,1,'2024-03-12 08:28:34','2024-03-13 10:48:50'),(293,1,261,NULL,'Harmonic mitigation for enhancing grid-integrated photovoltaic system power quality: a review','<p>With the growing integration of renewable energy sources, such solar energy systems into electrical grids, power quality issues emerge from possible harmonic distortions. This study analyzes the effectiveness of grid-integrated photovoltaic systems and discusses harmonic mitigation to improve electricity quality. Power quality can be negatively impacted by harmonic distortion due to voltage swings, higher losses, and interference with delicate equipment. As a result, efficient and dependable PV system functioning inside the grid depends on the implementation of effective mitigation techniques. We examine a range of mitigation strategies, such as hybrid solutions, active filters, and passive filters, each with unique benefits and drawbacks in terms of expense, intricacy, and efficiency. The effects of integrating PV systems on grid stability, voltage regulation, and frequency management are also covered in the article, emphasizing the significance of thorough performance analysis. The effectiveness of various harmonic mitigation techniques is assessed by modeling studies and experimental validation, taking into account variables including system efficiency, dependability, and compliance with international power quality standards. The study also looks at how grid circumstances, PV system layout, and size affect harmonic generation and mitigation needs. The research yields valuable insights that aid in the formulation of strategies aimed at improving power quality and maximizing grid-integrated photovoltaic systems\' performance under various operating situations</p>','no_image.jpg','Manuscript_IJSREAT_1710241002.docx',NULL,NULL,NULL,1,2,1,2,'IJSREAT',2,1,3,15,NULL,'<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJSREAT Journal Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\">Click Here</span><br><br>FDRP Website Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\">Click Here</span><br><br>Crossref Link(DOI): <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\">Click Here</span> (Please check after 24 hrs.)<br></p>','paid-2',1,261,1,'2024-03-12 10:56:42','2024-03-13 10:34:51'),(294,1,293,NULL,'Material Optimization in Formula One Seat Fit based on Structural and Biomechanical analysis','<p>F1 drivers have reported that they suffer a long-term lower back pain due to ‘Porpoising’ effect, it is a series of bounce that is generated due to Aerodynamic downforce. This downforce is part of drag reduction principle that pulls the air underneath the vehicle, thereby creating an incredible speed of 200 to 230 mph. Also at 200 mph speed, the driver experiences a high amount G-forces up to six times during the race. This can be simply avoided by increasing the ground clearance of vehicle but at the same time it also reduces the max speed of the vehicle. Hence, without compromising the speed, Design optimization is done for driver’s seat-fit through Computational methods of Biomechanical modelling and simulation for determining the optimum Seat Angle for Postural Ergonomics. As an additional Reinforcement and Shock absorption in seat material to protect driver’s spine from the resulting dynamics, Material optimization is done by selecting Graphene as the suitable material over the existing Carbon fiber material. Finite element method was carried out for structural analysis of seat-fit model. The stress, strain and deformation values were found to be lesser in Graphene model when compared to Carbon fiber. The simulation results will provide a solution for eliminating the higher risk of spine injury or pathological condition of a sportsman and thereby improves the sporting performance.</p>','no_image.jpg','Vishwakiran_IJIRE_Manuscript_Template_new_1710305430.docx',NULL,NULL,NULL,1,2,1,1,'IJIRE',1,1,2,15,'2024-03-15','<p><span style=\"color: rgb(0, 0, 255); font-weight: bold;\">Published Article Details:</span><br><br>IJIRE Journal Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://theijire.com/archives?year=2024&amp;volume=5&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijire/archives?year=2024&amp;volume=5&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>Crossref Link(DOI): <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/?from_ui=&amp;q=10.59256%2Fijire.20240502006\" target=\"_blank\">Click Here</a></span> (Please check after 48 hrs.)<br></p>','paid-2',1,293,1,'2024-03-13 04:50:30','2024-03-15 04:12:24'),(295,1,299,NULL,'DEPTH SENSING IMAGING SYSTEM FOR AUTONOMOUS  VEHICLE TO RESTORE FOG','<p>In image processing, \"edge-preserving \r\n</p><p>smoothing\" eliminates textures without removing their \r\n</p><p>distinct edges. Image de-noising is one method for lowering \r\n</p><p>photo noise in corrupted files. Enhancing an image\'s \r\n</p><p>contrast, the way non-computer-aided viewers interpret \r\n</p><p>information from photos, or the results of other automated \r\n</p><p>image processing techniques are the goals of image \r\n</p><p>denoising. Haze frequently detracts negatively from videos \r\n</p><p>that were taken outside or in foggy conditions. Haze can be \r\n</p><p>eliminated from hazy videos using a variety of techniques. \r\n</p><p>The majority oversaturate the videos without hazing them. \r\n</p><p>One of the greatest algorithms for removing haze from \r\n</p><p>photos is the color attenuation prior approach..</p>','no_image.jpg','paper_project_pdf_1710307665.pdf',NULL,NULL,NULL,1,2,2,1,'IJIRE',7,1,2,1,NULL,NULL,NULL,0,299,NULL,'2024-03-13 05:27:45','2024-03-13 06:35:33'),(296,1,299,NULL,'DEPTH SENSING IMAGING SYSTEM FOR AUTONOMOUS  VEHICLE TO RESTORE FOG','<p>In image processing, \"edge-preserving \r\n</p><p>smoothing\" eliminates textures without removing their \r\n</p><p>distinct edges. Image de-noising is one method for lowering \r\n</p><p>photo noise in corrupted files. Enhancing an image\'s \r\n</p><p>contrast, the way non-computer-aided viewers interpret \r\n</p><p>information from photos, or the results of other automated \r\n</p><p>image processing techniques are the goals of image \r\n</p><p>denoising. Haze frequently detracts negatively from videos \r\n</p><p>that were taken outside or in foggy conditions. Haze can be \r\n</p><p>eliminated from hazy videos using a variety of techniques. \r\n</p><p>The majority oversaturate the videos without hazing them. \r\n</p><p>One of the greatest algorithms for removing haze from \r\n</p><p>photos is the color attenuation prior approach..\r\n</p><p>Keywords— Dark Channel Prior (DCP), Adaptive \r\n</p><p>Dehazing Methods,an image interpolation method based on \r\n</p><p>GSAA and a spatial general AR model.</p>','no_image.jpg','paper_project_pdf_1710307774.pdf',NULL,NULL,NULL,1,2,1,2,'IJSREAT',1,1,2,5,NULL,NULL,NULL,0,299,NULL,'2024-03-13 05:29:34','2024-03-14 09:12:05'),(297,2,303,NULL,'Comparative Analysis of Program Execution Time Required by Python, R and Julia Compiler','<p>As the popularity of high-level programming languages such as Python, R, and Julia continues to rise, the need for assessing their computational performance becomes paramount. This study aims to address the fundamental question: \"Which programming language is best suited for faster program execution among Python, R, and Julia?\" Through a series of trials, this paper investigates the execution time required by each language to solve five common programming problems: calculating the determinant of a large matrix, implementing Dijkstra\'s algorithm, conducting a Monte Carlo simulation, computing the Levenshtein distance between two strings, and simulating a Predator-Prey model. By comparing the performance of Python, R, and Julia across these tasks, we seek to provide insights into the relative strengths and weaknesses of each language in terms of computational efficiency.</p>','no_image.jpg','Comparative_Analysis_of_Program_Execution_Time_Required_by_Python,_R_and_Julia_Compiler_1710327976.docx',NULL,NULL,NULL,1,2,1,6,'INDJCST',1,1,3,15,'2024-03-15','<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IndJcst Journal Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://indjcst.com/archives?year=2024&amp;volume=3&amp;issue=1\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link:<a href=\"https://fdrpjournals.org/indjcst/archives?year=2024&amp;volume=3&amp;issue=1\" target=\"_blank\"> </a><span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/indjcst/archives?year=2024&amp;volume=3&amp;issue=1\" target=\"_blank\">Click Here</a></span><br><br>Crossref Link(DOI): <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/search/works?q=10.59256%2Findjcst.20240301002&amp;from_ui=yes\" target=\"_blank\">Click Here</a></span> (Please check after 48 hrs.)<br></p>','paid-2',1,303,1,'2024-03-13 11:06:16','2024-03-15 05:43:26'),(298,2,287,NULL,'Addressing Challenges in Recommendation Systems: Proposing and Implementing Solutions for Improvement','<p>Recommendation systems play a crucial role in today\'s digital landscape, assisting users in discovering content tailored to their preferences. However, they face challenges such as cold start, data sparsity, scalability, diversity of content, and lack of trust. This paper proposes solutions to these challenges and implements a model combining neural matrix factorization for collaborative filtering and content-based recommendations using user demographics. By leveraging hybrid approaches, demographic information, trust networks, distributed computing, and incremental data training, the system aims to provide accurate, diverse, and trustworthy recommendations while addressing scalability issues. The implementation is tested on the Movie-Lens dataset, demonstrating improved performance in mitigating cold start and sparsity issues. Future enhancements include feature-rich onboarding, feature engineering, and user-controlled filters to further enhance recommendation accuracy and user experience.</p>','no_image.jpg','Research_Paper_Draft_1710342599.docx',NULL,NULL,NULL,1,2,1,2,'IJSREAT',1,1,1,5,NULL,NULL,NULL,0,287,NULL,'2024-03-13 15:09:59','2024-03-14 15:03:11'),(299,1,282,NULL,'SLEEP ALARM DETECT FOR DRIVER’S USING EYE BLINK SENSOR','<p>There has been a very large increase in road accidents due to the drowsiness of drivers while driving which leads to enormous fatal accidents. The driver loses control when he falls asleep which leads to an accident. This is because when the driver is not able to control his vehicle at a very high speed on the road. This project can generate a model which can prevent such accidents. Therefore, I have with an idea and successfully develop a sleepy detection and alarming system, which could effectively meet this demand.&nbsp;</p>','no_image.jpg','SLEEP_DETECT_FOR_DRIVER_1710394079.docx',NULL,NULL,NULL,1,2,1,1,'IJIRE',1,1,2,15,NULL,'<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJIRE Journal Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://theijire.com/archives?year=2024&amp;volume=5&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijire/archives?year=2024&amp;volume=5&amp;issue=2\" target=\"_blank\">Click Here</a></span><br></p>','paid-1',1,282,1,'2024-03-14 05:27:59','2024-03-19 06:03:36'),(300,1,305,NULL,'JOURNAL _ SEQUENCE MODELING OF PASSIVE SENSING DATA FOR TREATMENT RESPONSE PREDICTION IN MAJOR DEPRESSIVE DISORDER','<p>Major depressive disorder (MDD) is a preva- lent mental health condition and has become a pressing societal challenge. Early prediction of treatment response may aid in the rehabilitation engineering of depression, which is of great practical significance for the relief of suffering and burden of MDD. In this paper, we present a sequence modeling approach that uses data collected by passive sensing techniques to predict patients with an outcome of treatment responded defined by the reduc- tion in clinical administrated scales. Hundreds of patients with MDD have been recruited from outpatient clinics at 4 psychiatric sites. Each has been delivered with a self-developed app to passively record their daily phone usage and physical data with minimal human action. An unavoidable dilemma in passive sensing is missing val- ues. To overcome that, the proposed approach combined feature extraction and sequence modeling methods to fully utilize the pattern of missing values from longitudinal data. With no treatment constraints, it enables us to predict the treatment response of MDD 8–10 weeks before the comple- tion of the treatment course, leaving time for preventative measures. Our work explored the feasibility of treatment response prediction using longitudinal passive sensing data and sparse ground truth, and also has the potential for preventing depression by forecasting treatment outcomes weeks in advance.</p>','no_image.jpg','JOURNAL___SEQUENCE_MODELING_OF_PASSIVE_SENSING_DATA_FOR_TREATMENT_RESPONSE_PREDICTION_IN_MAJOR_DEPRESSIVE_DISORDER_1710480935.docx',NULL,NULL,NULL,1,2,2,6,'INDJCST',7,2,3,16,NULL,NULL,NULL,0,305,NULL,'2024-03-15 05:35:35','2024-03-16 06:14:20'),(301,4,307,NULL,'ROLE OF CREDIT CARD IN THE DIGITAL PAYMENT SYSTEM: GROWTH ANALYSIS','<p>The present Government is aimed at transforming the country into a digital economy. It gives special attention for digital payments. In daily lives larger transactions are happening on payments and it has been resulted that enhance the better society, business and the economy at larger part. Over the past three years, digital payment system works with new payment modes along with existing payment system in order to increasing Person to Merchant (PtoM) as well as Person to Person (PtoP) payments. Among various modes of digital payments, credit card payment is one of the retail payment systems which have improved Person to Merchant payments. The usage of credit card depends on the users’ willingness to spend on credit basis. Thus, this study measure the growth of credit card payments with respect to volume and value of credit card payment transactions. These two parameters play a vital role in order to observe the users’ position in credit card payments.   The 11 Financial Years from 2009-10 to 2019-20 were considered for the study. The analysis reveals that an average of 838.31 million transactions of credit card payment with the value of INR 2676.39 Billion has been takes place for the study period. Further, the growth prospect is expected that credit card payment takes place over INR 7000 Billion with over 2200 volume of transactions in 2022-23. Further, this study has been identified that most important credit card payment infrastructure namely number of outstanding credit cards, Point of Sales (POS) machines and volume of transaction on the growth on value of credit card payments for the reference period.&nbsp;&nbsp;</p>','no_image.jpg','Research_Paper__Final_1710578699.docx',NULL,NULL,NULL,1,2,1,2,'IJSREAT',1,1,1,5,NULL,NULL,NULL,0,307,NULL,'2024-03-16 08:44:59','2024-03-17 06:33:08'),(302,1,277,NULL,'REALM OF AUG MATRIX','<p>Our cybersecurity gamification website is designed to make learning and practicing cybersecurity skills more fun and engaging. The platform offers interactive games and challenges that cover basic cybersecurity topics and best practices. Users can progress through various levels and earn rewards as they learn and demonstrate their skills. The platform also includes educational resources and guidance to help users understand their understanding of online security. By gamifying cybersecurity education, we hope to make it more accessible and engaging to a wider audience, ultimately helping to create a safer environment.</p>','no_image.jpg','REALM_1710588959.docx',NULL,NULL,NULL,1,2,1,2,'IJSREAT',1,1,1,5,NULL,NULL,NULL,0,277,NULL,'2024-03-16 11:35:59','2024-03-17 06:34:02'),(303,1,308,NULL,'Phish Catcher: Client-Side Defense Against Web-Spoofing Attacks Using Machine Learning','<p>Cybersecurity faces a significant challenge in safeguarding users\' confidential information, such as passwords and PIN codes, from phishing attacks. These attacks, which employ various deceptive tactics like fake login pages, phishing emails, and click-jacking, aim to trick users into divulging sensitive data. Traditional security strategies often encounter issues of latency and accuracy in detecting these fraudulent activities. To address this challenge, we propose a client-side defense mechanism leveraging machine learning techniques to detect spoofed web pages and protect users from phishing attacks.</p>','no_image.jpg','phish_catcher_1710657980.docx',NULL,NULL,NULL,1,2,1,3,'IJRTMR',4,1,2,15,NULL,'<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJRTMR Journal Link:<a href=\"https://ijrtmr.com/archives?paperid=2423936516865113309\" target=\"_blank\"> </a><span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://ijrtmr.com/archives?paperid=2423936516865113309\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link:<a href=\"https://fdrpjournals.org/ijrtmr/archives?year=2024&amp;volume=4&amp;issue=2\" target=\"_blank\"> </a><span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijrtmr/archives?year=2024&amp;volume=4&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>Crossref Link(DOI): <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/search/works?q=10.59256%2Fijrtmr.20240402016&amp;from_ui=yes\" target=\"_blank\">Click Here</a></span> (Please check after 48 hrs.)<br></p>','paid-2',1,308,1,'2024-03-17 06:46:20','2024-04-16 13:51:28'),(304,1,312,NULL,'Lifespan Enhancement of WSN for IoT - Modified Fuzzy Grey Wolf Optimizer (MFGWO) Approach','<p>Wireless Sensor Networks (WSNs) are gaining prominence for diverse applications, including environmental monitoring and industrial automation. Yet, their energy constraint poses a significant challenge. Clustering, a prevalent technique, optimizes energy utilization by grouping nodes into clusters and appointing a cluster head (CH) to aggregate data and communicate with the base station (BS). This paper presents a novel clustering and CH selection algorithm for a energy varied WSNs, leveraging modified fuzzy c-means (FCM) clustering and Grey Wolf Optimization (GWO). Modified FCM partitions nodes based on their similarity, while GWO identifies CHs in each cluster, considering energy levels, centrality, distance from the BS, and dynamic node distribution. Simulation results demonstrate the superior energy efficiency and network lifetime of our proposed approach compared to existing algorithms.</p>','no_image.jpg','MFGWO_1710683675.docx',NULL,NULL,NULL,1,2,1,1,'IJIRE',1,1,1,15,'2024-03-20','<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJIRE Journal Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://theijire.com/archives?year=2024&amp;volume=5&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijire/archives?paperid=5775433131845371669\" target=\"_blank\">Click Here</a></span><br><br>Crossref Link(DOI):<span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"> <a href=\"https://search.crossref.org/?from_ui=&amp;q=10.59256%2Fijire.20240502008\" target=\"_blank\">Click Here</a></span> (Please check after 48 hrs.)<br></p>','paid-2',1,312,1,'2024-03-17 13:54:35','2024-03-19 07:08:08'),(305,2,310,NULL,'A Critical Review of Text to Image Synthesis Using GAN : Unveiling the Power of GANs','<p>Text image synthesis is central to graphic synthesis. In previous studies, text-image integration whose primary goal was to find matching words and images through sentence or keyword retrieval has improved over image integration as it holds promise due to advances in deep learning, especially deep genetic models in image fusion. use of an important generational model is generative adversarial network, it has been successfully used in computer vision, NLP, and other fields. In this research, we explore recent research on Generative Adversarial Networks-based text-to-image synthesis and to sum it up, its development. Traditional and advanced models are also summarized. Let\'s present the explanation. The Generative Adversarial Networks based text-to-image synthesis input details the specific structure of each class, including visual structure and dialog language, in addition to the detailed text description used in previous experiments. The most common application of text to image synthesis is all text-based images, which fall into three categories based on advances in text information processing, network topology, and output control conditions.</p>','no_image.jpg','Text_to_image_Draft_1710685968.docx',NULL,NULL,NULL,1,2,1,6,'INDJCST',2,1,1,15,NULL,'<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IndJcst Journal Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://indjcst.com/archives?year=2024&amp;volume=3&amp;issue=1\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/indjcst/archives?year=2024&amp;volume=3&amp;issue=1\" target=\"_blank\">Click Here</a></span><br></p>','paid-1',1,310,1,'2024-03-17 14:32:48','2024-03-23 16:27:25'),(306,1,313,NULL,'Deep Learning-Based Leaf Disease Detection in Crop Using Images for Agricultural Application','<p>The \"Leaf Disease Detection\" system addresses the critical challenge of plant diseases in agriculture through the implementation of an automated solution leveraging deep learning techniques. In this comprehensive endeavor, convolutional neural networks (CNNs), specifically DenseNet-121, ResNet-50, VGG-16, and Inception V4, are fine-tuned for efficient and accurate identification of plant diseases. The project utilizes the PlantVillage dataset, encompassing 54,305 images across 38 plant disease classes, to conduct a comparative analysis of model performance. DenseNet-121 emerged as the top-performing model, achieving an exceptional 99.81% classification accuracy, surpassing other state-of-the-art models. The system\'s methodology strategically employs transfer learning to overcome computational challenges associated with training deep CNN layers. This approach, coupled with the multi-class classification strategy, proves robust in handling diverse plant species and diseases within each class. The results highlight the superior efficiency of transfer learning in comparison to building models from scratch, showcasing the potential for real-world applications in agriculture. The system\'s success is attributed to the careful optimization of hyperparameters and the adoption of advanced deep learning techniques, offering a promising avenue for automated and accurate plant disease detection, with implications for improving agricultural practices, minimizing economic losses, and ensuring global food security.</p>','no_image.jpg','Leaf_Disease_Detection_(Research_paper)_1710737717.docx',NULL,NULL,NULL,1,2,1,5,'INDJECE',1,1,3,4,NULL,NULL,NULL,0,313,NULL,'2024-03-18 04:55:17','2024-03-23 03:08:22'),(307,15,317,NULL,'IOT BASED ACCIDENT ANALYSIS SYSTEM USING EDGE COMPUTING','<p><span style=\"font-family: &quot;Times New Roman&quot;;\">﻿</span>The increasing number of road \r\n</p><p>accidents and their associated consequences necessitate \r\n</p><p>the development of advanced systems for timely \r\n</p><p>detection and analysis. This paper proposes an \r\n</p><p>Internet of Things (IOT)-based Accident Detection \r\n</p><p>and Analysis System that leverages Edge Computing \r\n</p><p>for real-time processing and decision-making. The \r\n</p><p>system integrates smart sensors, edge devices, and \r\n</p><p>cloud infrastructure to create a comprehensive \r\n</p><p>framework for efficient accident detection and \r\n</p><p>analysis. The proposed IOT-based Accident Detection \r\n</p><p>and Analysis System enhances road safety by enabling \r\n</p><p>quick response to accidents and providing valuable \r\n</p><p>insights for preventive measures. The integration of \r\n</p><p>edge computing optimizes resource utilization, \r\n</p><p>minimizes latency, and enhances the overall efficiency\r\n</p><p>of the system. This research contributes to the evolving \r\n</p><p>field of smart transportation systems, addressing the \r\n</p><p>critical need for advanced technologies accident \r\n</p><p>detection and analysis.</p>','no_image.jpg','paper1_1710762458.docx',NULL,NULL,NULL,1,2,1,1,'IJIRE',1,1,1,15,'2024-03-21','<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJIRE Journal Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://theijire.com/archives?year=2024&amp;volume=5&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link:<a href=\"https://fdrpjournals.org/ijire/archives?year=2024&amp;volume=5&amp;issue=2\" target=\"_blank\"> </a><span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijire/archives?year=2024&amp;volume=5&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>Crossref Link(DOI): <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/?from_ui=&amp;q=10.59256%2Fijire.20240502009\" target=\"_blank\">Click Here</a></span> (Please check after 48 hrs.)<br></p>','paid-2',1,317,1,'2024-03-18 11:47:38','2024-03-21 12:37:12'),(308,15,318,NULL,'\"A Decaying Trend of Ethical Values inside the Indian Parliament \"','<p>A Representative Parliamentarian Governance structure the pride of Indian governance has lasted over 70 years with strong strides towards the general welfare of people.Hence we say that Indian Parliament is not effective.</p>','no_image.jpg','A_decaying_trend_inside_the_Indian_parliment_(2)_1710778223.docx',NULL,NULL,NULL,1,2,1,3,'IJRTMR',1,1,3,2,NULL,NULL,NULL,0,318,NULL,'2024-03-18 16:10:23','2024-03-18 17:07:27'),(309,15,322,NULL,'Financial fraud and scams occurred in developing economy','<p>Abstract</p><p>Financial fraud and scams have become pervasive issues in India, posing significant challenges to its economy and the broader financial ecosystem. This research paper aims to provide a comprehensive analysis of the landscape of financial fraud and scams in India and its ramifications on developing countries. The study employs a mixed-method approach, combining qualitative analysis of case studies and quantitative assessment of economic indicators. Through an in-depth examination of prominent fraud cases and their impact on various sectors, this paper elucidates the intricate mechanisms underlying financial malfeasance in India. Furthermore, it investigates the interconnectedness between fraudulent activities in India and their spillover effects on developing countries, particularly in terms of economic stability, investor confidence, and global financial contagion. By shedding light on the causes, consequences, and regulatory responses to financial fraud, this research contributes to the existing literature on financial crime and provides insights for policymakers, financial institutions, and stakeholders to mitigate risks and safeguard financial integrity in India and beyond.</p>','no_image.jpg','Research_paper_alisha_1710787786.docx',NULL,NULL,NULL,1,2,2,6,'INDJCST',1,1,3,17,NULL,NULL,NULL,0,322,NULL,'2024-03-18 18:49:46','2024-03-19 15:02:05'),(310,1,323,NULL,'HANDWRITING DETECTION SYSTEM USING IMAGE PROCESSING','<p>The name handwriting&nbsp;<span style=\"font-size: 0.875rem;\">recognition is quite popular since it is&nbsp;</span><span style=\"font-size: 0.875rem;\">widely applied in document analysis,&nbsp;</span><span style=\"font-size: 0.875rem;\">biometrics, and other areas in forensics.&nbsp;</span><span style=\"font-size: 0.875rem;\">This study, therefore, involves detailed&nbsp;</span><span style=\"font-size: 0.875rem;\">research and implementation of a&nbsp;</span><span style=\"font-size: 0.875rem;\">handwriting detection system using&nbsp;</span><span style=\"font-size: 0.875rem;\">advanced image processing techniques.&nbsp;</span><span style=\"font-size: 0.875rem;\">Thus, for better photos quality, the&nbsp;</span><span style=\"font-size: 0.875rem;\">recommended system starts with the&nbsp;</span><span style=\"font-size: 0.875rem;\">preprocessing stages which include image&nbsp;</span><span style=\"font-size: 0.875rem;\">acquisition, noise reduction and image&nbsp;</span><span style=\"font-size: 0.875rem;\">enhancement. Then various approaches&nbsp;</span><span style=\"font-size: 0.875rem;\">such as texture analysis, contouring&nbsp;</span><span style=\"font-size: 0.875rem;\">function and intensity pixel histograms&nbsp;</span><span style=\"font-size: 0.875rem;\">are employed so as to separate particular&nbsp;</span><span style=\"font-size: 0.875rem;\">characteristics of handwritten patterns&nbsp;</span><span style=\"font-size: 0.875rem;\">from others.&nbsp;</span><span style=\"font-size: 0.875rem;\">Afterward, the features collected are&nbsp;</span><span style=\"font-size: 0.875rem;\">further classified into various types of&nbsp;</span><span style=\"font-size: 0.875rem;\">handwritings using classification methods&nbsp;</span><span style=\"font-size: 0.875rem;\">like support vector machines (SVM),&nbsp;</span><span style=\"font-size: 0.875rem;\">convolutional neural networks (CNN)&nbsp;</span><span style=\"font-size: 0.875rem;\">together with decision trees etc.&nbsp;</span><span style=\"font-size: 0.875rem;\">scalability issues among others followed&nbsp;</span><span style=\"font-size: 0.875rem;\">by possible remedies.&nbsp;</span></p>','no_image.jpg','HANDWRITING_DETECTION_SYSTEM_USING_IMAGE_PROCESSING(UGC)_1710826589.docx',NULL,NULL,NULL,1,2,1,6,'INDJCST',1,1,2,5,NULL,NULL,NULL,0,323,NULL,'2024-03-19 05:36:29','2024-03-20 19:48:59'),(311,11,325,NULL,'\"Revolutionizing Dental Care: A Comprehensive Exploration of AI, 3D Printing, and Teledentistry Integration in Contemporary Dentistry','<p>This delves into the transformative landscape of dental care through the integration of cutting-edge technologies—Artificial Intelligence (AI), 3D Printing, and Teledentistry. The study explores the applications, challenges, and global perspectives of these innovations, aiming to provide a holistic understanding of their impact on modern dentistry. The analysis encompasses customization \r\n</p><p>of dental solutions, remote patient monitoring, ethical considerations, and the global adoption of these technologies. As digital dentistry continues to evolve, this paper contributes valuable insights to the ongoing discourse, paving the way for enhanced patient care, streamlined practices, and a glimpse into the future of dental healthcare.\r\n</p><p><br></p>','no_image.jpg','Revolutionizing_Dental_Care_1710830406.docx',NULL,NULL,NULL,1,2,1,3,'IJRTMR',1,1,1,15,NULL,'<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJRTMR Journal Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://ijrtmr.com/archives?year=2024&amp;volume=4&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link:<a href=\"https://fdrpjournals.org/ijrtmr/archives?paperid=8065260379681409176\" target=\"_blank\"> </a><span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijrtmr/archives?paperid=8065260379681409176\" target=\"_blank\">Click Here</a></span><br></p>','paid-1',1,325,1,'2024-03-19 06:40:06','2024-03-20 15:53:09'),(312,1,313,NULL,'Deep Learning-Based Leaf Disease Detection in Crop Using Images for Agricultural Application','<p>The \"Leaf Disease Detection\" system addresses the critical challenge of plant diseases in agriculture through the implementation of an automated solution leveraging deep learning techniques. In this comprehensive endeavor, convolutional neural networks (CNNs), specifically DenseNet-121, ResNet-50, VGG-16, and Inception V4, are fine-tuned for efficient and accurate identification of plant diseases. The project utilizes the PlantVillage dataset, encompassing 54,305 images across 38 plant disease classes, to conduct a comparative analysis of model performance. DenseNet-121 emerged as the top-performing model, achieving an exceptional 99.81% classification accuracy, surpassing other state-of-the-art models. The system\'s methodology strategically employs transfer learning to overcome computational challenges associated with training deep CNN layers. This approach, coupled with the multi-class classification strategy, proves robust in handling diverse plant species and diseases within each class. The results highlight the superior efficiency of transfer learning in comparison to building models from scratch, showcasing the potential for real-world applications in agriculture. The system\'s success is attributed to the careful optimization of hyperparameters and the adoption of advanced deep learning techniques, offering a promising avenue for automated and accurate plant disease detection, with implications for improving agricultural practices, minimizing economic losses, and ensuring global food security.\r\n</p><p><br></p>','no_image.jpg','Leaf_Disease_Detection_(Research_paper)_1710847811.docx',NULL,NULL,NULL,1,2,1,1,'IJIRE',1,1,3,15,NULL,'<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJIRE Journal Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://theijire.com/archives?year=2024&amp;volume=5&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link:<a href=\"https://fdrpjournals.org/ijire/archives?year=2024&amp;volume=5&amp;issue=2\" target=\"_blank\"> </a><span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijire/archives?year=2024&amp;volume=5&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>Crossref Link(DOI): <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/?from_ui=&amp;q=10.59256%2Fijire.20240502018\" target=\"_blank\">Click Here</a></span> (Please check after 48 hrs.)<br></p>','paid-2',0,313,1,'2024-03-19 11:30:11','2024-04-08 03:53:14'),(313,1,311,NULL,'Design and implementation of Embedded Edge processing Water quality monitoring system based on IOT”','<p>\"Design and implementation of Embedded</p><p>Edge processing Water quality monitoring</p><p>system based on IOT”</p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Ms. Rani Anand Jibhekar&nbsp; &nbsp;&nbsp;</p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Prof. Rahul Dhuture (Asst. Professor)&nbsp; </p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Prof.&nbsp; Mayuri Harde (Asst. Professor)&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Department of Electronics &amp; Communication Engineering&nbsp;</p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Tulsiramji Gaikwad Patil College of Engineering &amp; Technology, Nagpur</p><p><br></p><p>Abstract</p><p>Water quality monitoring plays a significant part in the transition towards intelligent</p><p>and smart agriculture and provides an easy transition to automated monitoring of</p><p>crucial components of human daily needs as new technologies are continuously</p><p>developed and adopted in agricultural and human daily life (water). For the</p><p>monitoring and management of water quality, this effort, however, requires reliable</p><p>models with accurate and thorough datasets. Analyzing water quality monitoring</p><p>models by utilizing sensors that gather water properties during live experiments is</p><p>possible due to the necessity for precision in modeling.Internet of Things (IoT)-based</p><p>approach for real-time water quality monitoring using NodeMCU, a low-cost</p><p>open-source IoT platform. The proposed system employs various sensors to measure key water quality parameters.&nbsp;</p><br>','no_image.jpg','1710869571684_1710869556851_DOC_20240112_WA0014._1710869975.docx',NULL,NULL,NULL,1,2,1,1,'IJIRE',7,1,1,3,NULL,NULL,NULL,0,311,NULL,'2024-03-19 17:39:35','2024-03-20 19:50:59'),(314,1,328,NULL,'Student dropout Analysis','<p>School dropout is still a serious problem \r\n</p><p>with broad ramifications. This abstract \r\n</p><p>examines the many facets of student \r\n</p><p>dropout in education and provides a \r\n</p><p>thorough study of it. It examines a range of \r\n</p><p>issues, emphasizing their effects on \r\n</p><p>students, including social, academic, and \r\n</p><p>economical factors. It also addresses the \r\n</p><p>serious repercussions of dropping out, \r\n</p><p>highlighting the necessity of efficient \r\n</p><p>interventions. The importance of \r\n</p><p>technology, community involvement, and \r\n</p><p>proactive tactics in lowering dropout rates \r\n</p><p>is further emphasized in the abstract. This \r\n</p><p>analysis seeks to address these important \r\n</p><p>issues in order to offer insights and answers \r\n</p><p>that are essential for promoting a \r\n</p><p>welcoming and encouraging learning \r\n</p><p>environment.</p>','no_image.jpg','STUDENT_DROP_OUT_ANLYSIS_FOR_SCHOOL_EDUCATION[1]_1710908558.docx',NULL,NULL,NULL,1,2,1,1,'IJIRE',1,1,1,15,NULL,'<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJIRE Journal Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://theijire.com/archives?year=2024&amp;volume=5&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link:<span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"> <a href=\"https://fdrpjournals.org/ijire/archives?year=2024&amp;volume=5&amp;issue=2\" target=\"_blank\">Click Here</a></span><br></p>','paid-1',1,328,1,'2024-03-20 04:22:38','2024-03-27 05:40:15'),(315,1,329,NULL,'Tourist plan partner','<p>The Tourist Management System website project is a pioneering endeavor aimed at transforming the landscape of tourism management through a customized online platform catering to tourists, tour operators, and destination management organizations. As the tourism industry undergoes rapid digitalization and adapts to changing consumer behaviors, there arises a pressing need for innovative solutions to navigate these challenges effectively. This project endeavors to meet these demands by offering a holistic solution that facilitates streamlined planning, effortless booking, and precise management of tourist activities and services.</p>','no_image.jpg','journal_2_1710912411.docx',NULL,NULL,NULL,1,2,1,1,'IJIRE',1,1,1,5,NULL,NULL,NULL,0,329,NULL,'2024-03-20 05:26:51','2024-03-21 03:02:38'),(316,1,311,NULL,'Design and Implementation of an Embedded Edge Processing Water Quality Monitoring System based  on Internet Of Things','<p>Abstract – “The Framework Is Center On Plan For Particularly UNDERGROUND WATER” \r\n</p><p>Keywords( Catchphrases):&nbsp;<span style=\"font-size: 0.875rem;\">Arduino, IoT, Groundwater, TDS, Sensors</span></p><p>The specter of water contamination looms large over the realm of green globalization, casting a shadow of apprehension upon its aspirations for sustainability and environmental harmony. In arrange to guarantee the secure supply of the drinking water the quality should be screen in genuine time. In this paper we display a plan and advancement of a moo fetched framework for genuine time observing of the water quality in IOT(internet of things).The framework comprise of a few sensors is utilized to measuring physical and chemical parameters of the water. The major issue among the individuals is that they are missing within the awareness of the underground water utilization. Hence, they are within the handle of planning the “Application” which gives the information almost the underground water utilization of the buyers and screen the ground water utilization of the shoppers. Too, disturbing when the most extreme utilization of water or wastage of water.</p><p>\r\n</p><p>\r\n</p><p>\r\n</p>','no_image.jpg','CONFERECE_PAPER_3_RANI_JIBHEKAR_2024_1710920287.docx',NULL,NULL,NULL,1,2,1,1,'IJIRE',1,1,1,15,NULL,'<p><span style=\"color: rgb(0, 0, 255);\"><b>Published Article Details:</b></span><br><br>IJIRE Journal Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://theijire.com/archives?year=2024&amp;volume=5&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link:<a href=\"https://fdrpjournals.org/ijire/archives?year=2024&amp;volume=5&amp;issue=2\" target=\"_blank\"> </a><span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijire/archives?year=2024&amp;volume=5&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br><br></p>','paid-1',1,311,1,'2024-03-20 07:38:07','2024-04-08 09:11:03'),(317,2,330,NULL,'DESIGN AND IMPLEMENTATION OF RETINAL EYE DISEASE DETECTION BASED ON MACHINE LEARNING','<p>Abstract— Hemorrhages are one of the diabetic retinopathy diseases which affect the retinal part. It Occurs in the deeper layers of the retina and are often called ‘blot’ hemorrhages because of their round shape. Abnormal new blood vessels form at the back of the eye as a part of Proliferative Diabetic Retinopathy (PDR). Hence the new blood vessels are weak that causes blur vision.<br>A retinal hemorrhage may be caused cardiovascular disease, retinal vein occlusion (a blockage of a retinal vein), or diabetes mellitus (which causes small fragile in blood vessels which are easily damaged). The presence of hemorrhages in the retina is the main symptom of diabetic retinopathy. The number and shape of hemorrhages is used to identify the severity of the disease. The objectives of this study are to detect blood vessel, identify hemorrhages and classify different stages of diabetic retinopathy into traditional, moderate and non-proliferative diabetic retinopathy (NPDR).<br>Keywords—Hemorrhage, Diabetic retinopathy, image processing.<br><br></p>','no_image.jpg','meenakshi_ugc_care_1710935206.docx',NULL,NULL,NULL,1,2,2,1,'IJIRE',1,1,2,16,NULL,NULL,NULL,0,330,NULL,'2024-03-20 11:46:46','2024-03-27 09:39:16'),(318,1,332,NULL,'ONLINE AUCTION APP','<p>The online auction app described represents a sophisticated yet accessible platform, leveraging the robust capabilities of Firebase Realtime Database and Firebase Storage. Its user- centric design fosters seamless interaction, enabling effortless login and signup processes for users eager to explore a treasure trove of valuable and rare products. Through a meticulously organized interface, users can not only peruse listings but also contribute their own prized possessions to the auction ecosystem, creating a dynamic marketplace of coveted items. The product description pages offer comprehensive insights accompanied by vivid imagery, empowering users to make informed decisions with confidence. Real-time bidding capabilities ensure an exhilarating experience, with automatic increments through proxy bidding ensuring fairness and efficiency. Moreover, the incorporation of secure payment gateways instills trust and reliability, enhancing the overall transactional experience. With a commitment to user satisfaction evident in its ad-free and free-of-charge model, this app stands as a testament to the seamless convergence of cutting- edge technology and user-centric design principles in the realm of online auctions.</p>','no_image.jpg','ONLINE_AUCTION_APP1_1710942605.docx',NULL,NULL,NULL,2,2,1,6,'INDJCST',1,1,3,15,NULL,'<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>INDJCST Journal Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://indjcst.com/archives?year=2024&amp;volume=3&amp;issue=1\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/indjcst/archives?year=2024&amp;volume=3&amp;issue=1\" target=\"_blank\">Click Here</a></span><br><br>Crossref Link(DOI): <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/search/works?q=10.59256%2Findjcst.20240301003&amp;from_ui=yes\" target=\"_blank\">Click Here</a></span> (Please check after 48 hrs.)<br></p>','paid-2',1,332,1,'2024-03-20 13:50:05','2024-03-21 12:49:33'),(320,1,333,NULL,'Digital Transformation in Tailoring:Thread Express Application','<p>The Tailor Stitching Delivery Software innovates traditional tailor-client interactions with a digital platform, simplifying order processes. It guarantees a smooth experience by efficiently managing orders, facilitating seamless communication, and providing accurate delivery tracking for both tailors and clients. This software marks a significant shift in the conventional tailoring landscape, enhancing overall efficiency and user satisfaction. Both tailors and clients benefit from user-friendly interfaces designed for simplicity and ease of navigation, enhancing overall user experience. The inclusion of a streamlined process for accurate and convenient measurement collection, where clients can choose between providing old cloth for measurements or opting for a pickup service, further solidifies the commitment to a user-centric approach. Seamless integration with secure payment gateways facilitates hassle-free transactions, enabling clients to make payments within the application.</p>','no_image.jpg','Digital_Transformation_in_Tailoring_1710945418.docx',NULL,NULL,NULL,1,2,1,6,'INDJCST',2,1,3,15,NULL,'<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>INDJCST Journal Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://indjcst.com/archives?year=2024&amp;volume=3&amp;issue=1\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/indjcst/archives?paperid=5462564142679961798\" target=\"_blank\">Click Here</a></span><br><br>Crossref Link(DOI): <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/search/works?q=10.59256%2Findjcst.20240301004&amp;from_ui=yes\" target=\"_blank\">Click Here</a></span><a href=\"https://search.crossref.org/search/works?q=10.59256%2Findjcst.20240301004&amp;from_ui=yes\" target=\"_blank\"> </a>(Please check after 48 hrs.)<br></p>','paid-2',1,333,1,'2024-03-20 14:36:58','2024-03-21 12:54:42'),(321,2,334,NULL,'Development of Android-based Real-time Observing and Control system for Renewable Energy Sources','<p>Abstract— This project presents the development of Android-based online monitoring and control system tailored for Renewable Energy Sources, fondly known as RES. The system aims to enhance the effectiveness and operation of renewable energy installations by feeding real- time data monitoring and remote- control capabilities through a client friendly mobile software. The system, like, integrates various sensors deployed in renewable energy systems, such as solar panels and wind turbines, to collect essential data. This data is transmitted to a cloud-based platform for real-time processing and storage. The Android application serves as the user interface, offering comprehensive insights into energy production, consumption, and system status.</p><p><br></p>','no_image.jpg','Sami_doc_conf_ppr_1710947718.docx',NULL,NULL,NULL,1,2,1,1,'IJIRE',1,1,2,15,'2024-03-25','<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJIRE Journal Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://theijire.com/archives?year=2024&amp;volume=5&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijire/archives?year=2024&amp;volume=5&amp;issue=2\" target=\"_blank\">Click Here</a></span><br></p>','paid-1',1,334,1,'2024-03-20 15:15:18','2024-03-25 04:47:24'),(322,1,329,NULL,'Tourist plan partner','<p>The Tourist Management System website project is an innovative initiative aimed at revolutionizing tourism management through a customized online platform. This platform caters to tourists, tour operators, and destination management organizations, addressing the challenges posed by rapid digitalization and changing consumer behaviors in the tourism industry.\r\n</p><p>The project focuses on leveraging advanced technologies and incorporating user-centric design principles to provide a holistic solution. It facilitates streamlined planning, effortless booking, and precise management of tourist activities and services. The platform also offers intuitive interfaces, real-time updates, and personalized recommendations to enhance user experiences and optimize operational efficiency for all stakeholders involved.\r\n</p><p>By prioritizing innovation, adaptability, and user satisfaction, the Tourist Management System website project aims to set new standards in the tourism industry. It empowers travelers and service providers to thrive in an increasingly digital era, redefining how tourism services are accessed and managed.\r\n</p><p><br></p>','no_image.jpg','New_journal_1710956038.docx',NULL,NULL,NULL,1,2,1,1,'IJIRE',1,1,1,5,NULL,NULL,NULL,0,329,NULL,'2024-03-20 17:33:58','2024-03-22 12:28:50'),(323,1,321,NULL,'Performance analysis of routing protocol of an efficient data transmission in WSN communication','Performance analysis of routing protocol of an efficient data tramsmission inWSN communication','no_image.jpg','abstract_1710957436.docx',NULL,NULL,NULL,1,2,1,1,'IJIRE',1,1,1,3,NULL,NULL,NULL,0,321,NULL,'2024-03-20 17:57:16','2024-03-20 18:48:19'),(324,2,335,NULL,'Design and implementation of clusters of microcontroller for various sensors data on real time using embedded system','<p><span style=\"font-size: 0.875rem;\">&nbsp;Abstract:</span></p><p><span style=\"font-size: 0.875rem;\">This project addresses the need for an efficient and scalable system for real-time collection, processing, and management of data from various sensors using embedded systems. The proposed solution involves the design and implementation of clusters of microcontrollers, providing a distributed architecture capable of handling diverse sensor types in a seamless and energy-efficient manner. The Key parameters for development of embedded systems optimized for low power consumption, the establishment of real-time communication protocols for data exchange within clusters, and the integration of fault-tolerant mechanisms to ensure the robustness of the system. Clusters are dynamically formed, allowing for the addition of new sensors and microcontrollers to accommodate evolving requirements.</span></p><p><span style=\"font-size: 0.875rem;\">The microcontrollers within the clusters are tasked with real-time processing of sensor data, including computations, filtering, and aggregation. Customizable sensor data fusion algorithms are implemented to enhance the accuracy and reliability of the collected data. Energy efficiency is a focal point, ensuring that the system is well-suited for deployment in resource-constrained environments, such as remote or inaccessible locations.</span></p><p><span style=\"font-size: 0.875rem;\"><br></span></p><p><span style=\"font-size: 0.875rem;\"><br></span></p><p><span style=\"font-size: 0.875rem;\"><br></span></p><p><br></p>','no_image.jpg','international_conference_paper_priyanka_1710959310.docx',NULL,NULL,NULL,1,2,1,1,'IJIRE',1,1,2,15,'2024-03-25','<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJIRE Journal Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://theijire.com/archives?year=2024&amp;volume=5&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijire/archives?year=2024&amp;volume=5&amp;issue=2\" target=\"_blank\">Click Here</a></span><br></p>','paid-1',1,335,1,'2024-03-20 18:28:30','2024-03-25 04:50:19'),(325,1,337,NULL,'Pawsome Connection: Pet Adoption and Donation','<p>\"Pawsome Connection\" is a\r\n</p><p>comprehensive project aimed at promoting pet\r\n</p><p>adoption and facilitating donations for animal welfare\r\n</p><p>organizations. The initiative seeks to address the\r\n</p><p>growing issue of abandoned and stray animals by\r\n</p><p>creating a user-friendly platform that connects\r\n</p><p>potential pet parents with rescue animals in need of\r\n</p><p>loving homes. This project integrates an intuitive\r\n</p><p>adoption portal, where users can browse profiles of\r\n</p><p>pets available for adoption, learn about their stories,\r\n</p><p>and connect with shelters or foster families.\r\n</p><p>Additionally, a streamlined donation system is\r\n</p><p>incorporated to support the financial needs of these\r\n</p><p>organizations, ensuring proper care, medical attention,\r\n</p><p>and rehabilitation for rescued animals. The platform\r\n</p><p>leverages modern technology and social media\r\n</p><p>integration to amplify its reach, encouraging a wider\r\n</p><p>audience to engage in the noble cause of providing safe\r\n</p><p>and caring environments for animals. By fostering a\r\n</p><p>sense of community and compassion, \"Pawsome\r\n</p><p>Connection\" aims to make a positive impact on the\r\n</p><p>lives of both pets and humans, creating lasting\r\n</p><p>connections that benefit all involved parties.</p>','no_image.jpg','IEEE_paper_for_Pawsome_connection_1710995108.pdf',NULL,NULL,NULL,1,2,1,6,'INDJCST',1,1,3,15,NULL,'<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>INDJCST Journal Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://indjcst.com/archives?year=2024&amp;volume=3&amp;issue=1\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/indjcst/archives?year=2024&amp;volume=3&amp;issue=1\" target=\"_blank\">Click Here</a></span><br><br>Crossref Link(DOI): <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/?from_ui=&amp;q=10.59256%2Findjcst.20240301005\" target=\"_blank\">Click Here</a></span> (Please check after 48 hrs.)<br></p>','paid-2',1,337,1,'2024-03-21 04:25:08','2024-03-21 17:24:04'),(327,1,337,NULL,'Enviro Edible: Satisfying Hunger, Minimizing Waste','<p>\"Enviro Edible\" is an innovative food\r\n</p><p>waste management system designed to address the\r\n</p><p>escalating global challenge of food waste. This\r\n</p><p>comprehensive solution integrates technology,\r\n</p><p>community engagement, and sustainable practices to\r\n</p><p>minimize food wastage at various stages of the supply\r\n</p><p>chain. The system employs a multi-faceted approach,\r\n</p><p>encompassing smart inventory management, consumer\r\n</p><p>awareness campaigns, and collaborative efforts with\r\n</p><p>local businesses and charities. Key components include\r\n</p><p>a user-friendly website that empowers consumers to\r\n</p><p>make informed purchasing decisions, reducing the\r\n</p><p>likelihood of excess food in households. Additionally, the\r\n</p><p>system incorporates data analytics for businesses to\r\n</p><p>preventing overstocking and expirations. Real-time\r\n</p><p>analytics enable businesses to identify potential issues\r\n</p><p>and make informed decisions to prevent food spoilage,\r\n</p><p>reduce waste, and improve overall supply chain\r\n</p><p>efficiency. \"Enviro Edible\" fosters partnerships with\r\n</p><p>local charities and food banks, enabling seamless\r\n</p><p>redirection of surplus food from businesses to those in\r\n</p><p>need. Through real-time tracking and analytics, the\r\n</p><p>system not only minimizes food waste but also creates a\r\n</p><p>positive impact on communities by addressing hunger\r\n</p><p>and promoting sustainable consumption. This food\r\n</p><p>waste management system envisions a future where\r\n</p><p>technology and collective efforts converge to create a\r\n</p><p>more sustainable and responsible approach to food\r\n</p><p>consumption, reducing environmental impact and\r\n</p><p>enhancing social welfare.\r\n</p>','no_image.jpg','IEEE_paper_for_Enviro_Edible_(1)_1710995748.pdf',NULL,NULL,NULL,1,2,1,2,'IJSREAT',1,1,3,15,NULL,'<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span><br><br></b>IJSREAT Journal Link:<a href=\"https://ijsreat.com/archives?year=2024&amp;volume=4&amp;issue=2\" target=\"_blank\"> </a><span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://ijsreat.com/archives?year=2024&amp;volume=4&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijsreat/archives?year=2024&amp;volume=4&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>Crossref Link(DOI): <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/search/works?q=10.59256%2Fijsreat.20240402006&amp;from_ui=yes\" target=\"_blank\">Click Here </a></span>(Please check after 48 hrs.)<br></p>','paid-2',1,337,1,'2024-03-21 04:35:48','2024-03-21 17:26:05'),(328,1,339,NULL,'AUTOMATIC COUNTING MACHINE WITH IR-SENSOR BASED COUNTING MACHINE IN SORTING AREAS USING CONVEYOR BELT','<p>Absolutely, the transition from manual counting to automated counting with the help of technology has been a significant advancement across various industries. This shift has brought about increased accuracy, efficiency, and convenience in monitoring and managing processes. The use of sensors, cameras, and other smart technologies has revolutionized how businesses handle tasks that require counting or tracking. In the context of factories and stores, automated counting systems offer several advantages. They eliminate the errors associated with manual counting, reduce labor costs, and provide real-time data that can be crucial for decision-making. These systems are not only faster but also more reliable, allowing businesses to streamline their operations and improve overall productivity. Moreover, the integration of these automated counting systems with digital displays or screens makes the information easily accessible to relevant personnel. This real-time visibility enhances monitoring and control, enabling quick responses to changes or issues in the production or sales processes. The use of such technology reflects the ongoing trend of leveraging automation to enhance various aspects of work, making processes more efficient and accurate. It\'s indeed a testament to how innovation has transformed everyday tasks and workflows, bringing about positive changes in different industries.</p>','no_image.jpg','IR_Sensor_Paper_1710995751.doc',NULL,NULL,NULL,1,2,1,1,'IJIRE',2,1,1,15,NULL,'<p><span style=\"color: rgb(0, 0, 255);\"><b>Published Article Details:</b></span><br><br>IJIRE Journal Link:<a href=\"https://theijire.com/archives?year=2024&amp;volume=5&amp;issue=2\" target=\"_blank\"> </a><span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://theijire.com/archives?year=2024&amp;volume=5&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijire/archives?year=2024&amp;volume=5&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>Crossref Link(DOI): <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/?from_ui=&amp;q=10.59256%2Fijire.20240502014\" target=\"_blank\">Click Here</a></span> (Please check after 48 hrs.)<br></p>','paid-2',1,339,1,'2024-03-21 04:35:51','2024-03-28 14:35:16'),(329,1,341,NULL,'AquaCareIoT: Intelligent Plant Watering System','<p>AquaCareIoT: Intelligent Plant Watering System represents a groundbreaking solution aimed at revolutionizing traditional plant care practices through the integration of IoT technology. In response to the inefficiencies and limitations associated with conventional watering methods, this system seeks to provide a comprehensive and intelligent approach to plant hydration. The core focus is on optimizing water usage, ensuring consistent and tailored care for diverse plant species, and enabling remote monitoring and control. By harnessing the power of IoT sensors and automation, the system aims to deliver precise and timely watering, preventing both overwatering and underwatering scenarios.</p>','no_image.jpg','Smart_Water_Plant_1710996410.docx',NULL,NULL,NULL,1,2,1,6,'INDJCST',1,1,2,5,NULL,NULL,NULL,0,341,NULL,'2024-03-21 04:46:50','2024-03-22 03:21:30'),(330,1,337,NULL,'GIFT LOOP','<p>“Gift loop\" is an innovative unwanted stuffs management system designed to address the escalating global challenge of wasting good stuffs. This comprehensive solution integrates technology, community engagement, and sustainable practices to minimize goods wastage at various stages of the supply chain. Key components include a user-friendly mobile application that empowers buyers to make informed purchasing decisions, reducing the likelihood of excess things in households. This fosters partnerships with local charities enabling seamless redirection of surplus goods from businesses to those in need. Through real-time tracking and analytics, the system not only minimizes goods wastage but also creates a positive impact on communities by addressing poverty and promoting sustainable consumption.By decluttering our living spaces and donating items we no longer need, we not only create physical space but also foster a sense of purpose and community engagement. Through the act of donation, individuals contribute to the well-being of others, providing essential resources to those in need and supporting various charitable organizations.This abstract delves into the ripple effects of donating, examining how it fosters connections within communities and promotes a culture of giving. It highlights the significance of small individual actions in collectively addressing social and environmental challenges.</p>','no_image.jpg','giftloop[1]_1710997643.docx',NULL,NULL,NULL,1,2,1,1,'IJIRE',1,1,3,15,NULL,'<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJIRE Journal Link:<span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"> <a href=\"https://theijire.com/archives?year=2024&amp;volume=5&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link:<a href=\"https://fdrpjournals.org/ijire/archives?year=2024&amp;volume=5&amp;issue=2\" target=\"_blank\"> </a><span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijire/archives?year=2024&amp;volume=5&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>Crossref Link(DOI): <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/search/works?q=10.59256%2Fijire.20240502010&amp;from_ui=yes\" target=\"_blank\">Click Here</a></span> (Please check after 48 hrs.)<br></p>','paid-2',1,337,1,'2024-03-21 05:07:23','2024-03-21 17:27:37'),(331,1,337,NULL,'Apple Leaf Disease Prediction Using Deep Learning Models','<p>In India, nearly two lakh people rely on apple production for a living, with apples accounting for approximately 16% of GDP in their respective states. Although apple production is second only to that of other fruits in terms of volume, it generates more revenue. In addition, India ranks fifth in total apple production worldwide. As a result, the apple is a fruit that has a significant impact on our economic situation. Apple productivity is primarily influenced by leaf diseases such as scab, cedar rust, black rot, and others. To prevent apple leaf diseases from spreading throughout the tree, it is critical to detect them in their early stages of infection. We proposed a convolutional neural network methodology to accurately and efficiently detect these leaf diseases.\r\n</p><p>The image pre-processing and augmentation methods help us distinguish the region of interest from the background. We then trained and validated our dataset of apple leaf images by applying deep learning algorithms. The DenseNet algorithm, which has a 98.42% accuracy rate, is used to label the leaf diseases in our model.\r\n</p><p><br></p>','no_image.jpg','Apple_Leaf_Disease_Prediction_Using_Deep_Learning_Models_final_1710997777.docx',NULL,NULL,NULL,1,2,1,2,'IJSREAT',1,1,3,15,NULL,'<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJSREAT Journal Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\">Click Here</span><br><br>FDRP Website Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\">Click Here</span><br><br>Crossref Link(DOI): <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\">Click Here </span>(Please check after 48 hrs.)<br></p>','paid-2',1,337,1,'2024-03-21 05:09:37','2024-03-21 17:30:03'),(332,15,343,NULL,'GREEN BONDS: A PATHWAY TO SUSTAINABLE INVESTMENT AND ENVIRONMENTAL RESILIENCE','<p>Green bonds (or climate bonds) are one of the most used sustainable investment instruments, and under the Paris Climate Agreement of 2015, the climate bond market is expected to thrive soon. Green bonds are gaining increasing popularity among environmentally responsible investors, as well as investors who “simply” attempt to benefit from portfolio diversification, including green issuances, that are close to other fixed bonds. This paper aims to take advantage of previous literature contributions on the green bond market to indicate the way forward for future research. Herein, through a systematic literature review on the green bond market, our goal is to provide investors, main markets actors, and policymakers with some helpful insight on the role of environmental investments in reshaping the financial markets and fostering the sustainability of the economy</p>','no_image.jpg','PCL_TEAM_8_Complete_1711001554.docx',NULL,NULL,NULL,1,2,1,3,'IJRTMR',1,1,2,15,NULL,'<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJRTMR Journal Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://ijrtmr.com/archives?paperid=8748966951945783066\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link:<span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"> <a href=\"https://fdrpjournals.org/ijrtmr/archives?year=2024&amp;volume=4&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>Crossref Link(DOI): <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/?from_ui=&amp;q=10.59256%2Fijrtmr.20240402004\" target=\"_blank\">Click Here</a></span> (Please check after 48 hrs.)<br></p>','paid-2',1,343,1,'2024-03-21 06:12:34','2024-03-25 11:45:31'),(333,1,308,NULL,'Analyzing Crime Hotspot Prediction with Machine Learning Techniques','<p>This study explores the use of machine learning algorithms for crime prediction using historical data of public property crime in a large coastal city in southeast China. The comparative analysis focuses on the predictive power of several machine learning models. The findings indicate that the LSTM model outperformed other methods such as KNN, random forest, support vector machine, naive Bayes, and convolutional neural networks when solely using historical crime data. Furthermore, incorporating built environment data such as points of interest (POIs) and urban road network density into the LSTM model as covariates improved the prediction effect. These results have implications for the formulation of policing strategies and the implementation of crime prevention and control.</p>','no_image.jpg','crime_analysis_1711024766.docx',NULL,NULL,NULL,1,2,1,1,'IJIRE',4,1,2,5,NULL,NULL,NULL,0,308,NULL,'2024-03-21 12:39:26','2024-03-23 02:45:45'),(335,1,342,NULL,'Design and Implementation of Fire Security Alarm With Voice Interaction Using IOT','<p>The project “Design and Implementation of Fire Alarm with Voice Interaction using IOT” aims Industrial environments present unique fire safety challenges due to the presence of flammable materials, complex layouts, and high noise levels. Existing fire alarms often struggle to effectively alert personnel in such settings, potentially leading to delayed evacuations and catastrophic consequences. This paper proposes an innovative IoT-based fire security alarm system with voice interaction specifically designed for industrial applications. The system leverages a network of interconnected sensors, a central processing unit, and voice-enabled communication to provide precise fire detection, clear evacuation guidance, and enhanced situational awareness for occupants.\r\n</p><p><br></p><p>\r\n</p>','no_image.jpg','UGC_CARE_PAPER_VARSHA_CHAUDHARI_07.03.2024_1711026108.docx',NULL,NULL,NULL,1,2,1,1,'IJIRE',1,1,1,15,NULL,'<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJIRE Journal Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://theijire.com/archives?year=2024&amp;volume=5&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijire/archives?year=2024&amp;volume=5&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>Crossref Link(DOI): <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/?from_ui=&amp;q=10.59256%2Fijire.20240502012\" target=\"_blank\">Click Here</a></span> (Please check after 48 hrs.)<br></p>','paid-2',1,342,1,'2024-03-21 13:01:48','2024-03-23 15:25:31'),(336,2,345,NULL,'Sentiment Analysis on movie reviews using BERT algorithm','<p>ABSTRACT\r\n</p><p>Sentiment analysis is essential for comprehending public opinion on a wide range of subjects, including films. This study examines how well the Bidirectional Encoder Representations from Transformers (BERT) algorithm performs sentiment analysis on reviews of motion pictures. We examine BERT\'s advantages in gathering contextual data and its applicability to this purpose. The process, including data preparation, model optimization, and assessment measures, is described in depth in the paper. We showcase the outcomes and juxtapose them with alternative sentiment analysis methodologies. In conclusion, we address the constraints of our research and provide possible avenues for further development.\r\n</p><p>KEYWORDS: Sentiment analysis, Opinion mining, NLP, BERT algorithm and Deep learning.\r\n</p><p><br></p>','no_image.jpg','MOVIE_REVIEW_USING_BERT_ALGORITHM_1711028660.docx',NULL,NULL,NULL,1,2,1,1,'IJIRE',1,1,2,15,NULL,'<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJIRE Journal Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://theijire.com/archives?year=2024&amp;volume=5&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijire/archives?year=2024&amp;volume=5&amp;issue=2\" target=\"_blank\">Click Here</a></span><br></p>','paid-1',1,345,1,'2024-03-21 13:44:20','2024-03-23 04:29:46'),(337,1,337,NULL,'Smart Ride Connect (Revolutionizing Bus Pass Management through Innovative Transportation Solutions)','Smart Ride Connect introduces a paradigm shift in bus pass management by harnessing the power of Qr Code technology. The system aims to streamline the cumbersome process of issuing, validating, and managing bus passes, thereby enhancing the overall efficiency and user experience of public transportation systems. By providing personalized Qr Code-enabled passes with essential user information and validity details encoded within, Smart Ride Connect ensures seamless access to transportation services while empowering administrators with real-time insights and control over the system<p></p>','no_image.jpg','Smart_Ride_Connect_paper_1711029930.docx',NULL,NULL,NULL,1,2,1,2,'IJSREAT',1,1,3,15,'2024-03-28','<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJSREAT Journal Link:<span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"> <a href=\"https://ijsreat.com/archives?year=2024&amp;volume=4&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijsreat/archives?year=2024&amp;volume=4&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>Crossref Link(DOI): <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/search/works?q=10.59256%2Fijsreat.20240402008&amp;from_ui=yes\" target=\"_blank\">Click Here</a></span> (Please check after 48 hrs.)<br></p>','paid-2',0,337,1,'2024-03-21 14:05:30','2024-03-24 04:54:57'),(338,15,346,NULL,'Innovative Green Social Work Practices for Environmental Protection and Sustainable Development','<p>This study explores innovative practices in social work methodologies aimed at environmental protection and promoting sustainable development. In the face of an escalating environmental crisis, this approach integrates the principles of ecological preservation and social equity to address complex global challenges. This paper also underscores the role of green social work in promoting environmental preservation, fostering sustainable progress, and enhancing community welfare. It examines a range of creative initiatives, including grassroots efforts, policy reform advocacy, educational outreach, and the establishment of collaborative partnerships, illustrating the significant contribution of social work to ecological sustainability. Furthermore, it addresses the challenges faced in implementing these initiatives and the importance of active community participation. In conclusion, it calls for a collective effort from social workers, policymakers, environmental advocates, and the broader community to tap into the transformative potential of green social work, guiding us towards a more sustainable and equitable future.</p><p><br></p>','no_image.jpg','Innovative_Green_Social_Work_Practices_for_Environmental_Protection_and_Sustainable_Development_1711069573.docx',NULL,NULL,NULL,1,2,1,3,'IJRTMR',2,1,2,15,NULL,'<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJRTMR Journal Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://ijrtmr.com/archives?year=2024&amp;volume=4&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijrtmr/archives?paperid=1556536065706509915\" target=\"_blank\">Click Here</a></span><br><br>Crossref Link(DOI): <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\">Click Here</span> (Please check after 48 hrs.)<br></p>','paid-2',1,346,1,'2024-03-22 01:06:13','2024-03-24 17:00:51'),(339,1,347,NULL,'Four Axis Solar Tracking System using ESP32','<p>This Project aimed to create a practical model of a solar tracking system for commercial, with the purpose of optimizing the performance of photovoltaic modules in solar energy setups. The main idea behind the device is to consistently align the photovoltaic modules with sunlight, maximizing the exposure to the Sun’s radiation and consequently increasing the output power of the solar panel. The project encompassed the design and implementation of hardware, along with programming the microcontroller unit responsible for the solar tracker. For motion control, an ESP32 microcontroller was employed to manage two servo motors, facilitating the rotation of the solar panel along two axes. The microcontroller determined the degree of rotation based on inputs received from four photo sensors positioned next to the solar panel. The outcome of the project was a fully operational solar tracking system that effectively kept the solar panel aligned with the sun or any light source, showcasing the efficiency of the hybrid control system. The solar tracker designed in this project serves as a valuable reference and starting point for the development of more advanced systems in the future.</p>','WhatsApp Image 2024-03-22 at 09.42.38_c83aaa02_1711080792.jpg','IJIRE_paper_1711079618.docx',NULL,NULL,NULL,2,2,1,3,'IJRTMR',2,1,1,5,NULL,NULL,NULL,0,347,347,'2024-03-22 03:53:38','2024-03-23 02:42:41'),(340,1,348,NULL,'Smart Glass Cleaning Robot','<p>The Glass Cleaning Robot for High-Rise Buildings represents a pioneering venture into the domain of vertical maintenance, seeking to revolutionize the traditional methods of high-rise window cleaning. As urban landscapes evolve with towering structures and expansive glass facades, the challenges associated with the upkeep of these architectural marvels demand innovative solutions. Our project addresses this demand through the development of an autonomous robot designed specifically for the cost-effective and efficient cleaning of glass surfaces in high-rise buildings. The key objectives encompass enhancing safety by minimizing human exposure to potential hazards associated with high-altitude window cleaning. In conclusion, our project stands at the intersection of safety, efficiency, and technological innovation, aiming to redefine standards in high-rise building maintenance.</p>','no_image.jpg','SGCR_journel_paper_1712846034.docx',NULL,NULL,NULL,2,2,1,3,'IJRTMR',2,1,1,5,NULL,NULL,NULL,0,348,348,'2024-03-22 04:17:13','2024-04-11 14:33:54'),(345,1,337,NULL,'A Comprehensive Women\'s safety Platform Offering Secure Login,  Emergency Panic, News Alerts, Route Navigation with Police Station Proximity, Incident Reporting','<p>A significant challenge confronting by society is women\'s safety. The frequency of crimes targeting women, including sexual assaults, domestic abuse, and dawn teasing, is rising daily due to different social or ethnic reasons. Using a smartphone to seek assistance in matters of security can be one of the simplest options  such as across the globe method of handheld  data transmission and the global positioning system (GPS) .It was determined that in order to properly solve the issue, technologies emphasising automatic set-up warning production in addition less individual input additionally higher accuracy must be developed, despite delivering noteworthy research in the underlying subject .It makes advantage of the GPS tracking technology to give registered contacts an easy and quick way to find out if the individual has encountered troubles and to get in touch with them. It also has safety features like Disaster hotlines which could possibly contacted straight through phone to emergency services in accordance with the circumstances encountered with women in order to protect them, a live location of the victim that can assist by a law enforcement provides contextual and identifying information, and an alarm for notify individuals of all kinds misbehaviour.&nbsp;</p>','no_image.jpg','final_project__paper_1_1711124018.docx',NULL,NULL,NULL,1,2,1,1,'IJIRE',1,1,3,15,'2024-03-29','<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJIRE Journal Link<span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\">:<a href=\"https://theijire.com/archives?year=2024&amp;volume=5&amp;issue=2\" target=\"_blank\"> Click Here</a></span><br><br>FDRP Website Link:<a href=\"https://fdrpjournals.org/ijire/archives?year=2024&amp;volume=5&amp;issue=2\" target=\"_blank\"> </a><span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijire/archives?year=2024&amp;volume=5&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>Crossref Link(DOI): <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/?from_ui=&amp;q=10.59256%2Fijire.20240502011\" target=\"_blank\">Click Here</a></span><a href=\"https://search.crossref.org/?from_ui=&amp;q=10.59256%2Fijire.20240502011\" target=\"_blank\"> </a>(Please check after 48 hrs.)<br></p>','paid-2',0,337,1,'2024-03-22 16:13:38','2024-03-24 05:04:41'),(346,1,351,NULL,'Smart Vehicle Diagnostics1- Integrating OBD-II and Cloud Technology for Enhanced Health Monitoring','<p>This documentation offers concise and practical guidance on a project aimed at elevating vehicle safety through the integration of real-time Engine Control Unit (ECU) data and cloud technology. Focused on monitoring critical vehicle metrics, analyzing them in the cloud, and employing advanced algorithms to forecast maintenance needs, the project proactively alerts vehicle owners or fleet managers, thereby averting breakdowns, minimizing downtime, and optimizing maintenance schedules. Encompassing aspects such as data collection, cloud-based analysis, security protocols, and user-friendly interfaces, the documentation caters to both technical and non-technical audiences. By enhancing vehicle safety and empowering users to oversee their maintenance needs, this initiative ensures smoother and more dependable journeys.&nbsp;</p><p><br></p>','no_image.jpg','srisaran_journal_paper_3_1711162998.docx',NULL,NULL,NULL,1,2,1,5,'INDJECE',1,1,3,5,NULL,NULL,NULL,0,351,NULL,'2024-03-23 03:03:18','2024-03-26 04:24:08'),(348,15,352,NULL,'What factors influence the income of people with Cerebral Palsy in India and the Tax Rate``','<p>&nbsp;This paper will be studying factors influencing the income of people with Cerebral Palsy (CP) in India and impact on income tax.  Economics and social opportunities may be limited for people with CP due to following factors such as age gender type of cp, type of education social status of family wealth.   Researcher thinks that current income tax reducing income of people with CP and calls for reforms in the income tax in the postmodern period. In other words, Source of income for people with CP may be limited and higher income tax rate is causing   many problems therefore reforms are needed in current income tax system. For example, a content writer with strong CP, day trader at MNC earns 1 million in a year and current rate is 30% which is 300000. With such rate he has no money to take his sweet heart for a trip in U.S. One guy with mild cp has a degree from IIM who earns 470000 in a year and current rate is 15% which is 51200.  With such rate he has no money to buy a small house for his family former has 1.5 cr in land and house but latter has 1.2 cr in bank. I hope government sees the problem and it is in front of you. Make no mistakes about it. In mathematics term Income will be a dependent variable, rest will be independent variables and tax rate will be a controlled however in this proposal researcher will be using case studies of people with CP to make case for reforms in tax rate in the postmodern area.  Postmodernism, in Western philosophy, a late 20th-century movement characterized by broad skepticism, subjectivism, or relativism; a general suspicion of reason; and an acute sensitivity to the role of ideology in asserting and maintaining political and economic power. Researcher will be using postmodern as and philosophy of science backgrounds of the study to deconstruct class, type of education and type of cp and everything is relative and to explain problem. In social science, expiation of problem is more important unlike in pure science method and result of problem is more important. Researcher is using very strong words to make the case. In social sciences many problems cannot be solved by Nature of science. In   pure science everything can be controlled. In former everything cannot be controlled by researcher.one can read philosophy of science to find difference between former and latter. So, researcher in social science can be provided space to explain problem. However, there is not really any scientific paradigm to solve this problem. In the structure of scientific revolution by Thomas Kuhn, the problem is largely at pre-science. In other words, there is no paradigm to solve this problem, so headless people are doing heartless things. Researcher and others can develop paradigm for university education. \r\n</p><p>Ke</p>','no_image.jpg','Chetan_Manuscript_Forma_1711166584.docx',NULL,NULL,NULL,1,2,2,3,'IJRTMR',4,1,3,16,NULL,NULL,NULL,0,352,NULL,'2024-03-23 04:03:04','2024-03-27 09:37:32'),(352,15,352,NULL,'factors influencing the marital status of People with CP in the Indian context in the postmodern era','<p>\r\n</p><br>This paper will examine factors influencing the marital status of People with CP in the Indian context in the postmodern era.   Dating and marrying are the outcome of economic freedom.     the researcher thinks that dating and marrying opportunities may be limited due to the mobility of people and the degree of CP. After 2000 people with CP started to acquire economic freedom by meanings of jobs or family wealth. The next step for Pepple with CP is marriage. In western being single is the preferred choice because of social factors but in the East being single is a bad idea... The paper will be studying factors that influence marital statuses such as SSE, degree of CP, type of education, type of job, virgin Mary, and special achievement...  \r\nExperience of childhood plays playing imperative role in shaping views on marital status. An active investor is from a rich family. The mother of an active investor hired 4 to 9 female babysitters to take care of him. The mother of an active investor had two children and a husband to take care of so her hands were full.  A guy with an IIM degree is from the middle class so he had no babysitter. The active investor had a big sister and she is a second mother to him.  And A guy with an IIM degree had no sisters. Active investors had a group of girls and with them, he played hide and seek games so active investors have a good understanding of women during their adulthood and he can pick up women for dates at the speed of light. Women can understand the speech of people with CP better so guys with CP have more female friends.     A guy With an IIM degree had no such luck. During childhood father of an active investor gave him a “hot drink “when he had a cold but one of his babysitters told him that drinking a hot drink was bad. Active investors stopped it. parents of active investors took him to hotels on M.G. Road and a few times he saw his father arguing at the high court. The active investor has a tailor on M.G. to make jean pants for him because he cannot use buttons.  Active. the investor had three teachers he liked. Two of the teachers have educational degrees from Stanford University. One of the young teachers of active investors had a crush on him and she was feeding him rice because he could not feed rice himself so during adulthood many of his sweethearts were feeding him.  During BCA that teacher wrote his exam as a scribe.   A guy with an IIM degree went to a normal school where he was bullied like hell and he thinks that going to a special school is a bad idea because he is coming from the middle class. See the difference between middle and high class. One got bullied but the other got love. Active investor had a home tuition teacher during high school and she changed the game for him. No PhD guide in multiverse can do that job. Even God likes rich kids because even God needs loans.  The researcher will be using postmodern and philosophy of science backgrounds of the study to deconstruct class, type of education and  type of cp virgin marry, special achievement   and everything is relative and to explain the problem.’ Postmodernism, in Western philosophy, is a late 20th-century movement characterized by broad skepticism, subjectivism, or relativism; a general suspicion of reason; and an acute sensitivity to the role of ideology in asserting and maintaining political and economic power. The researcher will be using case studies to explain the problem and to develop  7 hypotheses including four brand new and these can be tested for future research. In mathematics term marital status will be a dependent variable, rest will be an independent variable and Special achievements in high school, virgin marry, and birth order will be controlled variables.\r\n<br>\r\n','no_image.jpg','paper_4_1711167782.docx',NULL,NULL,NULL,1,2,2,3,'IJRTMR',1,1,3,16,NULL,NULL,NULL,0,352,NULL,'2024-03-23 04:23:02','2024-03-27 09:37:22'),(354,1,253,NULL,'Overview on 3D Printing Technology: Empowering Industries: The Transformative Potential of 3D Printing Technology','<p>Digital fabrication, also known as 3D printing or additive manufacturing, enables the creation of physical objects from a digital model by adding materials layer by layer. This technology has rapidly emerged as a versatile tool with widespread adoption across various industries such as agriculture, healthcare, automotive, locomotive, and aviation. It facilitates mass customization and the production of open-source designs. This paper provides an overview of different 3D printing technologies, their applications, and the materials utilized in the manufacturing sector.</p><p><br></p>','no_image.jpg','DOC_20240323_WA0002_1711169517.',NULL,NULL,NULL,1,2,1,4,'INDJEEE',1,1,3,17,NULL,NULL,NULL,0,253,NULL,'2024-03-23 04:51:57','2024-03-28 04:09:21'),(364,14,352,NULL,'What factors influence income of people with Cerebral Palsy in India, special achievement and birth order will be moderated variable and tax rate will be controlled variable','<p>\r\n</p><br>This paper  will be studying factors influencing the income of people with Cerebral Palsy (CP) in India and impact on income tax.  Economics and social opportunities may be limited for people with CP due to following factors such as age gender type of cp, type of education social status of family wealth.   Researcher thinks that current income tax reducing income of people with CP and calls for reforms in the income tax in the postmodern period. In other words, Source of income for people with CP may be limited and higher income tax rate is causing   many problems therefore reforms are needed in current income tax system. For example, a content writer with strong CP, day trader at MNC earns 1 million in a year and current rate is 30% which is 300000. With such rate he has no money to take his sweet heart for a trip in U.S. One guy with mild cp has a degree from IIM who earns 470000 in a year and current rate is 15% which is 51200.  With such rate he has no money to buy a small house for his family former has 1.5 cr in land and house but latter has 1.2 cr in bank. I hope government sees the problem and it is in front of you. Make no mistakes about it. In mathematics term Income will be a dependent variable, rest will be independent variables and tax rate will be a controlled and special achievement and birth order will be moderated variable  however in this paper l researcher will be using case studies of people with CP to make case for reforms in tax rate in the postmodern area.  Postmodernism, in Western philosophy, a late 20th-century movement characterized by broad skepticism, subjectivism, or relativism; a general suspicion of reason; and an acute sensitivity to the role of ideology in asserting and maintaining political and economic power. Researcher will be using postmodern as and philosophy of science backgrounds of the study to deconstruct class, type of education and type of cp and everything is relative and to explain problem. In social science, expiation of problem is more important unlike in pure science method and result of problem is more important. Researcher is using very strong words to make the case. In social sciences many problems cannot be solved by Nature of science. In   pure science everything can be controlled. In former everything cannot be controlled by researcher.one can read philosophy of science to find difference between former and latter. So, researcher in social science can be provided space to explain problem. However, there is not really any scientific paradigm to solve this problem. In the structure of scientific revolution by Thomas Kuhn, the problem is largely at pre-science. In other words, there is no paradigm to solve this problem, so headless people are doing heartless things. Researcher and others can develop paradigm for university education. \r\nKeywords: Finance, Stock Market, Cerebral Palsy, Social Science. \r\n<br>\r\n','no_image.jpg','chetan_3_1711170404.docx',NULL,NULL,NULL,1,2,2,3,'IJRTMR',4,1,3,16,NULL,NULL,NULL,0,352,NULL,'2024-03-23 05:06:44','2024-03-27 09:37:46'),(365,15,352,NULL,'What is the Right Post-Secondary Course for People with Special Needs','In India, there is a large number of students with disabilities is entering universities because better academic preparation, improved transition planning and scholarship programs. On one hand, a large number of students with disabilities is enrolling into science and applied science courses at postsecondary level due to monetary awards and job securities attached with these courses. In developing countries, these students are from low and middle classes and these students are motivated by monetary factors to enter science courses while in developed countries, students are motivated by various reasons such as passion for science, fame and hawking factor to enter science courses. Upon completion of these courses, these students are unable to find decent jobs because decisions to enroll into science courses have no relevant to a scientific paradigm. In fact, within the paradigm of special education, reading and writing instructions are focal points and very little is done on science subjects in secondary classes. In India, many educational boards waive science and mathematics papers for students with disabilities at secondary level because of complexity of these subjects. So vast majority of students with disabilities have no sound knowledge of mathematics and science to enroll into science and applied science courses at postsecondary level. From the survey of   literature suggests vast majority of students with disabilities are poor in sciences and they are good in management and non-sciences such as arts, humanities, social sciences and law. On another hand, students with disabilities are enrolling into non-science courses and finding decent jobs. This paper argues different disabilities require different postsecondary courses. In order to do that researcher will be using regression method.  Job status will be categorical dependent variable and it will take two values.  Types of disabilities will be an independent variable and it will take three values mild, moderate and severe. Types of post-secondary education will be an independent variable and it will take three values management non science and science. Mathematic score at ten grades will be an independent variable. And grade average points at undergraduate level will be an independent variable. Sample size is 150 adults with disabilities having a college degree for this study.\r\n\r\n<br>','no_image.jpg','Formatted_Chetan_Paper_2_1711174788.docx',NULL,NULL,NULL,1,2,2,3,'IJRTMR',1,1,3,16,NULL,NULL,NULL,0,352,NULL,'2024-03-23 06:19:48','2024-03-27 09:37:56'),(366,1,356,NULL,'Smart Safety Device for Women Using IOT','<p>Now a days, women and children are facing various issues like sexual assaults. Such violence will definitely have huge impact on the lives of victim. It also affects their health and their psychological balance. These kinds of violence keep on increasing day by day. Even school children are kidnapped and sexually abused. We are living in a society where a nine months old girl child doesn’t have security, the child was kidnapped, raped and then murdered. On witnessing those violations against women, its impulses us to do something for women and children safety. So, in this paper we have planned to propose a device which will act as a tool to provide security and ensures the safety of the women and the children. Microcontroller, GSM and GPS module are used to send notifications and current location of women to various mobile numbers in their contact.</p>','no_image.jpg','Rese_1711186156.docx',NULL,NULL,NULL,1,2,1,3,'IJRTMR',5,1,2,5,NULL,NULL,NULL,0,356,NULL,'2024-03-23 09:29:16','2024-03-26 05:01:08'),(367,1,314,NULL,'DESIGN AND DEVELOPMENT OF AN RTC BASED RELAY BOARD FOR PRECISION CONTROL OF INDUSTRIAL MOTORS','<p>An Arduino-based time-regulated electrical apparatus control mechanism undertakes the responsibility of activating and deactivating electric equipment as per a pre-set timetable. This exploration introduces an option to manual switching by elevating technology in a manner that is more secure and more user-efficient. It showcases an integrated clock that updates in real-time, turning the associated device on or off when real-time aligns with the scheduled time. The input control panel enables users to alter the switching schedule at their convenience, while the numeric display illustrates the current time.</p>','no_image.jpg','Shashank_wankar_new_conference_paper_for_IJIRE_1711192453.docx',NULL,NULL,NULL,1,2,1,1,'IJIRE',1,1,2,15,NULL,'<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJIRE Journal Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://theijire.com/archives?year=2024&amp;volume=5&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijire/archives?year=2024&amp;volume=5&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>Crossref Link(DOI):<a href=\"https://search.crossref.org/?from_ui=&amp;q=10.59256%2Fijire.20240502013\" target=\"_blank\"> </a><span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/?from_ui=&amp;q=10.59256%2Fijire.20240502013\" target=\"_blank\">Click Here</a></span> (Please check after 48 hrs.)<br></p>','paid-2',1,314,1,'2024-03-23 11:14:13','2024-03-26 07:01:10'),(368,1,324,NULL,'Design and Implementation of Retinal Eye Disease Detection Based on Machine Learning .','Abstract disease, retinal vein occlusion (blockage of a retinal vein), or diabetes mellitus, which induces fragility in blood vessels, making them prone to damage. The presence of hemorrhages in the retina serves as a primary indicator of diabetic retinopathy. The severity of the disease can be assessed based on the number and morphology of these hemorrhages. This study aims to achieve several objectives, including the detection of blood vessels, identification of hemorrhages, and classification of diabetic retinopathy into traditional, moderate, and non-proliferative stages (NPDR).','no_image.jpg','meenakshi_paper_1711205113.doc',NULL,NULL,NULL,1,2,1,1,'IJIRE',1,1,1,15,NULL,'<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJIRE Journal Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://theijire.com/archives?year=2024&amp;volume=5&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link:<span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijire/archives?paperid=8239793953745121505\" target=\"_blank\"> Click Here</a></span><br><br><br></p>','paid-1',1,324,1,'2024-03-23 14:45:13','2024-03-24 17:06:27'),(369,1,359,NULL,'A holistic visionary aid for visually impaired people','<p>This research introduces an innovative assistive system tailored to empower&nbsp;<span style=\"font-size: 0.875rem;\">visually impaired individuals by integrating embedded systems and Python&nbsp;</span><span style=\"font-size: 0.875rem;\">OpenCV technology. The primary focus is on facilitating accurate detection of&nbsp;</span><span style=\"font-size: 0.875rem;\">familiar faces such as parents, addressing a significant challenge within the&nbsp;</span><span style=\"font-size: 0.875rem;\">visually impaired community. The hardware architecture of the embedded system&nbsp;</span><span style=\"font-size: 0.875rem;\">prioritizes compactness and efficiency, ensuring both portability and real-time&nbsp;</span><span style=\"font-size: 0.875rem;\">processing capabilities. At the heart of this system are sophisticated algorithms&nbsp;</span><span style=\"font-size: 0.875rem;\">from Python OpenCV, which utilize image processing and machine learning&nbsp;</span><span style=\"font-size: 0.875rem;\">techniques to achieve robust people detection. Through a sequence of image&nbsp;</span><span style=\"font-size: 0.875rem;\">preprocessing stages, including edge detection and feature extraction, the system&nbsp;</span><span style=\"font-size: 0.875rem;\">identifies human silhouettes with remarkable precision. Additionally, deep&nbsp;</span><span style=\"font-size: 0.875rem;\">learning models contribute to enhancing accuracy, enabling the system to&nbsp;</span><span style=\"font-size: 0.875rem;\">differentiate between individuals based on facial features. The user interface is&nbsp;</span><span style=\"font-size: 0.875rem;\">thoughtfully designed for simplicity and accessibility, incorporating auditory&nbsp;</span><span style=\"font-size: 0.875rem;\">cues and haptic feedback to facilitate intuitive interaction. During testing, the&nbsp;</span><span style=\"font-size: 0.875rem;\">system demonstrated impressive accuracy rates in detecting and distinguishing&nbsp;</span><span style=\"font-size: 0.875rem;\">between fathers and mothers, highlighting its potential as a dependable aid for the&nbsp;</span><span style=\"font-size: 0.875rem;\">visually impaired. Future improvements may involve expanding the dataset to&nbsp;</span><span style=\"font-size: 0.875rem;\">encompass a broader range of facial recognition scenarios and integrating voice&nbsp;</span><span style=\"font-size: 0.875rem;\">commands for seamless operation. In summary, this visionary assistive system&nbsp;</span><span style=\"font-size: 0.875rem;\">merges embedded systems and Python OpenCV capabilities to deliver a portable,&nbsp;</span><span style=\"font-size: 0.875rem;\">efficient, and precise solution for visually impaired individuals to identify&nbsp;</span><span style=\"font-size: 0.875rem;\">significant figures like parents.</span></p>','no_image.jpg','conference_1711252370.docx',NULL,NULL,NULL,1,2,1,1,'IJIRE',1,1,2,5,NULL,NULL,NULL,0,359,NULL,'2024-03-24 03:52:50','2024-03-26 02:18:52'),(370,1,363,NULL,'Real-Time Attendance Tracking Management System','<p>An innovative program designed to improve attendance tracking and management in various situations is the Real-Time Tracking and Management system using RSSI. This project combines Radio Signal Strength Indicator (RSSI) technology with embedded devices to provide accurate real-time tracking of individuals within defined premises. It also combines with a powerful reporting system to produce analytical data and attendance records. Better resource allocation and management are made possible by the integration of manpower data, which maximizes worker utilization.</p>','no_image.jpg','REVIEW_1711266272.docx',NULL,NULL,NULL,1,2,1,5,'INDJECE',1,1,1,5,NULL,NULL,NULL,0,363,NULL,'2024-03-24 07:44:32','2024-03-26 04:28:50'),(371,1,358,NULL,'ENHANCED PERFORMANCE OF INFRACTION  DETECTION USING RANDOM FOREST BY  COMPUTATIONAL ANALYSIS','<p>There are multitude security uncertainty on the internet due to the \r\n</p><p>breakthrough communication. This model safeguards computer networks from \r\n</p><p>unauthorized access. The system has been encountered to a numerous machine \r\n</p><p>learning (ML) technique to refine its accuracy in uncovering intrusions. Using \r\n</p><p>principle component analysis (PCA) and the random forest classification \r\n</p><p>approach, a proficient system for developing IDS has been proposed in this \r\n</p><p>study. When it comes to organizing the dataset, PCA will help by degrading its \r\n</p><p>dimensionality, and random forest will facilitate in systemization. The results \r\n</p><p>consolidated indicate that the advocated procedure outdoes other techniques \r\n</p><p>such as Decision Tree in terms of accuracy. The accuracy rate is 99%, the error \r\n</p><p>rate is 0.7%, and the performance time (min) is 3.24 minutes consistent with the \r\n</p><p>results of the advocated procedure. Through a comprehensive analysis of \r\n</p><p>infraction detection systems, this paper aims to provide valuable insights into \r\n</p><p>their role in fortifying network security and mitigating cyber threats in modern \r\n</p><p>computing techniques.&nbsp;</p>','no_image.jpg','REPORT__ENHANCED_PERFORMANCE_OF_INFRACTION_DETECTION_USING_RANDOM_FOREST_BY_COMPUTATIONAL_ANALYSIS_1711297796.docx',NULL,NULL,NULL,1,2,2,5,'INDJECE',7,1,1,17,NULL,NULL,NULL,0,358,NULL,'2024-03-24 16:29:56','2024-03-26 04:54:33'),(372,15,366,NULL,'INTELLIGENT LOCALIZATION SYSTEM FOR CONSTRUCTION ACCIDENT RESCUE USING RSSI','<p>The Intelligent Localization System for Construction Accident Rescue using RSSI for Person Identification and Health Monitoring System represents a critical advancement in ensuring the safety and wellbeing of workers in the construction industry. Leveraging the power of Radio Signal Strength Indicator (RSSI) technology, this system is designed to precisely locate and identify individuals within a construction site during emergencies or accidents. By analyzing RSSI signal strength, the system accurately pinpoints the location of each worker, enabling efficient and timely rescue operations. Furthermore, the system integrates health monitoring capabilities, providing real-time insights into the well-being of workers. This includes monitoring vital signs, such as heart rate and body temperature, ensuring early detection of distress signals and prompt medical intervention when needed. The amalgamation of person identification, localization, and health monitoring ensures a comprehensive safety net, enabling construction sites to respond swiftly and effectively in the event of an emergency.</p>','no_image.jpg','conference_paper_2_1711350839.docx',NULL,NULL,NULL,1,2,1,5,'INDJECE',4,1,1,5,NULL,NULL,NULL,0,366,NULL,'2024-03-25 07:13:59','2024-03-28 04:02:53'),(373,8,369,NULL,'HEART DISEASE PREDICTION USING RANDOM FOREST ALGORITHM','<p>Heart disease is a significant health concern worldwide, necessitating effective predictive models for early detection and intervention. In this study, we employ five popular machine learning algorithms: Random Forest, Logistic Regression, Decision Tree, Support Vector Machine (SVM), and K-Nearest Neighbor (KNN), to develop predictive models for heart disease classification. The dataset used in this analysis undergoes extensive data cleaning,  include handling missing values, standardizing features, and addressing class imbalance. Each algorithm is implemented and evaluated using appropriate performance metrics such as accuracy, precision, recall, and F1-score. Comparative analysis of these models provides insights into their effectiveness in predicting heart disease, aiding healthcare professionals in making informed decisions for patient care and management.&nbsp;&nbsp;</p>','no_image.jpg','Heart2_1711374022.docx',NULL,NULL,NULL,1,2,1,1,'IJIRE',1,1,2,15,NULL,'<p><span style=\"color: rgb(0, 0, 255);\"><b>Published Article Details:</b></span><br><br>IJIRE Journal Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://theijire.com/archives?year=2024&amp;volume=5&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijire/archives?year=2024&amp;volume=5&amp;issue=2\" target=\"_blank\">Click Here</a></span><br></p>','paid-1',1,369,1,'2024-03-25 13:40:22','2024-03-27 04:15:31'),(374,1,371,NULL,'Textile antenna for UWB applications','<p>The antenna covers the ultra-wideband&nbsp;<span style=\"font-size: 0.875rem;\">(UWB) frequency range (3 GHz to 10 GHz). As a&nbsp;</span><span style=\"font-size: 0.875rem;\">result, a pentagonal patch, tiny design, and partial&nbsp;</span><span style=\"font-size: 0.875rem;\">ground plane ultra-wideband (UWB) antenna&nbsp;</span><span style=\"font-size: 0.875rem;\">developed for efficient transmission. Jeans with a 1.6&nbsp;</span><span style=\"font-size: 0.875rem;\">mm thickness, a relative dielectric constant of 1, and a&nbsp;</span><span style=\"font-size: 0.875rem;\">loss tangent of 0.009 are used as the substrate in the&nbsp;</span><span style=\"font-size: 0.875rem;\">antenna design. This antenna provides users with&nbsp;</span><span style=\"font-size: 0.875rem;\">discreet and intelligent support by blending in&nbsp;</span><span style=\"font-size: 0.875rem;\">perfectly with regular clothing. The S-Parameter&nbsp;</span><span style=\"font-size: 0.875rem;\">value at maximum is 6.6857 and the gain is 3.042 .&nbsp;</span><span style=\"font-size: 0.875rem;\">Hence the constructed UWB antenna with a&nbsp;</span><span style=\"font-size: 0.875rem;\">pentagonal patch and partial ground plane, optimized&nbsp;</span><span style=\"font-size: 0.875rem;\">for medical imaging systems and other applications,&nbsp;</span><span style=\"font-size: 0.875rem;\">shows the potential to advance healthcare&nbsp;</span><span style=\"font-size: 0.875rem;\">technologies.</span></p>','no_image.jpg','Conference_Paper_1711424574.docx',NULL,NULL,NULL,1,2,1,5,'INDJECE',1,1,3,5,NULL,NULL,NULL,0,371,NULL,'2024-03-26 03:42:54','2024-03-28 04:02:06'),(375,2,372,NULL,'Enhanced Chemistry Lab Learning Management System - ECLLMS','<p>An innovative platform called the \"Enhanced Chemistry Lab Learning Management System (ECLLMS)\" was created to change the conventional chemistry laboratory experience into a dynamic and interesting learning environment. Under the motto \"A teacher for a student,\" ECLLMS provides individualized support, thorough safety instructions, dynamic experiments, and educators-only guidance to solve the inadequacies of traditional teaching techniques. The cutting-edge Doubt Clearance Module, which uses artificial intelligence (AI) and a unique database to respond to student questions and concerns in real-time, is one of the main features of ECLLMS. Students can get immediate help and clarification on experiment-related concerns from the Doubt Clearance Module\'s chat application, which is powered by sophisticated natural language processing (NLP) algorithms. By utilizing an AI-driven approach, students can overcome conceptual obstacles and get a deeper understanding of chemistry fundamentals by receiving precise and efficient solutions. Moreover, the Doubt Clearance Module\'s unique database improves the system\'s flexibility and reactivity. The ECLLMS makes sure that students receive timely, pertinent support that is catered to their individual requirements and learning objectives by constantly updating and growing its knowledge base. This individualized method encourages critical thinking abilities and self-directed learning in addition to increasing student confidence and engagement. All things considered, ECLLMS is a big step forward in chemistry education, providing a comprehensive way to improve the learning and teaching process in lab environments. ECLLMS fosters a lifetime excitement for scientific inquiry and discovery by enabling students to overcome obstacles, explore concepts, and thrive in their chemistry studies with its revolutionary Doubt Clearance Module.</p><p><br></p>','no_image.jpg','journal_ecllms_with_auth_nam_1711430361.docx',NULL,NULL,NULL,1,2,1,1,'IJIRE',1,1,1,5,NULL,NULL,NULL,0,372,NULL,'2024-03-26 05:19:21','2024-03-27 04:17:33'),(376,1,337,NULL,'Enhancing Electronic Services: Exploring the Optimal Security of Digital Signature Systems','<p>E-government, e-learning, e-shopping, and e-voting are examples of electronic processes whose efficacy depends on the security, legitimacy, and integrity of the data that is sent back and forth between users. Sensitive material must be extensively vetted by its intended recipient and digitally signed by its original sender in order to meet these benchmarks. Digital signature systems, which are based on intricate cryptographic formulas, are necessary to guarantee the dependability of these electronic services. However, a number of variables, like key and block sizes, computational complexity, security settings, and modifications unique to a given application, affect how well these services function.\r\n</p><p>The goal of the present research was to identify the ideal level of security for electronic mechanisms through a thorough investigation of industry-standard digital signature systems by the authors. They also looked into possible uses in many fields to improve comprehension and application in real-world situations.\r\n</p><p><br></p><p>\r\n</p>','no_image.jpg','Enhancing_Electronic_Services_Exploring_the_Optimal_Security_of_Digital_Signature_Systems_1711433416.docx',NULL,NULL,NULL,1,2,1,2,'IJSREAT',1,1,3,15,NULL,'<p><span style=\"color: rgb(0, 0, 255);\"><b>Published Article Details:</b></span><br><br>IJSREAT Journal Link: <span style=\"background-color: rgb(255, 255, 0);\"><a href=\"https://ijsreat.com/archives?year=2024&amp;volume=4&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link:<span style=\"background-color: rgb(255, 255, 0);\"> <a href=\"https://fdrpjournals.org/ijsreat/archives?paperid=4199545290965928542\" target=\"_blank\">Click Here</a></span><br><br>Crossref Link(DOI):<span style=\"background-color: rgb(255, 255, 0);\"> <a href=\"https://search.crossref.org/search/works?q=10.59256%2Fijsreat.20240402009&amp;from_ui=yes\" target=\"_blank\">Click Here</a></span> (Please check after 48 hrs.)<br></p>',NULL,0,337,1,'2024-03-26 06:10:16','2024-03-27 14:26:02'),(377,2,370,NULL,'Disparity in Carbon Footprints Between Developed and Developing Countries','<p>Burning fossil fuels is contributing to climate change, which is resulting in extreme weather, rising sea levels, changes in plant and animal life, and global warming. Rich countries\' carbon footprints are noticeably larger than those of emerging countries, notwithstanding the latter\'s expanding role.</p><p>The carbon footprint gap between industrialized and developing nations is examined in this research study, which also discusses alternative policy solutions and identifies contributing factors and effects on climate change and sustainable development.</p><p>Using information from the World Bank, the Intergovernmental Panel on Climate Change, and the United Nations, the report will review the body of research on carbon footprints and climate change.</p><p>The goal of the article is to resolve the discrepancy in carbon footprints between developed and developing nations, providing practitioners and politicians with useful information to facilitate a fair shift to a low-carbon economy.</p>','no_image.jpg','PCL___sem__6__final_draft_1711466616.docx',NULL,NULL,NULL,1,2,1,3,'IJRTMR',2,1,2,5,NULL,NULL,NULL,0,370,NULL,'2024-03-26 15:23:36','2024-03-27 04:20:18'),(378,4,376,NULL,'A STUDY ON EMPLOYEE TOWARDS HR POLICY AND PRACTICES','<p>Human resource management is concerned with people element in management. Since every organization is made up of people, acquiring their services, developing their skills/ motivating to high level of performances and ensuring that they continue to maintain their commitments to the organization which are essential to achieve organizational objectives. This project is meant to know the Human Resource Policies and practices in the organization. The HR Policies and practices are a tool to achieve employee satisfaction and thus highly motivated employees. The main objective of various HR Policies and practices is to increase efficiency by increasing motivation and thus fulfil organizational goals and objectives. The quantitative survey using statistical tools like regression analysis, correlation analysis, weighted average and frequency tabulation, all facilitated by SPSS software.</p><p>Keywords: HR policies, Employee Relationship, Organization.</p>','no_image.jpg','4_prasanth_journal_1711517567.docx',NULL,NULL,NULL,1,2,1,1,'IJIRE',2,1,2,15,NULL,'<b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span><br></b><br>IJIRE Journal Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://theijire.com/archives?year=2024&amp;volume=5&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijire/archives?year=2024&amp;volume=5&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>Crossref Link(DOI): <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/?from_ui=&amp;q=10.59256%2Fijire.20240502016\" target=\"_blank\">Click Here</a></span> (Please check after 48 hrs.)<p><span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><br></span><br></p>','paid-1',1,376,1,'2024-03-27 05:32:47','2024-04-01 15:40:24'),(379,4,378,NULL,'A Study on perception of job seeker on recruitment through job portals','<p>This study investigates the perceptions of job seekers regarding the effectiveness and reliability of job portals as a recruitment platform. With the proliferation of online job search platforms, understanding job seekers\' perspectives is crucial for both employers and job portal operators. Through a mixed-method approach involving surveys and interviews, this research delves into the preferences, concerns, and experiences of job seekers utilizing job portals. Initial findings suggest a mixed perception among job seekers, highlighting factors such as platform usability, trustworthiness of job listings, and the relevance of job matches. The study aims to provide insights for improving job portal functionalities and enhancing the overall recruitment experience for both job seekers and employers.</p><p>Key Words:  job portals, job seeker, trustworthiness, website aesthetics, service, online recruitment.</p>','no_image.jpg','JOURNAL__DEEPIKA_1711522936.docx',NULL,NULL,NULL,1,2,1,2,'IJSREAT',2,1,2,15,NULL,'<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJSREAT Journal Link: <span style=\"color: rgb(0, 0, 255);\"><span style=\"background-color: rgb(255, 255, 0);\"><a href=\"https://ijsreat.com/archives?year=2024&amp;volume=4&amp;issue=2\" target=\"_blank\">Click Here</a></span><br></span><br>FDRP Website Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijsreat/archives?year=2024&amp;volume=4&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>Crossref Link(DOI): <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/?from_ui=&amp;q=10.59256%2Fijsreat.20240402010\" target=\"_blank\">Click Here</a></span> (Please check after 48 hrs.)<br></p>','paid-2',1,378,1,'2024-03-27 07:02:16','2024-03-30 09:53:54'),(380,1,379,NULL,'Level Process Station Control Using ALE111 Communication Module','<p>A noteworthy example of the technological evolution is the ALE111, a cutting-edge system equipped with advanced functionalities designed to monitor the status of field wireless devices. One of its key features is the implementation of bumpless output, a capability that ensures seamless transitions and adjustments in the control process. Remarkably, the ALE111 enables wireless process control, a capability traditionally associated with wired control systems utilizing 4-20 mA signal communication.This wireless paradigm not only introduces a new level of flexibility but also contributes to the overall enhancement of process control reliability. The ALE111 goes a step further by incorporating redundant configurations, a strategic approach that adds an extra layer of reliability to the system. By doing so, potential points of failure are mitigated, and the overall robustness of the process control system is substantially improved.</p>','no_image.jpg',NULL,NULL,NULL,NULL,1,2,1,1,'IJIRE',1,1,1,15,NULL,'<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJIRE Journal Link: <span style=\"background-color: rgb(255, 255, 0);\"><a href=\"https://theijire.com/archives?year=2024&amp;volume=5&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link: <span style=\"background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijire/archives?paperid=7066203887204319910\" target=\"_blank\">Click Here</a></span><br><br>Crossref Link(DOI): <span style=\"background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/search/works?q=10.59256%2Fijire.20240502015+&amp;from_ui=yes\" target=\"_blank\">Click Here</a></span> (Please check after 48 hrs.)<br></p>','paid-2',1,379,1,'2024-03-27 07:43:37','2024-03-30 10:10:49'),(381,1,380,NULL,'Enhancing Decision-Making in Restaurant Selection: Predictive Modeling and Business Intelligence for Zomato Reviews','<p>In this paper, We want to predict restaurant reviews on Zomato platform using machine learning based classification algorithms. Zomato is a popular online platform for discovering and reviewing restaurants. Using a rich dataset from Zomato that includes features such as location, cuisine type, price range, and user reviews, We aims to build a predictive model that can accurately classify restaurants into review categories. This paper includes data preprocessing, feature engineering, model selection and evaluation to determine the most efficient classification algorithm. The use of predictive modeling and business intelligence to improve decision-making in restaurant selection on Zomato, a popular online review platform. The authors leverage Zomato\'s rich user-generated review data to develop a model that can predict the helpfulness of reviews. Using these inputs, the provided model predicts the restaurant\'s rating based on the features provided. The interface is intuitive and easy to use. Users simply enter relevant information about the restaurant they are interested in and the app quickly creates a forecast. Additionally, the interface may contain visualizations or informative displays to improve the user\'s understanding of the forecasting process. Our paper provide zomato users with valuable information to make effective nutritional decisions.\r\n</p><p>Keywords: Classification algorithms, Predictive modelling,Business intelligence,\r\n</p><p>Decision-making.\r\n</p><p><br></p>','no_image.jpg','zomato_(2)_1711525805.docx',NULL,NULL,NULL,1,2,1,1,'IJIRE',1,1,2,15,'2024-04-11','<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJIRE Journal Link:<a href=\"https://theijire.com/archives?year=2024&amp;volume=5&amp;issue=2\" target=\"_blank\"> </a><span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://theijire.com/archives?year=2024&amp;volume=5&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijire/archives?year=2024&amp;volume=5&amp;issue=2\" target=\"_blank\">Click Here</a></span><br></p>','paid-1',1,380,1,'2024-03-27 07:50:05','2024-04-11 05:09:42'),(382,2,381,NULL,'Application of Convolutional Neural Network in Sentiment Analysis','<p>The current rate development in the Artificial Intelligence models have put Sentiment Analysis to a forefront. With many AI models being developed and integrated into applications of various fields, the requirement for the appropriate assessment of the emotions is necessary to understand and process the data for the end user. This paper focuses on a Deep Learning approach, wherein we understand the applications of Convolutional Neural Network in Sentiment Analysis. Here we try to understand the implementation of CNN models paired with Word Embedding techniques to achieve accurate results. The paper discusses the different variations of the CNN models and their rate of accuracy on an extensive range of emotions. The paper also explains the experimentation of a proposed CNN model on the “GoEmotions’’ dataset.</p>','no_image.jpg','Application_of_Convolutional_Neural_Network_in_Sentiment_Analysis_1711526729.docx',NULL,NULL,NULL,1,2,1,2,'IJSREAT',1,1,1,5,NULL,NULL,NULL,0,381,NULL,'2024-03-27 08:05:29','2024-03-29 03:04:09'),(383,4,382,NULL,'A STUDY ON ROLE OF AI IN MODERN RECRUITMENT - OPPORTUNITIES AND CHALLENGES FOR HR PROFESSIONAL','<p>Artificial Intelligence (AI) is revolutionizing the recruitment landscape, presenting both opportunities and challenges for Human Resources (HR) professionals. This abstract explores the evolving role of AI in modern recruitment and its implications for HR practitioners.\r\n</p><p>AI technologies offer HR professionals a multitude of opportunities to enhance recruitment efficiency, streamline processes, and improve decision-making. From automated resume screening and candidate sourcing to predictive analytics for talent forecasting, AI empowers HR teams to optimize their workflow and allocate resources more effectively. Moreover, AI-driven chatbots and virtual assistants enhance candidate engagement by providing instant responses and personalized interactions, thereby elevating the overall candidate experience.\r\n</p><p>However, the adoption of AI in recruitment also presents challenges that HR professionals must navigate skillfully. Ethical considerations surrounding data privacy, algorithmic bias, and fairness in candidate selection require careful scrutiny and proactive measures to mitigate potential risks. Furthermore, there is a pressing need for HR professionals to develop competencies in data analysis, algorithm management, and ethical AI usage to harness the full potential of these technologies effectively.\r\n</p><p>Keywords: Artificial Intelligence (AI), recruitment, Human Resources (HR), opportunities, challenges, efficiency, decision-making, candidate engagement, ethical considerations, data privacy, algorithmic bias.\r\n</p><p><br></p><p>\r\n</p>','no_image.jpg','journal_1711530360.docx',NULL,NULL,NULL,1,2,1,2,'IJSREAT',2,1,2,15,NULL,'<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJSREAT Journal Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://ijsreat.com/archives?year=2024&amp;volume=4&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link:<a href=\"https://fdrpjournals.org/ijsreat/archives?year=2024&amp;volume=4&amp;issue=2\" target=\"_blank\"> </a><span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijsreat/archives?year=2024&amp;volume=4&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>Crossref Link(DOI): <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/search/works?q=10.59256%2Fijsreat.20240402011&amp;from_ui=yes\" target=\"_blank\">Click Here</a></span> (Please check after 48 hrs.)<br></p>','paid-1',1,382,1,'2024-03-27 09:06:00','2024-03-30 09:52:02'),(384,2,384,NULL,'Beyond Extractive Methods – Navigating the landscape of Abstractive Summarization Methods','<p>Abstract:  Today, millions of data are generated every hour, which highlights the need for summarizing all this data accurately and efficiently. Doing such a task manually is tedious. This welcomes the need for automatic summarizing techniques. Generating precise and concise summaries of long text data is a necessity. Automatic summarization includes two primary techniques- Extractive and Abstractive Summarization. Extractive Summarization uses important sentences and keywords to construct the summary whereas abstractive summarization understands the text and generates a summary. \r\n</p><p>The encoder-decoder architecture is generally used for abstractive summarization. This study briefs about various transformer architectures, including T5, BART, and Pegasus. Furthermore, a comparative analysis of these models on the same data is presented and the result of the same is compared on scores with the manually generated summaries- ROUGE1, ROUGE2, and ROUGEL. \r\n</p><p>The purpose of this study is to understand the advancement of abstractive text summarization models as well as to understand the strategies and their usefulness. \r\n</p><p>Index Terms – Natural Language Processing, Abstractive Summarization, BART, T5, Pegasus, ROUGE.</p><p>\r\n</p>','no_image.jpg','NLP_Final__new_edit_1711542569.docx',NULL,NULL,NULL,1,2,1,6,'INDJCST',1,1,1,15,NULL,'<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>INDJCST Journal Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://indjcst.com/archives?paperid=5773797537691450787\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link:<a href=\"https://fdrpjournals.org/indjcst/archives?year=2024&amp;volume=3&amp;issue=1\" target=\"_blank\"> </a><span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/indjcst/archives?year=2024&amp;volume=3&amp;issue=1\" target=\"_blank\">Click Here</a></span><br><br>Crossref Link(DOI):<a href=\"https://search.crossref.org/?from_ui=&amp;q=10.59256%2Findjcst.20240301008\" target=\"_blank\"> </a><span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/?from_ui=&amp;q=10.59256%2Findjcst.20240301008\" target=\"_blank\">Click Here</a></span><a href=\"https://search.crossref.org/?from_ui=&amp;q=10.59256%2Findjcst.20240301008\" target=\"_blank\"> </a>(Please check after 48 hrs.)<br></p>','paid-2',1,384,1,'2024-03-27 12:29:29','2024-04-10 10:24:40'),(385,1,386,NULL,'Data science applications in healthcare data transmission','<p>The studies and surveys that are already in existence in the field of data analysis have found that there is very complicated\r\n</p><p>and undisturbed correlation between the daily human incidental movements and the identification of the health \r\n</p><p>conditions. The smart health system has been the field of the interest within the researchers and analysts for such a long \r\n</p><p>period of time. Health conditions are so complicated to predict because of their higher volatile and unpredictable nature \r\n</p><p>which is completely dependent on the factors like ever changing health conditions of different people in different places \r\n</p><p>of the world and so on. Predicting the health conditions depending up on the data that is already gathered which is named \r\n</p><p>as the health information alone has become not so sufficient to predict the ups and downs of the health conditions. \r\n</p><p>Numerous analyses regarding the health conditions studies have been conducted to attain the accuracy by utilising many \r\n</p><p>algorithms like naïve bayes regression, data analytics and the deep learning. In this research paper, we have tried to \r\n</p><p>accelerate the rate of accuracy of the smart health care systems by collecting huge amount of time series data and for \r\n</p><p>the sake of analysing the data with the help of data analytics models to predict the of health conditions. The amount of \r\n</p><p>the verbal data that is available and analysed during few surveys and studies were insufficient and as a result the health \r\n</p><p>care systems that are with low accuracy rates were observed. The accuracy of the models that run with the help of the \r\n</p><p>data analytics methods are completely dependent on the amount of information provided for the sake of the training.</p>','no_image.jpg','final_paper_1711602672.docx',NULL,NULL,NULL,1,2,1,1,'IJIRE',2,1,3,5,NULL,NULL,NULL,0,386,NULL,'2024-03-28 05:11:12','2024-03-29 03:05:48'),(386,2,388,NULL,'Kernel Paradigms: A Comprehensive Analysis, Applications, and Future Directions in Computer Science','<p>Abstract: This research paper conducts a comprehensive analysis of kernel paradigms in computer science, focusing on their structure, applications, and potential future directions. Kernels, as pivotal components in operating systems, profoundly impact system functionality, performance, and security. This paper delves into the foundations of kernels, explores diverse architectures, discusses real-world applications, addresses performance and optimization strategies, highlights security implications, and envisions future trends in kernel development. By providing a thorough examination of kernel paradigms, this research contributes to the understanding of their critical role in contemporary computing, catering to both practitioners and researchers in the field.</p>','no_image.jpg','Kernel_Paradigms_A_Comprehensive_Analysis,_Applications,_and_Future_Directions_in_Computer_Science_1711618483.docx',NULL,NULL,NULL,1,2,1,6,'INDJCST',2,1,1,5,NULL,NULL,NULL,0,388,NULL,'2024-03-28 09:34:43','2024-03-29 20:36:54'),(387,1,286,NULL,'Blockballot: Blockchain Based E-Voting System','<p>Blockballot offers a promising solution to enhance the integrity and security of electoral processes. Leveraging the decentralized and immutable nature of blockchain technology, our system ensures transparency, verifiability, and tamper- resistance. By recording each vote as a transaction on the blockchain, the system provides a transparent audit trail, reducing the risks of fraud and manipulation. Voters can securely cast their votes from anywhere, promoting accessibility and convenience. Cryptographic techniques authenticate voters\' identities while maintaining anonymity. As a result, Blockballot: Blockchain based E-Voting System fosters trust in democratic processes, paving the way for a more inclusive, efficient, and trustworthy electoral environment.</p>','no_image.jpg','Article_Blockballot_1711655479.docx',NULL,NULL,NULL,2,2,2,2,'IJSREAT',1,1,1,1,NULL,NULL,NULL,0,286,286,'2024-03-28 19:45:26','2024-03-29 15:51:02'),(388,1,286,NULL,'Blockballot: Blockchain Based E-Voting System','<p>Blockballot offers a promising solution to enhance the integrity and security of electoral processes. Leveraging the decentralized and immutable nature of blockchain technology, our system ensures transparency, verifiability, and tamper- resistance. By recording each vote as a transaction on the blockchain, the system provides a transparent audit trail, reducing the risks of fraud and manipulation. Voters can securely cast their votes from anywhere, promoting accessibility and convenience. Cryptographic techniques authenticate voters\' identities while maintaining anonymity. As a result, Blockballot: Blockchain based E-Voting System fosters trust in democratic processes, paving the way for a more inclusive, efficient, and trustworthy electoral environment.</p>','no_image.jpg','Article_Blockballot_1711655493.docx',NULL,NULL,NULL,2,2,1,6,'INDJCST',1,1,1,5,NULL,NULL,NULL,0,286,286,'2024-03-28 19:48:21','2024-04-01 04:04:02'),(389,1,391,NULL,'PREDICTING GOLD PRICES: A COMPARATIVE ANALYSIS OF ML ALGORITHMS','<p>Gold price prediction holds significant importance for investors, economists, and policy makers due to its role as a global safe-haven asset and its influence on financial markets. In this paper, we propose a machine learning (ML) approach for predicting gold prices based on historical data and relevant economic indicators. The dataset includes various features such as gold prices , United State Oil ETF (USO Value), S&amp;P 500 Index (S&amp;P500), Euro against USD pair (EUR/USD), Shares Silver Trust (SLV). We preprocess the data to handle missing values, normalize features, and split it into training and testing sets. We experiment with different ML algorithms, including to Support Vector Machines, K-Neighbors Classifier, Random Forests Classifier, Gaussian NB, Decision Tree Classifier and Random Forests Regressor. We tune hyperparameters using techniques like grid search or randomized search to optimize model performance. Evaluation metrics such as mean absolute error (MAE), mean squared error (MSE), and R-squared are used to assess the accuracy and robustness of the models. We compare the performance of different algorithms and feature combinations to identify the most effective approach for gold price prediction. The results demonstrate the effectiveness of ML algorithms in predicting gold prices, with certain models outperforming traditional econometric approaches. Additionally, feature importance analysis provides insights into the key drivers of gold price movements. Overall, this paper contributes to the growing body of research on forecasting financial markets using machine learning techniques and provides valuable insights for investors and stakeholders in the gold market.</p>','no_image.jpg','Gold_Price_Paper_1711690231.docx',NULL,NULL,NULL,1,2,1,1,'IJIRE',1,1,2,15,NULL,'<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJIRE Journal Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://theijire.com/archives?year=2024&amp;volume=5&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link:<a href=\"https://fdrpjournals.org/ijire/archives?year=2024&amp;volume=5&amp;issue=2\" target=\"_blank\"> </a><span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijire/archives?year=2024&amp;volume=5&amp;issue=2\" target=\"_blank\">Click Here</a></span><br></p>','paid-1',1,391,1,'2024-03-29 05:30:31','2024-04-04 03:06:46'),(390,1,392,NULL,'Optimizing Energy Efficiency in Indian Buildings: A Comprehensive Analysis of Current Norms and Proposed Guidelines for Strategic Placement and Orientation','<p>The concept of energy-efficient buildings is increasingly critical in today\'s world, where energy conservation and environmental sustainability are paramount. Energy-efficient buildings are designed to minimize the use of energy for heating, cooling, lighting, and other operations without compromising on comfort or utility. This approach not only helps in reducing the overall energy demand but also contributes significantly to mitigating climate change by lowering carbon emissions. This research focuses on optimizing energy efficiency in residential buildings, recognizing the crucial role of the residential sector in overall energy consumption. The study investigates innovative approaches, technologies, and design strategies to enhance energy performance while ensuring occupant comfort and cost-effectiveness.</p>','no_image.jpg','Energy_efficient_building_paper_overeview_(1)_1711709523.docx',NULL,NULL,NULL,2,2,1,2,'IJSREAT',1,1,1,15,NULL,'<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJSREAT Journal Link:<a href=\"https://ijsreat.com/archives?year=2024&amp;volume=4&amp;issue=2\" target=\"_blank\"> </a><span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://ijsreat.com/archives?year=2024&amp;volume=4&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijsreat/archives?year=2024&amp;volume=4&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>Crossref Link(DOI): <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/search/works?q=10.59256%2Fijsreat.20240402013%09&amp;from_ui=yes\" target=\"_blank\">Click Here</a> </span>(Please check after 48 hrs.)<br></p>','paid-2',1,392,1,'2024-03-29 10:52:03','2024-04-04 13:48:43'),(391,1,393,NULL,'CENTRALIZED AUTOMATION SYSTEM FOR PUBLIC LIGHTING  WITH FAULT DETECTION (CASP LIGHT)','<p>This project introduces a Smart Urban Lighting Management System utilizing sensor technology to enhance \r\n</p><p>efficiency, safety, and maintenance in public and street lighting. It employs Light-Dependent Resistors (LDRs) and microwave \r\n</p><p>sensors to gather real-time data on day/night conditions, occupancy, and faults. The methodology includes sensor-based data \r\n</p><p>collection, adaptive lighting control, and fault detection, enabling dynamic illumination adjustments based on environmental \r\n</p><p>conditions. Development progress encompasses problem statement identification, literature review, PCB design, and a user-friendly \r\n</p><p>web interface for real-time monitoring, PCB printing, product development, collaboration with local authorities, and result analysis \r\n</p><p>for continuous improvement. The project aims to improve energy efficiency, cost savings, and safety by addressing issues like\r\n</p><p>faulty streetlights through proactive maintenance facilitated by a user-friendly web interface and automated fault detection.\r\n</p>','no_image.jpg','Journal_Report_1711723190.docx',NULL,NULL,NULL,1,2,1,1,'IJIRE',1,1,2,5,NULL,NULL,NULL,0,393,NULL,'2024-03-29 14:39:50','2024-03-31 05:01:32'),(392,1,394,NULL,'Automated Water Monitoring and Managing System for Aquaculture using IoT','<p>&nbsp;In recent years, the Internet of Things (IoT) has emerged as a transformative technology with profound implications for various sectors, including environmental monitoring and management. This paper presents an innovative IoT-based automated water quality monitoring and management system (AWQMS) designed to revolutionize the way we monitor and safeguard water resources. The AWQMS leverages a network of IoT-enabled sensors deployed at strategic locations throughout water bodies, continuously measuring crucial parameters such as pH, dissolved oxygen, turbidity, temperature, and conductivity. These sensors are equipped with wireless communication capabilities, enabling real-time data transmission to a centralized data acquisition and processing platform. At the heart of the AWQMS lies advanced data analytics and machine learning algorithms, which analyze incoming data streams to detect anomalies and deviations from predefined water quality thresholds.&nbsp;</p>','no_image.jpg','Automated_Water_Monitoring_and_Managing_System_for_Aquaculture_using_IoT._1711730757.docx',NULL,NULL,NULL,1,2,1,2,'IJSREAT',1,1,1,15,NULL,'<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJSREAT Journal Link: <span style=\"background-color: rgb(255, 255, 0);\"><a href=\"https://ijsreat.com/archives?year=2024&amp;volume=4&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link: <span style=\"background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijsreat/archives?year=2024&amp;volume=4&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>Crossref Link(DOI): <span style=\"background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/?from_ui=&amp;q=10.59256%2Fijsreat.20240402012\" target=\"_blank\">Click Here</a></span> (Please check after 48 hrs.)<br></p>','paid-2',1,394,1,'2024-03-29 16:45:57','2024-04-01 07:21:47'),(393,1,395,NULL,'Image Processing in MATLAB','<p>Photography was invented in 1826 by French inventor Joseph Nicéphore Niépce. Since then, it has revolutionized the modern world. From medical evidence in court &amp; drawing images of industrial machines to personal photos for memory, not a single field is left untouched by photography. Nowadays when there is so many photo editing software, not a single one ensures true privacy and provides open-source code to ensure that no data is being collected. In six months of project making, we have developed an Image processing app that not only provides enhancement tools but also displays the power of steganography, a user-friendly environment to encrypt your enhanced images before sending them forward, and a magnificent display of Fourier series epicycles which creates an image using Fourier series, an intuitive way to learn and understand the beauty of mathematics. Mathematics could be called the language of science. Our tool proves why it is said so. And what could be a better platform to make all this other than MATLAB which not only provides numerous libraries but also is a powerful debugging tool that can display all the things happening inside the code. This app is built using the Guide function in MATLAB and has the potential to influence this generation toward data security as well as mathematics.</p><p><br></p><p>&nbsp;Index Terms – Enhancement, Cryptography, Epicycles, and Steganography.</p><p><br></p>','no_image.jpg','Research_paper_(1)_1711796387.docx',NULL,NULL,NULL,1,2,1,1,'IJIRE',1,1,1,15,NULL,'<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJIRE Journal Link:<a href=\"https://theijire.com/archives?year=2024&amp;volume=5&amp;issue=2\" target=\"_blank\"> </a><span style=\"background-color: rgb(255, 255, 0);\"><a href=\"https://theijire.com/archives?year=2024&amp;volume=5&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link: <span style=\"background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijire/archives?year=2024&amp;volume=5&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>Crossref Link(DOI): <span style=\"background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/?from_ui=&amp;q=10.59256%2Fijire.20240502019\" target=\"_blank\">Click Here</a></span> (Please check after 48 hrs.)<br></p>','paid-2',1,395,1,'2024-03-30 10:59:47','2024-04-08 08:09:07'),(397,16,397,NULL,'A STUDY ON JOB SATISFACTION AMONG EMPLOYEES IN PROCONNECT LOGISTICS LTD','<p>The study is undergone at <b>PROCONNECT LOGISTICS LTD, CHENNAI</b> The project focuses on the employee’s job satisfaction level. Job satisfaction refers to one\'s feelings towards one\'s job. If the employee’s expectations are fulfilled (or) the employees get higher than what he/she feels with satisfied. If job satisfaction increases organization commitment will increase This results in higher productivity. The main objectives of this paper are to assess job satisfaction and To Analyze the factors contributing to an improvement in employee job satisfaction. To study the employee’s perception towards the organization.  To identify the impact of employee’s job satisfaction on their performance. In this study, <b>118 employees </b>responses were been taken as a sample. Percentage analysis, Correlation analysis, Regression, and Weighted average have been incorporated for research analysis. The study helped in revealing the level of satisfaction of employees concerning the various factors provided in the organization. This study clearly shows that employees in an organization are more or less satisfied with their jobs. The organization should consider the salary, relationship of employees and supervisors, training and development, and give more opportunities to the new employees.\r\n</p><p>Keywords — Salary package, Training & development, career growth, etc…..\r\n</p><p><br></p><p>\r\n</p>','no_image.jpg','final_journal_1711895396.docx',NULL,NULL,NULL,2,2,1,3,'IJRTMR',1,1,3,15,NULL,'<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJRTMR Journal Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://ijrtmr.com/archives?year=2024&amp;volume=4&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijrtmr/archives?year=2024&amp;volume=4&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>Crossref Link(DOI): <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/?from_ui=yes&amp;q=10.59256%2Fijrtmr.20240402005\" target=\"_blank\">Click Here</a> </span>(Please check after 48 hrs.)<br></p>','paid-1',1,397,1,'2024-03-31 14:28:43','2024-04-01 09:28:09'),(398,1,398,NULL,'Advances in Brain Tumour prediction and classification using CNN','<p>Here we have researched about how CNN can be used in various aspects specially in medical field.&nbsp;</p>','no_image.jpg','BT4197_RESEARCH_PAPER_Advances_in_Brain_Tumor_Prediction_and_Classification_Using_Convolutional_Neural_Networks_1711944449.docx',NULL,NULL,NULL,1,2,1,6,'INDJCST',2,1,1,5,NULL,NULL,NULL,0,398,NULL,'2024-04-01 04:07:29','2024-04-02 13:09:47'),(399,16,397,NULL,'A STUDY ON A STUDY ON THE QUALITY OF WORK LIFE AMONG EMPLOYEES IN RAPID DATA','<p>This study focuses on <b>the quality of work life of employees working in Information Technology </b>based Companies.  It tries to determine the role played by the methods and procedures of Work Life Balance in organization success.  It is now generally accepted that quality of human capital and its capabilities is critical to the success of an organization.  An individual’s role in the family has undergone radical change and hence it is imperative that work and life be balanced accordingly.  Thus, Quality of work life has assumed much significance.  Thus, it is in the interest of organizations to include work-life balance programs as an organizational initiative.  Organizations are open to embracing such initiatives to enhance the capabilities of their employees.\r\n</p><p>This study attempts to interpret the Work life balance program being followed in a selected IT company ion order to determine further improvement in aspects of working conditions so as to enhance flexibility in work.  The study was conducted using primary and secondary data sources which include questionnaire, interview for primary data and company website, company manuals, journals, records and books.  The analysis concluded that the organization needs of further adopt employee-friendly procedures and facilities and provides the same to its employees in order to enhance the Quality of work life balance.\r\n</p><p>Key words: Quality of Work Life, Flexible working Hours, Job satisfaction, Family Satisfaction, Turbulent Business Conditions &amp; Software Companies.\r\n</p><p><br></p>','no_image.jpg','Nisha_journal_publication_1711954853.docx',NULL,NULL,NULL,1,2,1,3,'IJRTMR',1,1,3,15,NULL,'<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJRTMR Journal Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://ijrtmr.com/archives?year=2024&amp;volume=4&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link:<a href=\"https://fdrpjournals.org/ijrtmr/archives?year=2024&amp;volume=4&amp;issue=2\" target=\"_blank\"> </a><span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijrtmr/archives?year=2024&amp;volume=4&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>Crossref Link(DOI): <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/?from_ui=&amp;q=10.59256%2Fijrtmr.20240402006\" target=\"_blank\">Click Here</a></span> (Please check after 48 hrs.)<br></p>','paid-1',1,397,1,'2024-04-01 07:00:53','2024-04-02 06:29:00'),(401,1,399,NULL,'Centralized ERP application for drinking water distribution under various units and maintenance','<p>Many small distributers and shops are packing and distributing mineral waters under various units \r\n</p><p>and containers based on user requirements.Most of these business people are only using some manual \r\n</p><p>entries for stock maintenance and water distribution as they cannot afford an ERP software to \r\n</p><p>automate their process.Thus, we are planning to create a centralized ERP application to maintain the \r\n</p><p>stocks and distribution history along with the mode of transport, payment cycles, customer \r\n</p><p>maintenance etc which will help the micro business units to enhance their business in a better way.The \r\n</p><p>application will be having 2 users, Admin and Operator. Admin will be having the supreme rights \r\n</p><p>towards all the functionalities of the application which includes customer maintenance, stock \r\n</p><p>maintenance, operator maintenance, payment maintenance and logistics maintenance. Registered \r\n</p><p>operators will be working on the billing part and stock maintenance. The water available from \r\n</p><p>untreated sources such as well, Boreholes and Spring is generally not hygienic and safe for drinking. \r\n</p><p>Thus it is desirable and necessary to purify the water and supply under hygienic conditions for human \r\n</p><p>drinking purpose.To supply and securing of clean and sufficient drinking water for the \r\n</p><p>population,provision and securing of access to sanitation,improvement and restoration of soil quality \r\n</p><p>and thus, raising productivity rates,reducing the impact of natural hazards,improvement of the income \r\n</p><p>of the population with simultaneous regeneration of natural resources,improvement of infrastructure \r\n</p><p>for storage, transport and agricultural marketing,improvement of physical health and advancement of \r\n</p><p>environment.\r\n</p><p>Keywords: clean drinking water, Progressive web Application, DigitalMarketing, Safe \r\n</p><p>and Sanitation, User friendly, Enhancement of hygene</p>','no_image.jpg','IEEE_paper_(1)_1711955660.pdf',NULL,NULL,NULL,1,2,1,6,'INDJCST',1,1,3,5,NULL,NULL,NULL,0,399,NULL,'2024-04-01 07:14:20','2024-04-02 13:11:17'),(402,16,397,NULL,'ASSESSING THE EFFICIENCY OF LAST-MILE DELIVERY STRATERGIES OF ECOM EXPRESS','<p>The research work aims to study and analyze the efficiency of last-mile delivery strategy of Ecom Express. This research studies the delivery agent’s relationship with the customer and the accessibility of customer’s location and the attitude of delivery agent towards the delivery policy of Ecom Express. The research design used for this study is descriptive in nature. The descriptive study helps the researcher to find out various characteristics from the sample size of 102. The statistical tool used includes percentage analysis, Chi square, Anova and weighted average.</p>','no_image.jpg','suriya_journal_1711995660.docx',NULL,NULL,NULL,1,2,1,1,'IJIRE',1,1,3,15,NULL,'<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJIRE Journal Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://theijire.com/archives?year=2024&amp;volume=5&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijire/archives?year=2024&amp;volume=5&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>Crossref Link(DOI): <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/?from_ui=&amp;q=10.59256%2Fijire.20240502017\" target=\"_blank\">Click Here</a></span> (Please check after 48 hrs.)<br></p>',NULL,1,397,1,'2024-04-01 18:21:00','2024-04-02 12:36:38'),(403,16,406,NULL,'A STUDY ON EMPLOYEE SATISFACTION AT APOLLO PHARMACIES LIMITED','<p>The research project entitled ‘A STUDY ON EMPLOYEE SATISFACTION AT APOLLO PHARMACY LTD’ is an attempt to understand how effectively technology has improved and holds the strength and weakness. The sample size of the study is 105. The research design carried out of this study is descriptive research. Primary data are collected from the Workers, secondary data are gathered from published by someone else for a different purpose than your current research. The findings of the study were arrived at based on the analysis conducted. \r\n</p><p>Key Words: Analysis, Research \r\n</p><p><br></p>','no_image.jpg','Jorunal_Bhavana_(1)_1712045144.docx',NULL,NULL,NULL,1,2,1,6,'INDJCST',1,1,3,3,NULL,NULL,NULL,0,406,NULL,'2024-04-02 08:05:44','2024-04-02 09:55:20'),(404,11,407,NULL,'Evaluate the Effectiveness of Video Assisted Teaching Programme on Knowledge and Attitude towards Early Identification and Management of Polycysticovarian Syndrome among Adolescent Girls','<p>Polycystic ovarian syndrome (PCOS) is one of the most common\r\n</p><p>reproductive endocrinological disorders with a broad spectrum of clinical manifestations\r\n</p><p>affecting about 6-8% of women of reproductive years. The study was conducted to\r\n</p><p>evaluate the effectiveness of video assisted teaching programme on PCOS among\r\n</p><p>Adolescent’s girls at Puducherry. The aim of the study to evaluate the VATP on PCOS.\r\n</p><p>Methodology using quantitative approach quasi-experimental (one group pre-test post-\r\n</p><p>test) research design. A total of 65 subjects were selected for study by using probability\r\n</p><p>simple random sampling technique. Self-Structured questionnaire and modified attitude\r\n</p><p>scale regarding early identification and management of PCOS were used as the tool.\r\n</p><p>Results The findings revealed that in the pre-test, regarding the level of knowledge, in\r\n</p><p>adequate 19(29.2%),and moderate 45 (69.2%) had adequate, 1 (1.6%). had unfavourable\r\n</p><p>attitude 0(0%) ,moderate favourable 59(90.8%) of them favourable 6 (9.2%) . In the Post-\r\n</p><p>test, regarding the level of knowledge inadequate0 (0%) of them had moderate and 5\r\n</p><p>(7.7%) had adequate level oknowledge,97(97%) of them had favourable and 3(3%) had\r\n</p><p>moderate favourable attitude, regarding the practice, majority 65 (92.3%) . had unfavourable\r\n</p><p>attitude 0(0%) and moderate favourable 36(55.4) had favourable 29(44.6%).Conclusion\r\n</p><p>Study concluded that selective nursing intervention showed that the video assisted\r\n</p><p>teaching programme is effective to improve knowledge for students.\r\n</p><p>Key words: PCOS, VATP, Adolescents girls.\r\n</p><p><br></p><p>\r\n</p>','no_image.jpg','vnd.openxmlformats_officedocument.wordprocessingml.document_rendition=1_1712060186.docx',NULL,NULL,NULL,1,2,1,3,'IJRTMR',1,1,3,15,NULL,'<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJRTMR Journal Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://ijrtmr.com/archives?year=2024&amp;volume=4&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link:<a href=\"https://fdrpjournals.org/ijrtmr/archives?year=2024&amp;volume=4&amp;issue=2\" target=\"_blank\"> </a><span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijrtmr/archives?year=2024&amp;volume=4&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>Crossref Link(DOI): <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/?from_ui=&amp;q=10.59256%2Fijrtmr.20240402007\" target=\"_blank\">Click Here</a></span> (Please check after 48 hrs.)<br></p>','paid-2',0,407,1,'2024-04-02 12:16:26','2024-04-03 12:49:58'),(405,1,408,NULL,'Face Recognition','<p>Face recognition technology has gained significant attention in recent years due to its wide range of applications in various domains such as security, surveillance, biometrics, and human-computer interaction. This paper presents an overview of face recognition techniques, including traditional methods and modern deep learning approaches. Traditional methods typically involve feature extraction techniques such as principal component analysis (PCA), linear discriminant analysis (LDA), and local binary patterns (LBP), followed by classification algorithms like support vector machines (SVM) or nearest neighbor classifiers. In contrast, deep learning approaches, particularly convolutional neural networks (CNNs), have revolutionized the field by automatically learning discriminative features from raw pixel data. The paper discusses the challenges faced by face recognition systems, such as illumination variations, pose variations, occlusions, and aging, and explores how modern techniques address these challenges. Furthermore, the ethical considerations and privacy concerns associated with face recognition technology are also discussed. Finally, the paper concludes with a discussion on future directions and potential applications of face recognition technology in various domains.</p>','no_image.jpg','FACE_RECOGNITION_1_1712075257.docx',NULL,NULL,NULL,1,2,1,1,'IJIRE',1,1,2,5,NULL,NULL,NULL,0,408,NULL,'2024-04-02 16:27:37','2024-04-03 13:51:20'),(406,1,409,NULL,'FarmAssist : Comprehensive Scheme Recommendation System For Enhanced Farming','<p>India’s economy and employment are heavily reliant on agriculture. FarmAssist emerges as a groundbreaking digital platform, reshaping how farmers access and leverage agricultural support. This web-based tool stands at the forefront of facilitating farmers with custom-tailored recommendations for agricultural programs and real-time updates on farming news. At its essence, FarmAssist harnesses the power of advanced data processing techniques, including machine learning, to sift through and interpret a diverse range of data specific to each farmer, such as crop varieties, land extent, and local climatic conditions. This approach ensures the delivery of highly relevant and practical scheme suggestions directly applicable to each farmer’s unique situation. The interface of FarmAssist is crafted for simplicity and ease of use, ensuring that farmers of varying digital literacy can navigate and utilize the platform effectively. This aspect is crucial in diminishing the digital barriers commonly encountered in rural farming sectors. Moreover, FarmAssist incorporates a constantly updating feed of agricultural news, equipping farmers with cutting-edge knowledge and practices in the agricultural realm, thus fostering well-informed agricultural decisions and modern cultivation techniques.</p><p>Key Word: FarmAssist, Web-based Dashboard, Scheme Recommendation System, Crop Prediction, Precision Agriculture, Real Time Farming News, Weather Forecast.</p>','no_image.jpg','FarmAssist_IJRTMR_Manuscript_Template_1712081389.docx',NULL,NULL,NULL,2,2,1,3,'IJRTMR',2,1,1,15,NULL,'<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJRTMR Journal Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://ijrtmr.com/archives?year=2024&amp;volume=4&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijrtmr/archives?year=2024&amp;volume=4&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>Crossref Link(DOI):<a href=\"https://search.crossref.org/?from_ui=&amp;q=10.59256%2Fijrtmr.20240402008\" target=\"_blank\"> </a><span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/?from_ui=&amp;q=10.59256%2Fijrtmr.20240402008\" target=\"_blank\">Click Here</a></span><a href=\"https://search.crossref.org/?from_ui=&amp;q=10.59256%2Fijrtmr.20240402008\" target=\"_blank\"> (</a>Please check after 48 hrs.)<br></p>','paid-2',1,409,1,'2024-04-02 18:09:49','2024-04-04 10:21:19'),(408,2,410,NULL,'DONATION CAMPAIGN','<p>In today\'s dynamic world, community development stands as a cornerstone for societal progress. However, numerous communities around the globe face various challenges hindering their growth and well-being. In response, our project aims to launch a donation campaign focused on addressing these challenges and fostering sustainable development within underserved communities. Through strategic planning and community engagement, we aspire to make a meaningful impact and create positive change on a grassroots level. \r\n</p><p>The donation campaign seeks to address pressing issues such as poverty, education gaps, healthcare deficiencies, and environmental degradation within marginalized communities. By providing targeted assistance and resources, we aim to uplift these communities and empower individuals to break the cycle of poverty.\r\n</p><p>&nbsp;The primary objective of the campaign is to mobilize resources and support from individuals, businesses, and organizations to fund initiatives that promote community development. These initiatives include but are not limited to providing access to education, healthcare services, clean water, sustainable livelihood opportunities, and environmental conservation efforts. Our campaign targets individuals and entities passionate about social impact and community development. This includes philanthropists, corporate entities with corporate social responsibility (CSR) initiatives, foundations, and individuals looking to make a difference in the lives of others. \r\n</p><p>&nbsp;The campaign will employ a multi-faceted approach, utilizing various communication channels such as social media, traditional media, community events, and partnerships with local organizations to raise awareness and solicit donations. We will also leverage technology to facilitate easy and secure donation processes, ensuring transparency and accountability. The campaign will be executed in phases, starting with a comprehensive needs assessment to identify priority areas within target communities. Following this, fundraising activities will be initiated, alongside community engagement efforts to ensure buy-in and participation from local stakeholders. Funds raised will be allocated towards implementing sustainable solutions tailored to the specific needs of each community. \r\n</p><p>Our donation campaign for community development represents a concerted effort to address systemic challenges faced by marginalized communities. By harnessing the collective power of donors and stakeholders, we aim to foster inclusive growth and create a brighter, more sustainable future for all. Join us in making a meaningful difference and building stronger, more resilient communities.\r\n</p><p><br></p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p>','no_image.jpg','Lakshmanan_Paper_1712138589.docx',NULL,NULL,NULL,1,2,1,6,'INDJCST',1,1,3,15,NULL,'<p><span style=\"color: rgb(0, 0, 255);\"><b>Published Article Details:</b></span><br><br>IndJCST Journal Link: <span style=\"background-color: rgb(255, 255, 0);\"><a href=\"https://indjcst.com/archives?year=2024&amp;volume=3&amp;issue=1\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link:<a href=\"https://fdrpjournals.org/indjcst/archives?year=2024&amp;volume=3&amp;issue=1\" target=\"_blank\"> </a><span style=\"background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/indjcst/archives?year=2024&amp;volume=3&amp;issue=1\" target=\"_blank\">Click Here</a></span><br><br>Crossref Link(DOI): <span style=\"background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/?from_ui=&amp;q=10.59256%2Findjcst.20240301007\" target=\"_blank\">Click Here</a></span> (Please check after 48 hrs.)<br></p>','paid-2',1,410,1,'2024-04-03 10:03:09','2024-04-05 08:24:02'),(409,1,411,NULL,'Eyes of Authenticity: Document Forgery Detection using  Siamese and OCR Techniques','<p>In an era marked by the widespread adoption of numerous digital tools and techniques, combating digital&nbsp;<span style=\"font-size: 0.875rem;\">crimes like the fraudulent replication or forgery of official documents has emerged as a formidable task. This&nbsp;</span><span style=\"font-size: 0.875rem;\">has become feasible due to technological progress, enabling easy alteration of documents. Every aspect, such&nbsp;</span><span style=\"font-size: 0.875rem;\">as official seals, signatures, and text, can be tampered with. Consequently, both public and private sectors are&nbsp;</span><span style=\"font-size: 0.875rem;\">experiencing significant losses in time and resources. In such a situation, it becomes crucial to employ different&nbsp;</span><span style=\"font-size: 0.875rem;\">methodologies to identify and examine irregularities within the inherent characteristics of the document image.&nbsp;</span><span style=\"font-size: 0.875rem;\">By using, different image processing approaches designed to identify instances of document forgery, with the&nbsp;</span><span style=\"font-size: 0.875rem;\">goal of curbing these unlawful practices. The primary objective is forgery detection to optimize the retrieval of </span><span style=\"font-size: 0.875rem;\">information from manipulated photographs and documents, especially in cases involving noisy and post-processed&nbsp;</span><span style=\"font-size: 0.875rem;\">image documents.</span></p>','no_image.jpg','Research_paper_1712145032.pdf',NULL,NULL,NULL,1,2,1,1,'IJIRE',2,1,2,5,NULL,NULL,NULL,0,411,NULL,'2024-04-03 11:50:32','2024-04-05 04:29:05'),(412,2,412,NULL,'Emotional Intelligence in Academic Decision-Making: A Systematic Review of Sentiment Mining Approaches','<p>This study aims to investigate and understand the importance of the intersection of Emotional Intelligence and academic decision-making through a systematic review of sentiment mining approaches. Recognizing the pivotal role of emotions in shaping educational choices, this paper explores the theoretical foundations of emotional intelligence and the integration of sentiment-mining methodologies within academic contexts. In this study, an extensive literature review is conducted focusing on emotional intelligence within the education sector, as well as exploring sentiment mining approaches. In the existing literature review, the researchers have introduced various machine learning and lexicon-based techniques, significantly contributing to the advancement of emotional intelligence in the education sector for higher studies. The findings contribute to the role of emotional intelligence in shaping academic decisions, providing valuable insights for educational practitioners. This study shows a direct relationship between emotional intelligence and decision-making within the educational sector.</p>','no_image.jpg','Paper_V0.1_Final_14032024_1712152456.docx',NULL,NULL,NULL,1,2,1,6,'INDJCST',2,1,2,5,NULL,NULL,NULL,0,412,NULL,'2024-04-03 13:54:16','2024-04-05 04:30:00'),(418,1,414,NULL,'Enhancing Decision-Making in Restaurant Selection: Predictive Modeling and Business Intelligence for Zomato Reviews','<p>In this paper, We want to predict restaurant reviews on Zomato platform using machine learning based classification algorithms. Zomato is a popular online platform for discovering and reviewing restaurants. Using a rich dataset from Zomato that includes features such as location, cuisine type, price range, and user reviews, We aims to build a predictive model that can accurately classify restaurants into review categories. This paper includes data preprocessing, feature engineering, model selection and evaluation to determine the most efficient classification algorithm. The use of predictive modeling and business intelligence to improve decision-making in restaurant selection on Zomato, a popular online review platform. The authors leverage Zomato\'s rich user-generated review data to develop a model that can predict the helpfulness of reviews. Using these inputs, the provided model predicts the restaurant\'s rating based on the features provided. The interface is intuitive and easy to use. Users simply enter relevant information about the restaurant they are interested in and the app quickly creates a forecast. Additionally, the interface may contain visualizations or informative displays to improve the user\'s understanding of the forecasting process. Our paper provide zomato users with valuable information to make effective nutritional decisions.</p><p>Keywords: Classification algorithms, Predictive modelling,Business intelligence,<span style=\"font-size: 0.875rem;\">Decision-making</span></p><p><br></p>','no_image.jpg','zomato_(2)_1712202782.docx',NULL,NULL,NULL,1,2,2,1,'IJIRE',1,1,2,16,NULL,NULL,NULL,0,414,NULL,'2024-04-04 03:53:02','2024-04-11 09:08:55'),(422,1,416,NULL,'Optimization of process parameters for Turning operation on d3 die steel','<p>Abstract: This research aims to determine the optimal Surface Roughness for machining D3 die steel alloy with uncoated carbide inserts. It will do this by studying the most efficient turning parameters, such as cutting speed, feed, and depth of cut.  Models have been generated using a variety of statistical modeling approaches, including Genetic Algorithm with Response Surface Methodology. This research aimed to use the regression technique to develop a model that could predict surface roughness. It has also been investigated if the Taguchi Technique may be used to optimize process parameters. To decide the primary boundaries affecting Surface Unpleasantness, we used Signal-to-Noise (S/N) ratio and Analysis of Variance (ANOVA) tests. This paper aims to contribute valuable insights into achieving the best Surface Roughness outcomes in the machining process for D3 die steel alloy with Uncoated Carbide Inserts. The utilization of Genetic Algorithm and Response Surface Methodology showcases a robust approach for modelling intricate parameter interactions. If you know the values of the parameters, you may use the Regression Technique to forecast the surface roughness. Process parameter optimization may be made more systematic with the use of the Taguchi Technique.</p><p><br></p><p>Keywords - Turning operation, Surface Roughness, Mathematical Model, ANOVA, Taguchi Technique.</p><p><br></p>','no_image.jpg','Optimization_of_Process_Parameters_for_Turning_Operation_on_D3_Die_Steel_1712208449.docx',NULL,NULL,NULL,1,2,1,1,'IJIRE',1,1,2,5,NULL,NULL,NULL,0,416,NULL,'2024-04-04 05:27:29','2024-04-05 04:33:31'),(425,2,417,NULL,'GLOBEGLIDER','<p>Globeglider Tours and Travels aims to revolutionize the travel industry by offering a comprehensive platform that integrates seamless booking experiences, personalized trip planning, and cutting-edge travel recommendations. With an emphasis on leveraging advanced AI algorithms and machine learning techniques, Globeglider seeks to redefine the way travelers discover, plan, and embark on their journeys. Our platform will provide users with a holistic travel solution, from browsing destinations to booking accommodations, transportation, and activities, all tailored to their preferences and interests.\r\n</p><p>&nbsp;Globeglider\'s mission is the commitment to enhancing the traveler\'s experience through innovative technology and curated content. By harnessing vast datasets and employing sophisticated algorithms, our platform will deliver personalized recommendations for destinations, activities, and experiences based on each user\'s unique profile and past travel behavior. Additionally, Globeglider will offer real-time assistance and support throughout the travel journey, ensuring a seamless and stress-free experience from start to finish.\r\n</p><p>In an ever-evolving travel landscape, Globeglider stands poised to empower travelers with the tools and resources needed to make informed decisions and create unforgettable experiences. With a focus on user-centric design, technological innovation, and unparalleled customer service, Globeglider aspires to become the go-to platform for travelers worldwide, facilitating seamless exploration, discovery, and adventure across the globe.\r\n</p><p>Globeglider sets itself apart by prioritizing sustainability and responsible tourism practices. In an era where environmental conservation and ethical travel are paramount concerns, our platform will actively promote eco-friendly travel options, support local communities, and advocate for the preservation of cultural heritage sites. Through partnerships with eco-conscious suppliers and community-based tourism initiatives, we aspire to minimize the carbon footprint of travel while maximizing positive socio-economic impacts on host destinations.\r\n</p><p>At the heart of GlobeGlider is a commitment to fostering a sense of exploration and connection among travelers. The application incorporates a user-centric approach, allowing individuals to customize their journeys based on preferences, interests, and travel goals. GlobeGlider not only streamlines the logistics of travel but also enhances the overall experience by offering curated suggestions, insider tips, and interactive maps. By combining convenience with a touch of adventure, GlobeGlider aims to empower users to embark on journeys that are not just destinations but transformative moments in their lives.\r\n</p><p><br></p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p>','no_image.jpg','Abinaya_paper_1712210003.docx',NULL,NULL,NULL,1,2,1,6,'INDJCST',1,1,3,15,NULL,'<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IndJCST Journal Link:<a href=\"https://indjcst.com/archives?year=2024&amp;volume=3&amp;issue=1\" target=\"_blank\"> </a><span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://indjcst.com/archives?year=2024&amp;volume=3&amp;issue=1\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/indjcst/archives?year=2024&amp;volume=3&amp;issue=1\" target=\"_blank\">Click Here</a></span><br><br>Crossref Link(DOI): <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/?from_ui=&amp;q=10.59256%2Findjcst.20240301006%09\" target=\"_blank\">Click Here</a></span> (Please check after 48 hrs.)<br></p>','paid-2',1,417,1,'2024-04-04 05:53:23','2024-04-04 13:35:24'),(443,2,420,NULL,'IPL WIN PROBABILITY PREDICTOR','<p><span style=\"font-size: 10px;\">One of the most exciting outdoor games that reached everyone heart is cricket. There are several series held and one among that created a magnificent history in the arena of sports is Indian Premier League (IPL). It has reached its popularity with successful brand in the world of sports and usually will be conducted among 8 teams. This proposed paper is specifically concentrating on enactment and measuring the difference between the models to foretell the captivating team of an IPL match. Data is accessed by the computer programs developed using Machine learning to build models. As of now, data analysis is need for each and every fields to examine the sets of data to extract the useful information from it and to draw conclusion and as well make decisions according to the information. The algorithm first analyses the data to create a model, specifically for understanding the patterns or trends. For creating the mining model, the model is optimized by selecting parameters and iterating. To extract actionable patterns and detailed statistics, the parameters are then fed into the dataset. This work focuses on finding the meaningful information about the IPL Teams by using the functions of R Package. R reduces the complexity of data analysis as it displays the analysis results in the form of visual representations. The dataset is loaded and a set of pre-processing is done followed by feature selection. Four machine learning algorithms Decision Tree, Naive Bayes, K-Nearest Neighbour and Random Forest are applied and the results are compared to measure the accuracy, precision, recall and sensitivity.&nbsp;</span></p>','no_image.jpg','RESEARCH_PAPER_1712241830.docx',NULL,NULL,NULL,1,2,1,6,'INDJCST',3,1,1,5,NULL,NULL,NULL,0,420,NULL,'2024-04-04 14:43:50','2024-04-06 03:51:14'),(444,15,422,NULL,'Tradition Meets Trend: Exploring Consumer Behaviour toward Branded Apparel in Varanasi','<p>The study aims to investigate the association between festivals and choices regarding branded apparel, the influence of traditional values and cultural symbolism on consumer decision-making, and the role of social networks and peer influence in shaping preferences. A mixed-methods approach, integrating qualitative and quantitative methodologies, is employed to capture the complexity of cultural and social dynamics. The study adopts a concurrent triangulation design, ensuring comprehensive data collection and analysis. A sample size of 250 participants is utilized to balance statistical robustness and qualitative depth. Findings reveal significant associations between festivals, traditional values, and consumer preferences, underscoring the importance of understanding cultural nuances in marketing strategies. Recommendations include incorporating qualitative methods and further exploring the impact of social networks on consumer behavior. Overall, the study provides valuable insights for businesses and marketers seeking to navigate the dynamic landscape of consumer preferences in Varanasi\'s cultural context.</p><p><br></p><p>Keywords: Consumer Behavior, Branded Apparel, Cultural Influences, Traditional Values, Marketing Strategies</p><p><br></p>','no_image.jpg','Tradition_Meets_Trend__Exploring_Consumer_Behaviour_towards_Branded_Apparels_in_Varanasi_1_1712252291.docx',NULL,NULL,NULL,1,2,1,3,'IJRTMR',1,1,2,15,NULL,'<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJRTMR Journal Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://ijrtmr.com/archives?year=2024&amp;volume=4&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link: <span style=\"color: rgb(0, 0, 255);\"><span style=\"background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijrtmr/archives?year=2024&amp;volume=4&amp;issue=2\" target=\"_blank\">Click Here</a></span><br></span><br>Crossref Link(DOI):<a href=\"https://search.crossref.org/search/works?q=10.59256%2Fijrtmr.20240402009&amp;from_ui=yes\" target=\"_blank\"> </a><span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/search/works?q=10.59256%2Fijrtmr.20240402009&amp;from_ui=yes\" target=\"_blank\">Click Here</a></span> (Please check after 48 hrs.)<br></p>','paid-2',1,422,1,'2024-04-04 17:38:11','2024-04-08 08:30:44'),(445,15,421,NULL,'The Zombie Fungus: Exploring the Intricate Intersection of Religion and Society in India','<p>This thesis delves into the multifaceted relationship between religion and various aspects of Indian society. Drawing an8\\ analogy with the zombie ant, we examine how some individuals get caught in a \"religious fungus\", leading to divisive beliefs and practices. This paper examines the impact of religion on politics, social norms, education and employment on, shedding light on the challenges and challenges faced by modern India.\r\n</p><p>The study also influences the role of religion in shaping moral and social norms, gender roles, marriage and daily rituals. This highlights the profound influence of religion on art and culture, manifested in architectural wonders and cultural traditions. In addition, the paper examines how religion has historically influenced and shaped politics in India. Education, an important pillar of society, becomes a focus for integrating religious values into the curriculum, with positive and negative consequences. \r\n</p><p>This paper highlights the complex and evolving relationship between religion and Indian society. It emphasizes the historical importance of religious values as they respond to contemporary challenges, especially with regard to minority rights. As India navigates a complex terrain of religion, culture and society, this paper offers valuable insights and a deeper understanding of these multifaceted developments.\r\n</p><p><b>Keywords</b>: <i>Religion, India, Society, Politics, Education\r\n</i></p><p><br></p>','no_image.jpg','Research_Paper_1712297056.docx',NULL,NULL,NULL,1,2,1,3,'IJRTMR',1,1,1,15,NULL,'<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJRTMR Journal Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://ijrtmr.com/archives?year=2024&amp;volume=4&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijrtmr/archives?year=2024&amp;volume=4&amp;issue=2\" target=\"_blank\">Click Here</a></span><br></p>','paid-1',1,421,1,'2024-04-05 06:04:16','2024-04-08 16:17:02'),(446,13,424,NULL,'An analysis of Fibonacci and Golden Ratio in Human body','<p>Pythogoras, plato and Euclid’s paved the way for classical geometry. The idea of shapes that can be mathematically defined by equations led to the creation of great structures of modern and ancient civilizations and milestone in mathematics and science. However, the classical geometry fails to explain the complexity of non-linear shapes replete in nature such as the curvature of a flower or the wings of a butterfly.\r\n</p><p>•	Such phenomenon non-linearity can be explained by the fractal geometry which creates the shapes that emulate those found in nature with remarkable accuracy. Fibonacci sequence may establish in origin for such a development.\r\n</p><p>•	theobservationoftheFibonaccisequenceisexistenceinalmostallaspectsoflikeranging from leaves of a fern tree, architecture and even paintings makes its highly unlikely to be a stochastic phenomenon. Despite its wide spread occurrence and existence, the Fibonacci sequence and the rule of golden proportion has been widely documented in the human body. This paper analysis the observed documentation of Fibonacci and golden ratio in human body.\r\n</p><p><br></p><p>\r\n</p>','no_image.jpg','Research_Article__Kalpana_1712303869.docx',NULL,NULL,NULL,1,2,1,3,'IJRTMR',2,1,1,15,NULL,'<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJRTMR Journal Link: <span style=\"color: rgb(0, 0, 255);\"><span style=\"background-color: rgb(255, 255, 0);\"><a href=\"https://ijrtmr.com/archives?year=2024&amp;volume=4&amp;issue=2\" target=\"_blank\">Click Here</a></span><br></span><br>FDRP Website Link:<span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"> <a href=\"https://fdrpjournals.org/ijrtmr/archives?paperid=6274104425429221952\" target=\"_blank\">Click Here</a></span><br><br><br></p>','paid-1',1,424,1,'2024-04-05 07:57:49','2024-04-10 10:34:56'),(447,11,400,NULL,'Effectiveness  of structured teaching programme on knowledge of preventive measures of low back pain among second year B.Sc. Nursing students in selected nursing college at Bangalore','<p>Lower back pain is universally common issue. It can be experienced at any age, and most people experience at least once in their life.  Low back pain (LBP) describes pain between the lower edge of the ribs and the buttock. The first episode usually occurs between early years of age. Nurses are vulnerable and ignored  so they must supposed to be knowledgeable about the risk factors and preventive measures and effectively apply it into practice to prevent them from sustaining back injuries. Pain often gets better with rest, physical therapy and medication. Reduce your risk of low back pain by keeping at a healthy weight and staying active. Hence different treatments are available for it but knowledge and primary prevention is essential as core for any. This study done on a total of 50 second  year B.Sc nursing students were selected in a college The study reveals that the structured teaching programme could increase the knowledge level of student nurse and it should be an on-going process. The findings of the present study have implications for Nursing practice like clinical instructor should expertise in assisting the student nurses to improve the knowledge about preventive measures of low back pain</p>','no_image.jpg','Research_Article_srinivasSS_1712304004.docx',NULL,NULL,NULL,2,2,1,3,'IJRTMR',1,1,3,15,NULL,'<p><b>Published Article Details:</b><br><br>IJRTMR Journal Link:<span style=\"background-color: rgb(255, 255, 0);\"> <a href=\"https://ijrtmr.com/archives?year=2024&amp;volume=4&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link: <span style=\"background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijrtmr/archives?year=2024&amp;volume=4&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>Crossref Link(DOI): <span style=\"background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/?from_ui=&amp;q=10.59256%2Fijrtmr.20240402010\" target=\"_blank\">Click Her</a></span><a href=\"https://search.crossref.org/?from_ui=&amp;q=10.59256%2Fijrtmr.20240402010\" target=\"_blank\">e</a> (Please check after 48 hrs.)<br></p>','paid-2',1,400,1,'2024-04-05 08:00:04','2024-04-08 10:14:15'),(448,1,428,NULL,'Talking Hands: Speech To Sign Language Converter','<p>Deaf people face communication challenges in many aspects of their lives. This project proposes a speech-to-sign language converter that can help to bridge the communication gap between deaf and hearing people. The converter would use speech recognition technology to transcribe spoken language into text. This text would then be translated into sign language images or GIFs. The images or GIFs would be displayed on a screen, allowing deaf people to easily understand the message. The converter would be designed to be as accurate and user-friendly as possible. It would also be customizable to support different sign languages. This project has the potential to make a significant impact on the lives of deaf people. It could help them to communicate more effectively in school, at work, and in social settings. It could also help to break down communication barriers and foster greater understanding between deaf and hearing people. The converter would be developed using a variety of technologies, including speech recognition, machine translation, and image processing. The objective of our project is to reduce the communication gap between normal people and disabled people by providing a virtual animation translator for sign language.\r\n</p><p>Keywords: Speech-recognition, speech-to-sign-language, machine learning, NLP, communication challenge\r\n</p><p><br></p><p>\r\n</p>','no_image.jpg','Talking_Hands_Speech_To_Sign_Language_Converter_1712384441.docx',NULL,NULL,NULL,1,2,1,6,'INDJCST',1,1,1,5,NULL,NULL,NULL,0,428,NULL,'2024-04-06 06:20:41','2024-04-07 19:09:03'),(449,1,430,NULL,'Investigation on Utilization of Medical Waste Ash in Concrete','<p>There is a major problem in India for generation of biomedical waste from health care units, research laboratories, clinics and other medical sources. Generation of waste adversely affect the whole environment for human being. Therefore Utilization of medical waste ash is a challenging work for all over India. Some researches revealed the scope for the use of medical waste ash in concrete as partly replacing of cement. In this paper the study describes the workability, density and compressive strength of concrete after partly replacing of cement with medical waste ash. \r\n</p><p>Key words: Medical waste, ash, concrete, coarse, aggregate, workability\r\n</p><p><br></p>','no_image.jpg','Investigation_on_Utilization_of_Biomedical_Waste_Ash_in_Concrete__new_1713289669.docx',NULL,NULL,NULL,2,2,1,1,'IJIRE',1,1,1,15,NULL,'<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJIRE Journal Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://theijire.com/archives?paperid=667816884961066157\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link:<span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"> <a href=\"https://fdrpjournals.org/ijire/archives?year=2024&amp;volume=5&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>Crossref Link(DOI): <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/?from_ui=&amp;q=10.59256%2Fijire.20240502031\" target=\"_blank\">Click Here</a></span><a href=\"https://search.crossref.org/?from_ui=&amp;q=10.59256%2Fijire.20240502031\" target=\"_blank\"> </a>(Please check after 48 hrs.)<br></p>','paid-2',0,430,1,'2024-04-06 11:11:11','2024-04-18 04:39:36'),(450,1,429,NULL,'Review on Advancements in the Production of Artificial Aggregates from Industrial Byproducts: A Sustainable Solution for Infrastructure Development','<p>&nbsp;This review paper explores the burgeoning interest in artificial aggregates as sustainable alternatives to traditional construction materials, driven by concerns over resource depletion and environmental degradation. It comprehensively examines recent advancements, challenges, and future prospects in this field. Beginning with an overview of the imperative for alternative aggregates in construction, the paper discusses various types of artificial aggregates sourced from industrial by-products, recycled materials, and innovative manufacturing processes. It delves into their mechanical, physical, and environmental properties, contrasting them with natural aggregates, and evaluates the impact of production techniques like sintering, foaming, and chemical activation on their performance. Environmental sustainability aspects, including carbon footprint reduction and waste management, are rigorously analyzed, underscoring the potential of artificial aggregates to mitigate ecological impacts associated with conventional extraction and processing methods. Addressing hurdles to widespread adoption, such as technological barriers and economic viability, the review proposes strategies for overcoming these challenges and outlines future research directions to optimize artificial aggregates\' properties and applications. In conclusion, this review offers valuable insights into the state-of-the-art developments in artificial aggregate technology, highlighting their pivotal role in advancing sustainability and resilience within the construction sector.</p><p>Key Word: Artificial aggregates, Sustainable construction materials, Environmental impact, Recycling, Waste utilization.</p>','no_image.jpg','Review_on_Advancements_in_the_Production_of_Artificial_Aggregates_from_Industrial_Byproducts__A_Sustainable_Solution_for_Infrastructure_Development_1712402490.docx',NULL,NULL,NULL,2,2,1,2,'IJSREAT',2,1,1,15,NULL,'<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJSREAT Journal Link: <span style=\"background-color: rgb(255, 255, 0);\"><a href=\"https://ijsreat.com/archives?year=2024&amp;volume=4&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link:<span style=\"background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijsreat/archives?year=2024&amp;volume=4&amp;issue=2\" target=\"_blank\"> Click Here</a></span><br><br>Crossref Link(DOI): <span style=\"background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/search/works?q=10.59256%2Fijsreat.20240402014&amp;from_ui=yes\" target=\"_blank\">Click Here</a></span><a href=\"https://search.crossref.org/search/works?q=10.59256%2Fijsreat.20240402014&amp;from_ui=yes\" target=\"_blank\"> </a>(Please check after 48 hrs.)<br></p>','paid-2',1,429,1,'2024-04-06 11:21:30','2024-04-08 07:51:35'),(461,2,43,NULL,'sfsdfsdfsdfsdfsdfsdf','<p>sdfsfs<br></p>','no_image.jpg',NULL,NULL,NULL,NULL,1,2,1,2,'IJSREAT',1,1,1,1,NULL,NULL,NULL,0,43,NULL,'2024-04-08 07:25:44','2024-04-08 07:25:44'),(462,1,433,NULL,'Empowering Nonverbal Communication: A Comprehensive Examination of Sign Language Recognition Systems and Implementation of Interpretation','<p>This paper provides a analysis of previous research on sign language recognition systems and their impact on Providing meaningful interaction among non-verbal individuals. It introduces a real-time sign language interpreter that translates text into gestures and vice-versa, accommodating regional sign languages and promoting personal expression. In a manner distinct from previous systems, it emphasizes individualization and includes text chat features for seamless communication. By enabling users to create and share their own gestures, it Promotes cultural diversity and authentic self-expression, promoting inclusivity and empowerment within the non-verbal community. This innovative solution also alleviates the pressure on non-verbal communication users to perform gestures in front of a camera for accurate recognition, addressing issues with outdated sign languages and the lack of personal sign gestures.</p>','no_image.jpg','Gesture_Voice_1712564043.docx',NULL,NULL,NULL,1,2,1,1,'IJIRE',1,1,1,15,NULL,'<p><span style=\"color: rgb(0, 0, 255);\"><b>Published Article Details:</b></span><br><br>IIJRE Journal Link: <span style=\"background-color: rgb(255, 255, 0);\"><a href=\"https://theijire.com/archives?year=2024&amp;volume=5&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link: <span style=\"background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijire/archives?year=2024&amp;volume=5&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>Crossref Link(DOI): <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/search/works?q=10.59256%2Fijire.20240502029&amp;from_ui=yes\" target=\"_blank\">Click Here </a></span>(Please check after 48 hrs.)<br></p>',NULL,1,433,1,'2024-04-08 08:14:03','2024-04-13 14:46:31'),(463,4,435,NULL,'Creating Innovative Business Models: A stepping stone towards achieving Sustainable Development Goals','<p>Business model innovation is recognized as a crucial catalyst in achieving the United Nations Sustainable Development Goals (SDGs). Simultaneously, the SDGs themselves provide valuable support to organizations by guiding their identification and pursuit of opportunities for business model innovation. This study adopts a constructive research method to construct a managerial approach that facilitates business model innovation aligned with the SDGs.\r\n</p><p>The proposed approach empowers organizations to evaluate their contributions to the SDGs, explore and prioritize SDG-focused business opportunities, and effectively address associated risks. By integrating the SDGs into their business strategies, organizations can proactively stimulate innovative practices that advance sustainable development.\r\n</p><p>Participatory action research serves as the foundation for developing this approach. Collaborating with two companies operating in the medical and educational sectors, the study actively engages stakeholders in shaping the strategy. Subsequently, the approach is applied to Ørsted, a multinational power company firmly committed to sustainability-driven business transformation and striving to make a significant impact on SDG 7 (Affordable and clean energy) and SDG 13 (Climate action).\r\n</p><p>The study\'s significance lies in furthering both academic and practical discussions on business model innovation for sustainability. It enriches the knowledge landscape by shedding light on how organizations can effectively leverage the SDGs to stimulate business model innovations with a sustainable focus.\r\n</p><p><br></p>','no_image.jpg','Reserach_Paper_1712574154.doc',NULL,NULL,NULL,1,2,1,3,'IJRTMR',2,1,1,5,NULL,NULL,NULL,0,435,NULL,'2024-04-08 11:02:34','2024-04-09 18:31:13'),(464,1,43,NULL,'testing purpose','<p>vgfgfg<br></p>','no_image.jpg',NULL,NULL,NULL,NULL,1,2,1,5,'INDJECE',1,1,1,6,NULL,NULL,NULL,0,43,NULL,'2024-04-08 15:53:10','2024-04-08 16:09:27'),(466,1,321,NULL,'Performance analysis of routing protocol of an efficient data transmission in WSN communication','<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<span style=\"font-size: 18px;\"> “Performance Analysis for routine protocols for an efficient data transmission in 5G WSN&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;communication”\r\n</span></p><p><span style=\"font-size: 18px;\">\r\n</span></p><p><br></p><p><b>Ms. Sushmita Kamble&nbsp;</b> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<b> Prof. Rohini Pochhi(H.O.D)&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; </b>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <b>&nbsp; &nbsp; Dr. Pravin Tajane\r\n</b></p><p>Kamblesushmita1994@gmail.com&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;rohini.ece@tgpcet&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;pravin.ece@tgpcet.com \r\n</p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<span style=\"font-size: 18px;\">Department of Electronics &amp; Communication Engineering\r\n</span></p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Tulsiramji Gaikwad-Patil College of Engineering &amp; Technology, Nagpur-441108\r\n</p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <span style=\"font-size: 18px;\">&nbsp;ABSTRACT</span>\r\n</p><p>This comprehensive report delves into the intricate realm of 5G Wireless Sensor Network (WSN) communication, scrutinizing the efficacy of routine protocols for seamless data transmission. Formulated as part of the M.Tech program in Electronics and Communication Engineering at Tulsiramji Gaikwad-Patil College of Engineering &amp; Technology, the study navigates through the inherent limitations of WSNs—energy, storage capacity, and power consumption—emphasizing the critical role these factors play in selecting routing protocols. Categorized into data-centric, hierarchical, and location-based protocols, the research employs various metrics to evaluate their performance. The overarching goal is to optimize these protocols based on the analysis, fostering a substantial enhancement in the efficiency and lifespan of WSNs. As we step into the 5G era, this exploration becomes pivotal, contributing valuable insights to the evolving landscape of wireless communication.\r\n</p><p><br></p><p>\r\n</p><p>\r\n</p><p>\r\n</p>','no_image.jpg','sush_paper_1712645348.docx',NULL,NULL,NULL,1,2,1,1,'IJIRE',1,1,1,15,NULL,'<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJIRE Journal Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://theijire.com/archives?year=2024&amp;volume=5&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijire/archives?year=2024&amp;volume=5&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>Crossref Link(DOI): <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/?from_ui=&amp;q=10.59256%2Fijire.20240502026\" target=\"_blank\">Click Here</a></span> (Please check after 48 hrs.)<br></p>','paid-2',1,321,1,'2024-04-09 06:49:08','2024-04-13 07:50:29'),(467,4,422,NULL,'Supply Chain Resilience: Adapting to Global Disruptions and Uncertainty','<p>In an increasingly interconnected world, supply chain resilience has emerged as a critical factor for businesses to navigate disruptions and uncertainty. This paper delves into the dynamic landscape of supply chain management, emphasizing the need for organizations to adapt and fortify their operations against a myriad of challenges, ranging from natural disasters to geopolitical tensions and pandemics. Drawing on a comprehensive review of existing literature and real-world case studies, this research explores the key components of supply chain resilience and identifies best practices for building robust systems. It examines the role of technology, collaboration, and risk management strategies in enhancing resilience across various industry sectors. Furthermore, this paper sheds light on the impact of recent global disruptions, such as the COVID-19 pandemic, on supply chains worldwide, highlighting both the vulnerabilities exposed and innovative responses adopted by organizations. A nuanced analysis elucidates the lessons learned and opportunities for improvement in supply chain resilience frameworks. By synthesizing insights from academia and industry, this study offers practical recommendations for executives and policymakers to bolster supply chain resilience in an era characterized by volatility and complexity. It underscores the imperative for proactive measures, agile strategies, and continuous monitoring to mitigate risks and ensure operational continuity in the face of uncertainty. Ultimately, this research contributes to a deeper understanding of supply chain resilience as a strategic imperative, empowering organizations to thrive amidst global disruptions and safeguard the flow of goods and services in an interconnected global economy.</p><p>Keywords: Supply Chain Resilience, Global Disruptions, Uncertainty, Risk Management, Adaptive Strategies</p><p><br></p>','no_image.jpg','Supply_Chain_Resilience__Adapting_to_Global_Disruptions_and_Uncertainties_1712654053.docx',NULL,NULL,NULL,1,2,1,1,'IJIRE',1,1,2,15,NULL,'<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJIRE Journal Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://theijire.com/archives?year=2024&amp;volume=5&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link:<a href=\"https://fdrpjournals.org/ijire/archives?year=2024&amp;volume=5&amp;issue=2\" target=\"_blank\"> </a><span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijire/archives?year=2024&amp;volume=5&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>Crossref Link(DOI): <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/?from_ui=&amp;q=10.59256%2Fijire.20240502025\" target=\"_blank\">Click Here</a></span> (Please check after 48 hrs.)<br></p>','paid-2',1,422,1,'2024-04-09 09:14:13','2024-04-11 12:23:51'),(468,1,437,NULL,'Crop Yield Prediction','<p>Everyone in India is aware that agriculture is the foundation of our nation. This article forecasts the output of nearly every crop cultivated or farmed in India. Using basic variables like State, District, Season, and Area, the user of this script can forecast the crop\'s yield for the year they wish to grow or produce it. The Random Forest Algorithm (RFA) of Supervised Learning and the idea of regression to enhance the algorithms are two examples of sophisticated regression approaches used in the study to forecast the yield. While there is still much to be done in many disciplines, technological breakthroughs have already shown improvements in numerous areas. It will show the ratio of the soil\'s phosphorus, potassium, and nitrogen levels.</p><p><span style=\"font-size: 0.875rem;\">Key Word: Farming, Machine Learning Techniques, Indian Agriculture, Random Forest Algorithm, Proper Yield</span></p><p><br></p>','no_image.jpg','Crop_Yield_Prediction_1712688326.docx',NULL,NULL,NULL,1,2,1,1,'IJIRE',1,1,1,15,NULL,'<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJIRE Journal Link:<span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://theijire.com/archives?year=2024&amp;volume=5&amp;issue=2\" target=\"_blank\"> Click Here</a></span><br><br>FDRP Website Link:<span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"> <a href=\"https://fdrpjournals.org/ijire/archives?year=2024&amp;volume=5&amp;issue=2\" target=\"_blank\">Click Here</a></span><br></p>','paid-1',1,437,1,'2024-04-09 18:45:26','2024-04-11 09:04:30'),(469,1,439,NULL,'Review paper on Road safety analysis','<p>Road safety analysis refers to thoroughly examining roads and general transportation infrastructure using various analytical methods. It usually involves a multidisciplinary team with the local governing body and other stakeholders to check for potential safety issues and bring improvements within the same. The purpose of this review paper is to study the causes of road accidents and identify the active blackspots present in Raipur city. The goal is to prevent accidents by making sure road infrastructure is designed and optimised for safety and efficiency. According to the Ministry of Road Transport &amp; Highways (MoRTH), Government of India, road accident blackspot on National Highways is a road stretch of about 500m in length in which either 5 road accidents (involving fatalities/grievous injuries) took place during the last three calendar years or 10 fatalities took place during the last three calendar years. Through detailed study and analysis, one can surmise that Road Safety Analysis can be easily broken down to factors such as types of road users, presence of traffic calming devices, weather conditions, whether users possess a driver’s licence and much more. Furthermore, it is important to address the deficiency and failure of one or more elements in road infrastructures to curb the issue of road accidents by understanding the data obtained accordingly.</p>','no_image.jpg','Review_Paper_1_1712768210.docx',NULL,NULL,NULL,1,2,1,2,'IJSREAT',4,1,1,15,'2024-04-15','<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJSREAT Journal Link<a href=\"https://ijsreat.com/archives?year=2024&amp;volume=4&amp;issue=2\" target=\"_blank\">:</a><span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://ijsreat.com/archives?year=2024&amp;volume=4&amp;issue=2\" target=\"_blank\"> Click Here</a></span><br><br>FDRP Website Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijsreat/archives?year=2024&amp;volume=4&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>Crossref Link(DOI): <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/?from_ui=&amp;q=10.59256%2Fijsreat.20240402020\" target=\"_blank\">Click Here </a></span>(Please check after 48 hrs.)<br></p>','paid-2',1,439,1,'2024-04-10 16:56:50','2024-04-15 04:41:07'),(470,1,440,NULL,'Energy optimization in water distribution system and pump scheduling','<p>Efficient management of water distribution systems are critical for providing consistent water supply while reducing energy usage and operational expenses. This research proposes a unique method for improving water distribution and pump scheduling. The suggested system leverages ultrasonic sensors to monitor water levels in storage tanks, then dynamically changes pump operation and valve settings depending on real-time demand and tank levels. A mobile application gives users remote access to system controls, allowing them to work from anywhere. By combining sensor data with intelligent algorithms, the system optimizes pump scheduling to fulfill water demand while conserving energy and lowering system losses. The creation and implementation of such a system have tremendous potential to improve the performance and sustainability of water distribution networks.</p>','no_image.jpg','Energy_optimization_in_water_distribution_system_1712772949.doc',NULL,NULL,NULL,1,2,1,1,'IJIRE',1,1,3,15,NULL,'<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJIRE Journal Link:<span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"> <a href=\"https://theijire.com/archives?year=2024&amp;volume=5&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijire/archives?year=2024&amp;volume=5&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>Crossref Link(DOI)<a href=\"https://search.crossref.org/search/works?q=10.59256%2Fijire.20240502028&amp;from_ui=yes\" target=\"_blank\">: </a><span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/search/works?q=10.59256%2Fijire.20240502028&amp;from_ui=yes\" target=\"_blank\">Click Here</a></span><a href=\"https://search.crossref.org/search/works?q=10.59256%2Fijire.20240502028&amp;from_ui=yes\" target=\"_blank\"> </a>(Please check after 48 hrs.)<br></p>','paid-2',1,440,1,'2024-04-10 18:15:49','2024-04-12 14:05:20'),(471,1,442,NULL,'STOCK PRICE PREDICTION','<p>Stock price prediction serves as a fundamental tool for informed financial decision- making This project presents a web-based platform for different users that uses Recurrent Neural Networks (RNNs) to predict stock prices. The platform integrates historical stock data encompassing opening and closing prices, high and low prices, and trading volume. A comprehensive preprocessing pipeline is established, encompassing data cleaning, normalization, and feature selection. RNN architectures, including Long Short-Term Memory (LSTM) and Gated Recurrent Units (GRUS), are employed to capture intricate temporal patterns essential for accurate prediction. The trained RNN model is incorporated into a web interface, allowing users to input stock symbols and obtain real-time predictions. The system\'s performance is evaluated using metrics such as Mean Absolute Error (MAE), Mean Squared Error (MSE), and Root Mean Squared Error (RMSE). This web-based application demonstrates the efficacy of RNNs in stock price prediction and provides an accessible and interactive tool for investors and traders to enhance their financial strategies</p>','no_image.jpg','REVIEW_PAPER_1712775454.docx',NULL,NULL,NULL,1,2,1,5,'INDJECE',2,1,3,17,NULL,NULL,NULL,0,442,NULL,'2024-04-10 18:57:34','2024-04-11 06:48:18'),(472,1,443,NULL,'Forecasting of Stressed Employees by Using Machine Learning Algorithms for Effective Pre-emptive Remediation','<p>The workplace environment plays a crucial role in the overall well-being of employees, and stress is a prevalent concern that can significantly impact productivity and employee satisfaction. This research addresses the challenge of proactively identifying employees under stress and implementing pre-emptive remediation strategies through the application of machine learning techniques. The proposed system leverages historical and real-time data, including work-related metrics, communication patterns, and potentially physiological indicators, to predict stress levels among employees. The machine learning model employed in this study is trained on a diverse dataset, allowing it to learn patterns associated with stressed and non-stressed states. Through continuous monitoring, the system generates alerts when an employee is predicted to be under significant stress, prompting timely intervention by Human Resources professionals. Remediation strategies may include targeted support, workload adjustments, or other measures aimed at alleviating stress and fostering a healthier work environment. The implementation of this predictive system aims to contribute to the well-being of employees, enhance organizational efficiency, and create a workplace culture that prioritizes mental health. By proactively addressing stressors, organizations can foster a more resilient and productive workforce while demonstrating a commitment to the holistic health and satisfaction of their employees.</p>','no_image.jpg','Forecasting_of_Stressed_Employees_by_Using_Machine_Learning__1712809028.docx',NULL,NULL,NULL,1,2,1,1,'IJIRE',5,1,1,5,NULL,NULL,NULL,0,443,NULL,'2024-04-11 04:17:08','2024-04-15 04:18:24'),(473,1,441,NULL,'Data-driven inline leak detection for pipelines using flow-induced acoustics analysis','<p>Fluid and water distribution networks are essential to the modern world. However, these systems are prone to leaks, which can lead to significant water loss, damage to infrastructure, and environmental pollution. The proposed solution makes use of Acoustic Emission sensors placed in discrete locations in the pipeline which measures the sound in the pipeline caused by the flow of fluids. Computation models are used to deduce the location from the input provided by the sensors. In case of leak, the leak is localized through cross correlation and TDOA methods. This solution is particularly developed for water distribution pipelines.</p>','no_image.jpg','Project_Article_1712811387.docx',NULL,NULL,NULL,1,2,1,1,'IJIRE',1,1,3,15,NULL,'<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJIRE Journal Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://theijire.com/archives?year=2024&amp;volume=5&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link:<a href=\"https://fdrpjournals.org/ijire/archives?year=2024&amp;volume=5&amp;issue=2\" target=\"_blank\"> </a><span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijire/archives?year=2024&amp;volume=5&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>Crossref Link(DOI): <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/?from_ui=&amp;q=10.59256%2Fijire.20240502027\" target=\"_blank\">Click Here</a></span> (Please check after 48 hrs.)<br></p>','paid-2',1,441,1,'2024-04-11 04:56:27','2024-04-12 13:23:33'),(474,1,444,NULL,'BACTERIAL CONCRETEASASUSTAINABLEBUILDING MATERIAL','<p>The right selection of building materials plays\r\n</p><p>an important role when designing a building to\r\n</p><p>fall within the definition of sustainable\r\n</p><p>development. One of the most commonly used\r\n</p><p>construction materials is concrete. Its\r\n</p><p>production causes a high energy burden on the\r\n</p><p>environment. Concrete is susceptible to external\r\n</p><p>factors. As a result, cracks occur in the material. Achieving its durability along with the\r\n</p><p>assumptions of sustainable construction means\r\n</p><p>there is a need to use an environmentally\r\n</p><p>friendly and effective technique of alternative\r\n</p><p>crack removal in the damaged material. Bacterial self-healing concrete reduces costs in\r\n</p><p>terms of detection of damage and maintenance\r\n</p><p>of concrete structures, thus ensuring a safe\r\n</p><p>lifetime of the structure. Bacterial concrete can\r\n</p><p>improve its durability. However, it is not\r\n</p><p>currently used on an industrial scale. The high\r\n</p><p>cost of the substrates used means that they are\r\n</p><p>not used on an industrial scale. Many research\r\n</p><p>units try to reduce production costs through\r\n</p><p>various methods; however, bacterial concrete\r\n</p><p>can be an effective response to sustainability</p>','no_image.jpg','adarsh_paper_publish_1712828002.docx',NULL,NULL,NULL,1,2,2,2,'IJSREAT',4,1,2,16,NULL,NULL,NULL,0,444,NULL,'2024-04-11 09:33:22','2024-04-14 18:31:57'),(475,1,436,NULL,'Form Perfector','<p>Home-based workouts are known to have significant health and fitness benefits, but it could be dangerous if not performed with proper posture. This could be due to a lack of sufficient training and bad habits, or the inability to afford a personal trainer to fix the individual\'s posture. With the current Artificial Intelligence technology, we are now able to achieve workout analysis by using computer vision approach without any involvement of personal trainer. This report discussed the approach of keypoint detection, human pose estimation and pose analysis that will be utilized to produce the proposed project through Rapid Application Development (RAD) methodology, which will monitor these procedures phase by phase. Pretrained model from MediaPipe was chosen as the main human key point detection, and various machine learning algorithms such as Linear Regression and Random Forest were studied to find the suitable algorithm to be implemented in detecting and analyze home workout postures. Furthermore, this research also studies on geometrical approach to determining proper and improper posture for analysis. These approaches were then compared to see which will produce the best results and user experience. Since machine learning approach does not produce the best result due to lack of training data and variety of other factors, the geometrical approach was chosen as the final approach before implementing it into desktop application.\r\n</p><p>KEYWORDS: Personal Trainer, Keypoint Detection, MediaPipe, Rapid Application Development\r\n</p><p><br></p><p> \r\n</p>','no_image.jpg','Form_Perfector_1712839315.docx',NULL,NULL,NULL,1,2,1,6,'INDJCST',1,1,1,15,NULL,'<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>INDJCST Journal Link: <span style=\"background-color: rgb(255, 255, 0);\"><a href=\"https://indjcst.com/archives?year=2024&amp;volume=3&amp;issue=1\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link:<a href=\"https://fdrpjournals.org/indjcst/archives?year=2024&amp;volume=3&amp;issue=1\" target=\"_blank\"> </a><span style=\"background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/indjcst/archives?year=2024&amp;volume=3&amp;issue=1\" target=\"_blank\">Click Here</a></span><br><br>Crossref Link(DOI): <span style=\"background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/?from_ui=&amp;q=10.59256%2Findjcst.20240301009\" target=\"_blank\">Click Here</a></span> (Please check after 48 hrs.)<br></p>','paid-2',1,436,1,'2024-04-11 12:41:55','2024-04-13 13:38:40'),(478,1,445,NULL,'Design and Operation of Hybrid Inverter of Capacity 1kW','<p>This study describes the installation of a prototype instant power supply (IPS) system that uses both hybrid energy sources and the AC grid to provide continuous output current to load in residential applications. In remote places where national grids are scarce and power outages diminish the effectiveness of intermittent power supply (IPS), a utility connecting PWM inverter that can run on both solar energy and storage batteries is extremely necessary.\r\n</p><p>Building a 1000 watt (1 kW) 220 volt inverter at a frequency of 50 Hz is the aim of this project. This item is built using materials that meet specified requirements and components that are sourced locally. Its main method of functioning is a straightforward conversion of 12V DC from a battery to 220V AC across a transformer’s windings at a frequency of 50 Hz using integrated circuits and semiconductors. Thus, a supplementary power source with the same power output as the public power supply is made available at a reasonable cost.\r\n</p><p>Keywords: Inverter, Integrated circuits, Semiconductors, Transformer, Solar Panel.\r\n</p><p><br></p><p>\r\n</p>','no_image.jpg','Design_And_Operation_of_Hybrid_Inverter_of_Capacity_1kW_1712909027.docx',NULL,NULL,NULL,1,2,1,1,'IJIRE',1,1,1,15,NULL,'<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJIRE Journal Link: <span style=\"background-color: rgb(255, 255, 0);\"><a href=\"https://theijire.com/archives?year=2024&amp;volume=5&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link: <span style=\"background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijire/archives?year=2024&amp;volume=5&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br><br></p>','paid-1',1,445,1,'2024-04-12 08:03:47','2024-04-13 13:44:03'),(479,1,447,NULL,'Self-Configuration and Smart Binding Control System for Autonomous Home Applications','<p>In wireless communication, traditional technologies such as Bluetooth and Wi-Fi face persistent challenges related to connectivity, bandwidth, power efficiency, and speed. This project endeavours to overcome these limitations by implementing a self-configuring system based on the Zigbee model. The primary objective is to establish a robust network comprising interconnected Zigbee devices capable of dynamic configuration, optimizing network performance, and adapting to changing conditions within a specified range. The proposed system addresses the shortcomings of conventional wireless technologies by exploring efficient routing algorithms, adaptive channel selection, and power management strategies. By harnessing these elements, the project aims to achieve seamless communication while minimizing energy consumption. The self-configuring Zigbee network serves as a testament to an improved solution for wireless communication in environments where traditional technologies fall short. Through these endeavours, the project not only showcases the feasibility of a self-configuring Zigbee network but also emphasizes its potential to provide reliable and efficient communication. The outcomes of this research contribute to advancing the field of wireless communication, offering a promising alternative for environments that demand adaptability and optimization beyond the capabilities of conventional wireless technologies.</p>','no_image.jpg','Self_Configuration_and_Smart_Binding_Control_System_for_Autonomous_Home_Application_Research_Paper_1712991167.docx',NULL,NULL,NULL,1,2,1,6,'INDJCST',1,1,1,5,NULL,NULL,NULL,1,447,NULL,'2024-04-13 06:52:47','2024-04-15 16:25:51'),(480,1,446,NULL,'Design and simulation of Electricity price forecasting using artificial neural network','<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <span style=\"font-size: 18px;\">Design and Simulation of Electricity Price Forecasting Using Artificial Neural Network</span>\r\n</p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Submitted by\r\n</p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <b>&nbsp;Ms. Damini Kamble\r\n</b></p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<span style=\"font-size: 0.875rem;\">Under the Guidance of</span></p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<b> &nbsp;Prof. Ganesh Wakte\r\n</b></p><p><b>Abstract\r\n</b></p><p>In the restructured power markets, price of electricity has been the key of all activities in the power market. Accurately and efficiently forecasting electricity price becomes more and more important. Therefore in this paper, an Artificial Neural Network (ANN) model is designed for short term price forecasting of electricity in the environment of restructured power market. The proposed ANN model is a four-layered perceptron neural network, which consists of, input layer, two hidden layers and output layer. Instead of conventional back propagation (BP) method, Levenberg- Marquardt BP (LMBP) method has been used for the ANN training to increase the speed of convergence. MATLAB is used for training the proposed ANN model, also it is performed on the Ontario electricity market to illustrate its high capability and performance.\r\n</p><p><b>Keywords</b>: Artificial Neural Network, Electricity Market, Price Forecasting, MATLAB etc.\r\n</p><p><br></p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p>','no_image.jpg','Research_paper_1_PL_RPT_(1)_1712995112.pdf',NULL,NULL,NULL,1,2,1,1,'IJIRE',1,1,1,15,'2024-04-27','<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJIRE Journal Link:<span style=\"color: rgb(0, 0, 255);\"><span style=\"background-color: rgb(255, 255, 0);\"><a href=\"https://theijire.com/archives?paperid=2922109535574800839\" target=\"_blank\"> Click Here</a></span><br></span><br>FDRP Website Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijire/archives?year=2024&amp;volume=5&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>Crossref Link(DOI): <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/?from_ui=&amp;q=10.59256%2Fijire.20240502037\" target=\"_blank\">Click Here</a></span> (Please check after 48 hrs.)<br></p>','paid-2',1,446,1,'2024-04-13 07:58:32','2024-04-27 04:58:25'),(481,1,444,NULL,'BACTERIAL CONCRETE AS A SUSTAINABLE BUILDING MATERIAL','<p>The right selection of building materials plays an important role when designing a building to fall within the definition of sustainable development. One of the most commonly used construction materials is concrete. Its production causes a high energy burden on the environment. Concrete is susceptible to external factors. As a result, cracks occur in the material. Achieving its durability along with the assumptions of sustainable construction means there is a need to use an environmentally friendly and effective technique of alternative crack removal in the damaged material.\r\n</p><p>Bacterial self-healing concrete reduces costs in terms of detection of damage and maintenance of concrete structures, thus ensuring a safe lifetime of the structure. Bacterial concrete can improve its durability. However, it is not currently used on an industrial scale. The high cost of the substrates used means that they are not used on an industrial scale. Many research units try to reduce production costs through various methods; however, bacterial concrete can be an effective response to sustainability.\r\n</p><p>Keywords: Analysis, investigation, research.</p>','no_image.jpg','addipaper2_1713023215.docx',NULL,NULL,NULL,1,2,1,2,'IJSREAT',2,1,3,15,NULL,'<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJSREAT Journal Link:<a href=\"https://ijsreat.com/archives?year=2024&amp;volume=4&amp;issue=2\" target=\"_blank\"> </a><span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://ijsreat.com/archives?year=2024&amp;volume=4&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link:<span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijsreat/archives?year=2024&amp;volume=4&amp;issue=2\" target=\"_blank\"> Click Here</a></span><br></p>','paid-1',1,444,1,'2024-04-13 15:46:55','2024-04-14 09:52:38'),(482,1,449,NULL,'Design and Operation of Clap Switch Based Bulb Control','<p>Abstract: A clap switch which used for making ON and OFF electric bulbs and other appliances. The gadget serves as a security feature in addition to being able to \"ON\" or \"OFF\" lights and other electrical appliances in our house. For example, if armed robbers break into a building, the security guard will clap his hands to turn on lights or other equipment to alert the occupants. The dynamic microphone in the system detects a single clap and generates a little signal, which is then amplified by the transistor stage that comes next. A bistable multivibrator, which consists of two cross-connected transistors, changes its state with each signal. One of these transistors powers a heavier transistor, which regulates the lightbulb or other electrical appliances.\r\n</p><p>A microphone that is interfaced with an amplifier circuit is part of this investigation. In this research paper the clap switch is applied in the circuit connected by the MIC. The multivibrator circuit, also referred to as the latch circuit, is next used to pass the signal. The transistor receives the final signal, and via a relay which is used to switche ON the lightbulb or other electrical appliances.</p><p>Key Word: Amplifier, bistable multivibrator, clap light switch, microphone.  \r\n</p><p><br></p>','no_image.jpg','CLAP_BASED_BULB_CONTROL_1713040787.docx',NULL,NULL,NULL,2,2,1,1,'IJIRE',1,1,1,15,NULL,'<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJIRE Journal Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://theijire.com/archives?year=2024&amp;volume=5&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijire/archives?year=2024&amp;volume=5&amp;issue=2\" target=\"_blank\">Click Here</a></span><br></p>','paid-1',1,449,1,'2024-04-13 20:39:47','2024-04-15 14:46:04'),(483,1,450,NULL,'Enhancement on mechanical parameters of concrete by application of bacillus megaterium bacteria','<p>This paper presents experimental results of self-healing process of concrete and effects on mechanical properties of concrete. Essentially, The self-repair of concrete occurs when cracks close due to the rehydration of unhydrated or inadequately hydrated cement particles within damaged areas. Bacterial concrete facilitates crack healing by converting calcium lactate to calcium carbonate through microbiological processes, leading to the cessation of crack propagation. Bacillus genus demonstrates impressive efficacy in diverse conditions for concrete reinforcement. Concrete vulnerabilities to attacks are inherent and cannot be entirely prevented. Water infiltration through these cracks initiates corrosion, significantly reducing the lifespan of concrete. Hence, there was a pressing need to develop and activate biomaterials for a self-repairing technique that could effectively address cracks and fissures in concrete. Bio-concrete emerges as a promising solution for enhancing concrete durability. This approach is highly desirable as it promotes eco-friendly crack remediation, employing Bacillus megaterium to induce artificial crack healing in cement concrete. Specimens were cast and subjected to mechanical strength and water absorption tests after 7 and 28 days of curing. Results show a notable improvement in compressive and flexural strengths by 12.91% and 9.02% respectively, compared to standard M25 grade concrete mix, after 28 days of curing. Additionally, bacterial concrete exhibits lower water absorption values than standard concrete mix, attributed to crack filling via calcite precipitation facilitated by Bacillus megaterium bacteria.Consequently, Bacillus megaterium, belonging to the Bacillus family, proves to be an effective agent for enhancing mechanical strength by reducing voids in concrete.</p>','no_image.jpg','Enhancement_on_mechanical_parameters_of_concrete_by_application_of_bacillus_megaterium_bacteria_1713082181.docx',NULL,NULL,NULL,1,2,1,2,'IJSREAT',1,1,3,15,NULL,'<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJSREAT Journal Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://ijsreat.com/archives?paperid=6631391272867351133\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijsreat/archives?year=2024&amp;volume=4&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>Crossref Link(DOI): <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/?from_ui=&amp;q=10.59256%2Fijsreat.20240402021\" target=\"_blank\">Click Here </a></span>(Please check after 48 hrs.)<br></p>','paid-2',1,450,1,'2024-04-14 08:09:41','2024-04-19 06:48:07'),(484,1,451,NULL,'A STUDY ON FASHION TECHNOLOGY USING AI/ML WITH CROSS-BORDER THINKING','<p>The fashion industry is a multi-billion-dollar industry that has significant social, cultural, and economic implications in the real world. Computer vision has shown great success in various applications within the fashion domain (Čiarnienė &amp; Vienažindienė, 2014). Natural language processing technology has also contributed to the field by establishing a connection between clothing images and human semantic understandings. This research paper aims to explore the use of machine learning data analysis in fashion technology, spe-cifically focusing on how computer vision methods can enhance online shopping recommendation systems in the fashion industry. By summarizing the state-of-the-art computer vision development in online shopping recommendation systems and identifying po-tential research gaps in the information systems field, this paper contributes to a deeper understanding of the potential impact of machine learning data analysis in fashion technology. The use of machine learning data analysis in fashion technology can greatly enhance the accuracy and efficiency of online shopping recommendation systems.</p>','no_image.jpg','comparitive_study_fashion_research_paper_1713114432.pdf',NULL,NULL,NULL,1,2,1,1,'IJIRE',1,1,1,5,NULL,NULL,NULL,0,451,NULL,'2024-04-14 17:07:12','2024-04-24 06:33:20'),(485,1,436,NULL,'Form Perfector Web Application','<p>At-home workouts are widely known for their significant health and fitness benefits, but improper posture poses a risk of injury. However, traditional solutions such as personal trainers may not always be accessible or affordable. This project introduces an innovative approach utilizing AI technology for workout analysis, eliminating the need for a personal trainer through computer vision techniques. The methodology revolves around key point detection, human pose estimation, and posture analysis, all integrated within a Rapid Application Development (RAD) framework. Using pre-trained models from MediaPipe, the project focuses on detecting key points and analyzing home workout postures. Various machine learning algorithms, including Linear Regression and Random Forest, are evaluated for their effectiveness in posture detection. Also, a mathematical approach is explored to differentiate between proper and improper posture. Given constraints such as limited training data, the mathematical approach emerges as the preferred method for integration into a desktop application. To ensure accessibility, a user-friendly web application is developed using Flask, HTML, CSS, and JavaScript. This platform caters to gym enthusiasts and beginners, providing seamless access to posture analysis and corrective guidance. Ultimately, this solution aims to enhance safety and effectiveness during home workouts without a personal trainer. \r\n</p><p>KEYWORDS: Personal Trainer, Key point Detection, MediaPipe, Rapid Application Development, Flask\r\n</p><p><br></p>','no_image.jpg','Form_Perfector_Web_Application_1713121273.docx',NULL,NULL,NULL,1,2,2,6,'INDJCST',1,1,2,17,NULL,NULL,NULL,0,436,NULL,'2024-04-14 19:01:13','2024-04-15 07:44:19'),(486,1,452,NULL,'Utilization of waste rubber tyre in soil stabilization','<p>This paper explores the feasibility and benefits of utilizing waste rubber tyre for soil stabilization purpose.With the growing environmental concern surrounding waste tyre disposal, repurposing them for soil stabilization presents a sustainable solution. Added amount of rubber tyre had been varied in proportions of 10%, 15%, 20% and 25%.Waste rubber tyre helps in improving the desired properties of soil and minimizes the amount of waste to be deposited in environment causing environmental pollution . Rubber tyres are cost effective and is quite easily available, due to day by day increase in cost of stabilizers like cement, lime and other admixtures;use of shredded rubber tyre can result in project completion optimally. The soil sample used is clay ,thus being highly plastic it is required to be strengthened by using varying proportion of shredded rubber tyre. The effect of shredded rubber tyre on soil is analysed by conducting various tests that governs the basic properties of soil and the obtained result shows that increasing the percentage of shredded rubber tyre results in enhancement in desired soil properties.Increase specific gravity, increase liquid limit, and decrease plastic limit are achieved through the incorporation of appropriate additives in soil stabilization processes.</p>','no_image.jpg','research_paper_1713164381.docx',NULL,NULL,NULL,1,2,1,2,'IJSREAT',1,1,1,15,NULL,'<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJSREAT Journal Link: <span style=\"background-color: rgb(255, 255, 0);\"><a href=\"https://ijsreat.com/archives?paperid=5672829193577120658\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link: <span style=\"background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijsreat/archives?year=2024&amp;volume=4&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>Crossref Link(DOI): <span style=\"background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/?from_ui=&amp;q=10.59256%2Fijsreat.20240402022\" target=\"_blank\">Click Here</a></span><a href=\"https://search.crossref.org/?from_ui=&amp;q=10.59256%2Fijsreat.20240402022\" target=\"_blank\"> </a>(Please check after 48 hrs.)<br></p>','paid-2',1,452,1,'2024-04-15 06:59:41','2024-04-21 05:33:31'),(487,1,308,NULL,'Exploring Cryptocurrency Market Trends Using Artificial Intelligence','<p>ABSTRACT:\r\n</p><p>Cryptocurrency has emerged as a transformative force in the financial realm, garnering widespread attention and acceptance. However, its dynamic nature and inherent uncertainties pose significant challenges for investors. This study delves into the factors shaping cryptocurrency value formation by harnessing the power of advanced artificial intelligence frameworks. Specifically, we employ fully connected Artificial Neural Network (ANN) and Long Short-Term Memory (LSTM) Recurrent Neural Network to analyze the price dynamics of prominent cryptocurrencies such as Bitcoin, Ethereum, and Ripple. Our research reveals that ANN tends to rely more heavily on long-term historical data, whereas LSTM exhibits a penchant for short-term dynamics. Interestingly, LSTM demonstrates superior efficiency in leveraging historical information, yet with adequate data, ANN can achieve comparable accuracy. Our findings shed light on the predictability of cryptocurrency market prices, albeit the interpretation may vary depending on the machine-learning model utilized. This study underscores the significance of leveraging artificial intelligence in comprehending and forecasting cryptocurrency market trends, thereby mitigating investment risks in this dynamic landscape.\r\n</p><p><br></p>','no_image.jpg','Analyzing_cryptocurrency_prices_paper_1713186440.docx',NULL,NULL,NULL,1,2,1,1,'IJIRE',4,2,3,15,NULL,'<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJIRE Journal Link: <span style=\"background-color: rgb(255, 255, 0);\"><a href=\"https://theijire.com/archives?paperid=7929123075065426816\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link: <span style=\"background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijire/archives?year=2024&amp;volume=5&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>Crossref Link(DOI): <span style=\"background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/?from_ui=&amp;q=10.59256%2Fijire.20240502030\" target=\"_blank\">Click Here</a></span> (Please check after 48 hrs.)<br></p>','paid-2',1,308,1,'2024-04-15 13:07:20','2024-04-16 15:47:39'),(488,1,434,NULL,'IoT Based Automatic Waste Segregation and Monitoring System','<p>One of the major issues for environmental hazard is the continuous accumulation of waste. As the world’s population continues to rise, garbage is dumped at one place, mixing different types of wastes. In India, the total generated waste is expected more than 1,50,000 metric tons per day. People spill waste along roadsides, and the people in charge of the model do not collect it regularly. This automated waste segregation bin is a project to make it more efficient, these rapid technological advancements have resulted in a low initial cost. This application proposes IoT-based smart segregation and management which segregates wastes as dry, metallic and wet waste with the help of sensors like IR sensor, Ultrasonic sensors, Inductive proximity sensors, Soil Moisture sensors. The microcontroller consists of a Wi-Fi module along with the Arduino that can take place in an effectively closed manner. Arduino controls the functions of the sensors and servo motors. The entire waste process, including level and separation, is monitored and controlled by configurable IO sensors, reducing open degradation of organic waste and thus the growth of microorganisms. In the proposed system it divides the waste into dry waste, metal waste and metal waste. This application is an effective method for the waste management and segregation process. By using a cloud server, the data collected by the Arduino can easily be viewed by an authority. The data will be based on the garbage filling level. So there is no need to check the waste filling level manually.&nbsp;</p>','no_image.jpg','Automatic_waste_segregation_and_monitoring_system_1713190754.docx',NULL,NULL,NULL,1,2,1,5,'INDJECE',1,1,1,5,NULL,NULL,NULL,0,434,NULL,'2024-04-15 14:19:14','2024-04-19 03:57:28'),(491,1,457,NULL,'Review Paper On Partial Replacement Of Coarse Aggregate By Jhama Brick In Concrete','<p>Abstract : The experiment explores using demolished brick aggregate, specifically Jhama brick, as a substitute for traditional coarse aggregate in concrete production. Different proportions of Jhama brick (15%, 25%, and 35%) were tested in M25 grade concrete. Testing included fresh and hardened concrete characteristics like workability and compressive strength at 7 and 28 days. Results showed that a 25% replacement of Jhama brick was cost-effective and had suitable strength for moderate load structures, although overall strength was lower than standard concrete.</p>','no_image.jpg','font_edited_1713263438.docx',NULL,NULL,NULL,1,2,1,2,'IJSREAT',2,1,1,15,NULL,'<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJSREAT Journal Link:<a href=\"https://ijsreat.com/archives?paperid=3329551031922114501\" target=\"_blank\"> </a><span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://ijsreat.com/archives?paperid=3329551031922114501\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijsreat/archives?year=2024&amp;volume=4&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>Crossref Link(DOI): <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/search/works?q=10.59256%2Fijsreat.20240402023&amp;from_ui=yes\" target=\"_blank\">Click Here</a></span><a href=\"https://search.crossref.org/search/works?q=10.59256%2Fijsreat.20240402023&amp;from_ui=yes\" target=\"_blank\"> </a>(Please check after 48 hrs.)<br></p>','paid-2',1,457,1,'2024-04-16 10:30:38','2024-04-17 09:13:29'),(492,2,458,NULL,'Photography Hub','<p>Photography Hub is a sophisticated platform designed to streamline the process for photographers, clients, and guests alike. Serving as a dynamic medium for photographers of all levels, the platform offers tools and resources to facilitate connections, streamline project management, and inspire artistic growth. Through its interface and interactive features, Photography Hub encourages users to connect with others, explore diverse photography genres, engage in discussions, and share insights and experiences. At the heart of Photography Hub is a vibrant ecosystem where users can explore a diverse array of photography genres, engage in discussions, and share insights and experiences via reviewing and can give it as feedback. The objective of Photography Hub is to revolutionize the photography industry by fostering collaboration, creativity, and growth among photographers.</p>','no_image.jpg','keerthana_PHOTOGRAPHY_HUB_1713278858.docx',NULL,NULL,NULL,1,2,1,2,'IJSREAT',1,1,2,15,NULL,'<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJSREAT Journal Link:<a href=\"https://ijsreat.com/archives?paperid=6819221432352092638\" target=\"_blank\"> </a><span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://ijsreat.com/archives?paperid=6819221432352092638\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijsreat/archives?year=2024&amp;volume=4&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>Crossref Link(DOI): <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/?from_ui=&amp;q=10.59256%2Fijsreat.20240402024\" target=\"_blank\">Click Here</a></span> (Please check after 48 hrs.)<br></p>','paid-2',1,458,1,'2024-04-16 14:47:38','2024-04-18 04:12:28'),(493,1,461,NULL,'SPEED CONTROL OF DC MOTOR BY USING HALF CONTROLLED CONVERTER','<p><b>Abstract :This study looks at the use of semi-controlled converters Thyristor Module (BKW75/16) to control the speed of DC motors. It analyze the principles and performance of semi-control converters in controlling the voltage delivered to the motor, thus controlling the speed of the motor. Various control methods and strategies are studied, such as adjusting the firing angle control to achieve the desired speed profiles and increase efficiency. The experimental validation and simulation results show the efficiency and practicality of using semi-controllable converters to control DC motor speed in a variety of applications, including industrial automation and electric vehicle (EV) propulsion. The results help to advance the knowledge and implementation of effective motor control systems in contemporary engineering practices.</b></p>','no_image.jpg','Speed_Control_of_D_1713325350.docx',NULL,NULL,NULL,1,2,1,1,'IJIRE',1,1,1,15,NULL,'<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJIRE Journal Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://theijire.com/archives?paperid=1175288849844253350\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijire/archives?year=2024&amp;volume=5&amp;issue=2\" target=\"_blank\">Click Here</a></span><br></p>','paid-1',1,461,1,'2024-04-17 03:42:30','2024-04-18 14:03:51'),(494,1,442,NULL,'stock price prediction','<p>Abstract- Stock price prediction serves as a fundamental tool for informed financial decision- making This project presents a web-based platform for different users that uses Recurrent Neural Networks (RNNs) to predict stock price. The platform integrates historical stock data encompassing opening and closing prices, high and low prices, and trading volume. A comprehensive preprocessing pipeline is established, encompassing data cleaning, normalization, and feature selection. RNN architectures, including Long Short-Term Memory (LSTM) and Gated Recurrent Units (GRUS), are employed to capture intricate temporal patterns essential for accurate prediction. The trained RNN  is a model which incorporated into a web interface, allowing users to input stock symbols and obtain real-time predictions. The system\'s performance is evaluated by using metrics such as Mean Absolute Error (MAE), Mean Squared Error (MSE), and Root Mean Squared Error (RMSE). This web-based application demonstrates the efficacy of RNNs in stock price prediction and provides an accessible and interactive tool for investors and traders to enhance their financial strategies</p>','no_image.jpg','vikrant_review_paper_1713328420.docx',NULL,NULL,NULL,1,2,1,6,'INDJCST',2,1,2,5,NULL,NULL,NULL,0,442,NULL,'2024-04-17 04:33:40','2024-04-18 04:24:04'),(495,1,464,NULL,'Designing a Predictive Model to Uncover Consumer Spending Patterns in India','<p>This study examines credit card transactions in India to analyze spending behaviors influenced by factors such as gender, card type, and location. The primary objective is to elucidate the diverse shopping patterns across demographic groups and cities, thereby offering insights into consumer lifestyles and regional economic activities. This analysis provides valuable data for businesses and policymakers, enhancing decision-making in India\'s evolving marketplace. The research methodology involves a rigorous examination of transaction data from a dataset available on kaggle, employing advanced predictive modeling techniques to decode spending behaviors. The data is categorized based on demographic and geographical attributes, facilitating the identification of significant trends and variations in consumer spending. This approach provides a granular analysis of consumer behavior, highlighting specific preferences and spending methods prevalent among various segments of the Indian population. The findings reveal considerable disparities in spending across different groups and cities, reflecting India\'s heterogeneous economic landscape. Insights into consumer expenditure not only aid in tailoring products and services to diverse consumer bases but also enhance the ability to predict future market trends. Fundamentally, this study equips businesses and policymakers with strategic insights to develop more effective marketing strategies and optimize resource allocation within the economy, thereby promoting targeted marketing and economic efficiency.\r\n</p><p><br></p>','no_image.jpg','Designing_a_Predictive_Model_to_Uncover_Consumer_Spending_Patterns_in_India_(1)_1713341464.docx',NULL,NULL,NULL,1,2,1,6,'INDJCST',1,1,3,17,NULL,NULL,NULL,0,464,NULL,'2024-04-17 08:11:04','2024-04-18 07:51:21'),(496,1,465,NULL,'ANALYSIS AND DESIGN OF HIGH-RISE G+12 BUILDING USING STAAD PRO','<p>High rise building is the most frequently used word in all most all construction activities especially in rapidly growing cities in terms of development and population.\r\n</p><p>National Building Code (NBC) defines a high-rise as “All buildings 15 m or above in height (a building more than 4 storeys).\r\n</p><p>The employment opportunities and facilities offered by the developing cities makes people to migrate towards urban areas which create the land scarcity for both Industrial and residential occupants. To satisfy the needs considering the future demand of habitable area and efficient use of land without expanding the boundaries of the cities makes people to choose high rise building it also facilitates with stunning views less noise pollution etc.\r\n</p><p>STAAD is a popular structural analysis application known for analysis, diverse applications of use, Interoperability, and time-saving capabilities. STAAD helps structural engineers perform 3D structural Analysis and design for both steel and concrete structures. It ensures on-time and cost-effective Completion of steel, concrete, timber, aluminium, and cold-formed steel structures and designs, Regard less of complexity.\r\n</p><p>We conclude that in this study we consider plot area 70 m x 24 m of g+12 Building consisting of 72 flats located kesarapalli near vijayawada Located in zone 3. we are going to analyse the high rise building for shear force and bending moments and design of critical sections of slab staircase footing by considering various loads such as with and without wind load, imposed load, dead loads.\r\n</p><p>Keywords: high rise building, wind load, STAAD pro\r\n</p><p><br></p>','no_image.jpg','project_article_1_1713343791.docx',NULL,NULL,NULL,1,2,1,1,'IJIRE',1,1,1,15,NULL,'<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJSREAT Journal Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://theijire.com/archives?paperid=4083211789748422448\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijire/archives?year=2024&amp;volume=5&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>Crossref Link(DOI): <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/?from_ui=&amp;q=10.59256%2Fijire.20240502034\" target=\"_blank\">Click Here</a> </span>(Please check after 48 hrs.)<br></p>','paid-2',1,465,1,'2024-04-17 08:49:51','2024-04-25 15:48:26'),(497,1,466,NULL,'Breast Cancer Detection Using Texture Analysis  and Convolutional Neural Network','<p><i><b>Abstract-- Breast cancer is a big problem for \r\n</b></i></p><p><i><b>women all over the world and it can make \r\n</b></i></p><p><i><b>them very sick. Researchers have worked hard \r\n</b></i></p><p><i><b>to improve how we diagnose and detect this \r\n</b></i></p><p><i><b>disease accurately. It remains one of the most \r\n</b></i></p><p><i><b>life-threatening illnesses, affecting about one \r\n</b></i></p><p><i><b>in eight women. The unclear causes make it \r\n</b></i></p><p><i><b>challenging to manage, and prevention is \r\n</b></i></p><p><i><b>difficult. So, early detection becomes crucial. \r\n</b></i></p><p><i><b>This paper wants to explain a clear way to find \r\n</b></i></p><p><i><b>breast cancer early by using computer tools to \r\n</b></i></p><p><i><b>analyze images. It will explain the steps \r\n</b></i></p><p><i><b>involved, such as image enhancement, \r\n</b></i></p><p><i><b>segmentation, and feature extraction, utilizing \r\n</b></i></p><p><i><b>a Convolutional Neural Network (CNN).\r\n</b></i></p><p><b>Keywords: </b>Diagnose, Prevention, Crucial, \r\n</p><p>Enhancement, Segmentation.</p>','no_image.jpg','Final_ppr_Project_1713364284.docx',NULL,NULL,NULL,1,2,1,2,'IJSREAT',1,1,1,5,NULL,NULL,NULL,0,466,NULL,'2024-04-17 14:31:24','2024-04-18 04:26:38'),(498,1,467,NULL,'Utilization of Waste Materials for Making Plastic Bricks','<p>&nbsp;Currently, due to urbanization, there has been a notable rise in the use of plastic in our daily lives, owing to its widespread utility and popularity. However, its non-biodegradable nature presents a significant drawback. One potential solution for recycling plastic waste involves creating plastic bricks by blending plastic with sand, offering a substitute for conventional bricks. The primary challenge lies in managing plastic waste, particularly as continued reuse of PET bottles carries the risk of carcinogenic transformation, with only a small percentage currently being recycled. To address this issue, PET bottles are meticulously cleaned and combined with fine aggregate (sand) at various ratios (3:7, 2:3, 1:1) to produce high-quality brick blocks with excellent thermal and acoustic insulation properties. This environmentally friendly approach tackles the non-biodegradability problem of plastics while reducing the overall cost of construction and pollution. The resulting bricks exhibit high compressive strength, minimal water absorption, and thermal resistance, rendering them suitable for diverse applications. Increasing the sand-to-plastic ratio enhances the strength of the bricks, ensuring durability with minimal water absorption and no efflorescence. This method shows promise in recycling plastic waste and mitigating its environmental impact. Furthermore, various tests including split tensile strength test, penetration test, and specific gravity were conducted to validate the efficacy of the approach.\r\n</p><p>Key Word: PET (polyethylene terephthalate), compressive strength, water absorption, split tensile strength test, efflorescence, specific gravity test</p><p>\r\n</p>','no_image.jpg','ijsreat_research_paper_1713379339.docx',NULL,NULL,NULL,1,2,2,2,'IJSREAT',1,1,1,16,NULL,NULL,NULL,0,467,NULL,'2024-04-17 18:42:19','2024-04-18 14:54:57'),(499,1,467,NULL,'Utilization of Waste Materials for Making Plastic Bricks','<p>&nbsp;Currently, due to urbanization, there has been a notable rise in the use of plastic in our daily lives, owing to its widespread utility and popularity. However, its non-biodegradable nature presents a significant drawback. One potential solution for recycling plastic waste involves creating plastic bricks by blending plastic with sand, offering a substitute for conventional bricks. The primary challenge lies in managing plastic waste, particularly as continued reuse of PET bottles carries the risk of carcinogenic transformation, with only a small percentage currently being recycled. To address this issue, PET bottles are meticulously cleaned and combined with fine aggregate (sand) at various ratios (3:7, 2:3, 1:1) to produce high-quality brick blocks with excellent thermal and acoustic insulation properties. This environmentally friendly approach tackles the non-biodegradability problem of plastics while reducing the overall cost of construction and pollution. The resulting bricks exhibit high compressive strength, minimal water absorption, and thermal resistance, rendering them suitable for diverse applications. Increasing the sand-to-plastic ratio enhances the strength of the bricks, ensuring durability with minimal water absorption and no efflorescence. This method shows promise in recycling plastic waste and mitigating its environmental impact. Furthermore, various tests including split tensile strength test, penetration test, and specific gravity were conducted to validate the efficacy of the approach.\r\n</p><p>Key Word: PET (polyethylene terephthalate), compressive strength, water absorption, split tensile strength test, efflorescence, specific gravity test\r\n</p><p><br></p>','no_image.jpg','ijsreat_research_paper_1713381423.docx',NULL,NULL,NULL,1,2,1,2,'IJSREAT',1,1,1,15,NULL,'<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJSREAT Journal Link:<span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://ijsreat.com/archives?paperid=1003189259373331114\" target=\"_blank\"> Click Here</a></span><br><br>FDRP Website Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijsreat/archives?year=2024&amp;volume=4&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>Crossref Link(DOI)<a href=\"https://search.crossref.org/?from_ui=&amp;q=10.59256%2Fijsreat.20240402025\" target=\"_blank\">:</a><span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/?from_ui=&amp;q=10.59256%2Fijsreat.20240402025\" target=\"_blank\"> Click Here</a></span> (Please check after 48 hrs.)<br></p>','paid-2',1,467,1,'2024-04-17 19:17:03','2024-04-19 05:46:21'),(500,1,468,NULL,'KrishiMitra: Growing Smarter with AI-Powered Farming','<p>Considering the vast challenges Indian Farmers&nbsp;<span style=\"font-size: 0.875rem;\">undergo, a project based on AI-powered farming has been&nbsp;</span><span style=\"font-size: 0.875rem;\">developed. The project offers an all-in-one solution for Indian&nbsp;</span><span style=\"font-size: 0.875rem;\">Farmers. It can quickly detect and diagnose potential crop&nbsp;</span><span style=\"font-size: 0.875rem;\">threats, fertilizer usage and provide accurate weather forecasts.&nbsp;</span><span style=\"font-size: 0.875rem;\">Our crop recommendation system suggests suitable crops based&nbsp;</span><span style=\"font-size: 0.875rem;\">on soil type and climate conditions, helping farmers maximize&nbsp;</span><span style=\"font-size: 0.875rem;\">their profits and come out of Debt traps (in India, the farmers’&nbsp;</span><span style=\"font-size: 0.875rem;\">suicide rate is very high due to debt challenges). We integrate&nbsp;</span><span style=\"font-size: 0.875rem;\">these four essential features with machine learning to revolution</span><span style=\"font-size: 0.875rem;\">ize farming practices and achieving sustainable growth.</span></p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p>','no_image.jpg','Krishimitra_1713459221.doc',NULL,NULL,NULL,1,2,1,6,'INDJCST',1,1,1,15,'2024-04-29','<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IndJcst Journal Link:<a href=\"https://indjcst.com/archives?paperid=4175328659772295355\" target=\"_blank\"> </a><span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://indjcst.com/archives?paperid=4175328659772295355\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/indjcst/archives?year=2024&amp;volume=3&amp;issue=1\" target=\"_blank\">Click Here</a></span><br><br>Crossref Link(DOI): <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/search/works?q=10.59256%2Findjcst.20240301010&amp;from_ui=yes\" target=\"_blank\">Click Here</a></span><a href=\"https://search.crossref.org/search/works?q=10.59256%2Findjcst.20240301010&amp;from_ui=yes\" target=\"_blank\"> </a>(Please check after 48 hrs.)<br></p>','paid-2',1,468,1,'2024-04-18 16:53:41','2024-04-29 04:33:15'),(501,1,469,NULL,'Review paper on Case Study on Green Building','<p>Green building is a cutting-edge approach to creating environmentally friendly structures that use effective renewable energy sources without harming the environment over the course of its lifetime. This research journal is a case study of how elements from an existing conventional structure were implemented to make it a green building. Certain regulatory boards, referred to as rating systems, assess buildings based on their standards. The dynamics of green building, including material efficiency, waste reduction, indoor air quality, water efficiency, and energy efficiency, are examined in this case study. This case study has shown that by looking at the components and ideas of green building, a building\'s life and other characteristics may be efficiently improved. Additionally, it is determined that the directions furnished by rating systems are efficacious.\r\n</p><p>Key Word:  Principle of Green Building, Green Building Rating System, Elements, Case Study, etc.\r\n</p><p><br></p>','no_image.jpg','FINAL_RESEARCH_PAPER4_1713507971.docx',NULL,NULL,NULL,1,2,1,2,'IJSREAT',2,1,1,1,NULL,NULL,NULL,0,469,NULL,'2024-04-19 06:26:11','2024-04-19 06:26:11'),(502,1,469,NULL,'Review paper on Case Study on Green Building','<p>Green building is a cutting-edge approach to creating environmentally friendly structures that use effective renewable energy sources without harming the environment over the course of its lifetime. This research journal is a case study of how elements from an existing conventional structure were implemented to make it a green building. Certain regulatory boards, referred to as rating systems, assess buildings based on their standards. The dynamics of green building, including material efficiency, waste reduction, indoor air quality, water efficiency, and energy efficiency, are examined in this case study. This case study has shown that by looking at the components and ideas of green building, a building\'s life and other characteristics may be efficiently improved. Additionally, it is determined that the directions furnished by rating systems are efficacious.\r\n</p><p>Key Word:  Principle of Green Building, Green Building Rating System, Elements, Case Study, etc.\r\n</p><p><br></p>','no_image.jpg','FINAL_RESEARCH_PAPER4_1713507976.docx',NULL,NULL,NULL,1,2,1,2,'IJSREAT',2,1,1,15,NULL,'<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJSREAT Journal Link:<a href=\"https://ijsreat.com/archives?paperid=1434899133281973710\" target=\"_blank\"> </a><span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://ijsreat.com/archives?paperid=1434899133281973710\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link:<span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijsreat/archives?year=2024&amp;volume=4&amp;issue=2\" target=\"_blank\"> Click Here</a></span><br><br>Crossref Link(DOI): <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/?from_ui=&amp;q=10.59256%2Fijsreat.20240402026\" target=\"_blank\">Click Here</a> </span>(Please check after 48 hrs.)<br></p>','paid-2',1,469,1,'2024-04-19 06:26:16','2024-04-21 08:37:15'),(503,15,470,NULL,'THE LOOPHOLES AND THE CRITICAL ANALYSIS ON DOCTRINE OF NECESITY WITH REFERENCE TO IPC','<p>The Doctrine of Necessity is a fundamental principle in the Indian Penal Code (IPC) that seeks to balance the strict application of the law with the practical exigencies of real-life situations. This abstract outline an in-depth examination of the Doctrine of Necessity within the context of the IPC. The study aims to elucidate the origins and evolution of this doctrine, its relevance in contemporary legal jurisprudence, and its application in Indian criminal law.</p><p>The research delves into notable legal cases and precedents where the Doctrine of Necessity has been invoked, highlighting its significance in providing an exception to criminal liability when actions are taken out of necessity and in the absence of alternative means. Furthermore, the paper explores the doctrinal and jurisprudential underpinnings of this principle, drawing from both Indian and international legal perspectives.</p><p>The investigation also scrutinizes the inherent challenges and ambiguities associated with the Doctrine of Necessity, including the subjectivity of what constitutes necessity and the potential for misuse or abuse. Additionally, it will discuss the ongoing debates and critiques surrounding this doctrine, assessing its limitations and proposing possible improvements or clarifications.</p><p>By offering a comprehensive analysis of the Doctrine of Necessity in the Indian Penal Code, this research project aims to contribute to a better understanding of the legal principles governing exceptions to criminal liability in situations of necessity, thus aiding in the development of a more just and equitable legal system.</p><p><br></p><p>Keywords: Doctrine of Necessity, Contemporary legal jurisprudence, Indian criminal law, Inherent challenges, Ambiguities, debates, critiques, Limitations, Legal principals, Criminal liability.</p><p>lity.</p>','no_image.jpg','THE_LOOPHOLES_AND_THE_CRITICAL_ANALYSIS_ON_DOCTRINE_OF_NECESITY_WITH_REFERENCE_TO_IPC_1713533637.docx',NULL,NULL,NULL,1,2,1,3,'IJRTMR',4,1,1,1,NULL,NULL,NULL,0,470,NULL,'2024-04-19 13:33:57','2024-04-19 13:33:57'),(504,15,470,NULL,'THE LOOPHOLES AND THE CRITICAL ANALYSIS ON DOCTRINE OF NECESITY WITH REFERENCE TO IPC','<p>The Doctrine of Necessity is a fundamental principle in the Indian Penal Code (IPC) that seeks to balance the strict application of the law with the practical exigencies of real-life situations. This abstract outline an in-depth examination of the Doctrine of Necessity within the context of the IPC. The study aims to elucidate the origins and evolution of this doctrine, its relevance in contemporary legal jurisprudence, and its application in Indian criminal law.</p><p>The research delves into notable legal cases and precedents where the Doctrine of Necessity has been invoked, highlighting its significance in providing an exception to criminal liability when actions are taken out of necessity and in the absence of alternative means. Furthermore, the paper explores the doctrinal and jurisprudential underpinnings of this principle, drawing from both Indian and international legal perspectives.</p><p>The investigation also scrutinizes the inherent challenges and ambiguities associated with the Doctrine of Necessity, including the subjectivity of what constitutes necessity and the potential for misuse or abuse. Additionally, it will discuss the ongoing debates and critiques surrounding this doctrine, assessing its limitations and proposing possible improvements or clarifications.</p><p>By offering a comprehensive analysis of the Doctrine of Necessity in the Indian Penal Code, this research project aims to contribute to a better understanding of the legal principles governing exceptions to criminal liability in situations of necessity, thus aiding in the development of a more just and equitable legal system.</p><p><br></p><p>Keywords: Doctrine of Necessity, Contemporary legal jurisprudence, Indian criminal law, Inherent challenges, Ambiguities, debates, critiques, Limitations, Legal principals, Criminal liability.</p><p>lity.</p>','no_image.jpg','THE_LOOPHOLES_AND_THE_CRITICAL_ANALYSIS_ON_DOCTRINE_OF_NECESITY_WITH_REFERENCE_TO_IPC_1713533662.docx',NULL,NULL,NULL,1,2,1,3,'IJRTMR',4,1,1,3,NULL,NULL,NULL,0,470,NULL,'2024-04-19 13:34:22','2024-04-19 15:11:03'),(505,2,471,NULL,'A Proportional Analysis Study on School Students\' Performance System Using Machine Learning Algorithms','<p>Objectives: Investigate global literacy rates and educational challenges, particularly focusing on gender disparities and the educational attainment of Sovereign states, while exploring the potential of Business Intelligence/Data Mining (BI/DM) techniques in addressing high school success. Methods: Utilized real-world data encompassing demographic, social, and academic characteristics, collected through certificates and questionnaires. Employed five-level/binary classification and regression tasks, testing four DM models (decision trees, random forest, neural networks, support vector machines) with and without leading notes. Findings: Comprehensive literacy rates were around 86% in 2016, with higher rates among younger age groups. Disparities in tertiary education attainment exist globally, with developed nations leading. Efforts to improve primary education access have shown progress but persisting challenges include gender disparities and insufficient resources. BI/DM techniques demonstrated potential in improving high school success rates, particularly in mathematics and Sovereign states. Novelty: This study highlights the innovative application of BI/DM techniques in addressing educational challenges, offering insights into improving high school success rates with real-world data and advanced modeling approaches</p>','no_image.jpg','Manuscript_1713584303.docx',NULL,NULL,NULL,1,2,1,1,'IJIRE',1,1,1,1,NULL,NULL,NULL,0,471,NULL,'2024-04-20 03:38:23','2024-04-20 03:38:23'),(506,2,471,NULL,'A Proportional Analysis Study on School Students\' Performance System Using Machine Learning Algorithms','<p>Objectives: Investigate global literacy rates and educational challenges, particularly focusing on gender disparities and the educational attainment of Sovereign states, while exploring the potential of Business Intelligence/Data Mining (BI/DM) techniques in addressing high school success. Methods: Utilized real-world data encompassing demographic, social, and academic characteristics, collected through certificates and questionnaires. Employed five-level/binary classification and regression tasks, testing four DM models (decision trees, random forest, neural networks, support vector machines) with and without leading notes. Findings: Comprehensive literacy rates were around 86% in 2016, with higher rates among younger age groups. Disparities in tertiary education attainment exist globally, with developed nations leading. Efforts to improve primary education access have shown progress but persisting challenges include gender disparities and insufficient resources. BI/DM techniques demonstrated potential in improving high school success rates, particularly in mathematics and Sovereign states. Novelty: This study highlights the innovative application of BI/DM techniques in addressing educational challenges, offering insights into improving high school success rates with real-world data and advanced modeling approaches.</p>','no_image.jpg','Manuscript_1713584550.docx',NULL,NULL,NULL,1,2,1,2,'IJSREAT',1,1,1,5,NULL,NULL,NULL,0,471,NULL,'2024-04-20 03:42:30','2024-04-22 04:46:07'),(508,1,473,NULL,'Water Footprint: A Review Based on Concepts, Methods, and Implications','<p>Water footprint assessment has become a useful method for assessing how much water is used by products and activities related to humans, offering insights into how water resources might be managed sustainably. While agricultural production accounts for the majority of water consumption worldwide, the industrial and residential sectors also use large amounts of water and cause pollution. This review article provides an examination of the approaches and uses of water footprint assessment in a range of industries and geographical areas. The notion of water footprint and its elements green, blue, and grey water footprints as well as the corresponding computation techniques are introduced at the outset of the work. The most recent developments in spatially explicit modelling and life cycle assessment techniques, it examines the development of water footprint assessment procedures. The paper explores the many uses of water footprint assessment, from consumer items and urban water management to industrial operations and agricultural output. It provides case studies and real-world examples that show how water footprint analysis may be applied practically to address issues with pollution, water shortages, and sustainability in various settings. The study also looks at the difficulties and constraints that come with assessing the water footprint, such as methodological uncertainty, data availability, and temporal and geographical variability. It talks about current studies as well as potential paths forward for improving the reliability and usability of water footprint measurement instruments. As a comprehensive and integrated method for measuring and controlling the effects of human-induced water usage on regional and global water resources, this study concludes by highlighting the importance of water footprint assessment. In order to promote sustainable water management practices, it highlights the necessity of multidisciplinary collaboration and stakeholder involvement.\r\n</p><p>Keywords: Water Footprint, Sustainability, Life Cycle Assessment, Spatial Analysis.\r\n</p><p><br></p>','no_image.jpg','Review_paper_Reshmi_1713680882.docx',NULL,NULL,NULL,1,2,1,1,'IJIRE',2,1,1,15,NULL,'<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJIRE Journal Link: <span style=\"background-color: rgb(255, 255, 0);\"><a href=\"https://theijire.com/archives?paperid=6382224809046685412\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link: <span style=\"background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijire/archives?year=2024&amp;volume=5&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>Crossref Link(DOI): <span style=\"background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/?from_ui=&amp;q=10.59256%2Fijire.20240502032\" target=\"_blank\">Click Here</a></span><a href=\"https://search.crossref.org/?from_ui=&amp;q=10.59256%2Fijire.20240502032\" target=\"_blank\"> </a>(Please check after 48 hrs.)<br></p>','paid-2',1,473,1,'2024-04-21 06:28:02','2024-04-24 08:45:14'),(517,1,453,NULL,'Water Quality Assessment of Godavari River','<p>Godavari is the second largest river in India. It originates from Triambakeswar, Nashik, Maharashtra and finally discharges into the Bay of Bengal near Narasapuram in West Godavari district of Andhra Pradesh. The study covers about 39 km of river starting from Gangadwar to Dasak village. Five locations were selected for collection of water samples from the river and water samples were analysed for water quality parameters. It was observed that untreated or partially treated sewage&nbsp; the river at five prominent locations in the study stretch. Based upon the results, the existing conservation measures have been reviewed and additional measures are suggested. The study concludes that infiltration of sewage is the main precursor of Godavari river pollution and available sewage treatment facilities in the region are inadequate.</p>','no_image.jpg','RESEARCH_PAPER_OF_WATER_QUALITY_ASSESSMENT_OF_GODAVARI_RIVER_1713879578.docx',NULL,NULL,NULL,1,2,1,2,'IJSREAT',4,1,1,15,NULL,'<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJSREAT Journal Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://ijsreat.com/archives?paperid=1821094916151031727\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link:<span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijsreat/archives?year=2024&amp;volume=4&amp;issue=2\" target=\"_blank\"> Click Here</a></span><br><br>Crossref Link(DOI):<a href=\"https://search.crossref.org/?from_ui=&amp;q=10.59256%2Fijsreat.20240402027\" target=\"_blank\"> </a><span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/?from_ui=&amp;q=10.59256%2Fijsreat.20240402027\" target=\"_blank\">Click Here</a></span> (Please check after 48 hrs.)<br></p>','paid-2',1,453,1,'2024-04-23 13:39:38','2024-04-26 14:51:55'),(518,1,480,NULL,'An Intelligent Traffic Signalling System based on integration of an Arduino and infrared sensor','<p>Currently, traffic lights operate according to a predetermined timetable, which might cause issues if certain lanes are empty while others are congested. To fix this, we came up with a smart traffic system. Our method proposes leaving the green light on longer than usual when there are a lot of automobiles on one side of the road. To determine this, we employ specialized sensors known as PIR sensors. A tiny computer called an Arduino control how many cars are allowed to pass and how long the green signal lasts. The Arduino determines when to change the lights by using sensors along the road to determine whether there are any cars nearby. In the parts that follow, we will go over every detail of how this system operates. Our project\'s primary objective is to create a traffic system that can automatically adjust the lights at an intersection according to the number of cars there. We believe that it is time to replace the outdated light timing system with a new autonomous system, as traffic congestion is a major issue in cities worldwide.</p>','no_image.jpg','An_Intelligent_Traffic_Signalling_System_based_on_integration_of_an_Arduino_and_infrared_sensor_1713887756.docx',NULL,NULL,NULL,1,2,1,6,'INDJCST',1,1,3,5,NULL,NULL,NULL,0,480,NULL,'2024-04-23 15:55:56','2024-04-24 06:15:49'),(519,1,484,NULL,'ASPIREAI: AI CHATBOT FOR CAREER GUIDANCE','<p>This paper introduces AspireAI, an AI chatbot designed for comprehensive career guidance. With the proliferation of Artificial Intelligence (AI), integrating such technology into career counseling is increasingly vital. Leveraging Large Language Models (LLMs), AspireAI provides personalized career information, job search advice, and educational recommendations. Our methods entail training LLMs on vast datasets of career-related content to enhance conversational capabilities. Results demonstrate AspireAI\'s efficacy in delivering tailored guidance, aiding users in making informed career decisions. Through this research, we highlight the importance and potential of AI-driven solutions in facilitating career exploration and advancement.</p>','no_image.jpg','Article_Template_1713952148.docx',NULL,NULL,NULL,1,2,1,1,'IJIRE',1,1,1,15,NULL,'<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJIRE Journal Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://theijire.com/archives?paperid=766595398245368585\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijire/archives?year=2024&amp;volume=5&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>Crossref Link(DOI):<span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/?from_ui=&amp;q=10.59256%2Fijire.20240502033\" target=\"_blank\"> Click Here</a></span> (Please check after 48 hrs.)<br></p>','paid-2',1,484,1,'2024-04-24 09:49:08','2024-04-25 08:48:42'),(520,1,485,NULL,'Combined analysis of different power systems','<p>The paper is used to analysis 4 different hybrid power generating station, Which combination gives good efficiency compare to others using Matlab simulink tool.</p>','no_image.jpg',NULL,NULL,NULL,NULL,1,2,1,4,'INDJEEE',1,1,1,3,NULL,NULL,NULL,0,485,NULL,'2024-04-24 11:35:59','2024-04-25 14:19:51'),(521,1,486,NULL,'Design and Analysis of Deep Learning Framework for Early Detection of Cancer Disease','<p>Cancer, notably brain and lung cancers, is a leading global cause of death, challenging to detect early. Traditional diagnostic methods struggle due to their complexity and lack of specific symptoms. Deep learning models show promise but need improvement, especially for early-stage brain and lung cancers. Challenges include limited data, complex features, and interpretability issues. This research aims to enhance deep learning methodologies by incorporating advanced techniques like transfer learning and attention mechanisms. The goal is to accurately detect and classify early-stage cancers, addressing existing challenges, gaining insights into biological mechanisms, and ultimately improving patient outcomes through earlier detection and treatment.</p><p><br></p>','no_image.jpg','Ravina_Paper_(1)_1713968677.docx',NULL,NULL,NULL,1,2,1,1,'IJIRE',1,1,2,15,NULL,'<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJIRE Journal Link:<span style=\"color: rgb(0, 0, 255);\"><span style=\"background-color: rgb(255, 255, 0);\"> <a href=\"https://theijire.com/archives?paperid=7477317951976422063\" target=\"_blank\">Click Here</a></span><br></span><br>FDRP Website Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijire/archives?year=2024&amp;volume=5&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>Crossref Link(DOI): <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/search/works?q=10.59256%2Fijire.20240502036&amp;from_ui=yes\" target=\"_blank\">Click Here</a></span> (Please check after 48 hrs.)<br></p>','paid-2',0,486,1,'2024-04-24 14:24:37','2024-04-26 10:06:08'),(522,6,57,NULL,'test_24.04.2024','<p>teerrerr</p>','no_image.jpg','IJIRE_0000508_1713972406.docx',NULL,NULL,NULL,1,2,1,1,'IJIRE',6,1,1,1,NULL,NULL,'paid-1',0,57,NULL,'2024-04-24 15:26:46','2024-04-24 15:42:47'),(524,1,443,NULL,'Improving Shopping Mall Revenue by Real-Time Customized Digital Coupon Issuance','<p>With the development of big data and deep learning technology, big data and deep learning technology have also been applied to the marketing field, which was a part of business administration. Customer churn management is one of the most important areas of marketing. In this paper, we proposed a method to prevent customer churn and increase purchase conversion rate by issuing customized discount coupons to customers with high churn rate based on big data in real time. After segmenting customer segments with two-dimensional segment analysis, a real-time churn rate estimation model based on clickstream data was generated for each segment. After that, we issued customized coupons to our customers. Finally, we tested the conversion rate and sales growth. A two-dimensional cluster analysis-based churn rate estimation combined with a recommendation system was found to be significantly more useful than the respective simple models. Using this proposed model, it is possible to increase sales by automatically estimating the customer’s churn probability and shopping propensity without the burden of marketing costs in the online shopping mall.</p>','no_image.jpg','Madhu_Improving_Shopping_Mall_Revenue_1714041772.docx',NULL,NULL,NULL,1,2,1,1,'IJIRE',1,1,1,15,NULL,'<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJIRE Journal Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://theijire.com/archives?paperid=6310453278476684835\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijire/archives?year=2024&amp;volume=5&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>Crossref Link(DOI):<a href=\"https://search.crossref.org/?from_ui=&amp;q=10.59256%2Fijire.20240502035\" target=\"_blank\"> </a><span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/?from_ui=&amp;q=10.59256%2Fijire.20240502035\" target=\"_blank\">Click Here</a> </span>(Please check after 48 hrs.)<br></p>','paid-2',1,443,1,'2024-04-25 10:42:52','2024-04-26 10:02:22'),(525,1,485,NULL,'Combined analysis of hybrid energy systems','This paper is the analysis of different types of hybrid power systems which performs better than others by using Matlab simulink tool','no_image.jpg','journal_1714043999.docx',NULL,NULL,NULL,1,2,1,4,'INDJEEE',1,1,1,17,NULL,NULL,NULL,0,485,NULL,'2024-04-25 11:19:59','2024-04-26 07:13:07'),(526,1,491,NULL,'Artificial Intelligence Ethics: Addressing Bias and Fairness in Machine Learning Models','<p>Machine learning (ML) and artificial intelligence (AI) have completely changed a number of facets of human existence, including healthcare, banking, transportation, and entertainment. But there are ethical issues with AI\'s widespread use, especially when it comes to prejudice and fairness in ML models. Decision-making processes, algorithms, and data all contain biases that can produce biased results and reinforce social injustices. This study investigates the moral ramifications of biased AI systems, looks at different types of bias, and looks at methods to lessen bias and guarantee fairness in ML models.</p>','no_image.jpg','8008_Research_Paper_1714048915.docx',NULL,NULL,NULL,2,2,1,1,'IJIRE',2,1,1,3,NULL,NULL,NULL,0,491,491,'2024-04-25 12:11:45','2024-04-25 14:18:50'),(527,1,491,NULL,'Artificial Intelligence Ethics: Addressing Bias and Fairness in Machine Learning Models.','<p>Machine learning (ML) and artificial intelligence (AI) have completely changed a number of facets of human existence, including healthcare, banking, transportation, and entertainment. But there are ethical issues with AI\'s widespread use, especially when it comes to prejudice and fairness in ML models. Decision-making processes, algorithms, and data all contain biases that can produce biased results and reinforce social injustices. This study investigates the moral ramifications of biased AI systems, looks at different types of bias, and looks at methods to lessen bias and guarantee fairness in ML models.</p>','no_image.jpg','8008_Research_Paper_1714049564.docx',NULL,NULL,NULL,1,2,1,2,'IJSREAT',2,1,1,5,NULL,NULL,NULL,0,491,NULL,'2024-04-25 12:52:44','2024-04-26 07:02:21'),(528,1,251,NULL,'PARTICLE SWARM OPTIMIZATION FOR 5G AND BEYOND','<p>Network embedding assigns nodes in a network to low dimensional representations and effectively preserves the network structure. Recently, a significant amount of progresses has been made toward this emerging network analysis paradigm. In this survey, we focus on categorizing and then reviewing the current development on network embedding methods, and point out its future research directions. We firs tsummarize the motivation of network embedding. Particle Swarm Optimization (PSO) algorithm is used as the proposed method. We discuss the classical graph embedding algorithms on cognitive radio environment and their relationship with network embedding. Afterwards and primarily, we provide a comprehensive overview of a large number of networks embedding methods in a systematic manner, covering the structure- and property-preserving network embedding methods, the network embedding methods with side information and the advanced information preserving network embedding methods. Moreover, several evaluation approaches for network embedding and some useful online resources, including the network data sets and software, are reviewed, too. Finally, we discuss the framework of exploiting these network embedding methods to build an effective system and point out some potential future directions.\r\n</p><p>Key Words- Particle Swarm Optimization (PSO), Beyond5G(B5G),InternetofThink(IOT),Machine Learning (ML)etc….\r\n</p><p><br></p>','no_image.jpg','Particle_Swarm_Optimization_for_5g_and_beyond_maha_1_4_1714115691.pdf',NULL,NULL,NULL,1,2,1,1,'IJIRE',1,1,1,15,NULL,'<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJIRE Journal Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://theijire.com/archives?paperid=5493881495948708950\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijire/archives?year=2024&amp;volume=5&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>Crossref Link(DOI): <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/?from_ui=&amp;q=10.59256%2Fijire.20240502039\" target=\"_blank\">Click Here</a></span> (Please check after 48 hrs.)<br></p>',NULL,1,251,1,'2024-04-26 07:14:51','2024-04-29 09:50:51'),(529,1,492,NULL,'Gravity Battery','<p>As in today’s world the penetration of&nbsp;<span style=\"font-size: 0.875rem;\">&nbsp;</span>renewable<span style=\"font-size: 0.875rem;\">&nbsp;energy resources is increasing for</span></p><p>electricity production, the problems due to\r\n</p><p>unpredictable nature and variable output of\r\n</p><p>these resources increases. Solution to these\r\n</p><p>problem leads to the need of proper energy\r\n</p><p>storage systems. There are various energy\r\n</p><p>storage techniques that been developed and\r\n</p><p>being using since long time e.g. battery\r\n</p><p>storage, compressed air energy storage, pumped hydro storage, flywheel storage etc., but each technique has some limitations. This paper explores and gives an overview of\r\n</p><p>recent gravity based energy storage\r\n</p><p>techniques.</p><p><br></p>','no_image.jpg','paper_publication_final_1714122112.pdf',NULL,NULL,NULL,1,2,1,4,'INDJEEE',1,1,1,17,NULL,NULL,NULL,0,492,NULL,'2024-04-26 09:01:52','2024-04-26 16:14:46'),(530,2,493,NULL,'ANALYZING AND ENHANCING YOUTUBE RANKING ALGORITHMS FOR VIDEO RECOMMENDATIONS','<p>In the rapidly evolving digital space, staying ahead is pivotal for video platforms. The dynamics of recommendation systems, responsible for curating a tailored experience for millions of users daily, become paramount in this pursuit. This study embarks on a comprehensive journey to dissect, simulate, and optimize the algorithms underpinning these recommendations. The proposed segments delve deeper into the specific objectives of this research endeavor. Analyzing YouTube\'s existing recommendation algorithms and leveraging a proposed model to create a user-friendly interface for the simulation of these algorithms. Testing and evaluating the efficacy of the enhanced algorithms against a benchmark dataset. The future of digital video platforms is intertwined with the evolution of recommended algorithm By enhancing the way platforms like YouTube recommend videos, this study aspires to contribute significantly to improving user experience and platform efficiency</p>','no_image.jpg','algorithm_for_you_tube_recommendations_1714123039.doc',NULL,NULL,NULL,1,2,1,1,'IJIRE',1,1,1,5,NULL,NULL,NULL,0,493,NULL,'2024-04-26 09:17:19','2024-04-27 05:03:09'),(531,1,494,NULL,'Experience design: A holistic approach to user-centric design','<p>The experience design involves the fundamental principles and methods of creating products and experiences that analyses the requirements, expectation and behaviors of users before presenting a prototype of the designed product. This article is highlighting the meaning of experience design and phases of the experience design which begins with the gathering of requirements from the users, then followed by the preparation of a prototype of the product from the defined requirements of the users, then user feedback is taken for transforming the prototype design into the development of final product. The paper is also presenting the paradigm shift from traditional ways of designing the products to innovative digital methods of designing the products by considering user experience. The challenges are also discussed for preparing the product design based on user experience and expectations and considering the user expectations for continuous improvement in the product design. The applications of experience design are also discussed. The practical implications are also demonstrated in the article of experience design. The article is concluding the human centric approach for designing the products. The importance of understanding users\' expectations, behaviour, emotions, and motivations to design the products or solutions is also emphasized in the article. The article is presenting a systematic framework for practicing user-centred design where preference is given to the user expectations for designing the solutions.&nbsp;</p>','no_image.jpg','Designing_for_Humans_1714141959.docx',NULL,NULL,NULL,1,2,1,3,'IJRTMR',3,1,2,15,NULL,'<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJRTMR Journal Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://ijrtmr.com/archives?paperid=3606601296975019880\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link:<span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijrtmr/archives?year=2024&amp;volume=4&amp;issue=2\" target=\"_blank\"> Click Here</a></span><br><br>Crossref Link(DOI): <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/?from_ui=&amp;q=10.59256%2Fijrtmr.20240402017\" target=\"_blank\">Click Here</a></span> (Please check after 48 hrs.)<br></p>','paid-2',1,494,1,'2024-04-26 14:32:39','2024-04-29 04:29:46'),(532,1,455,NULL,'Biometric And Voice Command Motorcycle Security System  With Alcohol Detection','<p style=\"text-align: justify; \"><i>Enhancing the security measures in motorcycles is imperative given the prevalence&nbsp;<span style=\"font-size: 0.875rem;\">of theft incidents facilitated by the current weak mechanical locks. Consequently, there\'s a&nbsp;</span><span style=\"font-size: 0.875rem;\">pressing need for an advanced security system to support the protection of motorcycles. This&nbsp;</span><span style=\"font-size: 0.875rem;\">endeavour outlines the development of such a system, integrating fingerprint recognition and&nbsp;</span><span style=\"font-size: 0.875rem;\">voice command capabilities for access. The outcomes of this initiative demonstrate a marked&nbsp;</span><span style=\"font-size: 0.875rem;\">enhancement in security compared to conventional mechanical key systems. With the alarming&nbsp;</span><span style=\"font-size: 0.875rem;\">rise in road accidents, prioritizing rider safety is paramount. This project aims to mitigate&nbsp;</span><span style=\"font-size: 0.875rem;\">accident risks by addressing common causes such as alcohol impairment and drowsiness. Upon&nbsp;</span><span style=\"font-size: 0.875rem;\">detecting these factors, the system alerts the rider via an alarm and, if stationary, automatically disables</span><span style=\"font-size: 0.875rem;\">&nbsp;the ignition and locks the bike as a precautionary measure.&nbsp;</span></i></p>','no_image.jpg','Biometric_fingerprint_and_voice_command_with_alochol_detection_1714151302.docx',NULL,NULL,NULL,1,2,1,5,'INDJECE',1,1,2,15,NULL,'<p><span style=\"color: rgb(0, 0, 255);\"><b>Published Article Details:</b></span><br><br>FDRP Website Link: <span style=\"background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/indjece/archives?year=2024&amp;volume=1&amp;issue=1\" target=\"_blank\">Click Here</a></span><br><br><br></p>',NULL,1,455,1,'2024-04-26 17:08:22','2024-04-29 09:49:46'),(533,1,57,NULL,'test_26.04.2024','<p>fffff</p>','no_image.jpg','INDJECE_0000137_Plagiarism_report_56__1714153769.pdf',NULL,NULL,NULL,1,2,1,5,'INDJECE',1,1,1,17,NULL,NULL,NULL,0,57,NULL,'2024-04-26 17:49:29','2024-04-26 18:05:05'),(534,1,304,NULL,'AN INTERVIEW SYSTEM USING AI TECHNOLOGY','<p>The rapid advancement of artificial intelligence (AI) has led to innovative applications across various industries, and one such application is the development of an AI-based interview system. This system aims to enhance and streamline the traditional interview process by leveraging AI technologies to assess and interact with candidates. The AI- based interview system incorporates natural language processing (NLP), machine learning (ML), and sentiment analysis algorithms to analyze both verbal and non-verbal cues during interviews. By employing AI, the system can assess a candidate\'s communication skills, problem-solving abilities, and cultural fit within the organization. The system\'s machine learning algorithms continuously learn and improve over time, enhancing their ability to accurately evaluate candidates and predict their potential success within the company. The benefits of an AI-based interview system include increased efficiency in the hiring process, reduction in human bias, and the ability to handle a large number of interviews simultaneously. Furthermore, the system can provide data-driven insights to recruiters, aiding in evidence-based decision-making. While the development and implementation of an AI-based interview system pose ethical considerations and challenges related to privacy and bias, ongoing research and ethical<br>guidelines are essential to address these concerns and ensure fair and transparent use of the technology. As technology continues to evolve, further research and collaboration between AI developers and human resource professionals are crucial to harness the full potential of this innovative tool in the hiring process.<br><br></p>','no_image.jpg','paper_sample_report_1714198892.docx',NULL,NULL,NULL,1,2,1,6,'INDJCST',1,2,2,1,NULL,NULL,NULL,0,304,NULL,'2024-04-27 06:21:32','2024-04-27 06:21:32'),(535,1,304,NULL,'AN INTERVIEW SYSTEM USING AI TECHNOLOGY','<p>The rapid advancement of artificial intelligence (AI) has led to innovative applications across various industries, and one such application is the development of an AI-based interview system. This system aims to enhance and streamline the traditional interview process by leveraging AI technologies to assess and interact with candidates. The AI- based interview system incorporates natural language processing (NLP), machine learning (ML), and sentiment analysis algorithms to analyze both verbal and non-verbal cues during interviews. By employing AI, the system can assess a candidate\'s communication skills, problem-solving abilities, and cultural fit within the organization. The system\'s machine learning algorithms continuously learn and improve over time, enhancing their ability to accurately evaluate candidates and predict their potential success within the company. The benefits of an AI-based interview system include increased efficiency in the hiring process, reduction in human bias, and the ability to handle a large number of interviews simultaneously. Furthermore, the system can provide data-driven insights to recruiters, aiding in evidence-based decision-making. While the development and implementation of an AI-based interview system pose ethical considerations and challenges related to privacy and bias, ongoing research and ethical<br>guidelines are essential to address these concerns and ensure fair and transparent use of the technology. As technology continues to evolve, further research and collaboration between AI developers and human resource professionals are crucial to harness the full potential of this innovative tool in the hiring process.<br><br></p>','no_image.jpg','paper_sample_report_1714199022.docx',NULL,NULL,NULL,1,2,1,1,'IJIRE',1,1,2,15,NULL,'<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJIRE Journal Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://theijire.com/archives?paperid=7628679669232548053\" target=\"_blank\">Click Here</a></span><br><br>FDRP Website Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijire/archives?year=2024&amp;volume=5&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>Crossref Link(DOI): <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/?from_ui=&amp;q=10.59256%2Fijire.20240502038\" target=\"_blank\">Click Here</a></span> (Please check after 48 hrs.)<br></p>','paid-2',1,304,1,'2024-04-27 06:23:42','2024-04-30 04:42:19'),(536,1,500,NULL,'FAULT DETECTION IN SUBSURFACE ENVIRONMENT USING LSTM MODEL','<p>n the past few years, with the rise of urban \r\n</p><p>dimensions and building of energy infrastructure, \r\n</p><p>more cities construct underground cables to replace \r\n</p><p>power lines in terms of sustainability and safety. \r\n</p><p>Underground cables are susceptible to a variety of \r\n</p><p>problems as a result of underground environments, \r\n</p><p>tear, damage and it also relates to all other factors. \r\n</p><p>This proposed system uses LSTM algorithm and \r\n</p><p>Ohm’s law to identify the specific location of the defect \r\n</p><p>that arises between the consumer and Grid System \r\n</p><p>Environment. Ohm’s Law defines the association \r\n</p><p>between voltage, current, and resistance in a circuit. \r\n</p><p>This technique can be used, together with LSTM \r\n</p><p>algorithms capable of processing data in batches, to \r\n</p><p>examine voltage and current measurements and \r\n</p><p>precisely determine the position of flaws along a\r\n</p><p>connection. The use of LSTM algorithms improves \r\n</p><p>both the precision and the efficacy of fault detection \r\n</p><p>systems by identifying behavioral trends in fault data \r\n</p><p>such as temperature, humidity and the cable status. \r\n</p><p>The aim of the project is to identify the location of \r\n</p><p>faults in centimeters.</p>','no_image.jpg','FAULT_DETECTION_IN_SUBSURFACE_ENVIRONMENT_USING_LSTM_paper_1714216615.docx',NULL,NULL,NULL,1,2,1,1,'IJIRE',1,1,2,5,NULL,NULL,NULL,0,500,NULL,'2024-04-27 11:16:55','2024-04-29 04:23:40'),(537,3,501,NULL,'Formulation and Optimization of Ropinirole Hydrochloride Loaded Mucoadhesive Niosome for Intranasal Delivery','<p>The goal of the prevailing look at was to enhance Ropinirole HCL bioavailability via niosomal-primarily based components designed for intranasal delivery. Niosomes were developed by mixing ldl cholesterol and surfactants ratio and the usage of Noveon AA1 Polycarbophil as a mucoahesive polymer. Niosomes have been prepared by way of ethanol injection technique. Entrapment efficiency, Particle length, Zeta capability, In vitro drug launch, Mucin binding efficacy, ex-vivo permeation and niosomes balance were determined. Niosomes suggests entrapment efficiency 80%, particle size260nm, and zeta capacity starting from -11 to-27 mV. The produced niosomes suggests prolonged drug launch. Balance research of optimized batch showed non great adjustments in niosomes parameters over a garage duration of 1 month.</p><p><br></p>','no_image.jpg','Niosome_Research_Paper_1714224227.docx',NULL,NULL,NULL,1,2,1,3,'IJRTMR',1,1,1,3,NULL,NULL,NULL,0,501,NULL,'2024-04-27 13:23:47','2024-04-28 05:32:39'),(538,3,502,NULL,'A review on quality by design approach for pharmaceuticals','<p>Quality by design (QbD) is an important part in today\'s pharmaceutical quality \r\n</p><p>developments. Quality design (QBD) is a modern and systematic approach to product \r\n</p><p>development and pharmaceutical quality. Quality by design is a concept proposed by well-\r\n</p><p>known quality expert Joseph M. Juran. This paper presents Pharmaceutical Quality by Design \r\n</p><p>(QbD) and how it can be used to ensure pharmaceutical quality. QbD provides a comprehensive \r\n</p><p>framework that integrates quality principles, risk assessment, and knowledge management \r\n</p><p>throughout the product lifecycle. This explores the key concepts and principles of QbD, \r\n</p><p>including the use of Quality Target Product Profile (QTPP), Critical Quality Attributes \r\n</p><p>(CQAs), and Critical Process Parameters (CPPs). The implementation of QbD involves the \r\n</p><p>application of various tools and methodologies, such as design of experiments (DoE), risk \r\n</p><p>assessment techniques, and process analytical technology (PAT). The objective of this review \r\n</p><p>is to discuss the concept of quality by design and describe its application in pharmaceutical \r\n</p><p>product development.</p>','no_image.jpg','A_Review_on_Quality_by_Design_Approach_for_Pharmaceuticals__1714237800.docx',NULL,NULL,NULL,1,2,1,1,'IJIRE',2,1,1,5,NULL,NULL,NULL,0,502,NULL,'2024-04-27 17:10:00','2024-04-29 04:26:48'),(539,1,505,NULL,'Aerodynamics Behaviour in high speed sports jersey fabrics with different roughness','<p>Enhancing aerodynamic performance holds paramount importance in high-speed sports, leading to a growing interest in garments that can positively impact aerodynamic efficiency. Wind tunnel experimentation has played a pivotal role in assessing aerodynamic properties, employing both cylinder and leg models within a closed return circuit tunnel setup. Utilizing a plastic cylinder model, researchers evaluated the aerodynamic properties of various knitted samples, with dummy cylinders introduced to minimize 3D flow effects and ensure adherence to the infinite length hypothesis. By employing the foot and knee as additional dummy components, efforts were made to further mitigate 3D flow effects. These wind tunnel tests encompassed nine knitted single jersey fabrics, predominantly composed of 100% polyester, subjected to speeds ranging from 20 to 80 km/h to simulate real-world sporting conditions. The findings revealed a significant correlation between fabric manufacturing, indicated by the cover factor, and fabric roughness, with discernible impacts on aerodynamic parameters. Notably, consistent aerodynamic behaviors were observed across fabric tests conducted on both the cylinder and leg models, underscoring the reliability of the experimental setup.</p>','no_image.jpg','Rohit_paper_work_27_1714304533.docx',NULL,NULL,NULL,2,2,1,1,'IJIRE',1,1,2,15,NULL,'<p><b><span style=\"color: rgb(0, 0, 255);\">Published Article Details:</span></b><br><br>IJIRE Journal Link:<span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://theijire.com/archives?paperid=5973784422497433137\" target=\"_blank\"> Click Here</a></span><br><br>FDRP Website Link: <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://fdrpjournals.org/ijire/archives?year=2024&amp;volume=5&amp;issue=2\" target=\"_blank\">Click Here</a></span><br><br>Crossref Link(DOI): <span style=\"color: rgb(0, 0, 255); background-color: rgb(255, 255, 0);\"><a href=\"https://search.crossref.org/search/works?q=10.59256%2Fijire.20240502040&amp;from_ui=yes\" target=\"_blank\">Click Here </a></span>(Please check after 48 hrs.)<br></p>','paid-2',1,505,1,'2024-04-28 11:42:13','2024-04-30 05:17:58'),(540,1,506,NULL,'Soft Starter For DC Motor with  Speed Control by PWM Method','<p>Soft Starter For DC Motor with  Speed Control by PWM Method</p>','no_image.jpg','paper_soft_starter_1714318626.docx',NULL,NULL,NULL,1,2,1,4,'INDJEEE',1,1,2,2,NULL,NULL,NULL,0,506,NULL,'2024-04-28 15:37:06','2024-04-28 15:45:19'),(541,1,507,NULL,'Transformer Monitoring And Control System','<p>ABSTRACT: When it comes to power systems, transformers are the most important construction piece. When a transformer sustains damage, it has a negative impact on the overall balance of a power system. Damages are mostly happening as a result of overloading and cooling that is not functioning well. One of the primary goals of the Internet of Things(IoT) technology implementation is to perform real-time monitoring of the health conditions of the distribution transformer. A transformer\'s properties, which include temperature, voltage, current, and oil level, are monitored, processed, and recorded on servers. These parameters include oil level. In order to do this, we make use of sensors that are attached to a Espwroom 32 microcontroller. With the use of Internet of Things technology, the data that has been collected may be sent via a Wi-Fi module and accessible from any location in the globe. Without human supervision, this assists in determining the extent of human reliance and finding a solution to a problem before it becomes a failure.</p>','no_image.jpg','Transformer_Monitoring_And_Control_System_Research_Paper_1714322269.docx',NULL,NULL,NULL,1,2,1,4,'INDJEEE',1,1,1,2,NULL,NULL,NULL,0,507,NULL,'2024-04-28 16:37:49','2024-04-28 16:42:08'),(542,1,508,NULL,'Thermal and Structural Analysis  on Simulated Model of a Beam Dump','<p>This paper deals with the design, thermal and structural analysis for stopping the proton beam. A conical beam dump is being designed to handle the thermal and structural stresses resulting due to high heat load and hydraulic pressure of coolant, while handling 600 KW proton beam power in CW operation at 20 MeV energy. Pressure drop and heat transfer calculations are done considering spiral channel cooling system. The heat flux has been calculated by using Bi-Gaussian distribution density function of particles in beam. Nickel is selected as the beam dump material because of its favorable properties. In order to understand the thermal performance of beam dump a finite element model has been developed to predict the steady state temperature and stress distributions within the beam stop material.</p>','no_image.jpg','Thermal_and_Structural_Analysis_of_beam_dump_1714368644.doc',NULL,NULL,NULL,1,2,1,2,'IJSREAT',1,1,2,5,NULL,NULL,'paid-2',0,508,NULL,'2024-04-29 05:30:44','2024-04-30 05:33:16'),(543,1,510,NULL,'Phishing Website Classification using Hybrid SVM and KNN approach','<p>Phishing attacks continue to pose a significant threat to cybersecurity, exploiting human vulnerabilities to gain unauthorized access to sensitive information. Traditional methods of detecting phishing attempts often struggle to keep pace with the evolving tactics employed by malicious actors. This paper explores the potential of machine learning (ML) techniques in bolstering phishing attack detection. By leveraging ML algorithms, such as supervised learning, unsupervised learning, and deep learning, organizations can enhance their defenses against phishing attacks. This paper reviews existing research on ML-based phishing detection systems, highlighting their strengths, limitations, and future prospects.<br></p>','no_image.jpg','Nishat_Phishing_attack_1714384562.pdf',NULL,NULL,NULL,1,2,1,1,'IJIRE',1,1,1,4,NULL,NULL,NULL,0,510,NULL,'2024-04-29 09:56:02','2024-04-29 15:25:30'),(544,15,490,NULL,'COMPUTATIONAL VIDEO ANALYSIS ON THE PERFORMANCE OF INDIAN FOOTBALL TEAM IN WORLD CUP QUALIFIERS 2026','<p>Abstract: The rise of Indian football has been gradual yet consistent. The journey for the Blue Tigers in World Cup Qualifying matches has been challenging thus far. The Indian Men\'s Football Team experienced their first taste of World Cup Qualifying matches in 1985 for the 1986 FIFA World Cup. Their debut match in the qualifying round resulted in a 2-1 loss against Indonesia. They skipped the 1990 World Cup Qualifiers but returned for the 1994 edition. So far, India has played 48 World Cup qualifiers and won 10 games. Their most successful campaign was the 2002 World Cup Qualifiers, where the Blue Tigers earned 11 points in six games, as per an Indian Super League (ISL) press release. India has been doing well so far in the 2026 world cup qualifiers. While football remains as the most popular sport in the world, there is a lack of understanding of the many components, or parameters, in a match that can lead to an overall successful season. Knowing how to adjust a team’s tactics based on several key parameters may provide coaches with the tools necessary to create a successful outcome. This project aims to study the performance of Team India in World Cup Qualifiers 2026 through dartfish video analysis which provides information through statistical data resulting in a better outcome.</p>','no_image.jpg','Journal_1714389972.docx',NULL,NULL,NULL,1,2,1,1,'IJIRE',1,1,1,4,NULL,NULL,NULL,0,490,NULL,'2024-04-29 11:26:12','2024-04-29 14:48:18'),(545,1,455,NULL,'Biometric And Voice Command Motorcycle Security System With Alcohol Detection','<p><i>Enhancing the security measures in motorcycles is imperative given the prevalence of theft incidents facilitated by the current weak mechanical locks. Consequently, there\'s a pressing need for an advanced security system to support the protection of motorcycles. This endeavour outlines the development of such a system, integrating fingerprint recognition and voice command capabilities for access. The outcomes of this initiative demonstrate a marked enhancement in security compared to conventional mechanical key systems. With the alarming rise in road accidents, prioritizing rider safety is paramount. This project aims to mitigate accident risks by addressing common causes such as alcohol impairment and drowsiness. Upon detecting these factors, the system alerts the rider via an alarm and, if stationary, automatically disables the ignition and locks the bike as a precautionary measure.</i></p>','no_image.jpg','Biometric_And_Voice_Command_Motorcycle_Security_System_With_Alcohol_Detection_1714391141.docx',NULL,NULL,NULL,1,2,1,2,'IJSREAT',1,1,3,5,NULL,NULL,NULL,0,455,NULL,'2024-04-29 11:45:41','2024-04-30 04:44:58'),(546,1,443,NULL,'Pest Detection and Classification in Peanut Crops Using CNN and EViTA Algorithms','<p>The field of image classification and identification tasks has seen tremendous progress driven by the quick development of Convolutional Neural Network (CNN) methods. Unlike the widely used Vision Transformer (ViT) methods, this study presents an improved CNN-based model for pest recognition, segmentation, and classification. According to recent research, ViT is better at classifying images than standard machine learning and CNN methods. Taking this into consideration, we investigate how CNN models can incorporate two branch segment representations by using a double-layer CNN encoder. This new CNN-based method handles token chunks with different sizes and levels of computational complexity with ease. These elements are then combined with various attention processes to improve the overall aspects of the image. We use publicly accessible pest databases that impact peanut &amp; other crops in our experiments. When compared to cutting-edge algorithms, the suggested CNN model shows unique characteristics and performs better in pest picture prediction, obtaining a high accuracy rate of 99.25%.</p>','no_image.jpg','Pest_Detection_and_Classification_1714404529.docx',NULL,NULL,NULL,1,2,1,1,'IJIRE',2,1,1,4,NULL,NULL,NULL,0,443,NULL,'2024-04-29 15:28:49','2024-04-29 16:17:39'),(547,1,513,NULL,'Techno-Economical Suitability of Hybrid Renewable Energy System for an Industry.','<p>This research paper presents an analysis of the system architecture, economic viability, and pollutant emissions of a grid-integrated system designed for the Bhilai Steel Plant (BSP), situated in Bhilai, District Durg, Chhattisgarh (C.G.) state. In the current context, there is a persistent government push towards promoting the utilization of alternative and renewable energy sources to conserve coal in manufacturing industries. The Indian Renewable Energy Development Agency Limited (IREDA) has established a robust policy framework aimed at providing incentives for the advancement of power generation from diverse renewable energy sources, with solar energy emerging as a particularly promising option due to its widespread availability and advantageous topological characteristics for local power generation in industrial settings. In the context of heavy industry in Chhattisgarh (C.G.), the proposed approach represents a novel initiative. This state boasts abundant solar radiation, owing to its location along the Tropic of Cancer, which renders it conducive for the deployment of solar-dependent technologies. This research paper focuses on assessing the economic feasibility of heavy industry, with a particular emphasis on analyzing metrics such as Net Present Cost (NPC) and Levelized Cost of Energy (LCOE). Additionally, it addresses the implementation of a technical system aimed at minimizing pollutant emissions while evaluating the feasibility of integrating a grid system to fulfill the load requirements of the Bhilai Steel Plant (BSP).</p>','no_image.jpg','Techno_Economical_Suitability_of_Hybrid_Renewable_Energy_System_for_an_Industry_1714408607.docx',NULL,NULL,NULL,1,2,1,4,'INDJEEE',1,1,3,4,NULL,NULL,NULL,0,513,NULL,'2024-04-29 16:36:47','2024-04-29 16:44:45'),(548,1,499,NULL,'REVOLUTIONIZING  BLIND  NAVIGATION THROUGH  AI VOICES','<p>Navigating the complexities of aiding visually impaired individuals in object detection and environmental navigation is undeniably challenging. Leveraging the latest advancements in artificial intelligence, our project aims to create a robust system capable of recognizing objects and delivering essential audio feedback to the user. The core of our implementation focuses on providing audio instructions, furnishing vital information about objects directly ahead, and intuitively guiding blind individuals in their chosen direction.</p>','no_image.jpg','Blind_Navigation_Journal_Paper_1714410645.doc',NULL,NULL,NULL,1,2,1,1,'IJIRE',1,1,1,4,NULL,NULL,NULL,0,499,NULL,'2024-04-29 17:10:45','2024-04-29 18:49:34'),(549,1,498,NULL,'SMART TRADING WITH NLP: A JOURNEY THROUGH SCOPUS RESEARCH ON STOCK MARKET ANALYSIS','<p>This research paper provides a comprehensive review of the use of Natural Language Processing (NLP) in stock market analysis, based on a systematic exploration of Scopus-indexed literature. The primary focus is on how NLP technologies have been applied to extract and analyze textual data from financial news, reports, and social media to forecast market trends and guide trading decisions. Through a meta-analysis of documented case studies and empirical research, this paper evaluates the effectiveness of various NLP techniques, including sentiment analysis, topic modelling, and event detection, in enhancing market prediction models compared to traditional quantitative approaches. Results indicate that while NLP presents a significant advantage in interpreting unstructured data, its integration into trading algorithms also poses challenges such as data inconsistency, model overfitting, and the need for adaptive learning mechanisms. The paper concludes by identifying future research directions that focus on improving the accuracy, robustness, and real-time capabilities of NLP applications in financial trading, underscoring the potential of NLP to transform financial market analytics.&nbsp;</p>','no_image.jpg','StockMarket_Trading_Analysis_NLP_1714413986.docx',NULL,NULL,NULL,1,2,1,1,'IJIRE',2,1,2,4,NULL,NULL,NULL,0,498,NULL,'2024-04-29 18:06:26','2024-04-29 18:51:07'),(550,1,499,NULL,'Revolutionizing Blind Navigation  Through AI Voices','<p>The project titled \"Revolutionizing Blind Navigation through AI Voices\" presents a novel approach to aid visually impaired individuals in navigating their surroundings independently and safely. By harnessing the power of artificial intelligence (AI) and voice technology, our system provides real-time guidance and assistance to users. Through the integration of advanced object detection algorithms, such as YOLO (You Only Look Once), our solution enables accurate detection and recognition of various objects in the environment. The detected objects are then translated into audio instructions, delivered through AI-generated voices, to help users understand their surroundings and navigate effectively. Moreover, the system is seamlessly integrated with a web interface using Flask, allowing for remote control and interaction. Our project contributes to the advancement of assistive technologies for the visually impaired, offering a user-friendly and reliable solution for enhanced mobility and independence.</p>','no_image.jpg','Journal_1714438347.doc',NULL,NULL,NULL,1,2,1,1,'IJIRE',1,1,1,4,NULL,NULL,NULL,0,499,NULL,'2024-04-30 00:52:27','2024-04-30 03:44:45');
